INSERT INTO `card` (`id`, `description`, `type`, `user`, `name`, `creation_time`, `modification_time`, `public`, `period`, `kpi`, `order`, `quarterly_toggle`, `column_kpis`, `line_kpis`, `active_company`) VALUES
	(2, 'Liquidity Measurement Ratios  for Dow companies -- except the financial services companies, since Current Ratio is not a useful indicator for these firms.\n\nLiquidity ratios attempt to measure a company\'s ability to pay off its short-term debt obligations. This is done by comparing a company\'s most liquid assets (or, those that can be easily converted to cash), its short-term liabilities. In this card, we focus on the Current Ratio and Quick Ratio.', 'rank', 2, 'Liquidity Measurement Ratios ', '2014-07-02 07:31:26', '2014-07-10 08:32:46', 1, '2013', '819581', 'asc', 0, '', '', ''),
	(3, 'These ratios, much like the operational performance ratios, give investors a good understanding of how well the company utilized its resources in generating profit and shareholder value.', 'rank', 2, 'Profitability Indicator Ratios -- Dow Jones Compan', '2014-07-02 07:34:31', '2014-07-10 08:43:57', 1, '2013', '907671', 'asc', 0, '', '', ''),
	(4, 'These ratios give investors a general idea of the company\'s overall debt load as well as its mix of equity and debt. Debt ratios can be used to determine the overall level of financial risk a company and its shareholders face. In general, the greater the amount of debt held by a company the greater the financial risk of bankruptcy.', 'rank', 2, 'Debt Ratios - Dow Jones Companies', '2014-07-02 07:37:47', '0000-00-00 00:00:00', 1, '2013', '413922', 'asc', 0, '', '', ''),
	(5, 'This group of the financial ratio looks at cash flow indicators, which focus on the cash being generated in terms of how much is being generated and the safety net that it provides to the company. These ratios can give investors another look at the financial health and performance of a company.', 'rank', 2, 'Cash Flow Indicator Ratios -- Dow Jones Companies', '2014-07-02 07:41:28', '2014-07-10 08:56:38', 1, '2013', '713585', 'asc', 0, '', '', ''),
	(6, 'This group of the ratios looks at a wide array of ratios that can be used by investors to estimate the attractiveness of a potential or existing investment and get an idea of its valuation. ', 'explore', 2, 'Investment Valuation Ratios -- Dow Jones Companies', '2014-07-02 07:46:00', '2014-07-14 02:10:06', 1, '2013', '221200', 'asc', 0, '', '', ''),
	(7, 'There\'s not a bad egg among the Dow Jones companies as of now, and all 30 members are profitable right now. But even among heroes, some are and will be stronger than others. These are the most profitable businesses on the Dow Jones today.', 'map', 2, 'Most Profitable Dow Jones Companies', '2014-07-02 07:56:12', '2014-07-10 05:48:51', 1, '2013', '907671', 'asc', 0, '', '', ''),
	(8, 'Dow flirts with 17,000 in the beginning of 2nd half of 2014, and finally reach a new "emotional" high of 17,068 on Thursday, July 3rd. The Dow\'s move came just 153 trading sessions since it first closed above 16000 on Nov. 21, 2013, making it the seventh-fastest 1000-point gain in the blue-chip barometer\'s history. \nHow does individual company stock perform in the last 12 months? Let\'s look at the winners.', 'combo', 2, 'Dow Stock Winners!', '2014-07-02 08:15:11', '2014-07-10 16:12:56', 1, '2013', '697697', 'desc', 0, '', '', ''),
	(9, 'Look at revenues and net income with specific revenue from federal contracts.', 'combo_new', 2, 'Federal Contract Revenues -- Selected Dow Companie', '2014-07-02 08:28:11', '2014-07-28 10:47:26', 1, '2012', '594500', 'asc', 1, '314019,', '293434,594500,', '1296'),
	(10, 'Google\'s top competitors', 'rank', 23, 'Google\'s top competitors', '2014-07-03 05:54:34', '2014-07-11 05:59:17', 1, '2013', '306956', 'desc', 0, '', '', ''),
	(11, NULL, 'combo', 23, 'Google\'s Top Competitors - Stock Price Performance', '2014-07-03 06:09:06', '2014-07-11 06:00:39', 1, '2013', NULL, 'desc', 0, '', '', ''),
	(12, NULL, 'column', 23, 'Google\'s Top Competitors - Earnings Per Share and ', '2014-07-03 06:15:00', '2014-07-08 17:22:55', 1, '2013', '306956', 'asc', 0, '', '', ''),
	(13, 'The Altman Z-score is a combination of five weighted business ratios that is used to estimate the likelihood of financial distress.', 'rank', 2, 'Predict Corporate Bankruptcy', '2014-07-04 03:47:13', '2014-07-04 04:23:38', 1, '2013', '283050', 'asc', 0, '', '', ''),
	(14, 'The Z Score is not intended to predict when a firm will actually file for legal bankruptcy. It is instead a measure of how closely a firm resembles other firms that have filed for bankruptcy.', 'line', 2, 'Altman Z Score ', '2014-07-04 03:53:57', '2014-07-21 10:59:08', 1, '2013', '283050', 'asc', 0, '', '', ''),
	(15, 'These ratios measures of liquidity (the ability to convert assets to cash and meet short-term obligations of less than one year) and leverage (the amount of debt in a firm\'s capital structure and the ability to meet long-term obligations of more than one year).', 'rank', 2, 'Balance Sheet Strength', '2014-07-04 04:29:54', '2014-07-05 10:37:43', 1, '2013', '710420', 'asc', 0, '', '', ''),
	(16, 'Look at several large companies and the various components made up their dangerously low Altman Z Scores.', 'line', 2, 'Altman Z Score -- Dangerously Low Scores', '2014-07-04 07:48:56', '0000-00-00 00:00:00', 1, '2013', '283050', 'asc', 0, '', '', ''),
	(17, 'Financial Strength vs. Profitability', 'rank', 2, 'Financial Strength vs. Profitability', '2014-07-04 10:29:46', '2014-07-04 10:37:57', 1, '2013', '283050', 'asc', 0, '', '', ''),
	(18, 'Looking at the insider trading (both sales and purchases) for the selected Dow 30 companies.', 'area', 2, 'Insider Trading -- Selective Dow Jones 30 Companie', '2014-07-04 10:58:07', '2014-07-05 10:02:37', 1, '2013', '483950', 'asc', 0, '', '', ''),
	(19, 'Stocks with high P/E ratios can be overpriced. Is a stock with a lower P/E always a better investment than a stock with a higher one?\n\nThe short answer? No. The long answer? It depends.', 'rank', 2, 'The Sexy Ratio: P/E', '2014-07-04 11:12:08', '0000-00-00 00:00:00', 1, '2013', '833144', 'asc', 0, '', '', ''),
	(20, 'A new analysis from the Washington Post reveals that most of the 30 companies listed in the Dow industrial average have seen their U.S. tax burdens as a share of corporate profits drop by half since the 1960s and 1970s.\nThe cumulative losses attributable to tax haven abuse by corporations and individuals are about $150 billion each year, according to tax experts. ', 'rank', 2, 'Corporate Tax - Dow Jones 30 Companies', '2014-07-05 07:52:24', '2014-08-12 11:04:01', 1, '2013', '771537', 'asc', 0, '', '', '1291'),
	(21, 'Looking at various KPI\'s to evaluate the earnings.', 'rank', 2, 'Earnings Valuation -- Most Active NASDAQ Companies', '2014-07-05 11:20:18', '2014-07-05 11:25:42', 1, '2013', '600972', 'asc', 0, '', '', ''),
	(22, 'Apple’s remarkable growth streak — now more than a decade old — is starting to fade a little.', 'column', 2, 'Is Apple Still Growing?', '2014-07-05 16:16:23', '2014-07-08 11:06:05', 0, '2013', '697697', 'asc', 0, '', '', ''),
	(23, 'According to a recent survey of analysts by Fortune, now over 60% of analysts predict Apple’s stock price will rise above $100. This is a significant increase from a year ago, when only 4 out of 45 analysts predicted that Apple’s stock price would rise above $700, the $100-equivalent of Apple’s stock price since its 7-for-1 stock split in June 2014.', 'combo', 2, 'Apple Stock Chart', '2014-07-05 16:41:55', '2014-07-10 15:51:57', 0, '2013', NULL, 'desc', 0, '', '', ''),
