	(46, 'Google has the highest P/E ratio as compared to Apple and Microsoft. One explanation is that Google has the highest closing stock price. Although Apple has a higher closing stock price as compared to Microsoft, Microsoft has the most common shares outstanding as compared to Apple. When calculating P/E ratio, Microsoft will have a smaller denominator as compared to Apple. Microsoft will have a higher P/E ratio as compared to Apple. Ratios are sensitive to changes in one factor.', 'rank', 29, 'Google vs its competitors', '2014-07-19 08:59:52', '2014-07-23 07:54:43', 1, '2013', '164813', 'asc', 0, '', '', '1438'),
	(47, 'The Apple 7 for 1 stock split happened June 2014. One month prior to the split you could buy a share of Apple At $592 . A month after the split Apple stock sold for $96 or $675 in pre split terms.', 'combo', 31, 'stock split, Apple Inc', '2014-07-19 14:37:11', '2014-07-19 16:21:49', 0, '2014Q2', '365595', 'asc', 0, '', '', ''),
