	(52, 'Well, GE is paying taxes, but how much exactly?', 'combo_new', 2, 'GE - Zero Tax?', '2014-07-21 06:39:31', '2014-07-22 08:38:01', 0, '2010', '771537', 'asc', 1, '425740,', '771537,907671,', '1430'),
	(53, NULL, 'rank', 30, 'Consumers Pick', '2014-07-21 07:24:05', '0000-00-00 00:00:00', 1, '2013', NULL, 'desc', 0, '', '', ''),
	(55, 'As a general rule of thumb, when a company reports higher earnings, they report higher income taxes, and vice versa.  Here are two companies - DuPont and Merck, where this is not the case.  What do you think might be going on here?', 'combo_new', 23, 'Income before taxes and Taxes - DuPont and Merck', '2014-07-23 06:41:23', '2014-07-23 06:43:21', 1, '2013', '289115', 'asc', 0, '', '289115,416563,', '1357'),
	(56, 'As a general rule of thumb, we expect income tax expense and income before taxes to move in the same direction.  In other words, as companies report more income, they report more income tax expense.  These Dow 30 companies are fine examples of this. ', 'combo_new', 23, 'Income before taxes and income tax - Some Dow 30 c', '2014-07-23 06:51:57', '0000-00-00 00:00:00', 1, '2013', '289115', 'asc', 0, '', '289115,416563,', '1296'),
	(57, 'You would expect the operating profit before tax and income tax expense have a consistent correlation -- the higher the profit, the high the tax expense. For these companies, the correlation doesn\'t seem "logical". Why?\n ', 'combo_new', 2, 'Inconsistent Income Tax?', '2014-07-23 14:51:17', '2014-07-27 02:50:54', 0, '2013', '416563', 'asc', 1, '416563,', '289115,852218,', '1632'),
	(58, 'Free Cash Flow represents the cash from operations minus capital expenditures.  In essence, it represents the \'excess cash\' the firm has left over after it has made the requisite investments during the period.', 'combo_new', 23, 'Free Cash Flow Analysis', '2014-07-25 08:22:46', '0000-00-00 00:00:00', 0, '2013', '723668', 'asc', 0, '', '723668,906132,184943,553423,', '1246'),
