	(66, 'Return on assets (ROA), return on equity (ROE) and return on invested capital (ROIC) are the three most prevalent metrics used to obtain an idea of the returns a company generates, and to compare this return generation to the company’s peers. While important information can be learned from each one of these metrics, there are some significant differences between them. ', 'rank', 2, 'ROA ROE ROIC', '2014-07-29 13:25:40', '2014-07-29 13:26:51', 0, '2013', '286474', 'asc', 0, '', '', '1438'),
