	(71, 'According to WSJ (7/31/2014), since 2008, the Fed\'s easy cash policies have allowed companies to buy back stock, pay dividends and make acquisitions largely without tapping cash from overseas subsidiaries. By leaving foreign profit overseas, companies avoid the sting of the U.S.\'s 35% federal tax rate on it.', 'combo_new', 2, 'Record Debt and Record Cash', '2014-08-01 05:09:39', '2014-08-01 07:56:46', 0, '2013', '157490', 'asc', 0, '575282,825397,', '157490,565234,', '1460'),
	(72, 'It\'s true that American corporations are fabulously profitable today. \n\nDespite earning record profits, and having the ability to borrow cash easily, companies seemed to refuse to spend, is this true?\n\nAbout 60 percent of [non-financial corporate] cash piles are offshore and subject to as much as 35 percent tax if brought back to the U.S.', 'combo_new', 2, 'Cash Reserve', '2014-08-01 08:08:16', '2014-08-01 08:12:35', 0, '2013', '565234', 'asc', 0, '565234,906132,', '895600,553423,157490,', '55'),
	(73, 'Playground', 'rank', 76, 'Story Test', '2014-08-04 10:09:15', '0000-00-00 00:00:00', 0, '2014Q2', '819581', 'desc', 0, '', '', '1513'),
	(74, 'Semiconductor Companies -- Basic Income Statement', 'rank', 2, 'Semiconductor Companies -- Basic Income Statement', '2014-08-09 11:20:54', '0000-00-00 00:00:00', 0, '2013', '425740', 'asc', 0, '', '', '1275'),
	(75, 'Amazon has long been seen as something of an anomaly in the business world. The company is all over the map when Wall Street attempts to guestimate its quarterly earnings, and when Amazon does manage to make money on razor thin margins, it reinvests all of it back into the business—a business that is nearly 20 years old and still laboring to stake its claim in the e-commerce land grab.\nHow does Amazon make money? Good question.', 'combo_new', 2, 'is Amazon Making Money?', '2014-08-10 04:32:37', '2014-08-10 12:05:21', 0, '2013', '314019', 'asc', 1, '314019,102956,837669,771081,', '559768,', '1281'),
