	(77, 'Missing from his list of winners are shareholders, who have been funding perhaps the longest-running equity bubble ever for a technology company. Enough said?', 'rank', 2, 'Is Amazon Overpriced?', '2014-08-10 05:28:24', '2014-08-11 11:18:14', 0, '2013', '833144', 'desc', 0, '', '', '1281'),
