	(97, 'My analysis of this card led to an instant investigation into what happened to Verizon in 2013, that led to such a major increase in the Quick Ratio. After looking up the SEC.Gov data, I noticed a huge jump of Cash and Cash equivalents from the previous year of over $50 M. After tracing that back to the Statement of Cash Flows, I was able to determine that this was not the result of a major change in net income or sales. I would be interested in investigating further, if there were certain chang', 'line', 108, 'Liquidity of Verizon vs. AT&T', '2014-09-13 09:03:01', '0000-00-00 00:00:00', 0, '2013', '184943', 'asc', 0, '', '', '1643'),
	(98, 'We all know that the net income of communication firms such as AT&T Inc. and Verizon Inc. is mainly affected by their operating income (loss). However, we can see that the curve of AT&T Inc. net income reached a summit in 2010 Q3, and its operating income (loss) was remained at same level compared to other three quarters of that year. I believe it is because that AT&T Inc. was the first communication carrier which maked an agreement with Apple Inc. to obtain the exclusive right to sell contract ', 'line', 152, 'Compare AT&T Inc. with Verizon Inc. 2010 Q3', '2014-09-13 14:43:09', '2014-09-13 15:22:43', 0, NULL, '425740', 'asc', 0, '', '', '1632'),
	(99, NULL, 'line', 130, 'The Cash Flow of Google and Microsoft', '2014-09-14 01:04:24', '2014-09-15 16:58:13', 0, '2013', '184943', 'asc', 0, '', '', '1438'),
	(100, ' Verizon\'s Cash From Financing Activities increased significantly in 2013.  What does this suggest about the liquidity ratios for Verizon in 2013?', 'combo_new', 23, 'Cash Flow Analyses of Verizon and AT&T', '2014-09-14 03:00:36', '0000-00-00 00:00:00', 0, '2013', '184943', 'asc', 0, '', '184943,906132,164813,362124,', '1643'),
	(101, 'First of all, Let\'s define what treasury stock is. Treasury stock is a cash paid for the repurchase of a firm\'s own stock. Stock repurchases are an efficient way to put cash into shareholder\'s hand, rather then paying dividends. As probably most of you notice company must have a cash on their hands in order to repurchase stock. In comparison with an Amazon, an Ebay concludes that for their company investing cash into treasury stock as an productive way of investing companies money. The benefitFi', 'line', 153, 'Treasury Stock', '2014-09-14 07:48:26', '2014-09-21 13:04:59', 0, '2009', '318387', 'asc', 0, '', '', '1376'),
	(102, 'This card involves several income statement items of Wal Mart and Costco.\nMaybe some analysis can be continued after learning these items.', 'line', 162, 'Income statements of Wal mart and Costco', '2014-09-14 08:20:34', '2014-09-16 10:52:21', 0, '2013', '314019', 'asc', 0, '', '', '1652'),
	(103, 'Wal Mart Stores Inc has more net cash provided by operating but has less net cash by investing and financing than Costco.', 'line', 162, 'Cash flow items of Wal mart', '2014-09-14 08:48:14', '2014-09-16 10:44:50', 0, '2013', '723668', 'asc', 0, '', '', '1652'),
	(104, 'I just wanted to see the relationship between cost of goods sold, operating income and net income.  I don\'t think I made any relevant conclusions from this yet, because I think I need more items to see a direct correlation, I was more busy trying to play with this!', 'rank', 138, 'Income Statement Items', '2014-09-14 09:31:29', '2014-09-15 16:59:35', 1, '2013', '425740', 'asc', 0, '', '', '1460'),
	(105, NULL, 'line', 130, 'Sales expenses and cost of Microsoft Inc.', '2014-09-14 11:53:37', '2014-10-14 08:01:49', 0, '2009', '425740', 'asc', 0, '', '', '2178'),
	(106, 'In 2010Q4, P&G had a high positive operating net cash, and J&J had a relatively low negative investing net cash in 2011Q2. In that quarter, the FCF of J&J was about double to that of P&G.\n\nIn 2012Q2, J&J had a very low negative financing net cash.\n\nIn the annual sheet, P&G deeply decreased it\'s operating net cash in 2012.', 'line', 92, 'Cash Flow of Johnson & Johnson and Procter & Gambl', '2014-09-14 13:40:16', '2014-09-16 01:24:39', 0, '2013', '511523', 'asc', 0, '', '', '1471'),
	(107, 'In 2012Q4 and 2013Q4, P&G had very high Revenue compare to any other quarters. In 2013 annual sheet, P&G had about twenty times revenue than J&J. In general, the COGS of P&G is usually twice more than J&J.', 'line', 92, 'Income Statements of Johnson & Johnson and Procter', '2014-09-14 13:51:31', '2014-09-17 08:23:24', 0, '2013', '459844', 'asc', 0, '', '', '1471'),
	(108, 'After creating my card and looking at the numbers, I was very surprised at the findings. I expected Walt Disney to have a higher liquid position compared to Twenty-first Century Fox. However, this was not the case so I looked at the 10-K for both companies. I discovered that Disney had higher net income despite the fact that their liquidity calculations were lower than Twenty-first Century Fox. Investors and analysts need to beware when examining a company\'s liquidity ratios because they can be ', 'line', 93, 'Walt Disney Company vs. Twenty-first Century Fox', '2014-09-15 00:57:52', '2014-09-16 10:16:44', 1, '2009', '819581', 'asc', 0, '', '', '1364'),
	(109, NULL, 'rank', 152, 'Cash Flow Statement of AT&T Inc. and Verizon Inc.', '2014-09-15 03:40:43', '0000-00-00 00:00:00', 0, '2010', '713585', 'asc', 0, '', '', '1643'),
	(110, 'This card provides a comparison of the annual asset impairment charges (relative to total assets) for Pfizer and Merck.', 'combo_new', 23, 'Asset impairment charges', '2014-09-15 05:11:00', '2014-09-15 10:02:20', 1, '2013', '837356', 'asc', 1, '346210,', '837356,', '1517'),
	(111, 'compare free cash flow and account payable between two firms', 'column', 97, 'statement of cash flow items', '2014-09-15 06:27:41', '0000-00-00 00:00:00', 0, '2013', '403335', 'asc', 0, '', '', '1643'),
	(112, 'compare revenue, COGS and GP between two firms', 'line', 97, 'income statement items', '2014-09-15 06:33:34', '0000-00-00 00:00:00', 0, '2013', '837669', 'asc', 0, '', '', '1643'),
	(114, NULL, 'rank', 21, 'revenue and expenses sample and microsoft', '2014-09-15 15:08:52', '0000-00-00 00:00:00', 0, '2013', '965488', 'asc', 0, '', '', '55'),
	(115, 'Above is the chart illustrating some significant accounts of the Cash Flow Statement of Microsoft Corp from 2009 to 2013. The accounts discussed include Free Cash Flow, Net Cash provided by( Used in) Operating Activities, Net Cash provided by( Used in) Financial Activities, and Net Cash provided by( Used in) Investing Activities. \n', 'line', 137, 'Cash Flow Statement Accounts for Microsoft Corp', '2014-09-15 15:46:00', '2014-09-15 15:50:05', 1, '2009', '184943', 'asc', 0, '', '', '2178'),
	(116, 'In this card, I wanted to see how much of the cash from sales were being used in financial activities such as investments as well as being used to pay back loans and notes.  ', 'rank', 138, 'Cash Flow Items Assignment 1', '2014-09-15 17:03:39', '0000-00-00 00:00:00', 1, '2013', '314019', 'asc', 0, '', '', '1438'),
	(117, NULL, 'combo_new', 92, 'Cash Flow of J&J and P&G (side-by-side)', '2014-09-16 01:26:44', '0000-00-00 00:00:00', 0, '2013', '184943', 'asc', 0, '373198,511523,723668,', '184943,', '2268'),
	(118, 'As of 9/3/2014, a new regulation adopted for large U.S banks requires them to hold cash or cash-like assets worth 100% of their cash outflow for 30 days.  This rule ensures banks have enough easy-to-sell assets on hand to meet their cash needs in case of a downtown.  This new regulation was created to protect the financial system from crises such as during 2008.  It will be interesting to see in future periods how large US banks such as JP Morgan liquidity ratios will change.   \n\nSource: http://', 'line', 100, 'Liquidity in Major US Banks as Regulations Change', '2014-09-16 02:17:22', '0000-00-00 00:00:00', 1, '2014Q1', '819581', 'asc', 0, '', '', '1475'),
	(119, 'This card compares four items in Statement of Cash Flow', 'line', 86, 'Cash Flow items', '2014-09-16 02:30:00', '0000-00-00 00:00:00', 1, NULL, '184943', 'asc', 0, '', '', '1438'),
	(120, 'A comparison of liquidity ratios (quick, current), net cash flow and current liabilities of Viacom, Comcast, and DirecTV.', 'line', 115, 'Liquidity of Broadcasting and Cable Providers', '2014-09-16 02:49:18', '0000-00-00 00:00:00', 0, '2013', '538668', 'asc', 0, '', '', '60'),
	(121, 'This card listed net income and cost of goods sold of google and apple', 'line', 86, 'Income Statement item', '2014-09-16 03:24:28', '0000-00-00 00:00:00', 1, '2013', '425740', 'asc', 0, '', '', '55'),
	(122, 'Comparing two of the largest public biopharamaceutical companies from a time period of 2009-2013', 'line', 95, 'AMGN/GILD Income Statement Analysis', '2014-09-16 05:34:28', '2014-09-16 05:38:23', 1, '2013', '434731', 'asc', 0, '', '', '1278'),
	(123, 'Comparing the Cash from Operations and the Cash from Financing amounts for the two of the largest public biopharmaceutical companies headquartered in the United States', 'column', 95, 'AMGN/GILD Cash Flow Analysis', '2014-09-16 05:45:05', '0000-00-00 00:00:00', 1, '2013', '362124', 'asc', 0, '', '', '1278'),
	(124, NULL, 'rank', 143, 'Comparison of liquidity of ATT and Verizon', '2014-09-16 06:36:51', '0000-00-00 00:00:00', 1, '2013', '819581', 'asc', 0, '', '', '1632'),
	(125, 'In this card I put 7 high tech companies together to compare their cash status from operating, nonoperating aspects. It is interesting to find that Apple stands from the crowd since 2010.', 'line', 117, 'High Tech Corporations Cash Status', '2014-09-16 08:15:29', '2014-10-08 00:33:35', 1, '2014Q2', '373198', 'asc', 0, '', '', '55'),
	(126, 'Just a quick look at Apple (AAPL) and Microsoft (MSFT) from an accounting standpoint. This comparison shows how Microsoft, although it is not the face of technology as it used to be, hold better financial rations (and liquidity) than Apple. This analysis suggests an upside in Microsoft\'s stock, when compared from a "stability" stand point.\n\nMicrosoft has higher Current, Quick Ratio, and Cash Ratio. This means what Microsoft has higher liquidity from an accounting standpoint. ', 'rank', 170, 'Microsoft vs Apple Liquidity Analysis', '2014-09-16 08:37:44', '2014-09-23 05:53:13', 1, '2013', '819581', 'asc', 0, '', '', '2178'),
	(127, 'All three pharmaceutical companies have high liquidity ratios. Pfizer is the most liquid company among them. Even the least liquid company, Merck & Co has a cash ratio of 0.98, which means the company can almost fully cover its current liabilities by cash and cash equivalents. On the other hand, high liquidity means a lot of idle cash, which could be used to generate more profit or simply returned to stockholders as dividends.', 'line', 160, 'Liquidity ratios of US pharmaceutical companies', '2014-09-16 08:43:10', '2014-09-16 09:25:38', 1, '2013', '376610', 'asc', 0, '', '', '1471'),
	(128, 'This chart shows the difference between online retail companies (such as Amazon, ebay, etc.) and offline retail companies (such as Walmart). It is interesting to find that the 4th quarter would always be in high net sales.', 'combo_new', 117, 'ROA, ROE, Sales of retail companies', '2014-09-16 08:47:58', '2014-10-08 00:45:13', 1, '2013', '286474', 'asc', 0, '286474,576859,195783,309857,', '314019,907671,717549,', '1376'),
	(129, 'Net profit margin indicates the profitability of each company, current ratio represents the liquidity and long-term debt and equity reflects debt capitalization of three public companies', 'column', 119, 'Comparison of ratios of Apple,Google and Microsoft', '2014-09-16 09:11:09', '2014-09-16 09:16:38', 1, '2013', '210307', 'asc', 0, '', '', '55'),
	(130, 'A quick look at Microsoft\'s and Apple\'s Stock Holder\'s Equity.', 'line', 170, 'Microsoft vs Apple Stockholder Equity Analysis', '2014-09-16 09:55:55', '2014-09-23 14:46:48', 1, '2013', '576859', 'asc', 0, '', '', '2178'),
	(131, 'This chart demonstrated two dominant companies worldwide. In 2009 Microsoft was on top of its business. However, Apple surpassed its competitor in 2011 in net income. The overshadowing of Microsoft\'s financial is when Apple made a key moment in the industry, as Apple\'s iPad table computer and iPhone smartphone has both become important source of revenue. In 2013, Apple dropped the net income drastically, while Microsoft had an ability to improve their situation. ', 'line', 153, 'Net Income', '2014-09-16 09:58:39', '0000-00-00 00:00:00', 0, '2013', '119622', 'asc', 0, '', '', '55'),
	(132, 'Current ratio and quick ratio measure a company\'s ability to pay back its short-term liabilities with its short-term assets. Both the current ratio and quick ratio of Costco are higher than those of Walmart, so Costco is more capable of paying its obligations. In addition, a current ratio under 1 indicates that Walmart would not be able to pay off its obligations if they came due at that point. Although it does not necessarily mean that it will go bankrupt, it is not a good sign.', 'line', 131, 'Liquidity of Walmart vs. Costco', '2014-09-16 10:04:15', '0000-00-00 00:00:00', 0, '2013', '538668', 'asc', 0, '', '', '1652'),
	(133, NULL, 'line', 98, 'Free Cash Flow vs. Dividends Paid', '2014-09-16 10:22:10', '0000-00-00 00:00:00', 0, '2010', '895600', 'asc', 0, '', '', '1849'),
	(134, NULL, 'area', 103, 'Profitability and Liquidity of Dow 30 Tech Compani', '2014-09-16 10:28:53', '2014-09-16 10:36:58', 1, '2013', '907671', 'asc', 0, '', '', '1438'),
	(135, NULL, 'combo_new', 98, 'J&J and Merck R&D and Net Income', '2014-09-16 10:30:41', '0000-00-00 00:00:00', 0, '2013', '425740', 'asc', 0, '717549,', '425740,', '1517'),
	(137, 'why so much federal funds sold in 2013?\nwhy such an obvious fluctuation in Net Cash Provided By (Used In) Financing Activities each year?\nIncreasing liabilities every year \n', 'line', 96, 'Liquidity analysis - Goldman Sachs', '2014-09-16 11:25:30', '2014-09-16 11:53:57', 0, '2009', '511523', 'asc', 0, '', '', '1443'),
	(138, 'Performance of e-commerce companies', 'rank', 88, 'E-commerce profitability', '2014-09-16 11:45:46', '2014-09-16 11:51:45', 0, '2013', '907671', 'asc', 0, '', '', '1281'),
	(140, 'Here we are comparing the cash ratio and current ratio of Google and Apple. Both companies are set to release highly anticipated phones. It will be interesting to see how Apple fares with the introduction of a new phablet (phone/tablet). This is a first for Apple. I anticipate that Apple will have an increase in cash.', 'line', 114, 'Google vs. Apple', '2014-09-16 13:15:08', '0000-00-00 00:00:00', 0, '2013', '819581', 'asc', 0, '', '', '1438'),
	(141, '1. From 2009 to 2013, the number of operating cash flow to sales of ebay is always higher than that of amazon.\n2. In 2012 there is a shift of the number of ebay and it went up quickly, maybe there was a big investment to the company or the company changed its sale strategy. However the number of amazon keeps going down.', 'line', 125, 'Operating Cash Flow to Sales (Ebay and Amazon)', '2014-09-16 13:20:58', '0000-00-00 00:00:00', 0, '2013', '713585', 'asc', 0, '', '', '1376'),
	(142, 'Both Amazon and Ebay have enough current assets to cover its current liabilities. Taking a further look at the quick ratio as well as well the trend of these liquidity ratios, we may find that Amazon and Ebay, as growing companies, may face the threaten of reduction of working capital. Another possible explanation might be: both Amazon and Ebay pay its suppliers a couple of days after products delivered to their warehouse. So with the growing of its business, the current liabilities increased di', 'line', 151, 'Liquidity Ratios of Amazon and Ebay', '2014-09-16 13:26:01', '2014-09-17 08:38:22', 1, NULL, '819581', 'asc', 0, '', '', '1281'),
	(143, 'I wanted to show the relationship between revenues and net income and how operating expenses and cost of good sold impact net income. \nIt is interesting to highlight that revenues increased in 2011 but net income decreased. This could attribute to increase in operating expenses and cost of goods sold. I found an article on bloomberg that talks about falling demand for soft drinks and how Coca Cola is planning to cut $1B in costs.\nhttp://www.bloomberg.com/news/2014-02-18/coca-cola-profit-falls-8-', 'combo_new', 148, 'Coca Cola Income Statement', '2014-09-16 13:28:42', '2014-09-16 14:31:53', 0, '2013', '697697', 'asc', 0, '', '697697,771081,425740,559768,102956,', '1481'),
	(144, 'The liabilities to total assets ratio indicates the portion of assets that are financed by the creditors. The Amazon\'s debt ratio is higher than Ebay\'s. This indicates that a larger percent of assets are financed by creditors in Amazon. The debt to equity ratio indicates the degree of protection to creditors in terms of insolvency. The Amazon debt to equity ratio reached 0.5 in 2013, which is higher than Ebay\'s. Therefore, Ebay company provides creditors a better protection than Amazon in 2013.', 'line', 121, 'Debt ratio comparison between Amazon and Ebay', '2014-09-16 13:31:36', '2014-09-16 13:54:16', 0, '2010', '577043', 'asc', 0, '', '', '1376'),
	(145, NULL, 'line', 151, 'Operating Cash Flow in Amazon and Ebay', '2014-09-16 13:31:40', '0000-00-00 00:00:00', 1, '2013', '909904', 'asc', 0, '', '', '1281'),
	(146, 'According to their quarterly statistics, we can tell that Amazon and Ebay are both stable in their sales and growing gradually. However, the income of Amazon is not  that optimistic. Starting from 2012 Amazon were making less money, although the they were selling more.  As another online shopping platform, Ebay was doing fine although the numbers in first season of 2014 was despairing. It might be temporary due to some possible changes in its accounting strategies. But if not, Ebay might face th', 'column', 118, 'Net income and net sales of Amazon and Ebay', '2014-09-16 14:12:02', '2014-09-16 16:40:38', 0, '2013', '425740', 'asc', 0, '', '', '1281'),
	(147, NULL, 'combo_new', 88, 'Income Statement of Facebook', '2014-09-16 14:13:51', '2014-09-16 15:05:51', 1, '2013', '727260', 'asc', 0, '', '425740,314019,530115,852218,727260,', '7754'),
	(148, 'This card displays KPIs that make up Apple Inc\'s income statement.  From 2009 - 2013, Apple had consistent growth in revenue. Naturally, its cost and expenses increased as its revenue increased.  In 2011, you start to see revenue increase at a higher rate than cost and expenses, which explains the slight spike in net income that occurred between 2011 to 2012.  After 2012, net income declined slightly, which coincides with the slowed growth in revenue but steady increase in costs and expenses tha', 'combo_new', 107, 'Apple Inc. Income Statement', '2014-09-16 14:25:22', '2014-10-14 17:35:31', 1, '2013', '697697', 'asc', 0, '', '697697,727260,301721,456413,503513,425740,', '55'),
	(149, 'This chart shows JPMorgan’s liquidity measurement ratios are higher than Boeing indicating a better liquidity. A simple analysis: Boeing is an aerospace company and a manufacturer of commercial jetliners and military aircraft. The company has a large amount of equipment and raw material resulting that Boeing has more illiquid asserts than liquid asserts. JPMorgan is a financial services firm and banking institution, most of their assets are money, bonds and stocks which are liquid assets.', 'line', 146, 'Liquidity: Boeing VS JPMorgan Chase', '2014-09-16 14:29:49', '2014-09-16 14:44:49', 1, '2013', '819581', 'asc', 0, '', '', '1475'),
	(150, 'The ROE and ROA of starbucks is keeping going up while the investment items remain relatively stable. This situation may caused by increasing sales. From 2011 to 2012 the net profit margin went down a bit, and this may be the result of market fluctuation.', 'combo_new', 125, 'Starbucks Cash flow items', '2014-09-16 14:34:57', '0000-00-00 00:00:00', 0, '2013', '576859', 'asc', 0, '907671,000000,286474,576859,', '610839,164813,693283,', '1591'),
	(151, 'This graph shows all the KPIs that make up Yahoo Inc.’s Net Cash Flow: Cash from Operating Activities, Cash from Investing Activities, and Cash from Financing Activities. \n\nYahoo’s Net Cash from Operating Activities (which is cash coming in / flowing out of the company from core business activities) is positive across the 5-year period from 2009 – 2013.  It is steady around $2 - $3 billion in 2009, 2010 & 2011.  In 2012 it jumps dramatically to ~$10 billion, and in 2013 it returns to ~$3 billion', 'column', 107, 'Yahoo Inc. Statement of Cash Flows ', '2014-09-16 14:41:11', '2014-10-21 22:05:15', 1, '2013', '511523', 'asc', 0, '', '', '1661'),
	(152, 'apple, yahoo, tesla, fox', 'combo_new', 134, 'Income statement', '2014-09-16 14:49:57', '0000-00-00 00:00:00', 0, '2013', '697697', 'asc', 0, '697697,102956,', '425740,', '55'),
	(153, 'The free cash flow is increasing in 2013 which is probably a good indicator that Starbucks is in better financial standing compared with previous 4 years. \n\n2010 is a very interesting year with net income of 0 and net cash provided by operating, financing and investing activities is also 0, but free cash flow is above $1B, how is that possible? I searched starbucks in 2010 and according to marketwatch.com starbucks made 945M in net income? I something wrong here?', 'combo_new', 148, 'Starbucks Cash Flows', '2014-09-16 14:52:10', '0000-00-00 00:00:00', 1, '2013', '713585', 'asc', 0, '', '713585,184943,425740,741847,373198,511523,723668,', '1591'),
	(154, 'There are more public developer company, but I can\'t find them in the company list....', 'column', 149, 'Activision Blizzard Liquidity', '2014-09-16 14:53:27', '2014-09-16 14:55:41', 1, '2013', '819581', 'asc', 0, '', '', '791'),
	(155, NULL, 'line', 134, 'apple and adobe cash from investment', '2014-09-16 14:57:41', '0000-00-00 00:00:00', 0, '2013', '164813', 'asc', 0, '', '', '53'),
	(158, NULL, 'column', 118, 'Free cash flow of Microsoft and Apple', '2014-09-16 15:31:05', '2014-09-16 16:40:13', 0, '2013', '184943', 'asc', 0, '', '', '2178'),
	(159, NULL, 'combo', 88, 'Facebook Income statement - 2', '2014-09-16 15:44:41', '2014-09-16 15:45:46', 1, '2013', '314019', 'desc', 0, '', '', '7754'),
	(160, 'As to Revenues and Cost of Goods Sold, Adobe remains flat while Microsoft rise a lot. However as to Net Income, in 2012, Microsoft dropped sharply.', 'line', 137, 'Income Statement accounts: Microsoft& Adobe', '2014-09-16 16:00:00', '0000-00-00 00:00:00', 1, '2013', '425740', 'asc', 0, '', '', '2178'),
	(161, 'Through the diagram, we can see that Whole Foods have higher Current Ratio, Quick Ratio and Cash Ratio than Wal-Mart. Whole Foods almost doesn\'t have liabilities at all, additionally, it has lots of free cash. \n\nWal-Mart has much more Free Cash Flow than Whole Foods, but Whole Foods has a much bigger Free Cash Flow over Cash ratio than Wal-Mart. Wal-Mart has more Cash Dividends than Whole Foods\n\nWhole Foods\' Free Cash Flow over Cash ratio is about 1. It means that most of the cash within the Who', 'line', 173, 'Comparison of Liquidity between Wal-Mart and Whole', '2014-09-16 16:30:14', '2014-09-17 10:12:55', 1, '2013', '376610', 'asc', 0, '', '', '1652'),
	(163, NULL, 'line', 126, 'cash flow items of travel companies', '2014-09-16 17:55:17', '2014-09-30 14:28:34', 1, '2013', '184943', 'asc', 0, '', '', '1063'),
	(164, NULL, 'line', 126, 'income statement of travel companies ', '2014-09-16 17:58:08', '2014-09-30 14:27:47', 1, '2013', '425740', 'asc', 0, '', '', '1063'),
	(165, NULL, 'rank', 145, 'Income Statement', '2014-09-16 18:02:23', '0000-00-00 00:00:00', 1, '2013', '425740', 'asc', 0, '', '', '1376'),
	(166, NULL, 'line', 145, 'Cash Flows of Apple, IBM, and Microsoft', '2014-09-16 18:16:03', '0000-00-00 00:00:00', 1, '2013', '184943', 'asc', 0, '', '', '1460'),
	(167, 'The charts show that Bed Bath& Beyond Inc. has higher current ratio than other companies and Whole Foods\' liquidity ratios are on the rise, which means that companies would have a better short-term financial standing to meet their debt obligations. However, Wal Mart\'s lower liquidity ratios do not necessarily prove that it has liquidity problem because it has a wide range of sales channels and strong profitability to generate sufficient cash flow to pay its current liability.  ', 'column', 144, 'Liquidity of major companies in US retail industry', '2014-09-16 18:18:19', '2014-09-17 05:36:46', 0, '2013', '819581', 'asc', 0, '', '', '1849'),
	(168, 'In 2013, there was a sudden drop of net income of Apple. Through analysis, I found that the slow down of the increase of net sales is one of the main reason, while the increase of cost of goods sold and expenses didn\'t accelerate.', 'combo_new', 102, 'Analysis of Net Income of Apple ', '2014-09-17 03:38:45', '2014-09-17 04:10:13', 0, '2013', '425740', 'asc', 0, '425740,314019,', '102956,503513,', '55'),
	(169, 'In 2013, there was a sudden drop of net income of Apple. Through analysis, I found that the reasons are the decrease of net sales which affects the net cash provided by operating activities and the increase of net cash used in financing activities.', 'combo_new', 102, 'Analysis of Cash Flow of Apple ', '2014-09-17 03:53:49', '2014-09-23 07:58:06', 0, '2013', '373198', 'asc', 0, '184943,373198,511523,', '723668,425740,', '55'),
	(171, 'Comparison of liquidity of Whole Foods, Costco, and Wal Mart', 'line', 120, 'Cash Ratio and Cash Conversion Cycle of Three Top ', '2014-09-17 04:11:03', '2014-09-17 04:11:29', 1, '2013', '376610', 'asc', 0, '', '', '2516'),
	(172, NULL, 'combo_new', 159, 'Exxon Mobil\'s Net PPE versus Return on Assest', '2014-09-17 04:20:42', '0000-00-00 00:00:00', 1, '2013', '286474', 'asc', 0, '286474,', '352402,', '155'),
	(173, NULL, 'rank', 116, 'wholefoods', '2014-09-17 04:35:05', '0000-00-00 00:00:00', 0, '2013', '413922', 'asc', 0, '', '', '1864'),
	(175, NULL, 'line', 127, 'Liquidity of Computer Storage Device', '2014-09-17 04:42:00', '2014-09-17 05:57:37', 1, '2013', '376610', 'asc', 0, '', '', '2214'),
	(176, 'We can see from this cards that the cost and expenses and gross profit in Q3 is higher than the other three quarters. Because the gross profit equals revenues subtracts cost of good sold, I think probably that McDonalds can sells more ice drinks during summer, from July to September. So the kind of ice drinks and ice cream really bring big profit to McDonalds. What\'s more, the net income shows the same quarter changes from 2010 to 2014, however, in the 2009 Q3, the net income just same as other ', 'combo_new', 167, 'The quarterly NT CE&GF of McDonalds ', '2014-09-17 04:45:40', '0000-00-00 00:00:00', 1, '2013', '727260', 'asc', 0, '', '727260,837669,425740,', '1501'),
	(177, 'Three ratios indicate different profitability of three telephone communication companies.', 'line', 139, 'Profitability of Telephone Communications Companie', '2014-09-17 05:07:40', '2014-09-17 05:08:41', 1, '2013Q2', '610839', 'asc', 1, '', '', '1643'),
	(178, 'From the chart, we can see that Net income is highly related to the Administrative   and general expense in financial institution, especially in investment bank.  What is more, the administrative expense is very high in these companies.', 'combo_new', 147, 'Net income and administrative expense in financial', '2014-09-17 05:17:07', '0000-00-00 00:00:00', 0, '2009', '425740', 'desc', 0, '', '425740,334578,', '1443'),
	(179, 'Liquidity ratios are used by investors to analyze a firms ability to meet short-term debt obligations. If a firm has trouble meeting these obligations, their bankruptcy risk increases. In 2013, Comcast posed much more of a liquidity threat than did Dish Network. They had a negative working capital, and a significantly lower quick, current, and cash ratios. Dish on the other hand, seems much more highly liquid, even though they had a higher Cash Conversion Cycle. ', 'rank', 140, '2013 Liquidty of Top Television Providers', '2014-09-17 05:54:28', '2014-09-17 06:16:58', 1, '2013', '819581', 'asc', 0, '', '', '1339'),
	(180, 'On this card, I compare the 2013 current ratio, cash ratio, and free cash flow of Wal Mart Stores Inc and Amazon.com Inc. Although Wal Mart is able to generate a lot more cash through it\'s sales, with is apparent when comparing the free cash flow of both companies, Amazon has more positive current ratios and cash ratios. Considering the huge difference in free cash flow between the two companies, I would assume the more positive cash and current ratios is due to Amazon having much less liabiliti', 'rank', 110, 'Retail Giants and their Liquidity', '2014-09-17 06:04:29', '2014-09-17 08:54:48', 1, '2013', '819581', 'desc', 0, '', '', '1652'),
	(181, 'As we can see from the ratios, Ebay\'s liquidity is better than Amazon\'s, which means Ebay has more abilities to pay off its short-term liabilities. I think it is because Amazon is a website that sell products from its own warehouse, but Ebay is a platform website that has zero-inventory leading to lower Accounts Receivable. But I have a question:which commerce pattern is better? There are  two similar websites in China called Taobao(similar to Ebay)&JD(similar to Amazon), and Taobao is much more', 'line', 89, 'Liquidity measurement ratios of Amazon and Ebay', '2014-09-17 06:22:39', '2014-09-28 15:18:16', 1, '2013', '409500', 'asc', 0, '', '', '1281'),
	(182, 'How will the liquidity of these companies change over the next year? As these 3 companies transform into giant web conglomerates, how will the recent surge in startup purchases effect liquidity in the next year? \n\nFacebook acquired the social media companies WhatsApp for $16 billion and Instagram for $1 billion. Google acquired the thermostat and smoke alarm developer Nest for $3.24 billion and Waze, a social mapping start-up, for $1 billion. Apple bought the music brand Beats Electronics for $3', 'line', 174, 'Liquidity of Web Conglomerates: Google, Facebook, ', '2014-09-17 07:41:23', '2014-10-01 11:29:20', 1, '2013', '538668', 'asc', 0, '', '', '1661'),
	(183, 'This card compares Google with General Electric. The companies are vastly different in their functional areas, their customers and their financials. \n\nIn sticking with the liquidity theme, I think that GE is a capital intensive business and is operates at the mercy of the global economy (at least more so that Google). \n\nOn the other hand, Google is providing, for the most part, internet services, so we can assume that their cash outlays are vary different than that of GE, and their customers are', 'combo_new', 172, 'Google vs. General Electric', '2014-09-17 08:29:42', '0000-00-00 00:00:00', 1, '2013', '819581', 'asc', 0, '819581,538668,376610,', '940439,380020,', '1438'),
	(184, 'We can obviously see that the liquidity of financial services companies like Visa Inc. is much better than companies in amusement/recreation services, engineering/management services and hotel/lounge services. \n\nMaybe it is because that the financial services companies are dealing with monetary much more than with equipment.', 'rank', 133, 'Comparision about liquidity of four companies in S', '2014-09-17 08:43:30', '0000-00-00 00:00:00', 1, '2013', '819581', 'asc', 0, '', '', '1364'),
	(185, 'The comparison shows that how quickly company could convert an asset to cash. According to the formula, quick ration are similar to current ratio, but more accurate. The cash ratio is generally a more conservative look at a company\'s ability to cover its liabilities than many other liquidity ratios. From the data, Google has the highest liquidity, then Microsoft and the liquidity of Apple is the lowest, which means Google is safer than Apple and Microsoft to investors. Also, the liquidity of App', 'line', 150, 'liquidity of Giant Internet Company', '2014-09-17 09:14:23', '2014-09-17 09:14:47', 1, '2013', '376610', 'asc', 0, '', '', '55'),
	(186, NULL, 'combo_new', 168, 'Starbucks and McDonalds', '2014-09-17 09:57:45', '0000-00-00 00:00:00', 0, '2013', '538668', 'asc', 0, '819581,538668,376610,', '940439,380020,', '1501'),
	(187, 'Current ratio, Quick Ratio, and Cash conversion cycle Alt comparison of two credit card companies. ', 'line', 175, 'liquidity comparison of VISA Inc. and American Exp', '2014-09-17 10:13:56', '0000-00-00 00:00:00', 1, '2013', '380020', 'asc', 0, '', '', '1291'),
	(188, 'Contrasting Tesla motors sharp increase in current ratio in 2009-2010 and then steady decline to Apples constant ratio. \n\nBoth firms are innovators in respective fields focusing on new tech.', 'line', 111, 'Tesla Motors vs. Apple', '2014-09-17 11:57:47', '2014-10-01 09:40:36', 1, '2013', '538668', 'asc', 0, '', '', '688'),
	(189, 'In generally, we use liquidity to embody certain company\'s operating ability. Here, I use cash flow and current ratio, cash and cash equivalents to represent it. Compared with the dividend payout, there is some blind links between them.', 'line', 163, 'The Liquidity of Google vs. Cisco', '2014-09-17 15:01:16', '0000-00-00 00:00:00', 0, '2013', '184943', 'asc', 0, '', '', '1864'),
	(190, 'J&J: in the quarter sheet, the trends of quick ratio and current ratio are pretty much same. Its assets are more than its liabilities. P&G: the trends of quick ratio and current ratio are also same, but its assets is less than its liabilities. P&G has a working capital deficit.', 'combo_new', 92, 'Liquidity for P&G and J&J', '2014-09-17 15:16:01', '2014-09-18 01:14:42', 0, '2013', '819581', 'asc', 0, '', '538668,819581,', '2268'),
	(191, 'P&G: In 2011Q4, the income from continuous operation is much lower than the income before extraordinary items available for common. I think there might be a profit gained from an irregular item in this season.\n\nJ&J had the same pattern in the fourth quarter from 2010 to 2013.', 'combo_new', 92, 'Non-recurring Items for P&G and J&J', '2014-09-17 15:20:53', '2014-09-24 01:37:13', 0, '2010', '128802', 'asc', 0, '128802,456633,459844,', '', '2268'),
	(192, NULL, 'line', 166, 'Apple vs. Google Cash flow indicator ratio', '2014-09-18 06:02:23', '0000-00-00 00:00:00', 0, '2013', '713585', 'asc', 0, '', '', '55'),
	(193, NULL, 'line', 152, 'Liquidity AT&T Inc. and Verizon Inc.', '2014-09-18 10:38:51', '0000-00-00 00:00:00', 0, '2013', '819581', 'asc', 0, '', '', '1643'),
