	(195, NULL, 'line', 166, 'Apple vs. Google Liquidity measurement', '2014-09-21 03:54:19', '0000-00-00 00:00:00', 0, '2013', '819581', 'asc', 0, '', '', '55'),
	(196, NULL, 'line', 166, 'Amazon vs. Ebay Stockholders\' Equity', '2014-09-21 03:56:09', '2014-09-21 03:57:21', 0, '2013', '140498', 'asc', 0, '', '', '1281'),
	(197, 'From the graph,I can see that the current ratio of Ebay suffered a 33.47% decline in the first quarter to the second quarter in 2011.In the same period,it suffered a 46.37% decline in quick ratio.Perhaps some assets included in current assets but not included in the numerator of quick ratio such as inventory decreased a lot.Also ,Ebay suffered a large increase in both the current ratio and quick ratio in the first to the second quarter of 2012.\n\nGenerally, the current ratio and the quick ratio o', 'line', 162, 'Liquidity of Ebay & Amazon', '2014-09-21 10:12:40', '0000-00-00 00:00:00', 0, '2013', '819581', 'asc', 0, '', '', '1376'),
	(198, NULL, 'rank', 153, 'EPS', '2014-09-21 13:03:12', '2014-09-21 13:57:57', 0, '2013', '306956', 'asc', 0, '', '', '1281'),
	(199, 'From the graph, the income from continuing operating of Costco had a 17.1% increase from 2010 to 2011,but the income before extraordinary items had decreased 54.48% in that period.That means discontinued operations in this period increased in that period and caused a loss in income.', 'line', 162, 'non-recurring items of Wal-mart & Costo', '2014-09-21 13:32:31', '2014-09-23 12:16:16', 0, '2011', '128802', 'asc', 0, '', '', '1652'),
	(200, NULL, 'line', 130, 'current ratio of Mirosoft and Google', '2014-09-23 01:27:08', '2014-10-13 16:04:36', 0, '2012', '819581', 'asc', 0, '', '', '2178'),
	(201, 'While PG and JNJ have similar levels of total debt at the end of 2013, JNJ\'s short-term debt only consists of 16.5% of its overall total debt. PG\'s short-term debt consists of 39.4% of its overall total debt.  It\'s likely that PG\'s higher short-term debt as a percentage of total debt and overall total number is higher because the company had a high number of short-term bank loans.  Maybe PG needed the liquidity to expand a product line or invest in property to expand its operations.', 'combo_new', 95, 'PG vs. JNJ Debt Analysis', '2014-09-23 02:18:35', '0000-00-00 00:00:00', 1, '2013', '825397', 'asc', 0, '907959,575282,', '825397,', '2268'),
	(202, 'Both PG and JNJ did not have any cash from discontinued operations in the time period 2009-2013. JNJ’s cash and cash equivalent levels during the time period remained significantly steadier than PG’s.  Its possible PG used cash during the time period for an acquisition.  This would explain PG’s more fluctuating cash and cash equivalent totals.', 'combo_new', 95, 'PG and JNJ non-recurring items check', '2014-09-23 02:43:59', '0000-00-00 00:00:00', 1, '2013', '145997', 'asc', 0, '', '663254,693283,888130,450106,486100,145997,', '2268'),
	(203, NULL, 'line', 130, 'Account receivable of Microsoft and Google', '2014-09-23 06:08:32', '2014-10-13 16:03:48', 0, '2013', '409500', 'asc', 0, '', '', '2178'),
	(204, NULL, 'line', 118, 'Liquidity related items of Walmart and Amazon', '2014-09-23 06:11:17', '2014-09-23 15:14:54', 0, '2013', '294130', 'asc', 0, '', '', '1652'),
	(205, 'The card shows that the allowance of bad debt of Microsoft is quite stable while that of Google increased sharply during 2012 and stayed in a high level. The change of the account, allowance of bad debt, in Google should have close connection with the increasing number of its account receivable. I assume that it’s because the growing account receivable made Google exposure larger risk of bad debt that Google changed its accounting policy about the account, allowance for bad debt. \nAnother intere', 'line', 130, 'allowance for bad debt of Microsoft and Google', '2014-09-23 06:13:06', '2014-10-13 16:03:04', 0, NULL, '397091', 'asc', 0, '', '', '2178'),
	(206, ' \nThe card shows that the allowance of bad debt of Microsoft is quite stable while that of Google increased sharply during 2012 and stayed in a high level. The change of the account, allowance of bad debt, in Google should have close connection with the increasing number of its account receivable. I assume that it’s because the growing account receivable made Google exposure larger risk of bad debt that Google changed its accounting policy about the account, allowance for bad debt. \nAnother inte', 'combo_new', 130, 'The acount receivable and allowance for bad debt o', '2014-09-23 07:02:43', '2014-09-23 07:15:09', 0, '2013', '397091', 'asc', 0, '409500,', '397091,', '2178'),
	(208, NULL, 'combo_new', 91, 'Liquidity of IBM, Apple Inc and Microsoft Corp', '2014-09-23 12:12:04', '2014-10-14 04:07:25', 0, '2013', '184943', 'asc', 0, '184943,294130,', '982558,386167,', '1460'),
	(209, 'Social media companies are valued highly in the market today. Facebook is the bestseller. Facebook is highly valuated and it\'s equities 52-week price constantly growing mostly affected by innovations. If Facebook\'s liquidity ratio is for several times higher compare to all top traded companies, what could be the reasons for not BUY?.', 'line', 88, 'Facebook is the bestseller ', '2014-09-23 14:11:02', '2014-10-29 10:18:59', 0, '2013', '819581', 'asc', 0, '', '', '7754'),
	(210, 'I chose current ratio,quick ratio and cash ratio to Analyze Google and Apple\'s liquidity. The trend of the three ratios are almost the same, and both of the companies has a decline in the ratios. Google\'s ratios are much bigger than Apples, which means Google has better liquidity. In 2009 Google\'s current ratio is 10.62, I think it is a little strange because Google does not have much inventories.', 'line', 86, 'Liquidity of Google and Apple', '2014-09-23 15:32:30', '2014-09-24 05:10:34', 1, '2009', '819581', 'asc', 0, '', '', '1438'),
	(211, 'Quick ratio of Ebay and Amazon both went down form 2009 to 2013, and that of Ebay went down more quickly than that of Amazon. Since quick ratio focus on the  quick assets, it tells us that this two companies may have increased their liabilities or have reduced their cash amounts. And I think it may not be a good news to the business.', 'line', 125, 'Quick ratio of Ebay and Amazon', '2014-09-23 16:22:29', '0000-00-00 00:00:00', 0, '2013', '538668', 'asc', 0, '', '', '1376'),
	(212, 'From 2009 to 2013 current ratio of both Ebay and Amazon went down, however, Ebay maintains a bigger number of current ration than Amazon. From the operating respect, I think Ebay has done a better job than Amazon.', 'line', 125, 'Current ration of Ebay and Amazon', '2014-09-23 16:27:10', '0000-00-00 00:00:00', 0, '2013', '819581', 'asc', 0, '', '', '1376'),
	(213, 'From 2009 to 2012 the net income is higher than income before extraordinary items, because these years satrbucks earned little and even lost money, so they have a profit form tax. In 2013 the net income was below income before extraordinary items, it may caused by increasing from non-recurring items.', 'combo_new', 125, 'Non-recurring items\' influence on income of Starbu', '2014-09-23 16:40:46', '0000-00-00 00:00:00', 0, '2013', '189526', 'asc', 0, '128802,', '189526,', '1591'),
	(214, 'It is very interesting to note that Pfizer had an incredibly large restructuring cost that it was able to add back after the period.  This restructure increased both its recorded "earnings" and the taxes, so the motivation behind this move is interesting, and it was able to dwarf even Microsoft\'s the year prior. ', 'column', 138, 'Restructuring data', '2014-09-23 17:31:03', '0000-00-00 00:00:00', 1, '2013', '385349', 'asc', 0, '', '', '2178'),
	(215, 'This takes a look at two down component stocks, Goldman and Verizon. The reason these two stock were chosen is they both had events (that is, within the last 2 years) that effectively changed their debt-to-equity ratio. \n\nCan anyone remember what these events were? ', 'column', 172, 'Goldman v. Verizon - Spikes in arrears', '2014-09-23 21:57:33', '0000-00-00 00:00:00', 1, '2013', '710420', 'asc', 0, '', '', '1443'),
	(217, 'An examination of the changes in equity of Google\'s two closest competitors: Cisco, which provides hardware for all major manufacturers, in addition to corporate IT infrastructure; and eBay, which provides services competitive with Google Wallet [RIP], Checkout, Shopping, etc.\n\nAcross all indicators, Google has maintained the steadiest trends: improving return on equity, stabilizing or reducing debt-to-equity, issuing additional stock, and experiencing growth in market value.\n\neBay experienced a', 'line', 103, 'Google and Its Top Competitors: Debt and Equity', '2014-09-24 00:10:27', '2014-09-29 01:39:56', 0, '2013', '710420', 'asc', 0, '', '', '1438'),
	(218, 'Based on working capital position of both companies, we can conclude that Ebay and Amazon are able to pay off its liabilities. Moreover, the operating cycle reveals that Amazon is comparatively better in terms of receiving cash that it was invested in in the inventory and the receivables. The cash ratio significantly indicated that both companies has cash and csh equivalents on hand but Ebay\'s position is substantially stronger by comparison with previous years. ', 'rank', 153, 'Comparing Liquidity of Ebay and Amazon', '2014-09-24 02:07:49', '2014-11-01 12:58:04', 0, '2013', '376610', 'asc', 0, '', '', '1281'),
	(219, 'The first time I saw the quick ratio of Wal Mart, I was shocked. Usually, it is safe to maintain the quick ratio around 1. After research, I found that Wal Mart has a large amount of inventory, thus its quick ratio is certainly low. As a retail company, Wal Mart can easily sell its inventory in a short time. So I found that using quick ratio to evaluate retail companies is somewhat unfair.', 'combo_new', 102, 'liquidity of Wal Mart', '2014-09-24 02:17:44', '0000-00-00 00:00:00', 0, '2013', '863966', 'asc', 0, '', '538668,965488,294130,863966,819581,376610,', '1652'),
	(220, 'Comparing income before extraordinary items and net income(loss), we will find that some extraordinary things happened to Verizon. ', 'combo_new', 102, 'Nonrecurring items of Verizon', '2014-09-24 02:38:32', '2014-09-24 02:39:45', 0, NULL, '128802', 'asc', 0, '', '189526,128802,', '1643'),
	(221, NULL, 'combo_new', 118, 'non-recurring items of Walmart', '2014-09-24 02:41:47', '2014-09-24 02:46:59', 0, '2013', '627616', 'asc', 0, '627616,', '128802,189526,', '1652'),
	(222, 'Apple\'s and Microsoft\'s current ratio are almost mirrors of each other. Microsoft is more liquid with a higher current ratio. \n\nIn 2010 Apple launched iPad, and their current ratio dropped. \n\nCurrent ratio shows if a company\'s short-term assets can pay off its short-term liabilities. This can be misleading b/c the current ratio only looks at current liabilities and assets, BUT investors should look at the the company as a going concern. ', 'line', 148, 'Apple vs Microsoft Current Ratio', '2014-09-24 02:42:49', '2014-09-24 02:48:19', 0, '2013', '819581', 'asc', 0, '', '', '2178'),
	(223, 'I compared GE\'s continued operations versus discontinued operations to show non-recurring items. I also added net income to see how it compared to continued and discontinued operations. It appears that net income follows the same trend as cash from discontinued operations. Why is that?', 'combo_new', 148, 'GE Non-recurring Items', '2014-09-24 02:58:16', '2014-09-24 03:02:07', 0, '2013', '888130', 'asc', 0, '', '888130,902284,425740,', '1430'),
	(224, 'This card illustrates the liquidity of several communication companies. The liquidity mentioned is highly related to a company\'s ability of paying off floating debts. According to the card, Verison has performed the best in the past few years. In 2013, its Current Assets exceeded its Current Liability, causing the Current Ratio, Quick Ratio and Cash Ratio to increase rapidly. It may be the result of borrowing long- term loan from the bank, or disposing of Fixed Assets. Thus, the ability of pay o', 'combo_new', 137, 'Liquidity of Several Communication Companies', '2014-09-24 03:04:10', '0000-00-00 00:00:00', 1, '2013', '965488', 'asc', 0, '965488,863966,', '819581,538668,376610,', '2350'),
	(225, 'Tesla Motors, a luxury brand automobile, experienced a sharp rise in its stockholders\' equity in 2013. The increase in stockholders\' equity may indicate growth in its profits since the operating profits also had a drastic increase in 2013.', 'line', 120, 'Tesla Soared on Stockholders\' Equity in 2013', '2014-09-24 03:23:57', '2014-09-24 03:26:47', 1, NULL, '154595', 'asc', 0, '', '', '688'),
	(226, NULL, 'area', 145, 'Liquidity for Verizon and AT&T', '2014-09-24 03:31:04', '2014-09-24 03:31:21', 1, '2013', '538668', 'asc', 0, '', '', '1632'),
	(227, 'It is really surprise me that McDonald\'s Non Current Asset is around seven times larger than its current assets, and they increase smoothly every year. What I found is that the strategy of McDonald\'s of PP&E is purchasing property as their restaurants rather than renting property. Some of the restaurants are operated directly by McDonald\'s. The other restaurants can be rented to people who want to operate a McDonald restaurant but have no property.', 'combo_new', 167, 'McDonalds\' Current Asset vs Non Current Asset', '2014-09-24 03:38:30', '2014-10-15 02:58:56', 0, '2013', '277049', 'asc', 0, '277049,965488,', '', '1501'),
	(228, NULL, 'line', 137, 'Non- recurring Items of Liberty Global, Inc.', '2014-09-24 03:43:42', '0000-00-00 00:00:00', 1, '2013', '627616', 'asc', 0, '', '', '114'),
	(229, NULL, 'column', 145, 'Non-Recurring Items for AT&T and Verizon', '2014-09-24 03:55:24', '0000-00-00 00:00:00', 1, '2013', '128802', 'asc', 0, '', '', '2268'),
	(230, 'The data shows that the current ratio of Coca Cola\nhas been quite stable while that of Hansen Natural Corp has been fluctuating sharply since 2009. ', 'line', 134, 'Current Ratio- Coca Cola Vs Hansen Natu', '2014-09-24 04:35:02', '2014-09-24 04:52:17', 0, '2013', '819581', 'asc', 0, '', '', '2008'),
	(231, NULL, 'line', 134, 'Non-operating Income(loss)-Coca cola VS Hansen', '2014-09-24 04:50:10', '2014-09-24 04:51:44', 0, '2013', '736288', 'asc', 0, '', '', '1481'),
	(232, 'The data shows that income derived from a source other than a firms regular activities has a positive income for Ebay, but not for the Amazon.', 'rank', 153, 'Other Non Operating Income', '2014-09-24 05:14:45', '0000-00-00 00:00:00', 0, '2013', '251897', 'asc', 0, '', '', '1376'),
	(233, 'Continuous research on Coca-cola, Kraft, and McD. ', 'rank', 124, 'Comparison of key items in Current Assets of Food ', '2014-09-24 08:29:57', '0000-00-00 00:00:00', 1, '2013', '145997', 'asc', 0, '', '', '1481'),
	(234, NULL, 'rank', 124, 'Related indicators from Shareholder\'s equity ', '2014-09-24 08:53:29', '0000-00-00 00:00:00', 1, '2013', '413922', 'asc', 0, '', '', '1481'),
	(235, 'P&G has a very stable trend of revenue, but the revenue of J&J dropped in 2013. However, when I look through the annual report of J&J in 2013, the sales to customers is $71,312, which is different from what shows in idaciti. The sales to customers for 2012 and 2011 are $67,224 and $65,030, which are only slightly different from what show in idaciti.', 'line', 92, 'Revenue for P&G and J&J', '2014-09-24 08:55:20', '0000-00-00 00:00:00', 0, '2013', '697697', 'asc', 0, '', '', '1471'),
	(236, 'The ROE ratio is an important measure of a company\'s earnings performance because it tells common shareholders how effectively their money is being employed. While a strong metric to measure profitability, the ROE ratio does have an achilles heel. Investors must be aware that a disproportionate amount of debt in a company\'s capital structure would translate into a smaller equity base. As the chart shows, Google\'s debt to equity remained flat in 2010 and 2011, but rose in 2012. The return on equi', 'combo_new', 159, 'Google\'s Return on Equity and Debt to Equity', '2014-09-24 10:32:54', '0000-00-00 00:00:00', 1, '2013', '710420', 'asc', 0, '710420,', '576859,', '1438'),
	(237, 'Procter & Gamble Co.\'s cash ratio and quick ratio deteriorated from 2009 to 2011 but then improved from 2012 to 2013 exceeding 2011 level. The current ratio, cash ratio and quick ratio of Johnson & Johnson are considerably higher compared to PG which indicates that JNJ is more liquid and has capacity to generate when compared to PG whose cash earning capacity is lower. Thus, JNJ is more liquid and has less liquidity risk.', 'line', 136, 'Liquidity comparison of household companies: PG an', '2014-09-24 15:25:19', '0000-00-00 00:00:00', 0, '2013', '819581', 'asc', 0, '', '', '2268'),
	(238, 'Compare shareholders\' equity per share, dividend payout and retained earnings of three public companies', 'line', 119, 'Comparison of equity in Apple,Google and Microsoft', '2014-09-25 01:44:01', '2014-09-30 02:04:18', 1, '2013', '587650', 'asc', 0, '', '', '55'),
	(239, NULL, 'rank', 124, 'Contributed Capital, APIC, and EPS', '2014-09-25 11:57:34', '0000-00-00 00:00:00', 1, '2013', '841889', 'asc', 0, '', '', '1481'),
	(240, 'Why so many items from Kraft are N/A???', 'rank', 124, 'Cash Flow from three activities and Net Income', '2014-09-25 12:04:08', '2014-09-25 12:07:11', 1, '2013', '425740', 'asc', 0, '', '', '1481'),
