	(242, NULL, 'rank', 140, '2013 Stockholders Equity: Major Television Provide', '2014-09-27 07:04:40', '2014-09-27 07:45:45', 1, '2013', '318387', 'asc', 0, '', '', '1363'),
	(243, 'compare the liquidity between two firms', 'line', 97, 'liquidity', '2014-09-28 06:52:02', '0000-00-00 00:00:00', 0, '2013', '145997', 'asc', 0, '', '', '55'),
	(244, 'see how the extraordinary items impact on the company', 'area', 97, 'non recurring item', '2014-09-28 07:33:55', '0000-00-00 00:00:00', 0, '2013', '627616', 'asc', 0, '', '', '1479'),
	(245, 'The price to earnings ratio indicates the investment potential of a enterprise. From 2010 to 2013, the walmart\'s price to earnings ratio increased from 12.52 to 15.24. Therefore, walmart INC seems to be a good choice of investment. However, the stockholder\'s equity and the net income decreased in 2013. Since both of them are also relevant factors, more research are needed before make investment decision.', 'line', 121, 'Investment potential of walmart INC.', '2014-09-28 09:52:12', '2014-09-28 10:30:59', 0, '2013', '140498', 'asc', 0, '', '', '1281'),
	(246, 'In 2009, Apple and Google\'s income before extraordinary items are about the same, but Apple\'s is growing faster than Google\'s. In 2014, Apple\'s income before extraordinary is more than four times larger than Google\'s.', 'rank', 86, 'Non-recurring items', '2014-09-28 14:26:11', '2014-09-29 13:58:35', 1, '2014Q1', '128802', 'asc', 0, '', '', '1438'),
	(247, 'The data shows that Apple\'s other non operating income and revenues has a negative relation. While Google\'s revenue is growing, its other non operating income does not change much.', 'line', 86, 'Revenue for Apple and Google', '2014-09-28 14:55:52', '2014-09-29 13:50:02', 1, NULL, '697697', 'asc', 0, '', '', '1438'),
	(248, 'In the graph, I can easily see that Amazon largely increased in its revenue in the fourth quarter of each year. And its accounts receivable had the same trend. Ebay had a sudden increase in its revenue in the first and second quarter of 2013. Its  accounts receivable also had the same trend.', 'combo_new', 162, 'Revenues of Ebay & Amazon', '2014-09-28 17:04:51', '2014-10-04 03:57:13', 0, '2013', '697697', 'desc', 0, '697697,409500,217992,', '', '1376'),
	(249, 'We can see that in 2012 Q1, 2013Q1 and 2014Q1, accounts receivable increased dramatically while net sales and cost and expenses are equal. According to Coca cola reports in 2012Q1, they have eliminated the BPW joint venture volume and associated concentrate sales from our reported results for both 2011 and 2012 in those countries in which the joint venture was phased out during 2012.  In addition, we have eliminated the Nestea licensed volume and associated concentrate sales in the U.S. which in', 'combo_new', 91, 'revenue of coca cola co.', '2014-09-29 07:28:27', '0000-00-00 00:00:00', 0, '2014Q2', '314019', 'asc', 0, '314019,868756,', '605057,727260,', '1481'),
	(250, 'We can see that in 2012 Q1, 2013Q1 and 2014Q1, accounts receivable increased dramatically while net sales and cost and expenses are equal. According to Coca cola reports in 2012Q1, they have eliminated the BPW joint venture volume and associated concentrate sales from our reported results for both 2011 and 2012 in those countries in which the joint venture was phased out during 2012.  In addition, we have eliminated the Nestea licensed volume and associated concentrate sales in the U.S. which in', 'combo_new', 91, 'revenue of coca cola co.', '2014-09-29 07:28:35', '0000-00-00 00:00:00', 0, '2014Q2', '314019', 'asc', 0, '314019,868756,', '605057,727260,', '1481'),
	(251, 'Comparing Google and Yahoo Revenue Over a 5 year time period', 'line', 95, 'Internet Information Providers Revenue Comparison', '2014-09-30 02:21:48', '0000-00-00 00:00:00', 1, '2013', '697697', 'asc', 0, '', '', '1438'),
	(252, 'I noticed a significant decrease in 21st Century Fox\'s Stockholders\' Equity after 2011. Stockholders\' equity is comprised of share capital plus retained earnings less treasury stock. To investigate further, I looked at the 10-K for 21st Century Fox. From 2011 to 2012, the company\'s retained earnings dropped 32% and from 2012 to 2013 there was an 86.6% decrease! Transactions that affect a decrease in RE could be a decrease in net income or dividends paid. In 2012, NI to shareholders decreased whi', 'line', 93, 'Stockholder\'s Equity of Walt Disney and 21st Centu', '2014-09-30 02:35:11', '2014-09-30 02:39:40', 0, '2011', '119622', 'asc', 0, '', '', '1364'),
	(253, 'In Q2 2012, Nike announced a two for one stock split.  Companies often do this to reflect confidence in its growth potential.  From the graph, you can see the huge spike in the per share value at the end of 2012.  This number is brought back down in Q1 2013 through the company buying back its shares.  This in turn reduced the number of shares outstanding, which is also reflected in the graph.  Nike repurchased shares to return value to shareholders. Nike\'s strategy to raise dividends by splittin', 'combo_new', 100, 'Nike 2012 stock split, 2013 buyback', '2014-09-30 04:00:00', '0000-00-00 00:00:00', 0, '2013', '365595', 'asc', 0, '365595,221200,868756,833144,386024,', '668136,', '1530'),
	(254, 'The chart shows the relation between the amount of treasury stock and that of proceeds from issuance of common stock of Yahoo Inc.. Generally, when the amount of treasury stock increases this period and decreases in next period, proceeds increases a lot in next period. After I did some research, I found out that the main reason of Yahoo’s share buyback is to collect more money for its purchasing companies. Once Yahoo bought back its stocks, the value of common stock increased and it collected mo', 'combo_new', 147, 'Treasury stock and Proceeds from issuance of commo', '2014-09-30 04:43:18', '2014-09-30 04:43:29', 0, '2013', '958803', 'asc', 0, '318387,', '958803,', '1661'),
	(255, NULL, 'rank', 108, 'P&G vs. J&J Stockholders Equity Analysis', '2014-09-30 06:48:04', '0000-00-00 00:00:00', 0, '2013', '413922', 'asc', 0, '', '', '1471'),
	(256, 'The chart shows key performance indicators of equity, dividend and liquidity for major U.S. pharmaceutical companies.', 'rank', 160, 'Dividend polices of US pharmaceutical companies', '2014-09-30 08:03:02', '2014-09-30 11:44:04', 1, '2013', '189860', 'asc', 0, '', '', '1471'),
	(258, 'ROE is a worthwhile metric when analyzing a company and its stock. This card shows IBM uses buyback stock strategy to have average ROE over 80%. The common stock decreased from 261 million in 2009 to 210 million in 2013. In 2013, the net income of IBM has slightly decreased, but the treasury stock increased 14 million decreasing shareholders’ equity to keep ROE high. Investors feel strong confidence since the ROE of IBM is above their expectation.', 'column', 146, 'ROE of IBM: Stock Buybacks', '2014-09-30 08:26:40', '2014-09-30 08:31:27', 0, '2013', '576859', 'asc', 0, '', '', '1460'),
	(259, NULL, 'line', 96, 'Equity analysis', '2014-09-30 11:53:18', '2014-09-30 11:55:56', 0, '2012', '801713', 'asc', 0, '', '', '9610'),
	(260, 'Earnings per share is relatively high for American Express because the card business is not extremely capital intensive in operations. I noticed that American express repurchased over 3 million shares of common stock in 2013. This was a progressive increase in the past 3 years. This repurchase of common stock as treasury shares will immediately increase the eps ratio. \n\n', 'rank', 108, 'Visa. Vs. American Express', '2014-09-30 11:56:39', '0000-00-00 00:00:00', 0, '2010', '576859', 'asc', 0, '', '', '1291'),
	(261, 'In 2009 Q2-Q4, we found that retained earnings have decreased dramatically. I don\'t know the exact reason for this decreasing. But I guess, in 2009, the net sale has decreased 3% and gross profit has decreased 80 basis points.  Facing the serious macroeconomic situation, the retained earning of P&G decreased a lot.', 'combo_new', 91, 'P&G Stockholders\' equity ', '2014-09-30 13:13:07', '0000-00-00 00:00:00', 0, '2013', '707672', 'asc', 0, '707672,318387,500208,', '447329,321048,', '2268'),
	(262, 'This chart shows the value of the common stock issued and the total stockholders equity. What is interesting to see here that the amount of stockholders equity is on an incline whereas the value of issued common stock is in a decline.', 'line', 114, 'American Express Stockholders Equity', '2014-09-30 13:18:01', '0000-00-00 00:00:00', 0, '2013', '484155', 'asc', 0, '', '', '1291'),
	(263, 'We can see from the chart that the stockholder’s equity of Walmart is the highest, then Costco, lastly Whole foods. Stockholder’s equity is mainly affected by paid-in capital and retained earning. For example, The stockholder’s equity of Walmart declined from 2009 to 2011, shortly increasing from 2011 to 2012, and decreased from 2012 to 2013. The retained earning did not show much fluctuation. However, the additional paid in capital presented the same trend as stockholder’s equity, which could e', 'line', 150, 'Comparison of Giant supermarkets\' stockholder equi', '2014-09-30 14:07:25', '0000-00-00 00:00:00', 1, '2013', '819581', 'asc', 0, '', '', '1652'),
	(264, NULL, 'line', 126, 'liquidity of travel companies ', '2014-09-30 14:25:08', '2014-09-30 14:26:32', 1, '2013', '819581', 'desc', 0, '', '', '7008'),
	(266, NULL, 'line', 126, 'revenues of travel industry ', '2014-09-30 14:52:03', '0000-00-00 00:00:00', 0, '2012', '697697', 'asc', 0, '', '', '7008'),
	(267, 'amazon\'s revenue remains higher than that of ebay from 2009 to 2013. it may results from that amazon has a bigger assets than ebay. And it is very obvious that both ebay\'s and amazon\'s revenue are going up, this situation reflects that the macro economic is warming.', 'line', 125, 'revenue for ebay and amazon', '2014-09-30 15:03:25', '2014-10-01 04:03:06', 0, '2013', '697697', 'asc', 0, '', '', '1376'),
	(268, 'Based on the data, we can conclude that Amazon\'s revenue from 2009 to 2013 grew drastically from 24.5B to 74.5B. I believe that its kindle e-reader was the retailer best selling product and creation of amazon prime (loyalty program).  Ebay managed to keep their revenue in steady process with no drastic changes from 2009 to 2013. 43% of their revenue have resulted by Pay Pal account, which isn\'t the core activity of the company. ', 'line', 153, 'Revenue amazon vs ebay', '2014-09-30 15:09:03', '0000-00-00 00:00:00', 0, '2009', '697697', 'asc', 0, '', '', '1281'),
	(269, 'The charts show that there was a big change of  common stock between 2012 and 2013 because IBM purchased back numerous common stocks outstanding, as a result, EPS increased from 2012. However, IBM\'s ROE increased from 2009 to 2012 but stagnated from 2012 to 2013. ROE presents a company\'s ability to generate profits by using stockholder\'s equity. Since there was not enough cash flow for buyback, IBM\'s total debt increased significantly from 2012 to 2013. ', 'line', 144, 'IMB stockholder\'s equity', '2014-09-30 18:07:25', '2014-10-01 09:20:48', 0, '2013', '306956', 'asc', 0, '', '', '1460'),
	(270, 'Looking at Liquidity of Verizon vs. AT&T, from 2009 to 2012 the two companies are similar, with Verizon slightly above AT&T.  Both companies are illiquid from 2009 - 2012, with the exception of Verizon in 2011, which reached liquidity of 1.01 before falling again in 2012 to .79.  \n\n Then in 2012 Verizon\'s liquidity jumps dramatically from .79 to 2.62 for 2013.  This is tremendous growth.  I assumed this had something to do with Verizon Fios, so I researched further.  I found a letter from the CE', 'line', 107, 'Verizon vs. AT&T Liquidity', '2014-09-30 19:41:03', '2014-09-30 19:56:07', 1, '2013', '819581', 'asc', 0, '', '', '1632'),
	(271, NULL, 'line', 145, 'Revenue for AT&T and Verizon', '2014-09-30 19:49:15', '0000-00-00 00:00:00', 1, '2013', '697697', 'asc', 0, '', '', '1632'),
	(272, NULL, 'rank', 101, 'Example Card Current Ratio', '2014-10-01 00:58:36', '2014-10-01 02:03:05', 0, '2013', '819581', 'asc', 0, '', '', '55'),
	(273, 'For both of companies, the amount of shareholder equity, retained earnings, and common stock remain stable from 2009 to 2013. While ROE of Costco increases year by year, suggesting that Costco is increasing its ability to generate profit without needing as much capital. ', 'line', 131, 'Equity of Walmart vs. Costco', '2014-10-01 01:56:40', '0000-00-00 00:00:00', 0, '2013', '801713', 'asc', 0, '', '', '1652'),
	(274, NULL, 'rank', 101, 'Net Income/Net Sales Example Card', '2014-10-01 02:09:04', '2014-10-02 09:26:36', 0, '2013', '425740', 'asc', 0, '', '', '1364'),
	(275, NULL, 'rank', 101, 'CGS and Inventory Example Card', '2014-10-01 02:32:52', '0000-00-00 00:00:00', 0, '2013', '294130', 'asc', 0, '', '', '1652'),
	(277, 'From the chat, we can see Kraft Foods\' revenues from  2009 to 2013 has dramatically fluctuated. The highest point is 38754000000 in 2009, and a sharply drop from 2009 to 2010. Gradually increase from 2010 to 2011, and then it hold steady in the following years.\nWhat I found is that Kraft Foods Inc acquired Cadbury Schweppes during 2009 to 2010. When Kraft Foods acquired Cadbury Schweppes successfully, they expense a lot in integrating resource from two companies.', 'combo_new', 167, 'Kraft Foods Revenues from 2009-2013', '2014-10-01 02:51:39', '0000-00-00 00:00:00', 0, '2013', '697697', 'asc', 0, '', '697697,727260,', '1479'),
	(278, 'The revenue of Blizzard always change with the issues of its new games.  Once a new game is issued, the revenue will highly increase, and as time passes by, the revenue will decrease gradually.\nIn Dec 2010, Blizzard issued World of Warcraft: Cataclysm, which brought back a lot of game players. Thus the revenue of 2010 Q4 and 2011 Q1 highly increased. \nIn Nov 2012, Blizzard issued World of Warcraft: Mists of Pandaria. The issue of new game increased revenue for the next two quaters. As time passe', 'combo_new', 102, 'Revenue of Blizzard', '2014-10-01 03:06:08', '0000-00-00 00:00:00', 0, NULL, '697697', 'asc', 0, '697697,', '', '791'),
	(279, 'comparison of debt to equity ratio，return on equity and shareholder‘s equity per share', 'line', 175, 'shareholder‘s equity（yahoo and google）', '2014-10-01 03:28:26', '2014-10-01 03:28:42', 1, '2013', '576859', 'asc', 0, '', '', '1661'),
	(280, 'comparison of debt to equity ratio，return on equity and shareholder‘s equity per share', 'line', 175, 'shareholder‘s equity（yahoo and google）', '2014-10-01 03:28:33', '0000-00-00 00:00:00', 0, '2013', '576859', 'asc', 0, '', '', '1661'),
	(281, NULL, 'line', 148, 'Starbucks Revenue', '2014-10-01 03:29:26', '0000-00-00 00:00:00', 0, '2013', '697697', 'asc', 0, '', '', '1652'),
	(282, 'Revenues are increasing steadily, but Net Income is fluctuating. 2011 notes on income and recent accounting standards updates will be effective in 2012, this may cause the net income to be lower in 2012 plus costs and expenses dramatically increased in 2012 due to mobile explosion and wireless connection need in the industry. \nhttp://www.verizon.com/investor/app_resources/interactiveannual/2012/downloads/12_vz_ar.pdf\n\nhttp://www.verizon.com/investor/app_resources/interactiveannual/2011/note01_02', 'combo_new', 148, 'Verizon Revenue', '2014-10-01 03:49:03', '2014-10-01 04:03:31', 0, '2013', '425740', 'asc', 0, '697697,425740,', '727260,', '1643'),
	(283, NULL, 'column', 98, 'Visa/Amex Revenues', '2014-10-01 04:09:23', '0000-00-00 00:00:00', 0, '2013', '559768', 'asc', 0, '', '', '1644'),
	(284, 'although the revenue of amazon is always going up, the operating and non operating income are going down and both of them remain negative since 2012. it shows amazon didn\'t do well in cost control and may cannot pay off its debts on time.', 'combo_new', 125, 'revenue operating income and non-operating income ', '2014-10-01 04:11:08', '0000-00-00 00:00:00', 0, '2013', '697697', 'asc', 0, '697697,736288,', '459844,', '1281'),
	(285, 'This cart measures the liquidity of Apple through its Cash and cash equivalent, accounts receivable, accounts payable, accrued liabilities, etc.', 'combo_new', 117, 'Liquidity of Apple', '2014-10-01 04:43:59', '2014-10-08 01:04:13', 1, '2013', '145997', 'asc', 0, '145997,373469,', '409500,294130,467351,967565,', '55'),
	(286, 'This graph compares the operating revenues after tax, interest revenue and total revenue among the Intel, apple, google, IBM.', 'area', 117, 'IT industry revenues', '2014-10-01 04:46:28', '2014-10-08 01:13:17', 1, '2013', '697697', 'asc', 0, '', '', '1460'),
	(287, 'The data shows that Walmart Inc is not only a far larger company in terms of it\'s operations and revenue when compared to Amazon Inc, it is also far more profitable and rewarding for investors since it has higher diluted earnings per share as well as return on equity.', 'line', 110, 'Retail Giants Shareholder\'s Equity', '2014-10-01 04:51:58', '2014-11-12 11:20:01', 0, '2013', '306956', 'asc', 0, '', '', '1652'),
	(288, 'Among 60 S&P companies engaging in buybacks in 2012, Johnson & Johnson accounted for the largest amount, repurchasing $12.9 billion worth of stock. J&J is known for its ambitious buyback plan, announcing in July of this year approval of a $5 billion buyback program of its common stock. Buybacks are usually used for several purposes, but the 2012 buyback was a well crafted move used to avoid a large tax hit on its acquisition of Synthes, a Swiss medical company. ', 'line', 115, 'Johnson & Johnson 2012 Buyback', '2014-10-01 06:00:42', '2014-10-15 03:52:32', 0, '2013', '576859', 'asc', 0, '', '', '1471'),
	(289, 'We can see from the column changes that the shareholders equity was decreased by 5,255,000,000 during 2012 to 2013.', 'column', 133, 'Shareholders Equity of Home Depot Inc', '2014-10-01 06:32:33', '0000-00-00 00:00:00', 0, NULL, '792477', 'asc', 0, '', '', '1448'),
	(290, 'We can obviously see from this line that the common stock of Home Depot Inc decreased a lot from the end of 2013 to beginning of 2014. (It\'s very weird that the line here shows that the common stock or Home Depot changed to be 0, may be the data is not that correct in this system.) We would like to figure out what influenced the common stock condition.', 'line', 133, 'Common Stock of Home Depot Inc', '2014-10-01 06:44:05', '0000-00-00 00:00:00', 0, '2013', '707672', 'asc', 0, '', '', '1448'),
	(291, 'It is reasonable to guess that the decrease in Home Depot Inc\'s Common stock was caused by the stock repurchase by the company, in which way the treasury stock of the company should increased. But from this line we are informed that the treasury stock decreased during 2013Q3 to 2014Q1. (it\'s also very weird that the treasury stock turned to be 0 in 2014Q1 here).', 'line', 133, 'Treasury Stock of Home Depot Inc', '2014-10-01 06:53:17', '0000-00-00 00:00:00', 0, '2013', '318387', 'asc', 0, '', '', '1448'),
	(292, 'Ebay has a bigger equity base than amazon and show more stable benefit than amazon. They both don;t have preferred stock.\n\nI tried a lot of companies within different industries. Too many companies are not in idaciti\'s company list. So there are only few of them can be used to compare.', 'line', 149, 'Amazon & Ebay Equity', '2014-10-01 07:30:16', '2014-10-01 07:51:40', 1, '2013', '792477', 'asc', 0, '', '', '1281'),
	(293, 'Long Term Debt Ratio: The greater a company\'s leverage, the higher the ratio. Generally, companies with higher ratios are thought to be more risky because they have more liabilities and less equity.\n\nDebt to Equity: A high debt/equity ratio generally means that a company has been aggressive in financing its growth with debt.\n\nOperating Cash Flow to Debt: The higher the percentage ratio, the better the company\'s ability to carry its total debt. Apple clearly has a higher rate at almost double. \n\n', 'column', 111, 'Apple v Microsoft | Stockholders\' Equity', '2014-10-01 09:34:11', '2014-10-01 09:38:54', 1, '2013', '801713', 'asc', 0, '', '', '55'),
	(294, NULL, 'line', 127, 'Computer Storage Indurstry---Stockholder\'s Equity', '2014-10-01 09:39:11', '2014-10-01 09:41:12', 0, NULL, '140498', 'desc', 0, '', '', '2380'),
	(295, 'Since 2011, Coke has put a greater emphasis towards marketing. The demand for its drinks have been going down even in emerging markets. With its drop in NI in 2011, Coca has gone through a period of heavy investment to recharge its branding. Coke might possibly purchase more health conscious refreshment companies. What coming effect will this period of reinvestment have on future dividends and net income?', 'line', 174, 'Coke\'s Reinvestment and the effect on equity', '2014-10-01 11:24:31', '0000-00-00 00:00:00', 1, '2013', '425740', 'asc', 0, '', '', '1481'),
	(296, NULL, 'rank', 166, 'Starbucks Free Cash Flow', '2014-10-04 06:43:20', '0000-00-00 00:00:00', 0, '2013', '713585', 'asc', 0, '', '', '1591'),
	(297, NULL, 'line', 166, 'Apple vs. Google Stock Price', '2014-10-04 06:47:30', '0000-00-00 00:00:00', 0, '2013', '947700', 'asc', 0, '', '', '55'),
	(298, 'Facebook', 'column', 88, 'Facebook Inc. ', '2014-10-05 12:11:49', '0000-00-00 00:00:00', 0, '2013', NULL, 'desc', 0, '', '', '7754'),
	(299, 'According to this graph Deferred Revenue is equal to zero. Thus, Facebook Inc. recognizes revenue only after service or product is delivered to the customer and return privileges have expired. ', 'combo_new', 88, 'Facebook Inc. Revenue recognition', '2014-10-05 12:26:00', '2014-10-05 12:36:32', 0, '2013', '697697', 'asc', 0, '697697,727260,', '425740,217992,', '7754'),
	(300, NULL, 'combo_new', 97, 'revenue for the energy industry', '2014-10-06 07:22:49', '2014-10-06 07:25:15', 0, '2013', '397091', 'asc', 0, '697697,409500,', '397091,', '1246'),
	(301, 'So I wanted to try to understand Apple\'s income, large sums of cash reserves, the amount of R&D they have (which should be taking up a lot of its cash), and the dividends per share that they give out (none). Then compare those numbers with Microsoft\'s numbers, and try to understand why Apple does not pay out any dividends.', 'line', 170, 'Apple vs Microsoft - EPS Analysis ', '2014-10-06 08:08:22', '0000-00-00 00:00:00', 1, '2014Q2', '833144', 'asc', 0, '', '', '55'),
	(302, 'ROE, dividends and EPS diluted of Household products companies.', 'line', 136, 'Equity comparison of P&G and JNJ', '2014-10-06 16:25:46', '2014-10-06 17:07:25', 0, '2013', '386024', 'asc', 0, '', '', '2268'),
	(303, NULL, 'line', 160, 'Comparison of dividend policy in US pharmaceutical', '2014-10-07 06:16:34', '2014-10-07 06:20:08', 0, NULL, '586375', 'asc', 0, '', '', '1471'),
	(304, 'The liquidity of Starbucks is not stable, it may result from company financing activities. From 2009 to 2012 Current Ratio was higher than Quick Ratio, however in 2013 Current Ratio is lower than Quick Ratio, thus the inventory account may have an negative impact on current assets in this year.', 'combo_new', 125, 'Quick Ratio and Current Ratio of starbucks', '2014-10-07 15:47:17', '0000-00-00 00:00:00', 0, '2013', '538668', 'asc', 0, '538668,', '819581,', '1591'),
	(305, 'Revenue went up form 2009 to 2013, however, Net income in 2013 was quite small compared to that in other years, thus there may have a huge expense in 2013. At the same time Operating cash flows to sales went up, it shows that the company generated large amount of cash from operating activity, so that the huge expense may result from non-operating activities.', 'combo_new', 125, 'Net income, Revenue and Operating cash flows to sa', '2014-10-07 16:08:12', '0000-00-00 00:00:00', 0, '2013', '697697', 'asc', 0, '697697,425740,', '713585,', '1591'),
	(306, 'While Google’s Net Income increased steadily from 2009 – 2013, Yahoo’s Net Income was less stable, increasing and decreasing every other year.  The difference in dollar amount between Google and Yahoo’s Net Income was significant.  Yahoo’s Net Income ranged from $597,992,000 to $3,945,479,000 between 2009 and 2013, while Google’s Net Income ranged from $6,520, 448,000 to $12,920,000,000 over the same period. \n\nFrom 2009 – 2013, Google’s Revenue increased quite quickly year over year, starting at', 'line', 107, 'Yahoo vs. Google: Revenues & Income St. KPIs', '2014-10-07 17:17:31', '2014-10-21 22:19:19', 1, '2013', '559768', 'asc', 0, '', '', '1661'),
	(307, 'The purpose of this card is to explore the relationship graphically between revenue and EBITDA over a period of time. ', 'line', 138, 'Revenue', '2014-10-07 18:58:56', '2014-10-07 19:00:18', 0, '2013', '697697', 'asc', 0, '', '', '55'),
	(308, NULL, 'line', 130, 'income from discontinued activities of Google and ', '2014-10-08 01:07:48', '0000-00-00 00:00:00', 0, '2013', '627616', 'asc', 0, '', '', '1438'),
	(309, 'why did J&J\'s revenue decline dramatically in 2013?', 'column', 117, 'J&J vs P&G on revenue', '2014-10-08 01:24:57', '2014-10-08 01:25:37', 1, '2013', '697697', 'asc', 0, '', '', '1471'),
	(310, 'From the chart we can see that McDonalds\' FCF is increase sharply from 2009 to 2010 and hold steady from 2010 to 2013. While the net cash provided by operating is just showing the same tendency. However, we know that FCF is increased by cash flow from operating and decreased by capital Expenditures. McDonalds keep stable in the financial activities and increase their investment activities. That means McDonalds enlarge it operation and investment.', 'combo_new', 167, 'McDonalds\' cash flow from operating，investing and ', '2014-10-08 02:41:14', '2014-10-08 02:42:32', 0, '2013', '286474', 'asc', 0, '', '286474,576859,', '1501'),
	(311, 'Apple\'s free cash per share is increasing and CAPEX decreasing - healthy sign. Microsoft free cash per share decreased in 2013, this could be caused by increase in investing activities. Apple\'s cash from investing activities is leveling off from 2012-2013 and cash from operating activities is decreasing in 2013 - could be red flag. ', 'combo_new', 148, 'Apple & Microsoft Cash Flow', '2014-10-08 02:54:18', '2014-10-08 03:41:57', 1, '2013', '184943', 'asc', 0, '389667,384690,', '184943,902284,164813,362124,', '55'),
	(312, NULL, 'line', 130, 'Net Income and Free Cash Flow of Google and Micros', '2014-10-08 03:16:51', '2014-10-13 15:59:13', 0, '2009', '425740', 'asc', 0, '', '', '2178'),
