	(320, 'In 2010 Microsoft launched windows 7, this could attribute to substantial increase in operating expenses. If you zoom in to Q4, 2012 net income was dropped to negative but revenues only slightly decreased. For apple, net income and revenues decreased in Q2, 2014 while operating expenses remained stable - could be a red flag again. ', 'combo_new', 148, 'Apple & Microsoft Income Statement', '2014-10-08 03:52:10', '2014-10-08 04:19:07', 0, '2013', '697697', 'asc', 0, '425740,771081,', '697697,102956,251897,', '2178'),
	(321, 'Liquidity card shows us a completely different story of apple and microsoft. It is clear that Microsoft looks a lot healthier short term because its cash, current and quick ratios are much higher then apple\'s. Apple\'s liquidity is on the decline from 2009 maybe because they are investing more in R&D and their operating expense in increasing while microsofts\'s operating expense is decreasing. ', 'combo_new', 148, 'Apple & Microsoft Liquidity', '2014-10-08 04:21:59', '2014-10-08 04:30:46', 0, '2013', '819581', 'asc', 0, '819581,538668,376610,', '717549,771081,', '2178'),
	(322, NULL, NULL, 148, NULL, '2014-10-08 04:23:22', '0000-00-00 00:00:00', 0, NULL, NULL, 'desc', 0, '0', '0', ''),
	(323, 'Wow! Zoom into 2013 Q4, and you will see that there is a huge different between net income and income before extraordinary items adjusted from common stock equivalents for both apple and microsoft. Also, cash and cash equivalents including discontinued operations keep of fluctuating and a trend going up towards Q2, 2014. ', 'combo_new', 148, 'Apple & Microsoft Non-recurring items', '2014-10-08 04:37:34', '2014-10-08 04:47:42', 0, '2013', '663254', 'asc', 0, '663254,781879,425740,', '627616,145997,', '2178'),
	(324, 'Update No. 2009-14 - software (Topic 985) was added to be effective in June 2010. This means that revenue for smart phones could  be accounted for at the time sale versus spreading the revenue over 2 years due to software updates. This could be why starting in 2010 revenue significantly increased for the industry that cells hardware and software together. ', 'line', 148, 'Tech Industry Revenues', '2014-10-08 04:56:41', '2014-10-08 05:09:56', 0, '2013', '697697', 'asc', 0, '', '', '55'),
