	(329, 'Firstly, per share data shows huge difference between these three companies. Microsoft Corp has the largest number of shares of common stock outstanding. Then lets move to the profitability of these common stocks. The average market P/E ratio is 20-25 times earnings. Generally a high P/E ratio means that investors are anticipating higher growth in the future. The whole picture indicates that market has a more optimism prediction for Google, then Apple, lastly Microsoft. Specifically, Apple was g', 'line', 150, 'Earning Per Share of Technology Company', '2014-10-08 09:44:21', '0000-00-00 00:00:00', 0, '2013', '386024', 'asc', 0, '', '', '55'),
