	(339, NULL, 'combo_new', 103, 'AT&T, Verizon, and Comcast', '2014-10-15 02:54:39', '2014-10-15 03:12:07', 0, '2013', '306956', 'asc', 0, '656701,', '306956,', '1339'),
	(340, NULL, 'combo_new', 103, 'Costco & Walmart', '2014-10-15 03:06:06', '0000-00-00 00:00:00', 0, '2013', '306956', 'asc', 0, '306956,', '656701,', '1849'),
	(341, 'From 2009 to 2012, Yahoo’s revenue decreases from approximately $6.5 Billion to approximately $4.7 billion.  Its COGS also decreases over the 5-year period from approximately $2.9 billion to approximately $1 billion.  The fact that the COGS decreases as the revenue decreases helps to keep Yahoo’s net income positive despite the loss in revenue.  This is especially evident in 2012 when Yahoo’s revenue stays about the same, yet its COGS descreases from approx. $1.5 B to $1.1 billion, which helped ', 'combo_new', 107, 'Yahoo Income Statement Items ', '2014-10-15 04:36:46', '2014-10-21 22:16:19', 1, '2013', '425740', 'asc', 0, '697697,102956,', '727260,425740,', '1661'),
	(342, 'This graph shows the items that make up Google’s income statement. \nFrom 2009 – 2013, Google’s revenue Inc. increased year over year.  It was ~ $24 billion in 2009, ~ $29 billion in 2010, ~ $38 billion in 2011, ~$50 billion in 2012, and ~60 billion in 2013.  This is shows strong and steady revenue growth for Google over the 5 –year period. \n\nGoogle’s COGS also increased steadily for 2009 & 2010, but in 2011 it jumped from ~10 billion to ~ $60 billion.  I have not been able to find what this huge', 'combo_new', 107, 'Google Inc. Income Statement Items ', '2014-10-15 04:39:52', '2014-10-21 17:12:14', 1, '2013', '697697', 'asc', 0, '697697,102956,', '727260,425740,', '1438'),
	(343, NULL, 'line', 107, 'Google vs. Yahoo: Return on Equity', '2014-10-15 04:44:33', '2014-10-21 21:26:49', 1, '2013', '576859', 'asc', 0, '', '', '1438'),
	(344, 'This graph shows all the KPIs that make up Google Inc.’s Net Cash Flow: Cash from Operating Activities, Cash from Investing Activities, and Cash from Financing Activities. \n\nGoogle has a positive cash flow from operating activities for 2009 – 2011, and also for 2013.  Cash from operating activities is only listed as negative in 2012 (- $51M).  This means that over the 5 year period, aside from 2012, Google had more cash coming into the company from its core business activities than it had going ', 'combo_new', 107, 'Google Inc. Net Cash Flow ', '2014-10-15 04:51:22', '2014-10-21 18:59:51', 1, '2013', '511523', 'asc', 0, '373198,511523,184943,', '723668,', '1438'),
	(345, 'Liquidity refers to the ability to convert an asset to cash quickly, which is also known as marketability. From an investor’s perspective, it is better to invest in liquid assets than illiquid ones because it is easier to get your money back.  \n\nLiquidity is often calculated using liquidity ratios, such as the Quick Ratio and Current Ratio.  These liquidity ratios measure a firm’s ability to meet maturing short-term obligations.  The higher the liquidity ratio, the better equipped it is to meet ', 'line', 107, 'Google vs. Yahoo Liquidity ', '2014-10-15 04:53:07', '2014-10-21 19:42:11', 1, '2013', '819581', 'asc', 0, '', '', '1438'),
	(346, 'A big difference in a company\'s EPS and diluted EPS can indicate high potential dilution for the company\'s shares, an attribute almost unanimously ostracized by analysts and investors alike. - Investopedia\n\n', 'combo_new', 115, 'Basic EPS vs Diluted EPS', '2014-10-15 07:30:00', '0000-00-00 00:00:00', 0, '2013', '306956', 'asc', 0, '656701,306956,', '393725,450106,', '1471'),
	(347, NULL, 'line', 175, 'Earnings per share for Yahoo and Google', '2014-10-15 07:51:08', '0000-00-00 00:00:00', 1, '2013', '306956', 'asc', 0, '', '', '1661'),
