	(349, NULL, 'combo_new', 115, 'Tax Effect on Acquisition of Synthes', '2014-10-15 07:52:15', '2014-11-05 15:32:10', 0, '2013', '495245', 'asc', 0, '289115,349702,', '365624,495245,852218,', '1471'),
	(350, 'Google is doing a good job', 'line', 96, 'EPS comparation--Yahoo and Google', '2014-10-15 08:35:57', '2014-10-15 10:16:56', 0, '2013', '459923', 'asc', 0, '', '', '1661'),
	(351, NULL, 'column', 149, 'Verizon and AT&T EPS', '2014-10-15 10:22:02', '0000-00-00 00:00:00', 1, '2013', '306956', 'asc', 0, '', '', '1643'),
	(352, 'The basic EPS indicates the profitability of a company. To make investment decision, besides basic EPS, we also need to consider the total amount of investment the company used to generate these profits. Walmart\'s basic EPS is around twice as much as ebay\'s EPS. However, walmart\'s stockholder\'s equity is 2 to 3 times more than Ebay\'s. Therefore, although walmart has a higher EPS, it use more assets to generate it. From this point, Ebay is much better to investment than Walmart.', 'column', 121, 'EPS comparison', '2014-10-15 11:05:24', '0000-00-00 00:00:00', 0, '2013', '760327', 'asc', 0, '', '', '1376'),
	(353, NULL, 'line', 166, 'Amazon, Apple and Google EPS chart', '2014-10-15 11:28:39', '0000-00-00 00:00:00', 0, '2013', '306956', 'asc', 0, '', '', '1281'),
	(354, 'EPS serves as an indicator of a company\'s profitability. Although the EPS of Warlmart is a little bit higher than that of Costco, Walmart\'s stockholder\'s equity is 7 times as much as Costco\'s. Walmart uses much more equity (investment) to general income. As far as I\'m concerned, Costco would be more efficient at using its capital to generate income and would be a better company. ', 'line', 131, 'EPS of Walmart vs. Costco', '2014-10-15 15:22:00', '2014-10-15 15:36:58', 0, '2013', '306956', 'asc', 0, '', '', '1652'),
	(355, 'I notice that the EPS of both companies are similar in 2013, but Apple had more Shareholders\' Equity and Net Income than Google had while the Weighted average number of stocks is similar as well. How could this be? I was thinking maybe because the buyback movement of Apple. And I also find out that the R&D expense of Google is much higher than Apple. Perhaps this is one of the reasons that decrease the Net Income. It seems that manager of Google think more highly of innovation, interesting.', 'line', 89, 'Apple vs. Google Shareholders\' Equity and EPS ', '2014-10-16 06:51:31', '2014-10-16 07:08:28', 1, '2013', '717549', 'asc', 0, '', '', '55'),
	(356, NULL, 'line', 160, 'EPS', '2014-10-16 07:14:39', '0000-00-00 00:00:00', 0, '2013', '306956', 'asc', 0, '', '', '1559'),
	(358, NULL, 'line', 160, 'Stock Price', '2014-10-16 07:20:05', '0000-00-00 00:00:00', 0, '2013', '947700', 'asc', 0, '', '', '1559'),
	(359, NULL, 'line', 160, 'P/E Ratio', '2014-10-16 07:23:47', '0000-00-00 00:00:00', 0, '2013', '833144', 'asc', 0, '', '', '1559'),
	(360, NULL, 'line', 160, 'Net Income', '2014-10-16 07:46:50', '0000-00-00 00:00:00', 0, '2013', '425740', 'asc', 0, '', '', '1559'),
	(361, 'Google\'s EPS fluctuates fiercely  between the third quarter of 2012 and final quarter of 2013. Company\'s market performance, especially in high technology field, I guess, is influenced a lot by media coverage. Because, during this period, Google suffered financial crisis, and  the board election. To some degree, all of these events discourage investments and at the same time force them to accept Google\'s products again. ', 'line', 163, 'The EPS of Google & Cisco', '2014-10-16 12:51:41', '0000-00-00 00:00:00', 0, '2013', '306956', 'asc', 0, '', '', '1438'),
	(363, NULL, 'line', 160, 'Total Asset', '2014-10-17 02:12:01', '0000-00-00 00:00:00', 0, '2013', '346210', 'asc', 0, '', '', '1559'),
	(364, NULL, 'line', 160, 'Common Shares', '2014-10-17 02:25:31', '0000-00-00 00:00:00', 0, '2013', '321048', 'asc', 0, '', '', '1559'),
	(365, NULL, 'line', 156, 'Cash flow of Wholefood, Costco and Wal Mart', '2014-10-17 10:02:49', '2014-10-17 16:41:10', 0, '2013', '184943', 'asc', 0, '', '', '2516'),
	(366, 'Based on management effectiveness data, we can conclude that Ebay demonstrates highly well finical performance then its competitor. In 2011, profit margin of Amazon has been declined substantially while Ebay\'s fluctuate and indicated that Ebay is successful on generating profit. In 2011, ebay must be considered as a good investment, which created a good opportunity to trade their shares at higher market price. ROE Amazon has lower due to its total shareholders equity increase. Overall, Company s', 'combo_new', 153, 'Ability of management effectively use resources to', '2014-10-17 15:28:51', '2014-11-01 13:09:31', 0, NULL, '610839', 'asc', 0, '610839,286474,', '576859,907671,', '1281'),
	(367, 'The bottom line for Amazon abruptly declined from 2010 to 2012.Despite the new Kindle Fire tablet’s selling so well that it was already increasing production. The key moment not only boost it\'s revenue but also ability to stabilize the operating expenses. While Ebay drastically improved and walked away in 2011 with 3.23B with after it has considered all costs. ', 'line', 153, 'Net Income', '2014-10-17 16:12:15', '2014-10-17 16:13:48', 0, '2013', '425740', 'asc', 0, '', '', '1281'),
	(368, 'The financial Environment is changing. Regulations are changing daily and the need for the financial sector to adopt is paramount. But when they aren\'t able to adopt, or they have employees act as though regulations out by the US aren\'t a requirement, they sometimes find themselves with heavy fines levied upon them. \n\nThis card attempts to explain what happens when a bank find themselves paying a legal/regulatory fine. Although the data only shows up to 2Q2014, I will try and fill in the rest. F', 'combo_new', 172, 'More Money, More Problems...Regulation\'s Effects o', '2014-10-19 15:57:18', '0000-00-00 00:00:00', 1, '2013', '119622', 'asc', 0, '306956,656701,486100,', '119622,425740,321048,', '1475'),
	(369, 'Not sure what happened in 2010 - I think this may be some sort of systems error. \nWhen looking at Viacom\'s overall increase in the EPS ratio over the past 3 years, it is important to compare to the C/F from financing.  A large increase in the outflow from financing in 2013 can be explained by the 4,800 treasury share purchase made. This is almost double previous years. This direct decrease in the common shares outstanding can explain the increased eps ratio of  4.93 in 2013. \nThe reasoning behin', 'line', 108, 'EPS and purchase of treasury stock', '2014-10-20 14:33:10', '0000-00-00 00:00:00', 0, '2013', '306956', 'asc', 0, '', '', '14'),
	(370, 'As described above, because of the redeemable controlled interest in the temporary equity section of the balance sheet, the is a diluted eps of 4.83 in 2013.  These results are not anti-dilutive because they decrease the earnings per share if this was to be converted or redeemed in the beginning of the period. The impact of the diluted portion of the ratio seems to be pretty consistent throughout the past few years which indicates a pretty steady makeup of the temporary equity section of the bal', 'combo_new', 108, 'Impact on Diluted EPS', '2014-10-20 14:53:25', '0000-00-00 00:00:00', 0, '2013', '306956', 'asc', 0, '306956,', '656701,', '14'),
	(371, 'By measuring profitability and liquidity through ROA and Debt/equity ratio, management is encouraged to utilize Operating Leases.', 'rank', 170, 'Leases - Appple vs Microsoft', '2014-10-21 10:04:29', '0000-00-00 00:00:00', 1, '2013', '350000', 'asc', 0, '', '', '2178'),
	(372, 'Microsoft\'s R&D expense is much higher than Apple\'s. I also added SG&A expenses and was surprised to see that Apple\'s SG&A expense sky rocketed from 2010 while Microsoft\'s SG&A grew at a much slower rate. ', 'line', 148, 'Apple & Microsoft R&D & SG&A', '2014-10-21 11:58:23', '2014-10-21 12:00:09', 0, '2013', '717549', 'asc', 0, '', '', '2178'),
	(373, 'Google’s Free Cash Flow is positive across the entire 5-year period, ranging from approximately $7B on the low end to approximately $13B on the high end.  \n\nYahoo’s Free Cash Flow, in comparison, is not very high over the 5-year period, and is even turns negative in 2012.  From 2009 – 2013, Yahoo’s Free Cash Flow ranges from approximately $877 M on the high end, to approximately -$787M on the low end.  \n\nFree Cash flow establishes how much cash a company has after paying its bills for ongoing ac', 'line', 107, 'Google Vs. Yahoo: Free Cash Flow ', '2014-10-21 19:13:56', '0000-00-00 00:00:00', 1, '2013', '184943', 'asc', 0, '', '', '1438'),
	(374, NULL, 'rank', 119, 'Compare Apple and Microsoft', '2014-10-21 19:58:30', '0000-00-00 00:00:00', 1, '2013', '668136', 'asc', 0, '', '', '55'),
