	(378, 'From 2009 to 2013 the INVT keeps going up, which means the inventory is selling  faster form year to year, and at the same time net sales are increasing as well. This may show a cause and effect relationship between these two numbers.', 'combo_new', 125, 'INVT and Net sales of Cisco', '2014-10-22 00:33:38', '0000-00-00 00:00:00', 0, '2013', '314019', 'asc', 0, '314019,', '309857,', '1864'),
	(379, 'Form 2009 to 2013 days average inventory conversion is getting shorter which means the inventory is getting salable and preferably. However the average inventory is going up form 2009 to 2011 and remain stable in 2012 and 2013. This  is because Cisco is enlarging its market share and need more products.', 'combo_new', 125, 'Days average inventory conversion and average inve', '2014-10-22 00:43:22', '0000-00-00 00:00:00', 0, '2013', '264247', 'asc', 0, '264247,', '306598,', '1864'),
