	(385, 'This card shows the income and loss from discontinued operations of Wal Mart.', 'line', 117, 'Discontinued operations of Wal Mart', '2014-10-22 09:15:45', '0000-00-00 00:00:00', 1, '2013', '627616', 'asc', 0, '', '', '1652'),
	(386, 'As Apple\'s financing plans work well among the customers, accounts receivable grows massively in recent three years. It also predicts abundant cash flow in the future. Allowance for bad debt is comparatively low, showing Apple\'s confidence in getting back the money', 'combo_new', 118, 'Accounts receivable and bad debt', '2014-10-22 09:42:14', '0000-00-00 00:00:00', 0, '2013', '409500', 'asc', 0, '', '409500,397091,', '55'),
	(387, 'As Apple\'s financing plans work well among the customers, accounts receivable grows massively in recent three years. It also predicts abundant cash flow in the future. Allowance for bad debt is comparatively low, showing Apple\'s confidence in getting back the money', 'combo_new', 118, 'Accounts receivable and bad debt', '2014-10-22 09:42:19', '0000-00-00 00:00:00', 0, '2013', '409500', 'asc', 0, '', '409500,397091,', '55'),
	(388, NULL, 'combo_new', 118, 'Sales and Income of Apple', '2014-10-22 09:44:46', '0000-00-00 00:00:00', 0, '2013', '294130', 'asc', 0, '294130,', '314019,425740,', '55'),
	(389, 'With sales and income growing, Apple also enjoys a relatively stable and gradually growing stock price. But seems Apple never declared any dividend', 'combo_new', 118, 'Apple\'s stock', '2014-10-22 10:02:14', '0000-00-00 00:00:00', 0, '2013', '501308', 'asc', 0, '', '501308,288970,', '55'),
	(390, 'It\'s very interesting to notice that the inventory of Wal Mart (W) is much more fluctuant than that of McDonalds (M). The inventory of W always reach a peak in Q3 which I guess it is because they need to prepare more inventories for sale in Q4. However, M has a rather flat and relative low inventory.', 'area', 117, 'Seasonality on net Inventories between Walmart&Mcd', '2014-10-22 10:11:55', '2014-10-22 10:26:08', 1, '2013', '851732', 'asc', 0, '', '', '1652'),
	(391, 'This is the second part of the comparison between W&M.\nIn the last card, I found that inventory of W always has a peak in Q3 but that of M is rather flat. In these card, I want to further explore the connection between inventory and sales as well as its profit margin seasonally.', 'line', 117, 'seasonality on net Sale&Profit between Walmart&Mcd', '2014-10-22 10:31:07', '2014-10-22 10:39:19', 1, '2013', '314019', 'asc', 0, '', '', '1652'),
	(392, NULL, 'line', 134, 'Revenues for petroleum industry ', '2014-10-22 11:23:37', '0000-00-00 00:00:00', 0, '2013', '697697', 'asc', 0, '', '', '1246'),
	(393, 'The picture shows that Wal-Mart did a lot of operating lease. The number of operating leases, minimum payments due and rent expense are extremely large and increasing year by year since Wal-Mart expands his business. Using operating lease instead of purchasing stores or equipments, the company can reduce its debt, finance their growth prospects and pass on the tax allowances to the lessors and conserve liquidity.', 'combo_new', 146, 'Lease: Wal-Mart Stores Inc', '2014-10-22 12:02:55', '2014-10-22 12:09:45', 0, '2013', '803353', 'asc', 0, '803353,', '560577,', '1652'),
	(395, 'The McD has far lager number than Coca cola in terms of EPS both basic and diluted, it it necessary to dig into NI and Shares outstanding to find out why. ', 'rank', 124, 'EPS of two food companies', '2014-10-22 13:15:28', '0000-00-00 00:00:00', 1, '2013', '306956', 'asc', 0, '', '', '1481'),
	(396, 'I dig into NI and Common stock outstanding to find out why McD\'s EPS is far larger than that of Coca cola. It turns out that although Coca cola has more Net income, McD has far less Common share than Cola. ', 'rank', 124, 'impact factors on EPS (basic)', '2014-10-22 13:22:27', '0000-00-00 00:00:00', 1, '2012', '318387', 'asc', 0, '', '', '1481'),
	(398, 'Aircraft companies are one of the leaders in the field of leasing in the US. However, current lease rules under FASB arguably do not provide a faithful representation of the correct figures.', 'rank', 140, 'Boeing Leases', '2014-10-22 16:10:44', '0000-00-00 00:00:00', 1, '2013', '225980', 'asc', 0, '', '', '1296'),
	(399, 'Coca Cola\'s earnings per share decreased dramatically from 2010, which is consistent with its reduced earnings since 2010. A high EPS figure is an indicator of steady source of income. It may not be a good time to invest on Coca Cola right now, especially when the news report stated that Coca Cola failed its cost cuts and its profits kept falling.', 'line', 120, 'Coca Cola\'s EPS Analysis', '2014-10-22 17:26:48', '0000-00-00 00:00:00', 0, '2013', '306956', 'asc', 0, '', '', '1481'),
	(400, 'The chart shows that IBM has higher EPS than Cisco and Microsoft, which means that IBM is more profitable and company has more profits distributed to its shareholders. The reasons why IBM has relative high EPS are because it constantly acquires other technology companies and keeps purchasing back its common stock outstanding. ', 'line', 144, 'Earnings Per Share', '2014-10-22 18:08:12', '2014-10-22 18:18:23', 0, '2014Q2', '306956', 'asc', 0, '', '', '1864'),
