	(405, 'The basic EPS indicates the profitability of a company. It represents the portion of a company\'s profit that is allocated to one share of stock. As we can see from this chart, Walmart\'s basic EPS is around twice as much as ebay\'s EPS. Therefore, this indicates that Walmart is much more profitable than Ebay.', 'column', 121, 'EPS comparison between Ebay and Walmart', '2014-10-23 16:17:02', '2014-10-23 16:17:57', 0, '2013', '306956', 'asc', 0, '', '', '1376'),
	(406, 'The basic EPS indicates the profitability of a company. It represents represents the portion of a company\'s profit that is allocated to one share of stock. As we can see from this chart, Walmart\'s basic EPS is around twice as much as ebay\'s EPS. Therefore, this indicates that Walmart is much more profitable than Ebay.', 'column', 121, 'EPS comparison between Ebay and Walmart', '2014-10-23 16:17:07', '0000-00-00 00:00:00', 0, '2013', '306956', 'asc', 0, '', '', '1376'),
	(407, 'Stockholders\' equity is important to investors. It shows how many assets the company possesses from investors. Walmart\'s stockholder\'s equity is 2 to 3 times more than Ebay\'s stockholder\'s equity. This demonstrates that walmart gaines more assets from investors than Ebay does.', 'column', 121, 'stockholder\'s equity comparison between Ebay and W', '2014-10-23 16:24:37', '0000-00-00 00:00:00', 0, '2013', '760327', 'asc', 0, '', '', '1376'),
