	(414, 'In 2011, Twenty-First Century Fox implemented a $6B share repurchase program. Then in 2012, the Board approved an increase in $5B. Twenty-First Century Fox\'s EPS decreased due to the repurchase program. ', 'area', 93, 'EPS for 21st Century Fox', '2014-10-24 14:27:02', '2014-10-24 17:44:12', 0, '2013', '306956', 'asc', 0, '', '', '125'),
	(415, 'Shows the capital expenditures and dividends at Wal Mart. Although these data are not current, I am assuming that the CAPEX for this year will be higher due to the enhancement of eCommerce upgrades they are currently undertaking.  ', 'combo_new', 172, 'CAPEX at Wally World', '2014-10-26 10:22:50', '0000-00-00 00:00:00', 0, '2013', '247269', 'asc', 0, '247269,553423,890426,', '384690,586375,447329,', '1652'),
	(416, 'Shows earnings per share at WalMart, as well as the number of shares outstanding and Treasury Shares (Note: according to these data, treasury shares are 0). ', 'combo_new', 172, 'EPS at Wally World', '2014-10-26 10:56:39', '0000-00-00 00:00:00', 0, '2013', '306956', 'asc', 0, '306956,656701,', '318387,321048,', '1652'),
	(417, NULL, 'column', 97, 'inventory analysis', '2014-10-29 15:57:50', '0000-00-00 00:00:00', 0, '2013', '306598', 'asc', 0, '', '', '1460'),
	(418, 'Walmart Inc. increased operating lease year by year, whereas, Costco Co. did not change operating lease much. The reason why more company like to use operating lease is that operating lease has tax incentives and does not result in assets or liabilities being recorded on the lessee’s balance sheet, which can improve lessee’s financial ratios. These points can get proved by the fixed asset turn over. The fixed asset turnover of Walmart Inc. is much less than that of Costco Co.', 'line', 150, 'Lease of supermarts', '2014-10-30 17:08:30', '2014-10-30 17:14:07', 1, '2013', '982558', 'asc', 0, '', '', '1652'),
	(420, NULL, 'line', 136, 'PG and JNJ: dividend yield and dividend payout', '2014-11-02 16:26:53', '0000-00-00 00:00:00', 0, '2013', '586375', 'asc', 0, '', '', '2268'),
