	(424, NULL, 'line', 136, 'PG and JNJ: PE', '2014-11-02 17:09:14', '0000-00-00 00:00:00', 0, '2013', '833144', 'asc', 0, '', '', '2268'),
	(426, 'The chart shows that Walmart made much more operating lease and capital lease than Costco did. The amount of operating leases, capital lease and rent expense are very large and increased year by year. As far as I\'m concerned, Walmart preferred to rent equipment and other tangible assets while Costco did not.', 'column', 131, 'Lease of Walmart vs. Costco', '2014-11-03 15:21:43', '2014-11-03 15:22:41', 0, '2013', '137200', 'asc', 0, '', '', '1849'),
	(427, 'The most interesting part of this chart is that the Interest Coverage Ratio of Walmart is negative. When I checked the EBIT and Interest Expense of Walmart, I found that its Interest Expense was negative. Negative Interest Expense means that Walmart paid less interest on the loans than it received in interest on its investments. From this perspective, Walmart has high ability to pay its debt.', 'line', 131, 'Long-term solvency of Walmart vs. Costco', '2014-11-03 16:12:02', '0000-00-00 00:00:00', 0, '2013', '413922', 'asc', 0, '', '', '1652'),
	(428, 'The EBIT of Walmart is much higher than that of Costco. However, the absolute level of profit may only provide an indication of the size of the business, but it says very little about company performance. In order to evaluate the level of profit, I compare Operating Profit Margin and ROA of these two companies. Compared to Costco, Walmart has a higher Profit Margin and ROA, which indicate that it has better ability to create profit.', 'line', 131, 'Profitability of Walmart vs. Costco', '2014-11-03 16:26:36', '2014-11-03 16:53:38', 0, '2013', '530115', 'asc', 0, '', '', '1849'),
	(429, 'Home Depot leases most of its store spaces. Most of the leases are operating leases. Some locations and equipments are categorized as capital leases. After 2009 the housing bubble burst, Home Depot sold and leased back some of its distribution centers in order to generate inflow of cash from illiquid investment. From 2010 to 2012, the capital leases of Home Depot remained relatively constant. In 2013, the capital leases decreased. When a lease is classified as capital lease instead of operating.', 'line', 160, 'Leases of Home Depot', '2014-11-03 18:48:05', '2014-11-03 20:19:40', 1, '2013', '137200', 'asc', 0, '', '', '1448'),
