	(440, 'Facebook utilizes both capital and operating leases. This card attempts to illustrate the portion of capital leases in debt and lease obligations. Included in these leases are the bulk of Facebook’s PP&E, including computer software, office equipment, data centers, etc.', 'combo_new', 115, 'Facebook - Capital Leases', '2014-11-05 15:10:34', '0000-00-00 00:00:00', 1, '2013', '160150', 'asc', 0, '160150,327873,404368,352402,', '685052,', '7754'),
