	(442, NULL, 'line', 119, 'Capital Lease VS Operating Lease', '2014-11-05 15:26:50', '2014-11-05 16:19:46', 1, '2013', '234695', 'asc', 0, '', '', '55'),
	(443, 'The card shows American Express\'s Operating vs Capital Leases. One thing that stands out is that Operating lease stays fairly steady where as Capital Lease fluctuates. A reason for this might be due to the fact that American Express is venturing into the online banking. It is no longer just a credit card company. I would expect that their capital leases would continue on this fluctuated curve for a while as they are fairly new to the online banking.', 'combo_new', 114, 'American Express Operating vs. Capital Lease', '2014-11-05 16:54:36', '0000-00-00 00:00:00', 0, '2013', '137200', 'asc', 0, '137200,', '234695,', '1291'),
	(444, 'eps', 'line', 44, 'whole foods', '2014-11-06 17:16:06', '2014-11-06 17:16:32', 0, '2013', '656701', 'asc', 0, '', '', '2516'),
	(445, 'In 2011 J&J inventory turnover peaked at 51.25 times, that is much higher than Pfizer and Merck. In 2011-2012 FDA launched investigations against J&J which may have caused its turnover to drop to 7.5 in 2012', 'line', 148, 'J&J vs Pfizer vs Merck Inventory Turnover', '2014-11-07 10:58:43', '2014-11-07 11:21:58', 0, '2013', '309857', 'asc', 0, '', '', '1471'),
	(446, 'J&J\'s net sales correspond with its inventory turnover in 2011. J&J cost of goods increases from 2010, but its revenues dramatically drop in 2012 and at the same time its current ratio is increasing, how could that be?', 'line', 148, 'J&J vs Pfizer vs Merck Revenue', '2014-11-07 11:28:25', '0000-00-00 00:00:00', 0, '2013', '819581', 'asc', 0, '', '', '1471'),
	(447, 'Revenue of all 3 competitors is dropping in 2013, but J&J is the only one who increased R&D spending and its revenues are also falling. ', 'combo_new', 148, 'J&J vs Pfizer vs Merck R&D', '2014-11-07 11:31:48', '0000-00-00 00:00:00', 0, '2013', '717549', 'asc', 0, '717549,', '697697,', '1471'),
	(448, 'Inventory Turnover Ratio = COGS / Average Inventory.   The inventory ratio is an efficiency ratio that shows how effectively inventory is managed by comparing cost of goods sold with average inventory for a period.  According to Nike\'s Inventory Turnover Ratio, its COGS for 2009/2010 should be around $10 billion, and in 2011/2012 should be between $18 billion and & $21 billion. ', 'combo_new', 107, 'Nike Inventory Turnover Ratio', '2014-11-07 12:11:17', '2014-11-07 12:13:27', 1, '2013', '306598', 'asc', 0, '306598,', '309857,', '1530'),
	(449, 'Inventory Turnover Ratio = COGS / Average Inventory.   The inventory ratio is an efficiency ratio that shows how effectively inventory is managed by comparing cost of goods sold with average inventory for a period.  According to Nike\'s Inventory Turnover Ratio, its COGS for 2009/2010 should be around $10 billion, and in 2011/2012 should be between $18 billion and & $21 billion. ', 'combo_new', 107, 'Nike Inventory Turnover Ratio', '2014-11-07 12:11:22', '0000-00-00 00:00:00', 1, '2013', '306598', 'asc', 0, '306598,', '309857,', '1530'),
	(450, 'From looking at the Inventory Turnover Ratio, I calculated that the the COGS in 2009 / 2010 was around $10 billion.  This COGS chart shows that this is true.  However I overestimated the COGS for 2011 / 2012 -- I calculated the COGS to be between $18 billion and $21 billion, when it was actually around $13 - $14 billion.   I\'m not sure why this overestimation happened -- perhaps it was a rounding error.  ', 'column', 107, 'Nike\'s Cost of Goods Sold', '2014-11-07 12:24:16', '0000-00-00 00:00:00', 1, '2013', '102956', 'asc', 0, '', '', '1530'),
	(451, 'From looking at the Inventory Turnover Ratio, I calculated that the the COGS in 2009 / 2010 was around $10 billion.  This COGS chart shows that this is true.  However I overestimated the COGS for 2011 / 2012 -- I calculated the COGS to be between $18 billion and $21 billion, when it was actually around $13 - $14 billion.   I\'m not sure why this overestimation happened -- perhaps it was a rounding error.  ', 'column', 107, 'Nike\'s Cost of Goods Sold', '2014-11-07 12:24:21', '0000-00-00 00:00:00', 1, '2013', '102956', 'asc', 0, '', '', '1530'),
	(452, 'A good rule of thumb is that if inventory turnover ratio multiplied by gross profit margin is 100 percent or higher, then the average inventory is not too high.  As you see from 2009 - 2013, Nike\'s inventory turnover ration multiplied by gross profit margin equals + 200% throughout the years.  Therefore, Nike\'s average inventory is not too high.  ', 'combo_new', 107, 'Nike: Is average inventory too high?', '2014-11-07 12:57:47', '0000-00-00 00:00:00', 1, '2013', '559768', 'asc', 0, '', '309857,559768,', '1530'),
	(453, 'A good rule of thumb is that if inventory turnover ratio multiplied by gross profit margin is 100 percent or higher, then the average inventory is not too high.  As you see from 2009 - 2013, Nike\'s inventory turnover ration multiplied by gross profit margin equals + 200% throughout the years.  Therefore, Nike\'s average inventory is not too high.  ', 'combo_new', 107, 'Nike: Is average inventory too high?', '2014-11-07 12:57:52', '0000-00-00 00:00:00', 1, '2013', '559768', 'asc', 0, '', '309857,559768,', '1530'),
	(454, 'From the chart of Nike\'s inventory adjustment -- in 2012 it looks like certain changes were made in the current period to the value and amount of inventory reported. ', 'line', 107, 'Nike Inventory Adjustment', '2014-11-07 13:38:03', '0000-00-00 00:00:00', 1, '2013', '850520', 'asc', 0, '', '', '1530'),
	(455, 'As we can see from the rank, At&t achieved as the same shareholders\' equity as the last year in first quarter this year and the shareholders\' equity of At&t is much more than Verizon this quarter. That means that the At&t has more market shares than Verizon. Although we cannot find the T-mobile data, it added more subscribers in the first quarter than At&t and Verizon combined. The main reason of the situation above is that T-mobile and At&t have more attractive  promotions and cheaper plans. ', 'rank', 173, 'The comparison of Shareholders\' Equity ', '2014-11-07 17:39:53', '2014-11-07 19:55:32', 1, '2014Q1', '587650', 'asc', 0, '', '', '55'),
	(457, 'As we can see, the retained earnings of Tesla are keeping decreasing under $0 from 2009. Retained earnings are accumulated from the net income year by year if there is some money that is not distributed to shareholders or is not distributed to specific objectives.  Negative number means that Tesla has no money to distribute to its shareholders and is hard to increase the capital stock by using APIC.\n\nThe EPS has the same trend with Retained earnings. The stock price of Tesla was very low before ', 'rank', 173, 'Earnings per share of Tesla', '2014-11-07 17:55:54', '2014-11-07 18:26:29', 1, '2014Q1', '306956', 'asc', 0, '', '', '688'),
