	(469, 'In high-tech sector, most of companies choose not to capital lease, because they  don\'t need too many machines and have less fixed assets compared with manufactory field. From the perspective of corporation maturity, Google has no data in operating lease payments, but when it comes to Cisco, it shows different story, I guess the operating lease is related to Cisco\'s expanse and limited capitalization. Especially after 2009, the trend of operating lease profit of Cisco climbed sharply, it indicat', 'combo_new', 163, 'The Lease of Google V.S Cisco', '2014-11-10 12:11:03', '0000-00-00 00:00:00', 0, '2013', '208770', 'asc', 0, '208770,137200,', '154595,178182,', '1864'),
