	(471, NULL, 'rank', 170, 'Apple vs Microsoft - Income Taxes', '2014-11-10 18:37:24', '2014-11-10 18:41:04', 0, '2013', '425740', 'asc', 0, '', '', '2178'),
	(472, 'This card attempts to show leases for two types of retailers that are, essentially, found everywhere in the United States, McDonalds and Wal-Mart. \n\nThey have different structures, in that McDonalds is is a franchise ownership structure. McDonalds, generally, leases the building and subleases it to the franchise owners. McDonalds adds up to 40% of the leased rate and is responsible for insurance, taxes and maintenance. If the location does well, they then are charged either the stipulated lease ', 'combo_new', 172, 'Wal-Mart and McDonalds on leasing', '2014-11-11 15:56:52', '0000-00-00 00:00:00', 1, '2013', '208770', 'asc', 0, '208770,157611,350000,', '867869,137200,839643,', '1501'),
	(473, 'Beoing experienced a gain from the sale of PP&E from 2009 until 2011. From 2011-2012 Boeing had a loss of $20 Million in PP&E and from 2012 - 2013 once again had a gain from sales of PP&E of $16 Million.', 'combo_new', 148, 'Boeing PP&E', '2014-11-11 19:50:55', '2014-11-11 19:52:33', 0, '2013', '782659', 'asc', 0, '352402,498400,', '782659,', '1296'),
	(474, 'Operating Income after depreciation is much higher than net income. Looks like Boeing accelerated depreciation in 2011 in order to increase net income. After 2011 Boeing stopped using depreciation for tax purposes. ', 'combo_new', 148, 'Boeing Depreciaton & Net Income', '2014-11-11 20:02:30', '0000-00-00 00:00:00', 0, '2013', '654661', 'asc', 0, '830899,425740,', '654661,', '1296'),
	(475, 'According to this graph, it seems like GE management does very good job to optimize their profit. Is there any mistake? Net sales decreased in past years, however they managed to generate income from other sources. Isn\'t is interesting?', 'combo_new', 88, 'GE revenue recognition', '2014-11-11 20:23:13', '2014-11-11 20:29:31', 0, '2013', '468893', 'desc', 0, '468893,314019,', '128802,', '1430'),
