	(482, 'Walmart\'s PP&E far exceeds that of Caterpillar\'s; I should browse through companies and see if there is a better comparable company to Walmart.', 'area', 145, 'PP&E of Wal Mart and Caterpillar', '2014-11-12 11:24:11', '0000-00-00 00:00:00', 1, '2013', '352402', 'asc', 0, '', '', '1652'),
	(483, 'The inventory of Wal Mart more than 4 times higher than Costco and Dollar Tree. Wal Mart\'s large inventory may require high cost in inventory management and warehouse.', 'line', 86, 'Inventory of three retailer corporations', '2014-11-12 12:10:35', '2014-11-17 16:34:18', 0, '2013', '294130', 'asc', 0, '', '', '1652'),
	(485, 'Although Wal Mart has higher inventory, its inventory turnover is also high. That means Walmart has higher sales revenue than other two. Costco has low inventory and high turnover, which means it does not spend a lot on inventory management and does not have many obsolete goods. In 2012, Costco\'s inventory turnover exceeded Wal Mart\'s.', 'line', 86, 'Inventory turnover of three retail corporations', '2014-11-12 12:14:31', '2014-11-17 16:23:41', 0, '2013', '309857', 'asc', 0, '', '', '1652'),
	(486, 'Costco and Dollar Tree\'s inventory is stable over years, but Wal Mart\'s inventory changed a lot. It has a dramatic increase in 2009 and 2010 and a decrease in 2011 and 2012. In 2009 the change in inventory is negative, which means inventory is higher in 2008 than in 2009.', 'line', 86, 'Change in inventories', '2014-11-12 12:16:13', '2014-11-17 16:39:37', 0, '2013', '875810', 'asc', 0, '', '', '1652'),
	(487, 'A look at the capital leases of Amazon.com and Walmart Inc. As expected, being that Amazon has physical locations, they have a greater need for leased retail space and equipment which results in a greater amount of capital leases when compared to Amazon. \n\nThe operation leases of Amazon.com are unavailable on Idacity but Amazon.com\'s 10-K states that Amazon has $595 million in operating lease obligations for 2013. That is about 1/3 of the roughly $1.7 billion in operating leases Walmart had for ', 'line', 110, 'Capital Leases of Amazon.com and Walmart', '2014-11-12 12:18:00', '0000-00-00 00:00:00', 0, '2013', '839643', 'asc', 0, '', '', '1281'),
	(488, 'The net cash from (used in) all of the entity\'s operating activities, including those of discontinued operations, of the reporting entity. Operating activities generally involve producing and delivering goods and providing services. Operating activity cash flows include transactions, adjustments, and changes in value that are not defined as investing or financing activities.\nGeneral Electric Co.\'s cash from operating activities increased from 2011 to 2012 but then slightly declined from 2012 to ', 'line', 109, 'General Electric Co', '2014-11-12 12:29:44', '2014-11-14 11:22:17', 0, '2013', '362147', 'asc', 0, '', '', '1430'),
	(489, 'Free CF as Percentage of NI', 'line', 109, 'Goldman Sachs', '2014-11-12 12:31:12', '0000-00-00 00:00:00', 0, '2013', '362147', 'asc', 0, '', '', '1443'),
	(490, 'Both companies have operating lease due in three years, and it is obvious that McD has a lot more operating lease than Coco cola, because McD may rent most of its franchise stores and machines, while Coco only needs to operate its manufacturing plants. It is interesting that both companies have no capital lease due in three years. Although just from two companies in food industry, it is hard to conclude that corporations are inclined to avoid classifying lease as capital, the data in some sense ', 'rank', 124, 'Operating and Capital Lease of two food companies ', '2014-11-12 14:08:20', '0000-00-00 00:00:00', 1, '2013', '839643', 'asc', 0, '', '', '1481'),
	(491, 'In 2013, operating leases recorded decreased and according to the notes table for minimum lease payments operating minimum payments will continue to go down through 2018. This will not be made up from Capital Leases. After calculating the PV of the asset add back that an analyst would consider here, (https://docs.google.com/spreadsheets/d/176IV9Lz79iO-tJhVjf12ofXJuYkCr3JoShn12m9dj4k/edit?usp=sharing), I believe there is still a substantial amount of long term debt that should be added back (abou', 'combo_new', 108, 'Home Depot Operating Lease Addback (Capital Vs. Op', '2014-11-12 14:32:30', '0000-00-00 00:00:00', 0, '2013', '137200', 'asc', 0, '137200,', '178182,', '1448'),
	(492, 'homework3', 'combo', 283, 'apple vs google', '2014-11-12 17:40:34', '0000-00-00 00:00:00', 0, '2013', '819581', 'asc', 0, '', '', '55'),
	(493, 'The charts show that Nike has a high rental expense because it need to leases retail store space, warehouse facilities, and office space for operation. From 2009 to 2011, Nike mainly focused on operating lease, and since 2011 capital leases started to increase. However, both capital lease and operating lease decreased sharply in 2012.', 'line', 144, 'Nike\'s operating lease & capital lease', '2014-11-12 17:48:44', '2014-11-12 17:52:41', 0, '2013', '404368', 'asc', 0, '', '', '1530'),
	(494, 'Under capital leases, operating cash flows will be higher because a company does not have an operating lease expense. Free cash flows is shown to increase as minimum capital lease payments increases.', 'combo_new', 93, 'Apple and Capital Leases', '2014-11-12 17:58:42', '0000-00-00 00:00:00', 0, '2010', '178182', 'asc', 0, '909904,178182,', '184943,', '55'),
