	(499, 'It is interesting to find that Google and Cisco have adopted two different avoided tax policies. Under the sustainable business mode, Google, as the head in high-technology sector, tends to use deferred tax liabilities policy. In general, firms with NDTL are more likely to issue debt and tend to have higher leverage after a refinancing. On the other hand, Cisco, as a growing middle-sized company, the NDTA helps alleviate the problem of identifying individual non-debt tax shields because it bundl', 'combo_new', 163, 'The income tax of Google & Cisco', '2014-11-13 16:06:33', '0000-00-00 00:00:00', 0, '2013', '104722', 'asc', 0, '104722,154595,234895,259039,', '275623,771537,805594,', '1438'),
	(500, NULL, 'combo_new', 150, 'income tax', '2014-11-13 18:48:12', '0000-00-00 00:00:00', 0, '2013', '104722', 'asc', 0, '104722,805594,', '264356,247602,', '1849'),
	(501, NULL, 'line', 150, 'deferred tax asset', '2014-11-13 18:48:57', '2014-11-13 18:49:21', 0, '2013', '805594', 'desc', 0, '', '', '1652'),
