	(505, 'As we can see, Amazon\'s operating leases maintain zero these years while Ebay\'s operating leases continue going up! Basically operating leases are applied to situations where the payments by the lessee don\'t cover enough of the value of the assets being leased.The major consequence from using operating leases instead of capital leases is that Ebay doesn\'t recognize the assets and it doesn\'t recognize the concomitant liabilities. Instead of recognizing the related capex used to buy or build the a', 'line', 91, 'comparison between Amazon\'s and Ebay\'s  operating ', '2014-11-14 15:36:01', '0000-00-00 00:00:00', 0, '2013', '157611', 'asc', 0, '', '', '1376'),
	(506, 'From the graph, we can see that PP&E of Walt Disney Co. is increasing steadily.', 'combo_new', 92, 'Walt Disney Co.-PP&E Gross & Net', '2014-11-15 09:12:11', '2014-11-15 09:36:35', 0, '2013', '498400', 'asc', 0, '498400,352402,', '104296,', '1364'),
	(507, 'In 2012Q4, asset impairment charges are negative.', 'combo_new', 92, 'Walt Disney Co.--Impairment', '2014-11-15 09:29:16', '2014-11-15 09:29:29', 0, '2010', '633419', 'asc', 0, '633419,', '837356,741847,', '1364'),
	(508, 'All data of depreciation are very stable while the operating income after depreciation are slowly increasing.', 'combo_new', 92, 'Walt Disney Co.--OI & Depreciation', '2014-11-15 09:38:49', '2014-11-15 09:43:28', 0, '2013', '104296', 'asc', 0, '104296,777100,741847,', '830899,', '1364'),
	(509, 'From the graph, you can easily see that both two companies had an increase in average inventory in the past 5 years. And Walmart had a larger inventory than Amazon. The larger average inventory may because Walmart has a  larger enterprise scale and it combines physical stores and internet commerce.', 'column', 162, 'inventory comparison of Amazon and Walmart', '2014-11-16 23:04:59', '0000-00-00 00:00:00', 0, '2013', '306598', 'asc', 0, '', '', '1281'),
	(510, 'From the graph, we can see that Amazon had increase largely in its cost of goods sold, while Walmart had a more stable cost of goods sold. But Walmart\'s amount are much larger than amazon. That may also caused by its larger enterprise scale.', 'column', 162, 'inventory comparison of Amazon and Walmart(2)', '2014-11-16 23:11:59', '0000-00-00 00:00:00', 0, '2013', '102956', 'asc', 0, '', '', '1281'),
	(511, 'From the graph, we can see that Amazon had increase largely in its cost of goods sold, while Walmart had a more stable cost of goods sold. But Walmart\'s amount are much larger than amazon. That may also caused by its larger enterprise scale.', 'column', 162, 'inventory comparison of Amazon and Walmart(2)', '2014-11-16 23:12:07', '0000-00-00 00:00:00', 0, '2013', '102956', 'asc', 0, '', '', '1281'),
	(512, 'From the graph, both the two companies had an increase in inventory turnover. Although Walmart had a larger amount in inventory turnover, amazon had a more obvious increase.\nThese means that the liquidity of the inventory had been both improved. And it would took fewer days for Walmart to transfer its inventories into cash , account receivables or other revenues. Amazon is trying to make a better control of its inventory.', 'column', 162, 'inventory comparison of Amazon and Walmart(3)', '2014-11-16 23:32:13', '2014-11-16 23:32:42', 0, '2013', '309857', 'asc', 0, '', '', '1281'),
	(513, 'From the graph, both the two companies had an increase in inventory turnover. Although Walmart had a larger amount in inventory turnover, amazon had a more obvious increase.\nThese means that the liquidity of the inventory had been both improved. And it would took fewer days for Walmart to transfer its inventories into cash , account receivables or other revenues. Amazon is trying to make a better control of its inventory.', 'column', 162, 'inventory comparison of Amazon and Walmart', '2014-11-16 23:32:20', '0000-00-00 00:00:00', 0, '2013', '309857', 'asc', 0, '', '', '1281'),
	(514, 'From the graph, we can see that Amazon had largely decrease the days it took to converse its inventory.And the days it took to converse inventory is just a little larger than Walmart in 2013.That means that Amazon had improved a lot in its inventory management.Thus the liquidity of its inventory,its ability to pay debt and its earning capacity are also to some extent improved.Walmart also decreases its inventory conversion days.But it did not decrease too much.', 'column', 162, 'inventory comparison of Amazon and Walmart(4)', '2014-11-17 00:09:25', '0000-00-00 00:00:00', 0, '2013', '264247', 'asc', 0, '', '', '1281'),
	(515, 'From the graph, we can see that both two companies had an increase in its revenue. Although the revenue of Walmart is still much larger than Amazon, the growth rate of Amazon in revenue is larger than Walmart. And one reason  that caused this larger growth rate in revenue may be the improved inventory management. ', 'line', 162, 'inventory comparison of Amazon and Walmart(5)', '2014-11-17 00:26:58', '0000-00-00 00:00:00', 0, '2013', '697697', 'asc', 0, '', '', '1281'),
	(516, 'From the graph, we can see that both two companies had an increase in its revenue. Although the revenue of Walmart is still much larger than Amazon, the growth rate of Amazon in revenue is larger than Walmart. And one reason  that caused this larger growth rate in revenue may be the improved inventory management. ', 'line', 162, 'inventory comparison of Amazon and Walmart(5)', '2014-11-17 00:27:05', '0000-00-00 00:00:00', 0, '2013', '697697', 'asc', 0, '', '', '1281'),
	(517, 'There is a cultural (management) idea that if management takes care of its employees and offer pension plans, and stock dividends, etc., that employees will theoretically perform better and as a result the firm will increase its sales and perform better throughout.\n\nIn this card I compare Apple and Microsoft and prove that this is not always the case. Microsoft has been paying higher pensions than Apple (even with apple having large amounts of cash), however Apple\'s sales have grown relatively f', 'line', 170, 'Pensions', '2014-11-17 15:09:07', '0000-00-00 00:00:00', 0, '2013', '314019', 'asc', 0, '', '', '55'),
	(518, 'The greater the pension plant (liability), the bigger effect it will have  on the liquidity ratios of the company. Theoretically, if pensions increase, holding everything else constant, liquidity ratios should decrease. Keep in mind that liquidity ratios can decrease if other liabilities are acquired or assets decrease - regardless of pensions, however, the higher the pensions (liability) the more probable liquidity rations will decrease.\n\nThis being said, comparing Apple and Microsoft, Microsof', 'combo_new', 170, 'Liquidity Ratios vs Pensions', '2014-11-17 15:46:03', '0000-00-00 00:00:00', 0, '2013', '819581', 'asc', 0, '819581,538668,', '239436,476682,', '2178'),
	(519, 'Just a comparison of Market Value of both companies. Following that Microsoft has had higher pensions and better liquidity ratios, we can assume that market value of equity is moved by sales movements of the company. Market value for Apple has increased more rapidly (look at steepness of curve), even though Microsoft has been a better overall company (paying higher pension amounts) and have had better liquidity ratios.', 'line', 170, 'Microsoft vs Apple Market Value', '2014-11-17 16:03:24', '0000-00-00 00:00:00', 0, '2013', '179686', 'asc', 0, '', '', '2178'),
	(520, 'What is driving Amazon\'s prime air initiative? Why is Amazon testing and investing into drone technology? I think it is because Amazon\'s operational expenses, specifically SHIPPING COSTS are increasing year over year as is seen in this chart. ', 'combo_new', 148, 'Amazon Operating Expenses', '2014-11-17 16:21:08', '0000-00-00 00:00:00', 0, '2013', '717549', 'asc', 0, '717549,', '771081,', '1281'),
	(521, 'The Gross PP&E of Sandisk keeps growing from 2009 to 2013, but when Gross PP&E increased in 2010, the Net PP&E decreased. The change in Net PP&E is much smaller than the change in Gross PP&E.', 'combo_new', 86, 'PP&E of Sandisk Corp', '2014-11-17 22:02:15', '0000-00-00 00:00:00', 0, '2013', '352402', 'asc', 0, '352402,498400,', '', '2380'),
	(522, 'The accumulated depreciation grow steadily over five years. The depreciation expense had a dramatic decrease in 2011. Maybe there is a change in the depreciation method.', 'combo_new', 86, 'Depreciation of Sandisk Corp.', '2014-11-17 22:28:35', '0000-00-00 00:00:00', 0, '2013', '741847', 'asc', 0, '104296,', '741847,', '2380'),
