	(532, NULL, 'column', 166, 'Amazon vs. Ebay Income taxes', '2014-11-18 20:32:58', '0000-00-00 00:00:00', 0, '2013', '852218', 'asc', 0, '', '', '1281'),
	(533, 'This card compares the PP&E of Microsoft vs. Home Depot.  As expected, Home Depot\'s PP&E is significantly higher than Microsoft\'s PP&E across the 5 years.  Home Depot has many physical stores that sell inventory of all different sizes (fixtures, furniture, etc), therefore it requires high amounts of PP&E to conduct its normal business operations. Microsoft, on the other hand, as a technology company does not require as much PP&E as Home Depot. \n. ', 'column', 107, 'Microsoft vs. Home Depot - PP&E', '2014-11-18 21:08:08', '2014-11-18 21:20:41', 1, '2013', '352402', 'asc', 0, '', '', '2178'),
	(534, 'Chart compares Home Depot\'s Gross & Net PP&E.  Gross PP&E is the amount that Home Depot paid for any property,  buildings or other assets that it owns.  It then needs to depreciate these assets each year.  What is left is the Net PP&E value, which is the cost for equipment less its accumulated depreciation.  You see in each year that Home Depot\'s Gross PP&E - Accumulated Depreciation = Net PP&E', 'combo_new', 107, 'Home Depot - Net vs. Gross PP&E', '2014-11-18 21:44:34', '2014-11-18 22:22:40', 1, '2013', '352402', 'asc', 0, '352402,498400,104296,', '', '1448'),
	(535, 'Card shows Home Depot\'s PP&E in relation to its Non-current assets.  You can see from the chart that PP&E makes up a majority of Home Depots non-current assets. ', 'combo_new', 107, 'Home Depot- PP&E / Non-Current Assets ', '2014-11-18 23:22:54', '0000-00-00 00:00:00', 1, '2013', '352402', 'asc', 0, '277049,352402,', '', '1448'),
	(536, 'Card shows Microsoft\'s PP&E, Noncurrent Assets, & Intangible Assets.  Across the 5 years, Microsoft\'s intangible assets are greater than its property plant and equipment. This is the trend I would have suspected being that Microsoft is a technology company; it requires less PP&E than other industries, and it also has a lot of proprietary technology, which is considered Goodwill (i.e. an intangible asset). ', 'combo_new', 107, 'Microsoft - PP&E / Non-Current Assets / Intangible', '2014-11-18 23:32:33', '2014-11-18 23:40:14', 1, '2013', '352402', 'asc', 0, '352402,277049,386167,', '', '2178'),
