	(541, 'amount of PPE grows up form 2009 to 2013, and the percentage of PPE to total assets goes up as well. This may because many new Disney Land is opening and shows a increase in its business.', 'combo_new', 125, 'PPE in walt Disney Company', '2014-11-19 10:46:31', '0000-00-00 00:00:00', 0, '2013', '352402', 'asc', 0, '352402,', '346210,', '1364'),
	(542, 'Form 2009 to 2013 Disney\'s net income went up quickly, it may because it opened more theme park to attract people. at the same time its PPE went up, which may support the former guess. Form the debt to equity we can tell, the rate is stable, but since the equity went up, the debt should go up as well.', 'combo_new', 125, 'PPE and debt in walt Disney Comapny', '2014-11-19 11:00:56', '0000-00-00 00:00:00', 0, '2013', '119622', 'asc', 0, '119622,', '352402,710420,', '1364'),
	(543, 'The total value of GE\'s PP&E is fairly low compared to total assets.  Furthermore, the value of GE\'s PP&E has remained relatively constant from 2009 to 2013 while the value of its total assets has declined in that same time period. ', 'combo_new', 98, 'Coca Cola PP&E', '2014-11-19 11:01:15', '2014-11-19 12:03:39', 0, '2013', '498400', 'asc', 0, '498400,346210,', '', '1481'),
	(544, 'From 2009 to 2013 Walt Disney obtains an normal rate of depreciation, and because the company was buying PPE quicker than selling or deprecating, the net PPE amount went up. and the net income went up.', 'combo_new', 125, 'PPE and its depreciation in walt Disney Comapny', '2014-11-19 11:09:36', '0000-00-00 00:00:00', 0, '2013', '104296', 'asc', 0, '104296,352402,', '459844,', '1364'),
