	(548, NULL, 'line', 119, 'Analysis of Income Tax in Microsoft', '2014-11-19 15:15:40', '2014-11-19 16:16:08', 1, '2013', '805594', 'asc', 0, '', '', '55'),
	(549, 'Looking at free cash flow of AT&T and Verizon.  The amount of cash on hand is very important because of the "Pension Reform Act of 1974" which attempts to safeguard employees\' pension rights by mandating pension plan requirements, including minimum funding. ', 'line', 111, 'Cash flow', '2014-11-19 15:41:35', '0000-00-00 00:00:00', 0, '2013', '184943', 'asc', 0, '', '', '1632'),
	(550, 'From SEC EDGAR AT&T notes Type: 10-Q/A: "Our combined net pension and postretirement cost decreased $163 in the third quarter and $489 for the first nine months of 2014. The decrease reflects higher amortization of prior service credits due to plan changes, including changes to future costs for continued retiree healthcare coverage. The decrease also reflects increasing corporate bond rates, which contributed to lower service cost and higher interest costs."\n\nFrom SEC EDGAR Verizon notes Type: 1', 'column', 111, 'AT&T vs Verizon', '2014-11-19 15:57:50', '2014-11-19 16:23:23', 0, '2013', '976118', 'asc', 0, '', '', '1632'),
	(551, 'From the FASB Accounting Standards Codification: 10/14/14: FASB issues Proposed Accounting Standards Update 2014-260—Compensation—Retirement Benefits. https://asc.fasb.org/imageRoot/03/56988603.pdf\n\nIn brief, three main Amendments to Subtopic 715-20, 715-30, and 715-60.\n\nSubtopic 715-20 is related to "Disclosures" and specifically for us public entities. Amounts related to the employer’s results of operations shall be\ndisclosed for each period for which a statement of income is presented. Amount', 'combo_new', 111, 'Net Profit Margin and importance of disclosure', '2014-11-19 16:08:39', '0000-00-00 00:00:00', 0, '2013', '907671', 'asc', 0, '907671,000000,286474,', '576859,610839,', '1632'),
	(552, 'From the FASB Accounting Standards Codification: 10/14/14: FASB issues Proposed Accounting Standards Update 2014-260—Compensation—Retirement Benefits. https://asc.fasb.org/imageRoot/03/56988603.pdf\n\nIn brief, three main Amendments to Subtopic 715-20, 715-30, and 715-60.\n\nSubtopic 715-20 is related to "Disclosures" and specifically for us public entities. Amounts related to the employer’s results of operations shall be\ndisclosed for each period for which a statement of income is presented. Amount', 'combo_new', 111, 'Net Profit Margin and importance of disclosure', '2014-11-19 16:10:04', '0000-00-00 00:00:00', 0, '2013', '907671', 'asc', 0, '907671,000000,286474,', '576859,610839,', '1632'),
	(553, NULL, 'line', 119, 'current income tax expense', '2014-11-19 17:00:22', '0000-00-00 00:00:00', 0, '2013', '259039', 'asc', 0, '', '', '2178'),
	(554, NULL, 'line', 119, 'DTA and DTL', '2014-11-19 17:02:00', '2014-11-19 17:03:11', 0, '2013', '805594', 'asc', 0, '', '', '2178'),
	(556, NULL, 'line', 119, 'operating income', '2014-11-19 17:10:00', '0000-00-00 00:00:00', 0, '2013', '459844', 'asc', 0, '', '', '2178'),
	(558, NULL, 'line', 119, 'DTA, DTL  in Apple', '2014-11-19 17:12:38', '0000-00-00 00:00:00', 0, '2013', '275623', 'asc', 0, '', '', '55'),
	(559, 'tax story?', 'column', 149, 'star mc', '2014-11-19 18:11:59', '0000-00-00 00:00:00', 0, '2013', '891878', 'asc', 0, '', '', '1501'),
	(560, 'A retirement plan is a financial arrangement designed to replace employment income upon retirement. These plans may be set up by employers, insurance companies, trade unions, the government, or other institutions. Congress has expressed a desire to encourage responsible retirement planning by granting favorable tax treatment to a wide variety of plans.  \n\n Defined contribution plans have become more widespread over recent years and are now the dominant form of plan in the private sector. The num', 'combo_new', 163, 'The Pensions and Postretirement Benefits of Google', '2014-11-19 21:56:02', '0000-00-00 00:00:00', 0, '2013', '239436', 'asc', 0, '239436,301721,121228,', '321583,326829,286474,782659,', '1864'),
	(561, 'Card shows Google and Cisco\'s Non-current Assets, & Intangible Assets. Across the 5 years, Google\'s intangible assets are greater than its property plant and equipment. This is the trend I would have suspected being that Google is a technology company; it requires less PP&E than other industries, and it also has a lot of proprietary technology, which is considered Goodwill (i.e. an intangible asset).', 'line', 163, 'Google & Cisco / Non-current Assets / Intangible', '2014-11-19 22:13:44', '0000-00-00 00:00:00', 0, '2013', '277049', 'asc', 0, '', '', '1438'),
	(562, NULL, 'column', 163, 'Liquidty Analysis of Google and Cisco', '2014-11-19 22:16:44', '0000-00-00 00:00:00', 0, '2013', '145997', 'asc', 0, '', '', '1438'),
	(563, NULL, 'rank', 229, 'Profitablitiy Indicator Ratios', '2014-11-20 16:54:15', '2014-11-20 21:30:53', 0, '2013', '907671', 'asc', 0, '', '', '1864'),
	(564, NULL, 'rank', 229, 'Liquidity Measurement Ratios', '2014-11-20 17:00:21', '2014-11-20 21:31:34', 0, '2013', '819581', 'asc', 0, '', '', '1864'),
	(565, NULL, 'line', 229, 'Debt Ratios', '2014-11-20 17:02:24', '2014-11-20 21:55:45', 0, '2013', '413922', 'asc', 0, '', '', '1864'),
	(566, NULL, 'combo', 229, 'Investment Valuation Ratios', '2014-11-20 17:04:24', '2014-11-20 21:57:40', 0, '2013', '365595', 'asc', 0, '', '', '1864'),
	(567, NULL, 'column', 229, 'Predict Bankruptcy', '2014-11-20 17:07:14', '2014-11-20 21:56:31', 0, '2013', '919275', 'asc', 0, '', '', '1864'),
	(568, NULL, 'combo_new', 101, 'A&E Rev,OI,NI', '2014-11-21 09:54:40', '0000-00-00 00:00:00', 0, '2013', '697697', 'asc', 0, '697697,', '425740,459844,', '1376'),
	(569, NULL, 'rank', 101, 'A&E Gross Profit', '2014-11-21 10:14:55', '2014-11-21 10:51:53', 0, '2013', '314019', 'asc', 0, '', '', '1281'),
	(570, NULL, 'rank', 101, 'A&E Liquidity', '2014-11-21 10:17:41', '0000-00-00 00:00:00', 0, '2013', '819581', 'asc', 0, '', '', '1281'),
	(571, NULL, 'rank', 101, 'A&E Inventory', '2014-11-21 10:48:02', '0000-00-00 00:00:00', 0, '2013', '294130', 'asc', 0, '', '', '1281'),
	(572, NULL, 'rank', 101, 'A&E Op Cycle', '2014-11-21 10:57:40', '0000-00-00 00:00:00', 0, '2013', '180197', 'asc', 0, '', '', '1281'),
	(573, NULL, 'rank', 101, 'A&E ROA', '2014-11-21 11:01:20', '0000-00-00 00:00:00', 0, '2013', '286474', 'asc', 0, '', '', '1281'),
	(574, 'The spike in SG&A for apple in 2010 was caused by Advertising, Marketing and Retail expansion. We can see that for Apple in 2009 Advertising expense was $501 million and by 2013 reached $1 billion in ads spent! Also I added cash to this card and looks like Apple has A LOT more cash on hand versus Microsoft and this paints a completely different picture of financial health of both companies.', 'column', 148, 'Apple & Microsoft Advertising & Cash', '2014-11-21 14:57:57', '2014-11-21 14:59:57', 0, '2013', '836554', 'asc', 0, '', '', '55'),
	(575, NULL, 'rank', 215, 'Cash flow', '2014-11-21 18:38:38', '2014-11-21 18:39:49', 0, '2013', '713585', 'asc', 0, '', '', '1291'),
	(576, NULL, 'rank', 215, 'Liquidity', '2014-11-21 18:44:52', '0000-00-00 00:00:00', 0, '2013', NULL, 'desc', 0, '', '', '1475'),
	(577, 'This card describes the deferred tax scenario for both J&J and P&G. It is particularly interesting to me how the valuation allowance can alter both the liabilities and assets. For J&J, there is a 1.5 Billion increase in tax assets in relation to a Belgium subsidiary. This is net of the valuation allowance. I am curious to understand exactly what the breakdown of that liability is. Similarly, for P&G, it is clear that DTA is beginning to decrease. It is also noted that 1.5 billion in DTA will exp', 'column', 108, 'P&G vs. J&J Income Taxes', '2014-11-24 16:35:06', '0000-00-00 00:00:00', 0, '2013', '891878', 'asc', 0, '', '', '1471');
