INSERT INTO `kpi` (`term_id`, `name`, `description`, `decision_category`, `financial_category`) VALUES
	(101149, 'Federal Contract Amount for 7000: Dept Of  Homeland Security', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 7000: Dept Of  Homeland Security', 'Federal Contract Earnings:Major Agency', 'Income Statement:Federal Contract Earnings'),
	(102956, 'Cost of Goods Sold', 'The aggregate costs related to goods produced and sold and services rendered by an entity during the reporting period. This excludes costs incurred during the reporting period related to financial services rendered and other revenue generating activities.', 'Operating Costs:COGS', 'Income Statement:Operating Expense'),
	(103718, 'Insider Stock Sale Shares', 'The number of shares sold by employees, executives, directors and other persons considered to be insiders of the company.', 'Insider Trading Transactions:Insider Stock Sales', 'Stockholders Equity:Related Party Transactions'),
	(104296, 'Accumulated Depreciation, Depletion and Amortization', 'Amount of accumulated depreciation, depletion and amortization for physical assets used in the normal conduct of business to produce goods and services.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(104722, 'Current Income Tax Expense (Benefit), State and Local', 'Amount of current state and local tax expense (benefit) pertaining to income (loss) from continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(106890, 'Preferred Stock Conversions, Inducements', 'The excess of (1) the fair value of all securities and other consideration transferred in transactions by the registrant to the holders of the convertible preferred stock over (2) the fair value of securities issuable pursuant to the original conversion terms, during the accounting period.', 'Earnings:Valuation', 'Income Statement:EPS'),
	(109165, 'Federal Contract Amount for 4900: National Science Foundation', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 4900: National Science Foundation', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(110664, 'Federal Contract Amount for 4500: Equal Employment Opportunity Commission', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 4500: Equal Employment Opportunity Commission', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(114590, 'Intangible Assets, Finite-Lived, Net', 'Amount after amortization of assets, excluding financial assets and goodwill, lacking physical substance with a finite life.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(117111, 'Federal Contract Amount for 955F: Consumer Financial Protection Bureau', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 955F: Consumer Financial Protection Bureau', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(119622, 'Net Income (Loss) Available to Common Stockholders, Basic', 'Net income after adjustments for dividends on preferred stock (declared in the period) and/or cumulative preferred stock (accumulated for the period).', 'Owners\' Investment:Earnings', 'Income Statement:EPS'),
	(121228, 'Defined Benefit Plan, Net Periodic Benefit Cost', 'The total amount of net periodic benefit cost for defined benefit plans for the period. Periodic benefit costs include the following components_ service cost, interest cost, expected return on plan assets, gain (loss), prior service cost or credit, transition asset or obligation, and gain (loss) due to settlements or curtailments.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(128802, 'Income Before Extraordinary Items Available for Common', 'Income from continuing operations net of preferred stock dividends (and other adjustments).', 'Owners\' Investment:Earnings', 'Income Statement:EPS'),
	(132866, 'Total Liabilities', 'Liabilities are probable future sacrifices of economic benefits arising from present obligations of an entity to transfer assets or provide services to other entities in the future.', 'Firm Obligations:Solvency', 'Balance Sheet:Liabilities'),
	(133018, 'Preferred Stock, Including Additional Paid in Capital', 'Aggregate issuance value of nonredeemable preferred stock (or preferred stock redeemable solely at the option of the issuer) issued and outstanding.', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(134438, 'Contractual Obligation, Due in Second and Third Year', 'Amount of contractual obligation maturing in the second and third fiscal years following the latest fiscal year.', 'Firm Obligations:Solvency', 'Balance Sheet:Liabilities'),
	(137200, 'Operating Leases, Minimum Payments Due in Three Years', 'Amount of required minimum rental payments maturing in the third fiscal year following the latest fiscal year for operating leases having an initial or remaining non-cancelable letter-terms in excess of one year.', 'Operating Costs:Expected Future Cash Flow', 'Income Statement:Operating Expense'),
	(137892, 'Other Short Term Investments', 'Other investments not otherwise specified in the taxonomy that will be realized in a short period of time, usually less than one year or the normal operating cycle, whichever is longer.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(139606, 'Marketable Securities, Current', 'Amount of investments in debt and equity securities, including, but not limited to, held-to-maturity, trading and available-for-sale expected to be converted to cash, sold or exchanged within one year or the normal operating cycle, if longer.', 'Firm Resources:Liquidity', 'Balance Sheet:Current Assets'),
	(140498, 'Stockholders\' Equity, Period Increase (Decrease)', 'The increase (decrease) in stockholders\' equity during the period.', 'Owners\' Investment:Valuation', 'Statement of Changes in Stockholders\' Equity:'),
	(141138, 'Interest Expense, Other Long Term Debt', 'Interest expense incurred on all other long-term debt, which may include (1) interest on long-term notes, and (2) amortization of issuance costs not otherwise separately disclosed.', 'Financing Activities:Cost of financing', 'Income Statement:Interest Expense'),
	(144605, 'State and Local Income Tax Expense (Benefit), Continuing Operations', 'Amount of state and local current and deferred income tax expense (benefit) attributable to continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(145997, 'Cash and Cash Equivalents, Including Discontinued Operations', 'For the entity and the disposal group, cash includes currency on hand as well as demand deposits with banks or financial institutions. It also includes other kinds of accounts that have the general characteristics of demand deposits in that the Entity may deposit additional funds at any time and also effectively may withdraw funds at any time without prior notice or penalty. Cash equivalents, excluding items classified as marketable securities, include short-term, highly liquid investments that ', 'Firm Resources:Liquidity', 'Balance Sheet:Current Assets'),
	(147877, 'Assets, Fair Value, Level 2', 'Fair value portion of probable future economic benefits obtained or controlled by an entity as a result of past transactions or events.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(153725, 'Federal Contract Amount for 1145: Peace Corps', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 1145: Peace Corps', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(154595, 'Operating Profit After Tax', 'Operating income or loss, net of tax.', 'Profitability:Earnings', 'Income Statement:Income'),
	(157490, 'Payments to Purchase Common Stock', 'The cash outflow to reacquire common stock during the period.', 'Owners\' Investment:Cash flow', 'Statement of Cash Flows:Financing Activities'),
	(157611, 'Capital Leases, Minimum Payments, Interest Included in Payments', 'Amount necessary to reduce net minimum lease payments to present value for capital leases.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Liabilities'),
	(160150, 'Capital Lease Obligations, Noncurrent', 'Amount equal to the present value (the principal) at the beginning of the lease term of minimum lease payments during the lease term (excluding that portion of the payments representing executory costs such as insurance, maintenance, and taxes to be paid by the lessor, together with any profit thereon) net of payments or other amounts applied to the principal, through the balance sheet date and due to be paid more than one year (or one operating cycle, if longer) after the balance sheet date.', 'Firm Obligations:Leverage', 'Balance Sheet:Liabilities'),
	(164813, 'Cash from Investing Activities Continuing Operations', 'Amount of cash inflow (outflow) of investing activities, excluding discontinued operations. Investing activity cash flows include making and collecting loans and acquiring and disposing of debt or equity instruments and property, plant, and equipment and other productive assets.', 'Investing Activities:Cash flow', 'Statement of Cash Flows:Investing activities'),
	(165252, 'Interest Income (Expense), Net', 'The net amount of operating interest income (expense).', 'Financing Activities:Cost of financing', 'Income Statement:Interest Expense'),
	(169591, 'Federal Contract Amount for 6900: Dept Of  Transportation', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 6900: Dept Of  Transportation', 'Federal Contract Earnings:Major Agency', 'Income Statement:Federal Contract Earnings'),
	(172293, 'Free Cash Flow Over Cash', 'Free Cash Flow / Cash from Operating Activities', 'Investing Activities:Cash flow', 'Ratio:Cash Flow Performance'),
	(173213, 'Federal Contract Amount for 6800: Environmental Protection Agency', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 6800: Environmental Protection Agency', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(175911, 'Stockholders\' Equity Attributable to Noncontrolling Interest', 'Total of all stockholders\' equity (deficit) items, net of receivables from officers, directors, owners, and affiliates of the entity which is directly or indirectly attributable to that ownership interest in subsidiary equity which is not attributable to the parent (that is, noncontrolling interest, previously referred to as minority interest).', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(178182, 'Capital Leases, Minimum Payments Due', 'Amount of minimum lease payments for capital leases.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Current Liabilities'),
	(179686, 'Market Value of Equity', 'Value of the common equity of the company.', 'Owners\' Investment:Valuation', 'Economic Value:Market Cap'),
	(180197, 'Days Accounts Receivable Conversion', '365 / (Net Sales / Average Accounts Receivable)', 'Firm Resources:Liquidity', 'Ratio:Cash Flow Performance'),
	(182476, 'Deferred Revenue, Non Current', 'The noncurrent portion of deferred revenue amount as of balance sheet date. Deferred revenue is a liability related to a revenue producing activity for which revenue has not yet been recognized, and is not expected to be recognized in the next twelve months. Generally, an entity records deferred revenue when it receives consideration from a customer before achieving certain criteria that must be met for revenue to be recognized in conformity with GAAP.', 'Firm Obligations:Solvency', 'Balance Sheet:Liabilities'),
	(184943, 'Free Cash Flow', 'Cash from operating activities net of capital expenditures.', 'Investing Activities:Cash flow', 'Statement of Cash Flows:Investing activities'),
	(186988, 'Proceeds from Sale, Maturity and Collections of Investments', 'The cash inflow associated with the sale, maturity and collection of all investments such as debt, security and so forth during the period.', 'Investing Activities:Cash flow', 'Statement of Cash Flows:Investing Activities'),
	(188179, 'Federal Contract Amount for 9577: Corporation For National And Community Service', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 9577: Corporation For National And Community Service', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(189526, 'Net Income (Loss), Including Noncontrolling Interest', 'The consolidated profit or loss for the period, net of income taxes, including the portion attributable to the noncontrolling interest.', 'Profitability:Earnings', 'Income Statement:Income'),
	(189860, 'Accumulated Other Comprehensive Income (Loss), Net of Tax', 'Accumulated change in equity from transactions and other events and circumstances from non-owner sources, net of tax effect, at period end. Excludes Net Income (Loss), and accumulated changes in equity from transactions resulting from investments by owners and distributions to owners. Includes foreign currency translation items, certain pension adjustments, unrealized gains and losses on certain investments in debt and equity securities, other than temporary impairment (OTTI) losses related to f', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(192760, 'Federal Contract Amount for 3355: National Gallery Of Art', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 3355: National Gallery Of Art', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(192928, 'Federal Contract Amount for 9565: Chemical Safety And Hazard Investigation Board', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 9565: Chemical Safety And Hazard Investigation Board', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(193127, 'Unusual or Infrequent Item, Loss', 'Amount of loss recognized in the income statement for an event or transaction, that is unusual in nature or occurs infrequently, but not both.', 'Earnings:Valuation', 'Income Statement:Income'),
	(195783, 'Asset Turnover', 'Net Sales / Total Assets', 'Firm Resources:Operating Performance', 'Ratio:Efficiency'),
	(196219, 'EBITDA', 'Earnings After Interest Before Taxes + Depreciation and Amortization Expense. Earnings Before Interest,Taxes, Depreciation and Amortization', 'Profitability:Earnings', 'Income Statement:Income'),
	(204667, 'Share Based Compensation Expense', 'Expense recognized during the period arising from equity-based compensation arrangements (for example, shares of stock, unit, stock options or other equity instruments) with employees, directors and certain consultants qualifying for treatment as employees.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(208770, 'Capital Leased Assets', 'The total gross amount less the charge for the use of the long-lived depreciable assets subject to a lease meeting the criteria for capitalization.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(209026, 'Interest and Debt Expense', 'Interest and debt related expenses associated with nonoperating financing activities of the entity.', 'Financing Activities:Cost of financing', 'Income Statement:Interest Expense'),
	(210307, 'Capitalization, Long-term Debt and Equity', 'Total consolidated (as applicable) capitalization of the entity which is comprised of its long-term debt and equity instruments. The table may be detailed by subsidiary (legal entity) and include information by type of debt or equity detailed by instrument.', 'Owners\' Investment:Capital Structure', 'Balance Sheet:Capitalization'),
	(211593, 'Income (Loss) Attributable to Parent', 'The portion of profit or loss for the period which is attributable to the parent.', 'Owners\' Investment:Earnings', 'Income Statement:Income'),
	(212683, 'Federal Contract Amount for 2800: Social Security Administration', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 2800: Social Security Administration', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(216124, 'Capital Leases, Minimum Payments Due in Five Years', 'Amount of minimum lease payments maturing in the fifth fiscal year following the latest fiscal year for capital leases.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Liabilities'),
	(217992, 'Deferred Revenue', 'Amount of deferred revenue as of balance sheet date. Deferred revenue represents collections of cash or other assets related to a revenue producing activity for which revenue has not yet been recognized. Generally, an entity records deferred revenue when it receives consideration from a customer before achieving certain criteria that must be met for revenue to be recognized in conformity with GAAP.', 'Firm Obligations:Solvency', 'Balance Sheet:Liabilities'),
	(221200, 'Price To Book Value', 'Market price per share / Shareholders Equity Per Share', 'Market:Valuation', 'Ratio:Multiple'),
	(221992, 'Unusual or Infrequent Item, Gain', 'Amount of gain recognized in the income statement for an event or transaction, that is unusual in nature or occurs infrequently, but not both.', 'Earnings:Valuation', 'Income Statement:Income'),
	(225980, 'Capital Lease Obligations', 'Amount equal to the present value (the principal) at the beginning of the lease term of minimum lease payments during the lease term (excluding that portion of the payments representing executory costs such as insurance, maintenance, and taxes to be paid by the lessor, together with any profit thereon) net of payments or other amounts applied to the principal through the balance sheet date.', 'Financing Activities:Solvency', 'Balance Sheet:Liabilities'),
	(226490, 'Undistributed Earnings, Diluted', 'The earnings that is allocated to common stock and participating securities to the extent that each security may share in earnings as if all of the earnings for the period had been distributed. Includes the adjustments resulting from the assumption that dilutive securities were converted, options or warrants were exercised, or that other shares were issued upon the satisfaction of certain conditions.', 'Profitability:Earnings', 'Income Statement:EPS'),
	(229830, 'Financial Services Revenue', 'The aggregate financial services revenue and operating interest income earned during the reporting period.', 'Earnings:Operating Performance', 'Income Statement:Revenue'),
	(232064, 'Interest Income', 'Amount before accretion (amortization) of purchase discount (premium) of interest income on nonoperating securities.', 'Financing Activities:Cost of financing', 'Income Statement:Income'),
	(234695, 'Capital Leases, Minimum Payments Due in Three Years', 'Amount of minimum lease payments maturing in the third fiscal year following the latest fiscal year for capital leases.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Liabilities'),
	(234895, 'Deferred Income Tax Expense (Benefit), Federal', 'Amount of deferred federal income tax expense (benefit) pertaining to income (loss) from continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(235799, 'Investments and Cash', 'Sum of investments and unrestricted cash as of the balance sheet date.', 'Firm Resources:Liquidity', 'Balance Sheet:Current Assets'),
	(239436, 'Employee Benefits and Share Based Compensation', 'The aggregate amount of noncash, equity-based employee remuneration. This may include the value of stock or unit options, amortization of restricted stock or units, and adjustment for officers\' compensation. As noncash, this element is an add back when calculating net cash generated by Operating Activities using the indirect method.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(247269, 'Capital Expenditure as a Percentage of Sales', 'Capital Expenditures / Net Sales', 'Investing Activities:Firm Resources', 'Ratio:Cash Flow Performance'),
	(247602, 'Deferred Income Tax Expense (Benefit), Current, Federal', 'Amount of deferred federal income tax expense (benefit) pertaining to income (loss) from continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(251897, 'Other Non Operating Sales', 'Net total realized and unrealized gain (loss) included in earnings for the period as a result of selling or holding marketable securities categorized as trading, available-for-sale, or held-to-maturity, including the unrealized holding gain (loss) of held-to-maturity securities transferred to the trading security category and the cumulative unrealized gain (loss) which was included in other comprehensive income (a separate component of shareholders\' equity) for available-for-sale securities tran', 'Nonoperating Costs and Revenues and revenues:Earnings', 'Income Statement:Revenue'),
	(254317, 'Employee-related Liabilities, Current', 'Total of the carrying values as of the balance sheet date of obligations incurred through that date and payable for obligations related to services received from employees, such as accrued salaries and bonuses, payroll taxes and fringe benefits. Used to reflect the current portion of the liabilities (due within one year or within the normal operating cycle if longer).', 'Firm Obligations:Solvency', 'Balance Sheet:Current Liabilities'),
	(259039, 'Current Income Tax Expense (Benefit), Foreign', 'Amount of current foreign income tax expense (benefit) pertaining to income (loss) from continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(262072, 'Interest Revenue (Expense), Net', 'Amount of interest revenue (income derived from investments in debt securities and on cash and cash equivalents) net of interest expense (cost of borrowed funds accounted for as interest).', 'Financing Activities:Earnings', 'Income Statement:Interest Expense'),
	(263915, 'Pretax Profit Margin', 'Operating Profit Before Tax / Net Sales', 'Profitability:Earnings', 'Ratio:Profitability'),
	(264247, 'Days Inventory Conversion', '365 / (Cost of Goods Sold / Average Inventory)', 'Firm Resources:Liquidity', 'Ratio:Cash Flow Performance'),
	(264356, 'Deferred Tax Liabilities, Current', 'Amount of deferred tax liability attributable to taxable temporary differences, net of deferred tax asset attributable to deductible temporary differences and carryforwards net of valuation allowances expected to be realized or consumed within one year or operating cycle, if longer.', 'Firm Obligations:Solvency', 'Balance Sheet:Current Liabilities'),
	(265608, 'Federal Contract Amount for 8800: National Archives And Records Administration', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 8800: National Archives And Records Administration', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(266379, 'Public Equity Float', 'State aggregate market value of voting and non-voting common equity held by non-affiliates computed by reference to price at which the common equity was last sold, or average bid and asked price of such common equity, as of the last business day of registrant\'s most recently completed second fiscal quarter. The public float should be reported on the cover page of the registrants form 10K.', 'Owners\' Investment:Valuation', 'Economic Value:Market Cap'),
	(271398, 'Debt Excluding Capital Leases, Remainder of Year', 'Amount of long-term debt, sinking fund requirements, and other securities redeemable at fixed or determinable prices and dates maturing in the remainder of the fiscal year following the latest fiscal year ended.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Current Liabilities'),
	(272721, 'Debt Excluding Capital Leases, Due in Year Five', 'Amount of long-term debt, sinking fund requirements, and other securities redeemable at fixed or determinable prices and dates maturing in the fifth fiscal year following the latest fiscal year.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Liabilities'),
	(275623, 'Deferred Tax Liabilities, Net', 'Amount of deferred tax liability attributable to taxable temporary differences net of deferred tax asset attributable to deductible temporary differences and carryforwards after valuation allowances.', 'Firm Obligations:Solvency', 'Balance Sheet:Liabilities'),
	(277049, 'Non Current Assets', 'Assets that are expected to be realized in cash, sold or consumed after one year or beyond the normal operating cycle, if longer.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(277855, 'Preferred Stock, Value, Issued', 'Aggregate par or stated value of issued nonredeemable preferred stock (or preferred stock redeemable solely at the option of the issuer). This item includes treasury stock repurchased by the entity. Note_ elements for number of nonredeemable preferred shares, par value and other disclosure concepts are in another section within stockholders\' equity.', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(279082, 'Debt Excluding Capital Leases, After Year Five', 'Amount of long-term debt, sinking fund requirements, and other securities redeemable at fixed or determinable prices and dates maturing after the fifth fiscal year following the latest fiscal year.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Liabilities'),
	(283050, 'Altman Z Score', 'Measure of bankruptcy risk', 'Firm Obligations:Solvency', 'Ratio:Solvency'),
	(283210, 'Change in Accounts Payable and Accrued Liabilities', 'The increase (decrease) during the reporting period in the amounts payable to vendors for goods and services received and the amount of obligations and expenses incurred but not paid.', 'Firm Obligations:Solvency', 'Statement of Cash Flows:Changes in Working Capital Account'),
	(283594, 'Dilutive Securities', 'Amount of increase (decrease) to net income used for calculating diluted earnings per share (EPS), resulting from the assumed exercise stock options, restrictive stock units (RSUs), convertible preferred stock of an employee stock ownership plan (ESOP), and other dilutive convertible securities.', 'Earnings:Valuation', 'Income Statement:EPS'),
	(284027, 'Federal Contract Amount for 1300: Dept Of  Commerce', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 1300: Dept Of  Commerce', 'Federal Contract Earnings:Major Agency', 'Income Statement:Federal Contract Earnings'),
	(286474, 'Return On Assets', 'Net Income+Interest Expense After Tax / Average Total Assests', 'Profitability:Earnings', 'Ratio:Profitability'),
	(288970, 'Dividends Declared', 'Dividends declared by the company during the period.', 'Owners\' Investment:Valuation', 'Statement of Changes in Stockholders\' Equity:Dividends'),
	(289115, 'Income Tax Expense', 'Amount of current income tax expense (benefit) and deferred income tax expense (benefit) pertaining to continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(293434, 'Federal Contract Amount for All Agencies', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for All Agencies', 'Federal Contract Earnings:All Agencies', 'Income Statement:Federal Contract Earnings'),
	(294100, 'Change in Accrued Liabilities', 'The increase (decrease) during the reporting period in the aggregate amount of expenses incurred but not yet paid.', 'Firm Obligations:Solvency', 'Statement of Cash Flows:Changes in Working Capital Account'),
	(294130, 'Inventory', 'Amount after valuation and LIFO reserves of inventory expected to be sold, or consumed within one year or operating cycle, if longer.', 'Firm Resources:Operating performance', 'Balance Sheet:Current Assets'),
	(295113, 'Preferred Shares Outstanding', 'Aggregate share number for all nonredeemable preferred stock (or preferred stock redeemable solely at the option of the issuer) held by stockholders. Does not include preferred shares that have been repurchased.', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(301721, 'Interest Expenses', 'Amount of the cost of borrowed funds accounted for as interest expense.', 'Financing Activities:Cost of financing', 'Income Statement:Interest Expense'),
	(304002, 'Federal Contract Amount for 8000: National Aeronautics And Space Administration', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 8000: National Aeronautics And Space Administration', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(305804, 'Interest Coverage', 'Earnings Before Interest and Taxes / Interest Expense', 'Operating Activities:Cash flow', 'Ratio:Cash Flow Performance'),
	(306598, 'Average Inventory', 'The average inventory for the period.', 'Firm Resources:Liquidity', 'Balance Sheet:Cash Flow Performance'),
	(306956, 'Earnings Per Share, Basic', 'The amount of net income (loss) for the period per each share of common stock or unit outstanding during the reporting period.', 'Profitability:Earnings', 'Income Statement:EPS'),
	(307732, 'Federal Income Tax Expense (Benefit), Continuing Operations', 'Amount of current and deferred income tax expense (benefit) attributable to income (loss) from continuing domestic operations within the country of domicile of the entity.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(309857, 'Inventory Turnover', 'Net Sales / Average Inventory', 'Firm Resources:Operating performance', 'Ratio:Efficiency'),
