	(362124, 'Cash from Financing Activities Continuing Operations', 'Amount of cash inflow (outflow) of financing activities, excluding discontinued operations. Financing activity cash flows include obtaining resources from owners and providing them with a return on, and a return of, their investment; borrowing money and repaying amounts borrowed, or settling the obligation; and obtaining and paying for other resources obtained from creditors on long-term credit.', 'Financing Activities:Cash flow', 'Statement of Cash Flows:Financing Activities'),
