	(375072, 'Increase (Decrease) in Cash and Cash Equivalents', 'Amount of increase (decrease) in cash and cash equivalents. Cash and cash equivalents are the amount of currency on hand as well as demand deposits with banks or financial institutions. Includes other kinds of accounts that have the general characteristics of demand deposits. Also includes short-term, highly liquid investments that are both readily convertible to known amounts of cash and so near their maturity that they present insignificant risk of changes in value because of changes in intere', 'Firm Resources:Liquidity', 'Statement of Cash Flows:Cash Flow'),
	(375372, 'Capital Stock', 'Common and preferred stock.', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
