	(549453, 'Deferred Income Taxes and Tax Credit', 'Amount of deferred income tax expense (benefit) and income tax credits.', 'Firm Obligations:Solvency', 'Balance Sheet:Liabilities'),
	(549628, 'Federal Contract Amount for 4700: General Services Administration', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 4700: General Services Administration', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(550530, 'Federal Contract Amount for 7300: Small Business Administration', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 7300: Small Business Administration', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(553070, 'Assets, Fair Value, Level 1', 'Fair value portion of probable future economic benefits obtained or controlled by an entity as a result of past transactions or events.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(553423, 'Capital Expenditures', 'The cash outflow for purchases of and capital improvements on property, plant and equipment (capital expenditures), software, and other intangible assets.', 'Investing Activities:Firm Resources', 'Statement of Cash Flows:Investing activities'),
	(559768, 'Gross Profit Margin', 'Gross Profit (Loss) / Net Sales', 'Profitability:Earnings', 'Ratio:Profitability'),
	(560577, 'Rent Expense', 'Amount of rent expense incurred for leased assets, including but not limited to, furniture and equipment, that is not directly or indirectly associated with the manufacture, sale or creation of a product or product line.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(563020, 'Total Liabilities and Stockholders Equity', 'Amount of liabilities and equity items, including the portion of equity attributable to noncontrolling interests, if any.', 'Firm Resources:Economic Value', 'Balance Sheet:Capitalization'),
	(565234, 'Cash and Short Term Investments', 'Cash includes currency on hand as well as demand deposits with banks or financial institutions. It also includes other kinds of accounts that have the general characteristics of demand deposits in that the customer may deposit additional funds at any time and effectively may withdraw funds at any time without prior notice or penalty. Cash equivalents, excluding items classified as marketable securities, include short-term, highly liquid Investments that are both readily convertible to known amou', 'Firm Resources:Liquidity', 'Balance Sheet:Current Assets'),
	(565759, 'Current Income Tax Expense (Benefit)', 'Amount of current income tax expense (benefit) pertaining to taxable income (loss) from continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(573370, 'Federal Contract Amount for 1200: Dept Of  Agriculture', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 1200: Dept Of  Agriculture', 'Federal Contract Earnings:Major Agency', 'Income Statement:Federal Contract Earnings'),
	(575282, 'Long Term Debt', 'Carrying amount of long-term debt, net of unamortized discount or premium, excluding amounts to be repaid within one year or the normal operating cycle, if longer (current maturities). Includes, but not limited to, notes payable, bonds payable, debentures, mortgage loans and commercial paper. Excludes capital lease obligations.', 'Firm Obligations:Leverage', 'Balance Sheet:Liabilities'),
	(576859, 'Return On Equity', 'Net Income / Average Shareholders Equity', 'Profitability:Earnings', 'Ratio:Profitability'),
	(577043, 'Liabilities To Total Assets', 'Total Liabilities / Total Assets', 'Leverage:Solvency', 'Ratio:Leverage'),
	(578272, 'Federal Contract Amount for 9507: Commodity Futures Trading Commission', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 9507: Commodity Futures Trading Commission', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(581060, 'Special Items', 'Non recurring items, for example, extraordinary items.', 'Nonoperating Costs and Revenues and revenues:Earnings', 'Income Statement:Income'),
	(581099, 'Net Income (Loss) Attributable to Parent, Diluted', 'The portion of profit or loss for the period, net of income taxes, which is attributable to the parent, and includes adjustments resulting from the assumption that dilutive convertible securities were converted, options or warrants were exercised, or that other shares were issued upon the satisfaction of certain conditions.', 'Owners\' Investment:Earnings', 'Income Statement:EPS'),
	(582780, 'Income Tax Expense (Benefit), Intraperiod Tax Allocation', 'The sum of income tax expense or benefit for the period that has been allocated among continuing operations, discontinued operations, extraordinary items, other comprehensive income, and items charged or credited directly to shareholders\' equity.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(582918, 'Federal Contract Amount for 9568: Broadcasting Board Of Governors', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 9568: Broadcasting Board Of Governors', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(586375, 'Dividend Payout', 'Dividends Per Common Share / Earnings Per Share', 'Financing Activities:Owner\'s Investment', 'Ratio:Dividends'),
	(586828, 'Preferred Stock Redemption Premium', 'The excess of (1) fair value of the consideration transferred to the holders of the preferred stock over (2) the carrying amount of the preferred stock in the registrant\'s balance sheet, during the accounting period.', 'Earnings:Valuation', 'Income Statement:EPS'),
	(587438, 'Inventory, Gross', 'Gross amount, as of the balance sheet date, of merchandise, goods, commodities, or supplies held for future sale or to be used in manufacturing, servicing or production process.', 'Firm Resources:Operating performance', 'Balance Sheet:Current Assets'),
	(587650, 'Shareholders Equity Per Share', 'Shareholders Equity / Per Share', 'Owners\' Investment:Valuation', 'Balance Sheet:Share'),
	(590919, 'Federal Contract Amount for 9514: Occupational Safety And Health Review Commission', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 9514: Occupational Safety And Health Review Commission', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(592612, 'Free Cash Flow as a Percentage of Sales', 'Free Cash Flow / Net Sales', 'Investing Activities:Cash flow', 'Ratio:Cash Flow Performance'),
	(593127, 'Net Income (Loss) Available to Common Stockholders, Diluted', 'Net Income or Loss Available to Common Stockholders plus adjustments resulting from the assumption that dilutive convertible securities were converted, options or warrants were exercised, or that other shares were issued upon the satisfaction of certain conditions.', 'Owners\' Investment:Earnings', 'Income Statement:EPS'),
	(594500, 'Federal Contract Amount for 9700: Dept Of Defense', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 9700: Dept Of Defense', 'Federal Contract Earnings:Major Agency', 'Income Statement:Federal Contract Earnings'),
	(599224, 'Stock Options, Number, Outstanding', 'Number of options outstanding, including both vested and non-vested options.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(600972, 'Dilution Adjustments', 'Convertible Preferred Stock Converted to Other Securities + Preferred Stock Redemption Premium + Preferred Stock Redemption Discount + Preferred Stock Conversions, Inducements + Temporary Equity, Dividends, Adjustment + Temporary Equity, Accretion to Redemption Value, Adjustment', 'Earnings:Valuation', 'Income Statement:EPS'),
	(602390, 'State and Local Income Tax Expense (Benefit)', 'Amount of state and local current and deferred income tax expense (benefit) attributable to continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(603370, 'Capital Leases, Minimum Payments Due in Two Years', 'Amount of minimum lease payments maturing in the second fiscal year following the latest fiscal year for capital leases.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Liabilities'),
	(605057, 'Accounts Receivable, Net, Current and Non Current', 'Accounts Receivable + Accounts Receivable, Net, Non Current', 'Firm Resources:Liquidity', 'Balance Sheet:Assets'),
	(608724, 'Deferred Income Tax Expense (Benefit), Current, Foreign', 'Amount of deferred federal income tax expense (benefit) pertaining to income (loss) from continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(609393, 'Income from Continuing Operations, Including Noncontrolling Interest', 'Income or loss from continuing operations attributable to the economic entity which may also be defined as revenue less expenses and taxes from ongoing operations before extraordinary items, and noncontrolling interest.', 'Owners\' Investment:Earnings', 'Income Statement:Income'),
	(610292, 'Non Current Liabilities', 'Amount of obligation due after one year or beyond the normal operating cycle, if longer.', 'Firm Obligations:Leverage', 'Balance Sheet:Liabilities'),
	(610839, 'Return on Invested Capital', 'Net Income / Average Invested Capital, Total (Compustat)', 'Owners\' Investment:Earnings', 'Ratio:Profitability'),
	(613948, 'Federal Contract Amount for 5000: Securities And Exchange Commission', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 5000: Securities And Exchange Commission', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(618690, 'Payments for (Proceeds from) Investments', 'The net cash paid (received) associated with the acquisition or disposal of all investments, including securities and other assets.', 'Investing Activities:Cash flow', 'Statement of Cash Flows:Investing Activities'),
	(619467, 'Federal Contract Amount for 5400: Federal Labor Relations Authority', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 5400: Federal Labor Relations Authority', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(622484, 'Contractual Obligation, Due in Fourth and Fifth Year', 'Amount of contractual obligation maturing in the fourth and fifth fiscal years following the latest fiscal year.', 'Firm Obligations:Solvency', 'Balance Sheet:Liabilities'),
	(623656, 'Short Term Debt Coverage', 'Cash from Operating Activities / Short Term Debt', 'Firm Obligations:Solvency', 'Ratio:Solvency'),
	(627616, 'Income (Loss) from Discontinued Operations, Net of Tax', 'Amount of income (loss) from a disposal group, net of income tax before extraordinary items allocable to noncontrolling interests. Includes, net of tax, income (loss) from operations during the phase-out period, gain (loss) on disposal, provision (or any reversals of earlier provisions) for loss on disposal, and adjustments of a prior period gain (loss) on disposal.', 'Earnings:Operating Performance', 'Income Statement:Income'),
	(633419, 'Restructuring, Settlement and Impairment Expense', 'The aggregate amount provided for estimated restructuring charges, remediation costs, and asset impairment loss during an accounting period. Generally, these items are either unusual or infrequent, but not both (in which case they would be extraordinary items).', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Nonoperating Income (Loss)'),
	(634518, 'Investments', 'Sum of the carrying amounts as of the balance sheet date of all investments.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(635930, 'Federal Contract Amount for 9594: Court Services And Offender Supervision Agency', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 9594: Court Services And Offender Supervision Agency', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(637146, 'Federal Contract Amount for 1400: Dept Of  Interior', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 1400: Dept Of  Interior', 'Federal Contract Earnings:Major Agency', 'Income Statement:Federal Contract Earnings'),
	(640613, 'Preferred Stock Dividends and Other Adjustments', 'The aggregate value of preferred stock dividends and other adjustments necessary to derive net income apportioned to common stockholders.', 'Owners\' Investment:Valuation', 'Statement of Changes in Stockholders\' Equity:Dividends'),
	(644700, 'Receivables', 'The aggregate of amounts due from customers or clients, within one year of the balance sheet date (or one operating cycle, if longer), for goods or services that have been delivered or sold in the normal course of business and an amount representing an agreement for an unconditional promise by the maker to pay the entity (holder) a definite sum of money at a future date within one year of the balance sheet, reduced to their estimated net realizable fair value by an allowance established by the e', 'Firm Resources:Liquidity', 'Balance Sheet:Current Assets'),
	(652222, 'Federal Contract Amount for 7500: Dept Of  Health And Human Services', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 7500: Dept Of  Health And Human Services', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(652235, 'Other Assets, Noncurrent', 'Aggregate carrying amount, as of the balance sheet date, of noncurrent assets not separately disclosed in the balance sheet. Noncurrent assets are expected to be realized or consumed after one year (or the normal operating cycle, if longer).', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(653789, 'Debt Excluding Capital Leases, Due in Year Two', 'Amount of long-term debt, sinking fund requirements, and other securities redeemable at fixed or determinable prices and dates maturing in the second fiscal year following the latest fiscal year.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Liabilities'),
	(654661, 'Depreciation, Depletion and Amortization', 'The aggregate expense recognized in the current period that allocates the cost of tangible assets, intangible assets, or depleting assets to periods that benefit from use of the assets.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(655793, 'Long-term Debt, Current Maturities', 'Amount of long-term debt, after unamortized discount or premium, scheduled to be repaid within one year or the normal operating cycle, if longer. Includes, but not limited to, notes payable, bonds payable, debentures, mortgage loans and commercial paper. Excludes capital lease obligations.', 'Firm Obligations:Leverage', 'Balance Sheet:Current Liabilities'),
	(656701, 'Earnings Per Share, Diluted', 'The amount of net income (loss) for the period available to each share of common stock or common unit outstanding during the reporting period and to each share or unit that would have been outstanding assuming the issuance of common shares or units for all dilutive potential common shares or units outstanding during the reporting period.', 'Profitability:Earnings', 'Income Statement:EPS'),
	(657447, 'Debt Excluding Capital Leases, Due in Year Three', 'Amount of long-term debt, sinking fund requirements, and other securities redeemable at fixed or determinable prices and dates maturing in the third fiscal year following the latest fiscal year.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Liabilities'),
	(657870, 'Accrued Expenses Current', 'Carrying value as of the balance sheet date of obligations incurred and payable, pertaining to costs that are statutory in nature, are incurred on contractual obligations, or accumulate over time and for which invoices have not yet been received or will not be rendered. Examples include taxes, interest, rent and utilities. Used to reflect the current portion of the liabilities (due within one year or within the normal operating cycle if longer).', 'Firm Obligations:Solvency', 'Balance Sheet:Current Liabilities'),
	(662470, 'Temporary Equity', 'Carrying amount, attributable to parent and noncontrolling interests, of an entity\'s issued and outstanding stock which is not included within permanent equity. Temporary equity is a security with redemption features that are outside the control of the issuer, is not classified as an asset or liability in conformity with GAAP, and is not mandatorily redeemable. Includes any type of security that is redeemable at a fixed or determinable price or on a fixed or determinable date or dates, is redeem', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(663250, 'Deferred Income Tax Expense (Benefit)', 'Amount of deferred income tax expense (benefit) pertaining to income (loss) from continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(663254, 'Cash from Investing Activities, Discontinued Operations', 'Amount of cash inflow (outflow) of investing activities of discontinued operations. Investing activity cash flows include making and collecting loans and acquiring and disposing of debt or equity instruments and property, plant, and equipment and other productive assets.', 'Investing Activities:Cash flow', 'Statement of Cash Flows:Investing activities'),
	(663351, 'Payments to Purchase Common and Preferred Stock', 'The cash outflow to reacquire common and preferred stock.', 'Owners\' Investment:Cash flow', 'Statement of Cash Flows:Financing Activities'),
	(667477, 'Federal Contract Amount for 4100: Merit Systems Protection Board', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 4100: Merit Systems Protection Board', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(668136, 'Price To Cash Flow', 'Market price per share / Operating Cash Flow Per Share', 'Market:Valuation', 'Ratio:Multiple'),
	(671693, 'Deferred Tax Assets, Operating Loss Carryforwards', 'Amount before allocation of valuation allowances of deferred tax asset attributable to deductible operating loss carryforwards.', 'Firm Resources:Solvency', 'Balance Sheet:Assets'),
	(677468, 'Capital Leases, Minimum Payments Due, Next Twelve Months', 'Amount of minimum lease payments maturing in the next fiscal year following the latest fiscal year for capital leases.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Liabilities'),
	(678535, 'Dividend Coverage', 'Cash from Operating Activities / Cash Dividends', 'Financing Activities:Owner\'s Investment', 'Ratio:Dividends'),
	(682145, 'Change in Receviables', 'The increase (decrease) during the reporting period in the total amount due within one year (or one operating cycle) from all parties, associated with underlying transactions that are classified as operating activities.', 'Firm Resources:Liquidity', 'Statement of Cash Flows:Changes in Working Capital Account'),
	(683692, 'Federal Contract Amount for 1100: Executive Office Of The President', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 1100: Executive Office Of The President', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(685052, 'Accounts, Notes, Loans and Financing Receivable, Net, Current', 'The aggregate of amounts due from customers or clients, within one year of the balance sheet date (or one operating cycle, if longer), for goods or services that have been delivered or sold in the normal course of business and an amount representing an agreement for an unconditional promise by the maker to pay the entity (holder) a definite sum of money at a future date within one year of the balance sheet, reduced to their estimated net realizable fair value by an allowance established by the e', 'Firm Resources:Liquidity', 'Balance Sheet:Current Assets'),
	(685141, 'Federal Contract Amount for 5900: National Foundation On The Arts And The Humanities', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 5900: National Foundation On The Arts And The Humanities', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(689579, 'Income Loss Before Income Taxes', 'Income or loss from continuing operations attributable to the economic entity which may also be defined as revenue less expenses from ongoing operations, after income or loss from equity method investments, but before income taxes, extraordinary items, and noncontrolling interest.', 'Profitability:Earnings', 'Income Statement:Income'),
	(692375, 'Accounts and Notes Receivable', 'The aggregate of amounts due from customers or clients, within one year of the balance sheet date (or one operating cycle, if longer), for goods or services that have been delivered or sold in the normal course of business and an amount representing an agreement for an unconditional promise by the maker to pay the entity (holder) a definite sum of money at a future date within one year of the balance sheet, reduced to their estimated net realizable fair value by an allowance established by the e', 'Firm Resources:Liquidity', 'Balance Sheet:Assets'),
	(693283, 'Cash From Financing Activities, Discontinued Operations', 'Amount of cash inflow (outflow) of financing activities of discontinued operations. Financing activity cash flows include obtaining resources from owners and providing them with a return on, and a return of, their investment; borrowing money and repaying amounts borrowed, or settling the obligation; and obtaining and paying for other resources obtained from creditors on long-term credit.', 'Financing Activities:Cash flow', 'Statement of Cash Flows:Financing Activities'),
	(697697, 'Revenues', 'Amount of revenue recognized from goods sold, services rendered, insurance premiums, or other activities that constitute an earning process. Includes, but is not limited to, investment and interest income before deduction of interest expense when recognized as a component of revenue, and sales and trading gain (loss).', 'Profitability:Earnings', 'Income Statement:Revenue'),
	(697898, 'Federal Contract Amount for 5940: National Endowment For The Humanities', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 5940: National Endowment For The Humanities', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(697955, 'Federal Contract Amount for 6500: Federal Maritime Commission', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 6500: Federal Maritime Commission', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(701989, 'Amortization of Intangible Assets', 'The aggregate expense charged against earnings to allocate the cost of intangible assets (nonphysical assets not used in production) in a systematic and rational manner to the periods expected to benefit from such assets. As a noncash expense, this element is added back to net income when calculating cash provided by or used in operations using the indirect method.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(704317, 'Amortization', 'The aggregate amount of recurring noncash expense charged against earnings in the period to allocate the cost of assets over their estimated remaining economic lives.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(704551, 'Debt, Current', 'Amount of short-term debt and current maturity of long-term debt and capital lease obligations due within one year or the normal operating cycle, if longer.', 'Firm Obligations:Leverage', 'Balance Sheet:Current Liabilities'),
	(707211, 'Capital Leases, Minimum Payments, Net Minimum Payments', 'Amount of minimum lease payments for capital leases net of executory costs, which include amounts paid by the lessee to the lessor for insurance, maintenance and taxes.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Liabilities'),
	(707672, 'Common Stock', 'Total of all stockholders\' equity (deficit) items, net of receivables from officers, directors, owners, and affiliates of the entity which are attributable to the parent. The amount of the economic entity\'s stockholders\' equity attributable to the parent excludes the amount of stockholders\' equity which is allocable to that ownership interest in subsidiary equity which is not attributable to the parent (noncontrolling interest, minority interest). This excludes temporary equity and is sometimes ', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(708048, 'Long-term Debt, Excluding Current Maturities', 'Carrying amount of long-term debt, net of unamortized discount or premium, excluding amounts to be repaid within one year or the normal operating cycle, if longer (current maturities). Includes, but not limited to, notes payable, bonds payable, debentures, mortgage loans and commercial paper. Excludes capital lease obligations.', 'Firm Obligations:Leverage', 'Balance Sheet:Liabilities'),
	(710420, 'Debt To Equity', 'Total Debt / Shareholders Equity', 'Leverage:Solvency', 'Ratio:Leverage'),
	(712611, 'Prepaid Expense and Other Assets', 'Amount of asset related to consideration paid in advance for costs that provide economic benefits in future periods, and amount of other assets.', 'Firm Resources:Liquidity', 'Balance Sheet:Assets'),
	(713585, 'Operating Cash Flows to Sales', 'Cash from Operating Activities / Net Sales', 'Operating Activities:Cash flow', 'Ratio:Cash Flow Performance'),
	(714750, 'Federal Contract Amount for 5920: National Endowment For The Arts', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 5920: National Endowment For The Arts', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(717473, 'Federal Contract Amount for 0500: Government Accountability Office', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 0500: Government Accountability Office', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(717549, 'Research and Development Expense', 'The aggregate costs incurred (1) in a planned search or critical investigation aimed at discovery of new knowledge with the hope that such knowledge will be useful in developing a new product or service, a new process or technique, or in bringing about a significant improvement to an existing product or process; or (2) to translate research findings or other knowledge into a plan or design for a new product or process or for a significant improvement to an existing product or process whether int', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(718597, 'Goodwill', 'Amount after accumulated impairment loss of an asset representing future economic benefits arising from other assets acquired in a business combination that are not individually identified and separately recognized.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(719677, 'Weighted Average Number of Shares Outstanding, Basic', 'Number of [basic] shares or units, after adjustment for contingently issuable shares or units and other shares or units not deemed outstanding, determined by relating the portion of time within a reporting period that common shares or units have been outstanding to the total time in that period.', 'Owners\' Investment:Earnings', 'Income Statement:EPS'),
	(720055, 'Deferred Income Tax Expense (Benefit), Foreign', 'Amount of deferred foreign income tax expense (benefit) pertaining to income (loss) from continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(723668, 'Net Cash Provided By (Used in) Investing Activities', 'Amount of cash inflow (outflow) from investing activities, including discontinued operations. Investing activity cash flows include making and collecting loans and acquiring and disposing of debt or equity instruments and property, plant, and equipment and other productive assets.', 'Investing Activities:Cash flow', 'Statement of Cash Flows:Cash Flow'),
	(723837, 'Comprehensive Income, Attributable to Parent', 'Amount after tax of increase (decrease) in equity from transactions and other events and circumstances from net income and other comprehensive income, attributable to parent entity. Excludes changes in equity resulting from investments by owners and distributions to owners.', 'Owners\' Investment:Earnings', 'Statement of Comprehensive Income:Income'),
	(725964, 'Common Stock Including Additional Paid In Capital', 'Aggregate of par value plus amounts in excess of par value or issuance value (in cases of no-par value stock) for common stock held by shareholders. Aggregate value for common stock issued and outstanding.', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(726854, 'Average Shareholders Equity', 'Average total of all stockholders\' equity (deficit) items, net of receivables from officers, directors, owners, and affiliates of the entity which are attributable to the parent. The amount of the economic entity\'s stockholders\' equity attributable to the parent excludes the amount of stockholders\' equity which is allocable to that ownership interest in subsidiary equity which is not attributable to the parent (noncontrolling interest, minority interest). This excludes temporary equity and is so', 'Owners\' Investment:Valuation', 'Balance Sheet:Cash Flow Performance'),
	(727260, 'Cost and Expenses', 'Total costs of sales and operating expenses for the period.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(727514, 'Average Receivables', 'The average receivables for the period.', 'Firm Resources:Liquidity', 'Balance Sheet:Cash Flow Performance'),
	(727984, 'Capital Leases, Minimum Payments Due in Two and Three Years', 'Amount of minimum lease payments maturing in the second and third fiscal years following the latest fiscal year for capital leases.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Liabilities'),
	(733250, 'Receivables Turnover', 'Net Sales / Average Receivables', 'Firm Resources:Operating performance', 'Ratio:Efficiency'),
	(733603, 'Federal Contract Amount for 9502: National Capital Planning Commission', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 9502: National Capital Planning Commission', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(735874, 'Share-based Compensation, Options, Exercises in Period', 'Number of share options (or share units) exercised during the current period.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(736288, 'Nonoperating Income (Loss), Excluding Interest Expense', 'The aggregate amount of income or expense from ancillary business-related activities (that is to say, excluding major activities considered part of the normal operations of the business).', 'Nonoperating Costs and Revenues and revenues:Earnings', 'Income Statement:Nonoperating Income (Loss)'),
	(736996, 'Income (Loss) from Continuing Operations Attributable to Parent', 'Amount of income (loss) from continuing operations attributable to the parent. Also defined as revenue less expenses and taxes from ongoing operations before extraordinary items but after deduction of those portions of income or loss from continuing operations that are allocable to noncontrolling interests.', 'Owners\' Investment:Earnings', 'Income Statement:Income'),
	(740783, 'Other Non Operating Income (Expense)', 'The net amount of other income and expense amounts, the components of which are not separately disclosed on the income statement, resulting from ancillary business-related activities (that is, excluding major activities considered part of the normal operations of the business) also known as other nonoperating income (expense) recognized for the period. Such amounts may include_ (a) dividends, (b) interest on securities, (c) net gains or losses on securities, (d) unusual costs, (e) gains or losse', 'Nonoperating Costs and Revenues and revenues:Earnings', 'Income Statement:Nonoperating Income (Loss)'),
	(741847, 'Depreciation', 'The amount of expense recognized in the current period that reflects the allocation of the cost of tangible assets over the assets\' useful lives. Includes production and non-production related depreciation.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(745489, 'Accrued Liabilities and Other Liabilities', 'Amount of obligations incurred and payable, pertaining to costs that are statutory in nature, incurred on contractual obligations, or accumulate over time and for which invoices have not yet been received or will not be rendered. Examples include, but not limited to, taxes, interest, rent and utilities. Also includes the aggregate carrying amount of liabilities not separately disclosed.', 'Firm Obligations:Solvency', 'Balance Sheet:Liabilities'),
	(746338, 'Deferred Revenue, Current', 'The carrying amount of consideration received or receivable as of the balance sheet date on potential earnings that were not recognized as revenue in conformity with GAAP, and which are expected to be recognized as such within one year or the normal operating cycle, if longer, including sales, license fees, and royalties, but excluding interest income.', 'Firm Obligations:Solvency', 'Balance Sheet:Current Liabilities'),
	(750331, 'Federal Contract Amount for 3352: J. F. Kennedy Center For The Performing Arts', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 3352: J. F. Kennedy Center For The Performing Arts', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(752029, 'Federal Contract Amount for 1500: Dept Of  Justice', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 1500: Dept Of  Justice', 'Federal Contract Earnings:Major Agency', 'Income Statement:Federal Contract Earnings'),
	(755453, 'Proceeds from Issuance of Equity', 'The cash inflow from the issuance of common stock, preferred stock, treasury stock, stock options, and other types of equity.', 'Financing Activities:Cash flow', 'Statement of Cash Flows:Financing Activities'),
	(760327, 'Stockholders\' Equity, Including Noncontrolling Interest', 'Amount of stockholders\' equity (deficit), net of receivables from officers, directors, owners, and affiliates of the entity, attributable to both the parent and noncontrolling interests. Amount excludes temporary equity. Alternate caption for the concept is permanent equity.', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(761232, 'Other Current Liabilities, As Reported', 'Aggregate carrying amount of current liabilities (due within one year or within the normal operating cycle if longer) not separately disclosed in the balance sheet. Includes costs that are statutory in nature, are incurred on contractual obligations, or accumulate over time and for which invoices have not yet been received or will not be rendered and of liabilities not separately disclosed.', 'Firm Obligations:Solvency', 'Balance Sheet:Liabilities'),
	(762483, 'Finite-Lived Intangible Assets, Accumulated Amortization', 'Accumulated amount of amortization of assets, excluding financial assets and goodwill, lacking physical substance with a finite life.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(763134, 'Debt, Long-term and Short-term, Combined Amount', 'Aggregate of total long-term debt, including current maturities and short-term debt.', 'Firm Obligations:Leverage', 'Balance Sheet:Liabilities'),
	(765290, 'Interest on Convertible Debt, Net of Tax', 'The after-tax amount of interest recognized in the period associated with any convertible debt.', 'Financing Activities:Cost of financing', 'Income Statement:Interest Expense'),
	(769695, 'Accounts Receivable, Net, Non Current', 'Amount due from customers or clients, more than one year from the balance sheet date, for goods or services that have been delivered or sold in the normal course of business, reduced to the estimated net realizable fair value by an allowance established by the entity of the amount it deems uncertain of collection.', 'Firm Resources:Liquidity', 'Balance Sheet:Assets'),
	(771081, 'Operating Expenses', 'Costs and expenses, not including cost of goods sold.', 'Operating Costs:Earnings', 'Income Statement:Operating Expense'),
	(771537, 'Tax Rate', 'Percentage of current income tax expense (benefit) and deferred income tax expense (benefit) pertaining to continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(777100, 'Depreciation and Amortization Expense', 'The current period expense charged against earnings on long-lived, physical assets not used in production, and which are not intended for resale, to allocate or recognize the cost of such assets over their useful lives; or to record the reduction in book value of an intangible asset over the benefit period of such asset; or to reflect consumption during the period of an asset that is not used in production.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(778200, 'Other Assets', 'The aggregate carrying amounts, as of the balance sheet date, of assets not separately disclosed in the balance sheet.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(780840, 'Federal Contract Amount for 2000: Dept Of  Treasury', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 2000: Dept Of  Treasury', 'Federal Contract Earnings:Major Agency', 'Income Statement:Federal Contract Earnings'),
	(781879, 'Income Before Extraordinary Items Adjusted for Common Stock Equivalents', 'Income from continuing operations net of preferred stock dividends (and other adjustments),  with addbacks of_ (1) interest on convertible debt, net of tax; (2) convertible preferred dividends, net of tax; and (3)  dilutive securities.', 'Profitability:Earnings', 'Income Statement:EPS'),
	(782659, 'Gain (Loss) from Sale of Property Plant and Equipment', 'Amount of gain (loss) on sale or disposal of property, plant and equipment assets, including oil and gas property and timber property.', 'Investing Activities:Earnings', 'Income Statement:Income'),
	(788535, 'Accounts Receivable Gross, Current', 'Amounts due from customers or clients, within one year of the balance sheet date (or the normal operating cycle, whichever is longer) for goods or services (including trade receivables) that have been delivered or sold in the normal course of business', 'Firm Resources:Liquidity', 'Balance Sheet:Current Assets'),
	(791949, 'Comprehensive Income, Total', 'Amount after tax of increase (decrease) in equity from transactions and other events and circumstances from net income and other comprehensive income. Excludes changes in equity resulting from investments by owners and distributions to owners.', 'Owners\' Investment:Earnings', 'Statement of Comprehensive Income:Income'),
	(792477, 'Shareholders Equity', 'Total of all stockholders\' equity (deficit) items, net of receivables from officers, directors, owners, and affiliates of the entity which are attributable to the parent. The amount of the economic entity\'s stockholders\' equity attributable to the parent excludes the amount of stockholders\' equity which is allocable to that ownership interest in subsidiary equity which is not attributable to the parent (noncontrolling interest, minority interest). This excludes temporary equity and is sometimes ', 'Owners\' Investment:Capital Structure', 'Balance Sheet:Equity'),
	(798012, 'Deferred Tax Liabilities, Gross', 'Amount of deferred tax liability attributable to taxable temporary differences.', 'Firm Obligations:Solvency', 'Balance Sheet:Liabilities'),
	(798565, 'Federal Contract Amount for 9543: Millenium Challenge Corporation', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 9543: Millenium Challenge Corporation', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(800958, 'Stock Options, Number, Exercised', 'Number of share options (or share units) exercised during the current period.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(801713, 'Common Stockholders Equity', 'Total of all stockholders\' equity (deficit) items, net of receivables from officers, directors, owners, and affiliates of the entity which are attributable to the parent. The amount of the economic entity\'s stockholders\' equity attributable to the parent excludes the amount of stockholders\' equity which is allocable to that ownership interest in subsidiary equity which is not attributable to the parent (noncontrolling interest, minority interest). This excludes temporary equity and is sometimes ', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(803353, 'Operating Leases, Minimum Payments Due', 'Amount of required minimum rental payments for leases having an initial or remaining non-cancelable letter-terms in excess of one year.', 'Operating Costs:Expected Future Cash Flow', 'Income Statement:Operating Expense'),
	(805594, 'Deferred Tax Assets, Net of Valuation Allowance, Current', 'Amount after allocation of valuation allowances of deferred tax asset attributable to deductible temporary differences and carryforwards expected to be realized or consumed within one year or operating cycle, if longer.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(805772, 'Federal Contract Amount for 2400: Office Of Personnel Management', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 2400: Office Of Personnel Management', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(807842, 'Net Income (Loss) Attributable to Parent', 'The portion of profit or loss for the period, net of income taxes, which is attributable to the parent.', 'Profitability:Earnings', 'Income Statement:Income'),
	(810253, 'Unusual or Infrequent Items', 'Amount of (gain) loss recognized in the income statement for an event or transaction that is unusual in nature or occurs infrequently, but not both.', 'Earnings:Valuation', 'Income Statement:Income'),
	(819581, 'Current Ratio', 'Current Assets / Current Liabilities', 'Operating Activities:Solvency', 'Ratio:Solvency'),
	(822141, 'Common Shares Issued During Period', 'Number of new stock issued during the period.', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(824080, 'Weighted Average Number of Shares Outstanding, Diluted', 'The average number of shares or units issued and outstanding that are used in calculating diluted EPS or earnings per unit (EPU), determined based on the timing of issuance of shares or units in the period.', 'Owners\' Investment:Earnings', 'Income Statement:EPS'),
	(825397, 'Short Term Debt', 'Amount of short-term debt and current maturity of long-term debt and capital lease obligations due within one year or the normal operating cycle, if longer.', 'Firm Obligations:Solvency', 'Balance Sheet:Current Liabilities'),
	(830756, 'Days Receivables Conversion', '365 / (Net Sales / Average Receivables)', 'Firm Resources:Liquidity', 'Ratio:Cash Flow Performance'),
	(830899, 'Operating Income After Depreciation', 'Operating Income (Loss) + Depreciation', 'Operating Activities:Profitability', 'Income Statement:Income'),
	(833144, 'Price To Earnings', 'Market price per share / Earnings Per Share', 'Profitability:Earnings', 'Ratio:Multiple'),
	(836554, 'Advertising', 'Amount charged to advertising expense for the period, which are expenses incurred with the objective of increasing revenue for a specified brand, product or product line.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(837356, 'Asset Impairment Charges', 'Amount of write-down of assets recognized in the income statement. Includes, but is not limited to, losses from tangible assets, intangible assets and goodwill.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(837669, 'Gross Profit (Loss)', 'Aggregate revenue less cost of goods and services sold or operating expenses directly attributable to the revenue generation activity.', 'Profitability:Earnings', 'Income Statement:Income'),
	(839643, 'Operating Leases, Minimum Payments Due, Next Twelve Months', 'Amount of required minimum rental payments maturing in the next fiscal year following the latest fiscal year for operating leases having an initial or remaining non-cancelable letter-terms in excess of one year.', 'Operating Costs:Expected Future Cash Flow', 'Income Statement:Operating Expense'),
	(841176, 'Notes Receivable, Net', 'Net amount of the investment in a contractual right to receive money on demand or on fixed or determinable dates that is recognized as an asset in the creditor\'s statement of financial position. Examples include, but are not limited to, credit card receivables, notes receivable and receivables relating to lessor\'s rights to payments from leases other than operating leases that have been recorded as assets. Excludes trade accounts receivable with contractual maturity of one year or less and arose', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(841889, 'Additional Paid in Capital', 'Excess of issue price over par or stated value of the entity\'s capital stock and amounts received from other transactions involving the entity\'s stock or stockholders. Includes adjustments to additional paid in capital. Some examples of such adjustments include recording the issuance of debt with a beneficial conversion feature and certain tax consequences of equity instruments awarded to employees. Use this element for the aggregate amount of additional paid-in capital associated with common an', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(842670, 'Deferred Income Tax Expense (Benefit), State and Local', 'Amount of deferred state and local tax expense (benefit) pertaining to income (loss) from continuing operations.', 'Operating Costs:Taxes', 'Income Statement:Operating Expense'),
	(849373, 'Federal Contract Amount for 1153: United States Trade And Development Agency', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 1153: United States Trade And Development Agency', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(849650, 'Federal Contract Amount for 6100: Consumer Product Safety Commission', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 6100: Consumer Product Safety Commission', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(850520, 'Inventory Adjustments', 'Certain changes made in the current period to the value and amount of inventory reported.', 'Firm Resources:Operating Performance', 'Balance Sheet:Current Assets'),
	(851732, 'Inventory, Net of Allowances, Customer Advances and Progress Billings', 'Carrying amount (lower of cost or market) of inventories less all valuation, other allowances, and progress payments or customer advances received on long-term contracts or programs. Excludes noncurrent inventory balances (expected to remain on hand past one year or one operating cycle, if longer).', 'Firm Resources:Economic Value', 'Balance Sheet:Current Assets'),
	(852218, 'Income Taxes Paid', 'The amount of cash paid during the current period to foreign, federal, state, and local authorities as taxes on income.', 'Operating Activities:Cash flow', 'Statement of Cash Flows:Operating Activities'),
	(856246, 'Cash, Cash Equivalents, and Federal Funds Sold', 'The sum of cash and cash equivalents plus Federal Funds Sold. Cash and cash equivalents consist of short term, highly liquid investments that are readily convertible to known amounts of cash and are so near their maturity that they present negligible risk of changes in value due to changes in interest rates -- usually with an original maturity less than 90 days.', 'Firm Resources:Liquidity', 'Balance Sheet:Current Assets'),
	(857467, 'Other Revenue', 'Revenues from the sale of other goods or rendering of other services, including other financial service, not elsewhere specified in the taxonomy; net of (reduced by) sales adjustments, returns, allowances, and discounts.', 'Nonoperating Costs and Revenues and revenues:Earnings', 'Income Statement:Revenue'),
	(858812, 'Federal Contract Amount for 8961: Federal Energy Regulatory Commission', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 8961: Federal Energy Regulatory Commission', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(863954, 'Accounts Payable and Accrued Liabilities, Current', 'Sum of the carrying values as of the balance sheet date of obligations incurred through that date and due within one year (or the operating cycle, if longer), including liabilities incurred (and for which invoices have typically been received) and payable to vendors for goods and services received, taxes, interest, rent and utilities, accrued salaries and bonuses, payroll taxes and fringe benefits.', 'Firm Obligations:Solvency', 'Balance Sheet:Current Liabilities'),
	(863966, 'Current Liabilities', 'Total obligations incurred as part of normal operations that are expected to be paid during the following twelve months or within one business cycle, if longer.', 'Firm Obligations:Solvency', 'Balance Sheet:Current Liabilities'),
	(864037, 'Stock Options, Granted, Price', 'Weighted average per share amount at which grantees can acquire shares of common stock by exercise of options.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(866422, 'Return On Equity before Nonrecurring Items', 'Net Income - Nonrecurring Items After Tax) / Average Shareholders Equity', 'Profitability:Earnings', 'Ratio:Profitability'),
	(867869, 'Operating Leases, Minimum Payments Due in Two Years', 'Amount of required minimum rental payments maturing in the second fiscal year following the latest fiscal year for operating leases having an initial or remaining non-cancelable letter-terms in excess of one year.', 'Operating Costs:Expected Future Cash Flow', 'Income Statement:Operating Expense'),
	(868756, 'Price To Sales', 'Market price per share / Net Sales Per Share', 'Market:Valuation', 'Ratio:Multiple'),
	(872107, 'Other Liabilities, Noncurrent', 'Aggregate carrying amount, as of the balance sheet date, of noncurrent obligations not separately disclosed in the balance sheet. Noncurrent liabilities are expected to be paid after one year (or the normal operating cycle, if longer).', 'Firm Obligations:Leverage', 'Balance Sheet:Liabilities'),
	(875810, 'Change in Inventories', 'The increase (decrease) during the reporting period in the aggregate value of all inventory held by the reporting entity, associated with underlying transactions that are classified as operating activities.', 'Firm Resources:Liquidity', 'Statement of Cash Flows:Changes in Working Capital Account'),
	(880740, 'Federal Contract Amount for 7200: Agency For International Development', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 7200: Agency For International Development', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(882605, 'Dividends Per Common Share', 'Dividends divded by number of common shares outstanding.', 'Owners\' Investment:Valuation', 'Statement of Changes in Stockholders\' Equity:Dividends'),
	(883905, 'Change in Other Operating Assets', 'The increase (decrease) during the reporting period in other assets used in operating activities not separately disclosed in the statement of cash flows. May include changes in other current assets, other noncurrent assets, or a combination of other current and noncurrent assets.', 'Firm Resources:Liquidity', 'Statement of Cash Flows:Changes in Working Capital Account'),
	(888130, 'Cash from Operating Activities, Discontinued Operations', 'Amount of cash inflow (outflow) of operating activities of discontinued operations. Operating activity cash flows include transactions, adjustments, and changes in value not defined as investing or financing activities.', 'Operating Activities:Cash flow', 'Statement of Cash Flows:Operating Activities'),
	(890426, 'Cash Flow to Capital Expenditures', 'Cash from Operating Activities / Capital Expenditures', 'Investing Activities:Firm Resources', 'Ratio:Cash Flow Performance'),
	(890684, 'Federal Contract Amount for 19Bm: International Boundary And Water Commission: U.S.-Mexico', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 19Bm: International Boundary And Water Commission: U.S.-Mexico', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(891878, 'Deferred Tax Assets, Net of Valuation Allowance', 'Amount after allocation of valuation allowances of deferred tax asset attributable to deductible temporary differences and carryforwards.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(893190, 'Amortization of Capitalized Software Costs', 'For each income statement presented, the amount charged to expense for amortization of capitalized computer software costs.', 'Operating Costs:Selling, General and Administrative', 'Income Statement:Operating Expense'),
	(895600, 'Cash Dividends', 'Cash outflow in the form of capital distributions and dividends to common shareholders, preferred shareholders and noncontrolling interests.', 'Owners\' Investment:Cash flow', 'Statement of Cash Flows:Dividends'),
	(896686, 'Property, Plant and Equipment, Net, Including Capital Leased Assets', 'Property, plant and equipment including capital leased assets.', 'Firm Resources:Economic Value', 'Balance Sheet:Assets'),
	(902284, 'Cash from Operating Activities Continuing Operations', 'Amount of cash inflow (outflow) from Operating Activities, excluding discontinued operations. Operating activity cash flows include transactions, adjustments, and changes in value not defined as investing or financing activities.', 'Operating Activities:Solvency', 'Statement of Cash Flows:Operating Activities'),
	(903829, 'Contractual Obligation, Due after Fifth Year', 'Amount of contractual obligation maturing after the fifth fiscal year following the latest fiscal year.', 'Firm Obligations:Solvency', 'Balance Sheet:Liabilities'),
	(904924, 'Federal Contract Amount for 9300: Federal Mediation And Conciliation Service', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 9300: Federal Mediation And Conciliation Service', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(906132, 'Cash from Operating Activities', 'Amount of cash inflow (outflow) from Operating Activities, including discontinued operations. Operating activity cash flows include transactions, adjustments, and changes in value not defined as investing or financing activities.', 'Operating Activities:Solvency', 'Statement of Cash Flows:Operating Activities'),
	(907671, 'Net Profit Margin', 'Net Income / Net Sales', 'Profitability:Earnings', 'Ratio:Profitability'),
	(907959, 'Total Debt', 'Total of short term debt and long term debt.', 'Firm Obligations:Leverage', 'Balance Sheet:Liabilities'),
	(909904, 'Operating Cash Flow Per Share', 'Cash from Operating Activities Continuing Operations / Per Share', 'Operating Activities:Cash flow', 'Ratio:Cash Flow Performance'),
	(910435, 'Gain (Loss) on Sale of Business', 'Gain (loss) from sale or disposal of an organization or integrated set of activities (for example, but not limited to, a partnership or corporation) engaged in providing a product or service in a commercial, industrial, or professional environment.', 'Operating Activities:Earnings', 'Income Statement:Income'),
	(919275, 'Working Capital', 'Current Assets - Current Liabilities', 'Firm Resources:Solvency', 'Statement of Cash Flows:Changes in Working Capital Account'),
	(919951, 'Federal Contract Amount for 3600: Dept Of  Veterans Affairs', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 3600: Dept Of  Veterans Affairs', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(921514, 'Federal Contract Amount for 9516: Defense Nuclear Facilities Safety Board', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 9516: Defense Nuclear Facilities Safety Board', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(922150, 'Interest Expense After Tax', 'Interest Expenses * (1 - Tax Rate)', 'Financing Activities:Cost of financing', 'Income Statement:Interest Expense'),
	(922593, 'Net Sales Per Share', 'Net Sales / Per Share', 'Profitability:Earnings', 'Ratio:Profitability'),
	(926318, 'Federal Contract Amount for 3400: International Trade Commission', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 3400: International Trade Commission', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(926556, 'Prepaid Expense, Current', 'Amount of asset related to consideration paid in advance for costs that provide economic benefits within a future period of one year or the normal operating cycle, if longer.', 'Firm Resources:Liquidity', 'Balance Sheet:Current Assets'),
	(927731, 'Change in Prepaid Expenses and Other Assets', 'The increase (decrease) during the reporting period in the value of prepaid expenses and other assets not separately disclosed in the statement of cash flows, for example, deferred expenses, intangible assets, or income taxes.', 'Firm Resources:Liquidity', 'Statement of Cash Flows:Changes in Working Capital Account'),
	(930449, 'Comprehensive Income (Loss), Net of Tax, Including Noncontrolling Interest', 'Amount after tax of increase (decrease) in equity from transactions and other events and circumstances from net income and other comprehensive income, attributable to parent entity. Excludes changes in equity resulting from investments by owners and distributions to owners.', 'Owners\' Investment:Earnings', 'Statement of Comprehensive Income:Income'),
	(933148, 'Notes and Loans Receivable, Net, Current', 'An amount representing an agreement for an unconditional promise by the maker to pay the Company (holder) a definite sum of money within one year from the balance sheet date (or the normal operating cycle, whichever is longer), net of any write-downs taken for collection uncertainty on the part of the holder. Such amount may include accrued interest receivable in accordance with the terms of the debt. The debt also may contain provisions and related items including a discount or premium, payable', 'Firm Resources:Economic Value', 'Balance Sheet:Current Assets'),
	(936573, 'Convertible Debt, Net of Tax', 'The after-tax amount of any dividends on convertible preferred stock.', 'Financing Activities:Solvency', 'Balance Sheet:Liabilities'),
	(940439, 'Cash Conversion Cycle', 'Days Inventory Conversion + Days Receivables Conversion - Days Payables Conversion', 'Operating Activities:Liquidity', 'Ratio:Cash Flow Performance'),
	(947700, 'Period Prior Close Stock Price', 'Period Prior Close Stock Price', 'Market:Valuation', 'Stock Price:'),
	(949201, 'Earnings After Interest Before Taxes', 'Sum of operating profit and nonoperating income or expense before Income or Loss from equity method investments, income taxes, extraordinary items, and noncontrolling interest.', 'Profitability:Earnings', 'Income Statement:Income'),
	(953826, 'Receivables, Net, Current', 'The total amount due to the entity within one year of the balance sheet date (or one operating cycle, if longer) from outside sources, including trade accounts receivable, notes and loans receivable, as well as any other types of receivables, net of allowances established for the purpose of reducing such receivables to an amount that approximates their net realizable value.', 'Firm Resources:Liquidity', 'Balance Sheet:Current Assets'),
	(954325, 'Federal Contract Amount for 6000: Railroad Retirement Board', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 6000: Railroad Retirement Board', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(958530, 'Insider Stock Purchase Shares', 'The number of shares purchased by employees, executives, directors and other persons considered to be insiders of the company.', 'Insider Trading Transactions:Insider Stock Purchases', 'Stockholders Equity:Related Party Transactions'),
	(958803, 'Proceeds from Issuance of Common Stock', 'The cash inflow from the additional capital contribution to the entity.', 'Owners\' Investment:Cash flow', 'Statement of Cash Flows:Financing Activities'),
	(960501, 'Commitments and Contingencies', 'Represents the caption on the face of the balance sheet to indicate that the entity has entered into (1) purchase or supply arrangements that will require expending a portion of its resources to meet the terms thereof, and (2) is exposed to potential losses or, less frequently, gains, arising from (a) possible claims against a company\'s resources due to future performance under contract terms, and (b) possible losses or likely gains from uncertainties that will ultimately be resolved when one or', 'Firm Obligations:Solvency', 'Balance Sheet:Liabilities'),
	(965488, 'Current Assets', 'Sum of the carrying amounts as of the balance sheet date of all assets that are expected to be realized in cash, sold, or consumed within one year (or the normal operating cycle, if longer). Assets are probable future economic benefits obtained or controlled by an entity as a result of past transactions or events.', 'Firm Resources:Liquidity', 'Balance Sheet:Current Assets'),
	(966821, 'Federal Contract Amount for 1600: Dept Of  Labor', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 1600: Dept Of  Labor', 'Federal Contract Earnings:Major Agency', 'Income Statement:Federal Contract Earnings'),
	(967565, 'Accrued Liabilities, Current', 'Carrying value as of the balance sheet date of obligations incurred and payable, pertaining to costs that are statutory in nature, are incurred on contractual obligations, or accumulate over time and for which invoices have not yet been received or will not be rendered. Examples include taxes, interest, rent and utilities. Used to reflect the current portion of the liabilities (due within one year or within the normal operating cycle if longer).', 'Firm Obligations:Solvency', 'Balance Sheet:Current Liabilities'),
	(968170, 'Income (Loss) from Continuing Operations before Income Taxes, Domestic', 'The portion of earnings or loss from continuing operations before income taxes that is attributable to domestic operations.', 'Earnings:Operating Performance', 'Income Statement:Income'),
	(969454, 'Other Liabilities, As Reported', 'The aggregate carrying amount, as of the balance sheet date, of liabilities not separately disclosed in the balance sheet.', 'Firm Obligations:Leverage', 'Balance Sheet:Liabilities'),
	(973089, 'Common Stock, Par Value per Share', 'Aggregate par or stated value of issued nonredeemable common stock (or common stock redeemable solely at the option of the issuer). This item includes treasury stock repurchased by the entity. Note_ elements for number of nonredeemable common shares, par value and other disclosure concepts are in another section within stockholders\' equity.', 'Owners\' Investment:Valuation', 'Balance Sheet:Share'),
	(973254, 'Proceeds From (Repayment) of Debt', 'The net cash inflow or outflow in aggregate debt due to repayments and proceeds from additional borrowings.', 'Financing Activities:Cash flow', 'Statement of Cash Flows:Financing Activities'),
	(975406, 'Change in Accounts Receivables', 'The increase (decrease) during the reporting period in amount due within one year (or one business cycle) from customers for the credit sale of goods and services.', 'Firm Resources:Liquidity', 'Statement of Cash Flows:Changes in Working Capital Account'),
	(976118, 'Operating Cash Flow To Debt', 'Cash from Operating Activities / Total Debt', 'Operating Activities:Cash flow', 'Ratio:Cash Flow Performance'),
	(979346, 'Stockholders\' Equity Attributable to Parent', 'Total of all stockholders\' equity (deficit) items, net of receivables from officers, directors, owners, and affiliates of the entity which are attributable to the parent. The amount of the economic entity\'s stockholders\' equity attributable to the parent excludes the amount of stockholders\' equity which is allocable to that ownership interest in subsidiary equity which is not attributable to the parent (noncontrolling interest, minority interest). This excludes temporary equity and is sometimes ', 'Owners\' Investment:Valuation', 'Balance Sheet:Equity'),
	(979552, 'Debt Excluding Capital Leases, Due in Year Four', 'Amount of long-term debt, sinking fund requirements, and other securities redeemable at fixed or determinable prices and dates maturing in the fourth fiscal year following the latest fiscal year.', 'Firm Obligations:Expected Future Cash Flow', 'Balance Sheet:Liabilities'),
	(982558, 'Fixed Asset Turnover', 'Net Sales / Property, Plant and Equipment, Net', 'Firm Resources:Operating Performance', 'Ratio:Efficiency'),
	(984562, 'Taxes Payable, Current', 'Carrying value as of the balance sheet date of obligations incurred and payable for statutory income, sales, use, payroll, excise, real, property and other taxes. Used to reflect the current portion of the liabilities (due within one year or within the normal operating cycle if longer).', 'Firm Obligations:Solvency', 'Balance Sheet:Current Liabilities'),
	(991291, 'Federal Contract Amount for 6300: National Labor Relations Board', 'The net, aggregated federal contract dollar amount that is obligated or de-obligated for 6300: National Labor Relations Board', 'Federal Contract Earnings:Other Agency', 'Income Statement:Federal Contract Earnings'),
	(994460, 'Purchases', 'Cost of Goods Sold + Change in Inventories', 'Operating Costs:COGS', 'Income Statement:Operating Expense'),
	(996356, 'Income from Asset Sales', 'Amount of gain (loss) on sale or disposal of property, plant and equipment assets, excluding oil and gas property and timber property.', 'Investing Activities:Earnings', 'Income Statement:Income');
