INSERT INTO `researchpublications` (`ID`, `Titre`, `Auteur`, `Type`, `Description`, `URL`) VALUES
	(1, 'Biomimicry: Nature as Model, Measure and Mentor', 'The Cloud Institute for Sustainability Education', 'PFE', 'Biomimicry: Nature as Model, Measure and Mentor', 'http://cloudinstitute.org/storage/terracycle/Materials%20Cycle%20-%206-8_lessonplan.pdf'),
	(2, 'Biomimicry in Architecture', 'Michael Pawlyn', 'THESE', 'Biomimicry in Architecture', 'http://www.ribabookshops.com/cms/product/preview/biomimicryinarchitectureextract.pdf'),
	(3, 'Biomimicry in Engineering', 'TryEngineering', 'PFE', 'Biomimicry in Engineering', 'http://www.tryengineering.org/lessons/biomimicry.pdf'),
	(4, 'Biomimicry: Nature as Model, Measure and Mentor', 'Sustainbility Leaders Network', 'THESE', 'Biomimicry: Nature as Model, Measure and Mentor', 'http://www.sustainabilityleadersnetwork.org/wp-content/uploads/2013/04/Learning-from-Nature-A-Course-in-Biomimicry-Teachers-Curriculum.pdf'),
	(5, 'Biomimicry innovation inspired by nature', 'Biomimicry Institute', 'PFE', 'Biomimicry innovation inspired by nature', 'http://openwetware.org/images/c/c1/IBE_-_biomimicry_lecture.pdf');
INSERT INTO `storyboard` (`id`, `title`, `description`, `creation_time`, `modification_time`, `public`, `start_end_template`, `start_image`, `end_text`, `end_avatar`, `end_link`, `end_link_name`, `user`) VALUES
	(1, 'Dow Power?', 'The Dow industrials and S&amp;P 500 rallied to fresh highs in the beginning of July 2014, kicking off the second half of the year on a <b><i>bullish</i></b> note. The rally took the Dow to the emotional marker of&nbsp;17,000+, which is the highest&nbsp;in a more-than-five-year rally for stocks after their \nfinancial-crisis declines.<br><br>Some people think the market is going higher because of the overall emotion of "extreme greed" is driving the market. Emotions aside, if we look closely at the true measures of the financial strength of these 30 companies, perhaps we can all feel more confident about our investment decisions.<br><br>', '2014-07-02 13:10:59', '2014-07-13 22:32:22', 1, 2, 'http://application.idaciti.com//data/upload/2Dow17000.jpeg', 'Dow doesn’t help us make sense of an increasingly interconnected global economy, but lit still helps to look&nbsp;closely at the financial strength of the largest US corporations.', 0, 'http://hello.idaciti.com/#get-invite', 'Get invite and be a data storyteller.', 2),
	(2, 'All About Apple', 'Apple\'s branding strategy focuses on the <b><u>\nemotions</u></b>. The starting point is how an Apple product experience makes \nyou <i>feel</i>. Apple\'s products&nbsp;“seduce” the consumer’s mind, address genuine consumer anxieties and emotions – and the products are&nbsp;elegantly simple.<br><br><br>The Apple brand personality is also about \n<i>simplicity,&nbsp;</i>and about being a really caring &nbsp;company with a heartfelt connection with its customers. Apple is a powerful brand, but can it last? This year, Google has&nbsp;surpassed Apple as the most valuable brand, can Apple regain its lead?&nbsp;<br><br>On 9.9.2014, Apple showcased the new iPhone 6/iPhone 6 Plus. More importantly, Apple has finally revealed the long waited Apple Watch (not iWatch as some expected). Will Apple Watch be the game changer, again? I don\'t know, but I for one, can\'t wait to get my hands on one.<br><br>', '2014-07-02 16:09:48', '2014-10-06 15:07:13', 1, 2, 'http://application.idaciti.com//data/upload/2AppleStore.jpeg', 'The Apple brand personality is about&nbsp;<i>lifestyle</i>; i<i>magination</i>;&nbsp;<i>passion</i>;&nbsp;<i>hopes</i>,&nbsp;<i>dreams</i>; and power-to-the-people through innovative technology.<br>', 0, 'http://hello.idaciti.com/#get-invite', 'Get invite and be a data storyteller.', 2),
	(3, 'Pay for Performance?', 'Executive compensation has been a hot topic in recent years. &nbsp;The financial press and investment community have been calling for the reigning in of excessive executive compensation. &nbsp;Companies argue that they need to pay for executive performance.<br><br>How does Google incentivize its employees to perform in order&nbsp;to create value for the Company? In the 2012 proxy statement, Google stated that the Company awards its top executives cash bonuses and equity awards based on the company-wide financial and&nbsp;operating performance.&nbsp;<br>&nbsp;<a target="_blank" rel="nofollow" href="http://www.sec.gov/Archives/edgar/data/1288776/000130817913000248/lgoogle_def14a.htm">http://www.sec.gov/Archives/edgar/data/1288776/000130817913000248/lgoogle_def14a.htm</a>s&nbsp;Do we see&nbsp;&nbsp;correlation between overall compensation and firm performance?', '2014-07-03 11:29:54', '2014-07-15 14:27:39', 1, 1, 'http://application.idaciti.com//data/upload/23Image exec compensation.jpg', 'Do you think Google\'s compensation incentive scheme&nbsp;is paying off&nbsp;compared to Apple and Microsoft? &nbsp;What other analyses can we do to dig further into this? Come and join the discussion!', 0, '', '', 23),
	(4, 'Risk of Bankruptcy?', 'After the 2008 financial crisis, we have learned how important it is to understand CREDIT risks when investing in equities.<br><br>As an investor, you&nbsp;have to have your eyes open to the fact that if you are buying a company with a weak balance sheet and something changes, then that’s when you are going to be most exposed as a shareholder.<br><span><br>For more information, you might want to&nbsp;</span>read Altman\'s follow-up paper published in &nbsp;2000, entitled:&nbsp;<a target="_blank" rel="nofollow" href="http://www.stockopedia.co.uk/clicks/?url=http://pages.stern.nyu.edu/~ealtman/Zscores.pdf" title="Link: http://www.stockopedia.co.uk/clicks/?url=http://pages.stern.nyu.edu/~ealtman/Zscores.pdf">Predicting the Financial Distress of Companies: Revisiting the Z-Score</a><span>.<br></span><span><br><br><br><br></span><br><br>', '2014-07-04 09:09:59', '2014-07-04 15:48:14', 0, 1, 'http://application.idaciti.com//data/upload/2Zscore.jpeg', 'Despite its flaws, the original Z Score model is still the most widely used measure of corporate financial distress.<span><br></span>', 0, NULL, NULL, 2),
	(6, 'Declining Tax Burdens?', 'Sure, the US may have the highest statutory corporate tax rate, but so what? No one pays that rate because of all the tax breaks and other loopholes, right?&nbsp;<br><br>The reason is not simply a few loopholes, it’s far bigger: the slow but steady transformation of the American multinational after years of globalization. Companies now have an unprecedented ability to move their capital around the world, and the corporate tax code has not kept up with the changes.<br><br><span>Walgreen\'s decision to <b>stay</b>&nbsp;a US company due to the pressure from the investors has proved what I always believed that&nbsp;companies that try to hide their profits, through whatever loophole/strategy, risk testing the goodwill of investors and&nbsp;consumers.<br></span><br><br>', '2014-07-05 10:13:38', '2014-08-07 07:21:23', 1, 2, 'http://application.idaciti.com//data/upload/2CorporateTax.jpeg', 'Corporate income taxes impact the federal revenue.&nbsp;Let\'s all try to understand and try to participate in the critical debates about federal spending and revenue.<br><br>', 0, 'https://www.nationalpriorities.org/', 'Learn more about federal budget', 2),
	(7, 'Storyboarding is the New Black', 'Your storyboard should start with a provocative statement or question that engages your audience from the get-go. You might want to support your statement or question with some backup text. Try to ensure that&nbsp;all your starter text displays \'above the fold\' so readers do not have to scroll through reams of exposition.<br>It\'s a lead-in, not a lecture.', '2014-07-07 04:28:40', '2014-07-15 00:55:04', 1, 1, 'http://application.idaciti.com//data/upload/182idaciti-logo.png', 'So what\'s your story? <br>Tell data stories with Idaciti.', 0, 'http://www.wfp.org/hunger/stats', 'Get the Latest on World Hunger...', 18),
	(8, 'Do Stock Buy Backs Reward Shareholders?', 'According to an article in the Washington Post, the 30 companies listed on the Dow Jones Industrial Average&nbsp;<u>a</u>uthorized $211&nbsp;billion in buybacks in 2013, according to data from ­Birinyi Associates, &nbsp;Some commentators suggest that stock buybacks signal that companies anticipate slower future growth. &nbsp;As a result, they use the excess cash to repurchase stock instead of investing in R&amp;D or capital expenditures. &nbsp;However, others suggest that stock buybacks can be a means for companies to&nbsp;&nbsp;fool the market by artificially increasing Earnings Per Share, a measure that investors pay attention.', '2014-07-07 07:30:48', '2014-11-07 03:34:02', 1, 1, 'http://application.idaciti.com//data/upload/23StockbyBack.jpg', 'What are your thoughts on stock buybacks?', 0, '', '', 23),
	(9, 'Getting Started', '<div>\n			<div>\n				<div>When you login to idaciti the home page shows the latest idaciti content highlights and US stock\nmarket information. You can also access the most recent SEC 10-K and 10-Q filings.<br><br><div>The sidebar has a number of options:<br><br></div><div>• <b><i>Dashboard</i></b> - return you to the home page/dashboard</div><div>• <b><i>Browse Cards </i></b>- view all the cards you have permission to view</div><div>• <b><i>Browse Storyboards</i></b> - view all the storyboards you have permission to view</div><div>• <b><i>Browse Circles</i></b> - view all the user circles (groups of users) you have permission to view</div><div>• <b><i>My Cards</i></b> - view and edit cards you own/created</div><div>• <b><i>My Storyboards</i> </b>- view and edit storyboards you own/created</div><div>• <b><i>My Circles</i> </b>- interact with circles you belong to</div><div>• <b><i>Recently Created...</i></b> - quick access to recently created&nbsp;cards/storyboards by you&nbsp;<br><br></div><br>Now, let\'s get started.\n					\n				</div>\n			</div>\n		</div>', '2014-07-09 07:41:05', '2014-07-18 16:21:23', 1, 2, 'http://application.idaciti.com//data/upload/2idaciti-logo.png', '<span>Get Data. Build Cards. Craft Story. Share Story.<br><br><br><br></span>', 0, 'http://www.linkedin.com/in/emilyhuang/', 'Connect with me on LinkedIn', 2),
	(11, 'Coffee, Anyone?', 'I am not a coffee drinker, but I am addicted to the iced green tea at Starbucks. It has never stopped to amaze me just how many Starbucks stores you can find around the world. They MUST be very profitable, right? When so many coffee and tea drinkers pay $3, $4, $5 for a cup of coffee/tea, profitability seems only logical. <br><br>I want to take a look at how Starbucks is doing and how they compare to another well-loved brand Whole Foods.<br><br><i>Time for a cup of tea to dig deeper...</i><br><br>', '2014-07-11 11:33:53', '2014-08-08 20:49:36', 1, 2, 'http://application.idaciti.com//data/upload/2starbucks.jpg', '<span>Starbucks is a&nbsp;popular brand among customers and investors with excellent brand power. &nbsp;I believe I will continue to enjoy my iced tea for years to come.<br><br></span><br>', 0, 'http://www.idaciti.com/#get-invite', 'Get invite and be a data storyteller.', 2),
	(12, 'Fanatical Cult Followings', 'TBD', '2014-07-12 19:29:23', '2014-07-13 07:58:11', 0, 1, 'http://application.idaciti.com//data/upload/2Brand 2.png', 'TBD', 0, '', '', 2),
	(13, 'Test de Storyboard', 'Test de storyboard', '2014-07-15 15:46:21', '2014-07-15 15:46:21', 0, 1, '', 'Allez, on y va', 0, '', '', 45),
	(14, 'idaciti -- Telling stories with data', '<b>Why idaciti?</b><b>\n</b>\n<br>\n\n<br>Because we beleive a great way to get value\n\nfrom the world of big financial data\n\nis\nby using data to tell stories.<br><br><b>idaciti\'s Misson:<br><br></b><div>Democratize the access to global financial information to drive changes is our mission. We aim to empower citizens of all countries to access the high value financial data -- from both public corporations and governments to gain insights and drive changes <i>locally</i> and <i>globally</i>.<br><br><br><br><br></div><br><br>', '2014-07-17 18:52:43', '2014-07-27 09:56:25', 0, 3, '', 'TBD<br><br>', 0, 'http://www.idaciti.com', 'Connect with us ', 2),
	(15, 'Hey, Big Spender!', 'Federal contracts -- how much were spent in education vs defense', '2014-08-06 17:26:57', '2014-07-24 17:08:53', 0, 1, 'http://application.idaciti.com//data/upload/2FederalContracts.jpeg', 'TBD', 0, '', '', 2),
	(16, 'Chevron\'s Capital Expenditures', 'In late 2013, Chevron announced that the Company would spend nearly&nbsp;$40B in capital expenditures in 2014. &nbsp;This seems like a lot of resources committed to investing in the company\'s operations! &nbsp;Let\'s take a look and see how Chevron compares to other Oil and Gas companies and whether these capital expenditures are paying off by increasing the stock price.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;', '2014-07-25 13:45:06', '2014-08-02 06:59:36', 1, 1, 'http://application.idaciti.com//data/upload/23logoChevron.gif', 'Which company should you invest in? &nbsp;It would seem that if you want growth,&nbsp;Chevron is your bet. &nbsp;However, if you want stability, then Exxon is preferable. &nbsp;What do you think?', 0, '', '', 23),
	(18, 'Record Debt and Record Cash', 'Since 2008, the Fed\'s <b>easy cash policies</b> have allowed companies to buy back stock, pay dividends and make acquisitions largely without tapping cash from overseas subsidiaries. By leaving foreign profit overseas, companies avoid the sting of the U.S.\'s 35% federal tax rate on it.<span>The result is a peculiar situation in which U.S. companies simultaneously have issued <i><b>record amounts of debt</b></i>—both in nominal terms and as a percent of gross domestic product—and hold what appears to be <i><b>record amounts of cash overseas</b></i>.&nbsp;<br><br></span><span>Rising foreign cash holdings correspond to a growing share of earnings derived from outside U.S. borders as companies expand around the globe. And the figure is rising, too. For example,&nbsp;55% of IBM\'s sales originate outside the U.S. <br><br>What does this mean for investors, and for US?<br></span><span><br><br><br><br></span>', '2014-08-18 10:22:15', '2014-08-01 13:14:14', 0, 2, 'http://application.idaciti.com//data/upload/2Cash.jpg', '<span>Money flows to <b>where</b> it creates the most value. &nbsp;For US corporations, looks like&nbsp;this is often into off-shore projects rather than the US.&nbsp;</span><br><br>', 0, '', '', 2),
	(22, 'Can Amazon Make Money? ', 'As a consumer, I love Amazon. Love the convenience&nbsp;&nbsp;that I can buy and download eBooks,&nbsp;buy a 80-inch HD TV and outdoor socks for my English Lab&nbsp;Tucker all from the same online store. But I often wonder is Amazon a profitable business, and as an investor, should I invest in them?<br><br>Amazon would want us to believe that it&nbsp;is&nbsp;profitable in its retail operations, but it\'s losing money overall because it\'s investing in big opportunities to expand globally and crank up sales. But other companies also make great investments (for example, Google), and can still post pretty impressive profits, so what\'s different about Amazon?<br><br><br><br><span><br><br></span><br><br><br>', '2014-08-20 09:39:58', '2014-08-27 09:17:57', 1, 2, 'http://application.idaciti.com//data/upload/2Amazon.jpeg', '<span>Amazon\'s&nbsp;<i>poor</i> profitability is most likely&nbsp;not a problem, as the company&nbsp;is using most of its revenue to aggressively invest in new products.&nbsp;<br><br></span>', 0, 'http://hello.idaciti.com/#get-invite', 'Join us and become a data storyteller', 2),
	(23, 'idaciti Going to School', '<span>We believe <b>Data\nstorytelling</b>&nbsp;is an important skill for\nfinance and accounting students. </span>In a teaching &amp; learning setting,&nbsp;<b>data storytelling</b> is also an activity that\nhelps to create a kind of collective intelligence from leveraging\nthe wisdom of a \'crowd\'. <br><br>Even disengaged students may find themselves\nattracted to the social story sharing&nbsp;paradigm.<b><span><br><br></span></b>We want to help professors deliver something extra to the finance and accounting programs by&nbsp;enabling you and your students get up to speed fast telling stories with the global financial data.<span><b> Together, we can&nbsp;engage, challenge and inspire students.<br><br><br><br><br></b><br><br><br></span><br><br><b><br></b>', '2014-08-20 18:46:18', '2014-11-15 23:14:26', 1, 2, 'http://application.idaciti.com//data/upload/2data-image.jpeg', '<b>When&nbsp;engage students in&nbsp;data storytelling, the learning might be a&nbsp;little clearer, a little less dogmatic, and a&nbsp;</b><i><b>lot</b></i><b>&nbsp;more fun.<br><br><br><br></b><b></b>', 0, 'http://hello.idaciti.com/#why', 'Learn more about why idaciti', 2),
	(26, 'CHECKING IN', 'Tourism is Hawaii\'s largest industry. Billions are spent on flights, hotels, and&nbsp;shopping by visiting&nbsp;tourists. A major expense for these tourists during their stay&nbsp;is the hotel bill. Hawaii has one of the highest average hotel rates in the country. To see whether or not the hotel rates in Hawaii and elsewhere generate high profit margins for the hotels, I chose to analyze the profitability ratios for Marriott International (MAR) and Wynn Resorts&nbsp;&nbsp;(WYNN).', '2014-08-29 17:14:05', '2014-08-29 18:46:53', 0, 2, '', 'It appears that the rates these hotel companies&nbsp;charge do generate healthy returns. However, it does not appear that these companies are making unreal levels of profit.&nbsp;', 0, '', '', 80),
	(27, 'Home Depot', 'Often, people get confused with Cash Inflow and Net Income and make the mistake of interpreting the two concepts as the same. &nbsp;Of course, as accountants and savvy investors, we know that there is a DIFFERENCE between cash flow and net income (which is based on&nbsp;\'accrual\' accounting). &nbsp;Let\'s take a look at Home Depot and explore how the company\'s cash flow is related to its net income.', '2014-09-08 07:54:39', '2014-09-08 08:01:35', 0, 1, 'http://application.idaciti.com//data/upload/23Home Depot image.jpg', 'Now you can see why the cash inflow and outflow from a company\'s operating activities is not equal to&nbsp;its net income. &nbsp;Can you find some examples of other companies?', 0, '', '', 23),
	(28, 'Apple: Marketing or Technology?', 'Is Apple moving into more fashion-minded luxury goods market to protect its profit margin? The&nbsp;<span><b>Apple Watch</b> are meticulously designed and continue Apple’s design strategy of elegant simplicity and fine materials.&nbsp;I simply couldn\'t take my eyes off this beautiful 18K Rose Gold Apple Watch that\'s likely going to cost way&nbsp;more than double its $349 base price. <br><br>I love Apple, but after watching the 9.9.2014 event, I have to ask if&nbsp;</span><span>f<i>undamental innovation</i> is missing from the highly anticipated <i>marketing</i> event? Is Apple changing from a technology company that\'s marketing-savvy to a marketing company that creates technology-based products and services?<br><br><br><br><br><br></span>', '2014-09-10 16:45:02', '2014-09-11 09:51:53', 1, 2, 'http://application.idaciti.com//data/upload/2Apple 18K Watch.png', 'Is Apple a technology driven company or has Apple become a marketing company, and how would this matter to you as an investor?<br><br>', 0, 'http://hello.idaciti.com/#get-invite', 'Join us and become a data storyteller', 2),
	(29, 'Goooogle！V.S Ciscoooo！', 'A financial&nbsp;battle between the giant and the dwarf !', '2014-09-24 21:30:57', '2014-11-20 04:22:29', 1, 1, '', 'Never End&nbsp;', 0, '', '', 163),
	(30, 'Example Storyboard', 'This storyboard is looking at:<br>Current Ratio<br>Profit Margin on Sale<br>', '2014-10-01 07:14:30', '2014-10-01 07:48:19', 0, 1, '', 'End of Storyboad', 0, '', '', 101),
	(31, 'Home Depot\'s Shareholders Equity Changes', '<b>The stockholders equity of Home Depot Inc decreased a lot during 2013 to 2014, I would like to figure out why</b>', '2014-10-01 12:10:04', '2014-10-01 12:10:36', 0, 1, 'http://application.idaciti.com//data/upload/133下载.jpg', '<b>It is very weird that the shareholders equity of Home Depot Inc decreased while its common stock and treasury stock all decreased at the same time. I have checked the financial report of Home Depot Inc in 2013, it shows that its treasury stock kep', 0, '', '', 133),
	(32, 'Storyboard for P&G and J&J', 'All cards created in past few weeks:<br>1. Cash Flow Statement<br>2. Cash Flow Statement (side by side)<br>3. Income Statement<br>4. Liquidity<br>5. Non-recurring<br>6. Revenue', '2014-10-01 12:55:24', '2014-10-01 13:04:10', 0, 2, 'http://application.idaciti.com//data/upload/92wm7rviyaltcihwzleqnees4vziadw6rhlm5vs2oll757hbaoaxlq_0_0.png', 'Storyboard for G&amp;P and J&amp;J.<br>', 0, '', '', 92),
	(34, 'Introduction to Financial Analysis', 'After looking through data from several different companies financial statements, I was able to apply accounting principals and analysis techniques learned in class&nbsp;to gauge companies past performance/revenue&nbsp;results and contemplate decisions the companies might of made in the past to grow their businesses.', '2014-10-07 07:57:22', '2014-10-07 07:59:15', 1, 1, '', 'Analyzing companies through various sectors (biotechnology, consumer staples, internet providers) showed me that different companies have different liquidity needs based on their business sector.', 0, '', '', 95),
	(35, 'Apple and Microsoft', '<p>A comprehensive look at how Apple compares with another long-lived giant of the tech industry.</p>', '2014-10-07 10:21:14', '2014-10-07 10:21:14', 0, 1, '', 'conclusion will go', 0, '', '', 103),
	(36, 'Storybook of Apple and Google', 'This story book use several items to analyze apple and Google\'s performance from 2009 to 2013.', '2014-10-07 12:40:05', '2014-10-07 23:51:38', 1, 1, '', 'After comparing Apple and Google, we find that Apple\'s revenue, incomeand cashflow are higher than Google\'s, but Apple has low liquidity.', 0, '', '', 86),
	(37, 'financial statement analysis', 'compare the data of different firms to analyze their past financial performance and future trend<br><br><br><br>', '2014-10-07 18:48:16', '2014-10-07 18:48:16', 0, 1, '', 'Storyboard&nbsp;<br><br>different industries included<br><br>', 0, '', '', 97),
	(61, 'Speedy AT&T vs. Reliable Verizon', 'Brief analysis of two big communication carriers\' financial statements.<br>', '2014-10-07 20:22:05', '2014-10-07 20:34:52', 0, 1, 'http://application.idaciti.com//data/upload/152ATT-Verizon.jpg', '<b><i>AT&amp;T has a speedy performance these year and becomes the most competitive rival to Verizon</i></b><br>', 0, 'http://www.cnet.com/news/speedy-at-t-vs-reliable-verizon-the-gap-narrows/', 'Speedy AT&T vs. Reliable Verizon', 152),
	(72, 'Business performance of Ebay and Amazon', 'This story board has combine the performance on&nbsp;income statement items and that on&nbsp;operation activities together.', '2014-10-07 20:32:53', '2014-10-07 21:23:38', 0, 1, '', 'story boar', 0, '', '', 125),
	(73, 'story board of starbucks', 'This story board includes liquidity analysis and operating performance analysis of starbucks', '2014-10-07 21:15:08', '2014-10-07 21:22:26', 0, 1, '', 'story board', 0, '', '', 125),
	(74, 'My first financial analysis', 'This is my first financial analysis storyboard.<br>In this storyboard,I analysis Wal-mart, Costco, Ebay and Amazon.<br>', '2014-10-07 21:19:54', '2014-10-07 21:22:58', 0, 1, '', 'There are still a lot of things that&nbsp;I need to work on on these five cards.Maybe more cards will add to this storyboard in the future.<br>If I keep making cards on these 4 companies,maybe I can have a deep understanding about their financial con', 0, '', '', 162),
	(75, 'Intro 4 Slides and Revenue/Liquidity ', 'Storyboard of first 4 cards, and an interesting relationship noted between Apple\'s high cash assets, and subsequent high liquidity, and compared to the revenue of IBM, Microsoft and Apple.', '2014-10-08 00:04:36', '2014-10-08 00:04:36', 1, 1, '', 'None?', 0, '', '', 138),
	(76, 'FS items of high-tech and retailers', 'This storyboard includes&nbsp;financial statements items of&nbsp;everal companies from high-tech and retailer and manufactures.', '2014-10-08 06:33:35', '2014-10-22 14:44:23', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/117can-stock-photo_csp3867827.jpg', 'If you have any questions please feel free to leave me a message', 0, '', '', 117),
	(77, 'Walt Disney EPS', 'An EPS analysis of the Walt Disney Corporati from 2009-2013<br>', '2014-10-08 08:50:21', '2014-10-08 08:50:21', 1, 1, 'http://application.idaciti.com//data/upload/140disney.jpg', 'Walt Disney\'s EPS grew substantially from 09-13. This was greatly aided by their consistent growth in Net Income. Great fluctuations in Common Shares Outstanding will be researched. <br>', 0, '', '', 140),
	(78, 'An Introduction to Financial Accounting', 'Storyboard of my first f cards examining several companies through different&nbsp;financial statements including:<br><ul><li>Income Statement (Ebay &amp; Amazon)</li><li>Statement of Cash Flows (Apple, IBM, &amp; Microsoft)</li><li>A card on Liquidity (AT&amp;T &amp; Verizon)</li><li>Non-Recurring Items (AT&amp;T &amp; Verizon)</li><li>Revenues for an Industry (AT&amp;T &amp; Verizon)&nbsp;</li></ul><br>', '2014-10-08 10:20:20', '2014-10-08 13:41:51', 1, 1, '', 'Kevin Toepfe', 0, '', '', 145),
	(79, 'Apple & Microsoft Trends', 'On the surface, it looks like Apple is performing much better than Microsoft due to Apple\'s much higher revenue. But when we look at cash from operations, Microsoft cash from operations is trending up while Apple\'s cash from operation is trending down. Also, the CAPEX for apple is much smaller then for Microsoft, this could mean that Microsoft is investing more expenditures while Apple is starting to be more conservative in expenditures. Further, Microsoft\'s liquidity is increasing over time, while Apple\'s liquidity is decreasing. This key measure signals that Microsoft is in much better financial standing while Apple may soon have issues paying its short term debt (yes that sounds crazy! but if you look at the Tech industry card, Apple\'s revenues are slowly beginning to level off in 2013-2014 while Microsoft has a steady increase in revenue over time.&nbsp; <br>', '2014-10-08 10:32:38', '2014-11-21 21:03:20', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/148Screen Shot 2014-10-24 at 4.37.40 PM.png', 'Could Microsoft be the next Apple?<br>"Microsoft transformed their brand identity and internal culture - good financial trends &amp; culture changes within Microsoft = good future."<br><br><br>', 0, 'http://adweek.mlbam.com/video/v36712467', 'Microsoft Transformation Presentation', 148),
	(80, 'EPS Analysis of Home Depot Inc.', 'I would like to figure out whether Home Depot Inc. is a good choice for investors through analyzing the performace of its&nbsp;EPS, Net Income and PE.', '2014-10-08 14:33:00', '2014-10-08 14:33:00', 0, 1, 'http://application.idaciti.com//data/upload/133egift-card-image-2.jpg', 'From the analysis about the EPS of Home Depot Inc., we can make a conclusion that it is a good choice for investors to buy its stocks at this time', 0, '', '', 133),
	(81, 'AT&T and Verizon: Earnings', 'Some analysis here<br>', '2014-10-09 12:23:08', '2014-10-14 14:31:03', 0, 1, '', '<p>Conclusion here</p>', 0, '', '', 103),
	(82, 'analysis about Google and Microsoft', 'Using Microsoft as a reference<br>', '2014-10-13 21:16:32', '2014-10-14 13:50:18', 0, 1, '', 'Compare Google and Microsof<br>', 0, '', '', 130),
	(83, 'eBay, Wal-Mart and Amazon', 'eBay Inc\'s retained earnings for the&nbsp;quarter&nbsp;that ended in&nbsp;Jun. 2014&nbsp;was$17,204 Mil.eBay Inc\'s&nbsp;quarterly&nbsp;retained earnings&nbsp;declined&nbsp;from Dec. 2013 ($18,854 Mil) to Mar. 2014 ($16,528 Mil) but thenincreased&nbsp;from Mar. 2014 ($16,528 Mil) to Jun. 2014 ($17,204 Mil).eBay Inc\'s&nbsp;annual&nbsp;retained earnings&nbsp;increased&nbsp;from Dec. 2011 ($13,389 Mil) to Dec. 2012 ($15,998 Mil) and&nbsp;increased&nbsp;from Dec. 2012 ($15,998 Mil) to Dec. 2013 ($18,854 Mil).<br><br>Wal-Mart Stores Inc\'s retained earnings for the&nbsp;quarter&nbsp;that ended in&nbsp;Jul. 2014was&nbsp;$77,172 Mil.Wal-Mart Stores Inc\'s&nbsp;quarterly&nbsp;retained earnings&nbsp;declinedfrom Jan. 2014 ($76,566 Mil) to Apr. 2014 ($73,366 Mil) but then&nbsp;increased&nbsp;from Apr. 2014 ($73,366 Mil) to Jul. 2014 ($77,172 Mil).Wal-Mart Stores Inc\'s&nbsp;annual&nbsp;retained earnings&nbsp;increased&nbsp;from Jan. 2012 ($68,691 Mil) to Jan. 2013 ($72,978 Mil) and&nbsp;increased&nbsp;from Jan. 2013 ($72,978 Mil) to Jan. 2014 ($76,566 Mil).<br><br>Amazon.com Inc\'s retained earnings for the&nbsp;quarter&nbsp;that ended in&nbsp;Jun. 2014was&nbsp;$2,172 Mil.Amazon.com Inc\'s&nbsp;qu', '2014-10-14 09:05:00', '2014-10-14 09:05:13', 0, 1, 'http://application.idaciti.com//data/upload/91ycharts_chart.png', 'eBay Inc\'s retained earnings for the&nbsp;quarter&nbsp;that ended in&nbsp;Jun. 2014&nbsp;was$17,204 Mil.eBay Inc\'s&nbsp;quarterly&nbsp;retained earnings&nbsp;declined&nbsp;from Dec. 2013 ($18,854 Mil) to Mar. 2014 ($16,528 Mil) but thenincreased&nbsp', 0, '', '', 91),
	(84, 'The cooperation between Apple and IBM', 'Apple has clearly been thinking more about the enterprise beyond the usual tallying of the Fortune 500 companies using iPads.&nbsp;<a target="_blank" rel="nofollow" href="http://www.cnet.com/products/apple-ios-8/">Apple\'s iOS 8</a>, the platform on which Apple and IBM will develop, includes enterprise-friendly provisions that run the gamut from more-open cloud services to out-of-office assistants.The partnership is a warning shot to Microsoft, which controls a broad swath of corporate computing in contrast to the high-end kinds of outsourcing and integration tasks that are the heart of Big Blue\'s business.But the alliance is not focused as much on today\'s computing experience as it is on the next generation of mobile. Indeed, the two companies represent a "divide and conquer" approach to Microsoft\'s "mobile-first, cloud-first" strategy that has been a rallying cry of CEO Satya Nadella. At least from a device perspective, Apple has succeeded in mobile the way few have. But Apple\'s cloud track record, while improving, lags behind that of its main mobile rivals, Microsoft and Google.That\'s why the partnership could have even more strategic value to Apple beyond the enterprise and coul', '2014-10-14 11:01:09', '2014-10-14 11:01:09', 0, 1, '', 'The cooperation between Apple and IBM let me think more about their relation in liquity. And What does their cooperation mean to Google and Microsoft?', 0, '', '', 91),
	(85, 'The coco cola company revenue', 'Coke is it -- it&nbsp;being the #1 nonalcoholic beverage company, as well as one of the world\'s most recognizable brands. The Coca-Cola Company&nbsp;is home to 16 billion dollar brands, including four of the top five soft drinks: Coca-Cola, Diet Coke, Fanta, and Sprite.&nbsp;Other top brands include&nbsp;Minute Maid<span>, Powerade, and vitaminwater. All told, the company owns or licenses and markets more than 500 beverage brands, mainly sparkling drinks but also waters, juice drinks, energy and sports drinks, and ready-to-drink teas and coffees. With the world\'s largest beverage distribution system,&nbsp;The Coca-Cola Company&nbsp;reaches thirsty consumers in more than 200 countries. Atlanta pharmacist John Pemberton invented Coke in 1886.</span>', '2014-10-14 11:17:25', '2014-10-14 11:17:25', 0, 1, 'http://application.idaciti.com//data/upload/91屏幕快照 2014-10-14 14.15.45.png', 'The coco cola company revenue and financial dat', 0, '', '', 91),
	(86, 'EPS Analysis of Pfizer and Competitors', 'This is an analysis of the earnings per share of Pfizer and its competitors(Merck, Johnson and Johnson)', '2014-10-14 15:35:40', '2014-10-17 09:25:28', 1, 1, 'http://application.idaciti.com//data/upload/160下载.png', 'Among the three pharmaceutical companies,&nbsp;Pfizer is the largest and it is under restructuring through asset sale and stock repurchase program in order to catch up with the competition.', 0, '', '', 160),
	(87, 'American Express EPS', 'This is an analysis of the earnings per share of American Expres', '2014-10-14 21:53:58', '2014-10-14 21:55:09', 0, 1, '', 'Talent hits a target no one else can hit; Genius hits a target no one else can see.<br>Francesk Nilaj<br><br><br><br>', 0, '', '', 114),
	(88, 'McDonalds\' storyboard', 'You can see McDonalds\' big logo( M with yellow and red) almost in every big city even country&nbsp;in the world. How can they be so successful? Following charts might bring us some ideas.', '2014-10-15 07:58:12', '2014-10-15 08:00:21', 0, 3, '', 'Thank you', 0, '', '', 167),
	(89, 'EPS Among Competitors', 'This board takes a high-level look at EPS trends (diluted and basic) among competitors in technology, telecommunications, and deep-discount retail.', '2014-10-15 08:53:48', '2014-10-15 08:54:16', 1, 3, '', 'Tech companies are more likely to offer stock-based compensation, convertible bonds, or options that contribute to diluted earnings than telecom providers or deep-discount retailers.', 1, '', '', 103),
	(90, 'Johnson & Johnson 2012 Buyback', 'Johnson &amp; Johnson&nbsp;is known for its ambitious buyback plan -&nbsp;&nbsp;in July of this year alone, approval of\na $5 billion buyback program of its common stock was announced. In 2012, it crafted a deal that ended in the&nbsp;acquisition of a foreign subsidiary while&nbsp;giving&nbsp;fodder to those&nbsp;debating tax regulation on&nbsp;earnings overseas.', '2014-10-15 09:08:15', '2014-11-05 21:27:57', 1, 2, 'http://application.idaciti.com//data/upload/115117135afa0f4308de267769d0fc4aaae.png', 'I\'m batman.', 0, '', '', 115),
	(91, 'Viacom EPS', 'Analysis of EPS, diluted EPS, and how it relates to the financial health of Viacom and the competitive landscape.<br><br>Heather Joy Miller<br>', '2014-10-20 18:57:30', '2014-10-20 20:13:31', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/108Screen Shot 2014-10-20 at 2.31.50 PM.png', 'The media and entertainment industry is dynamic. When considering business strategies, whether it be deals with SONY, or new ad sales,&nbsp; there is a direct impact on financials.<br>', 0, 'http://www.nasdaq.com/symbol/viab/financials?query=income-statement', 'Nasdaq Summary', 108),
	(92, 'EPS Analysis of Apple and Microsoft', '<b></b>This is an analysis of the earnings per share of Apple and Microsoft from 2009 to 2013.<br>', '2014-10-22 03:18:32', '2014-10-22 13:26:08', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/119Apple-Company.jpg', 'During its fiscal Q4 ending in Sep. 2014, Apple spend $17 billion to repurchase its own stock, increasingly doing so on its own without assistance of outside bank.', 0, '', '', 119),
	(93, 'Yahoo vs. Google (Tech/Online Industry)', 'There are several conclusions drawn from the cards of Yahoo and\nGoogle.<br><span>First, with revenues in the billions of dollars for both companies\nover the 5-year period, this shows the massive size of the tech /online\nindustry in general.&nbsp; However, looking at\nthe revenues for Google and Yahoo, you can see that as Google grows at a\nsignificant rate, Yahoo’s revenue is declining steadily year by year.&nbsp; <br></span>\n\n<span><br>Google’s net income has increased steadily over the 5-year period,\nwhile Yahoo’s net income is much less stable, as it increases and decreases\nevery other year.&nbsp; <br></span>\n\n<span><br>In terms of free cash flow, Google has much more than Yahoo.&nbsp; Google’s ranges from $7B to $13B, while\nYahoo’s is around $500 M – $800 M throughout the 5-year period, with the\nexception for 2012, in which Yahoo had a negative free cash flow of around\n-$800M. &nbsp;This shows that Google has much\ngreater financial health than Yahoo, as Google has a greater ability to pay its\ndebt, pay dividends, buy back stock, and facilitate the growth of its business.\nThe fact that Yahoo’s free cash flow is negative in 2012 signals a major\nproblem for its financial health, as ', '2014-10-22 03:58:38', '2014-11-07 20:53:16', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/107Yahoo vs. Google.jpg', '<b>Overall, the cards tell the story that Google is a much stronger and financially stable company than Yahoo. &nbsp;&nbsp;</b>', 0, '', '', 107),
	(94, 'Cisco\'s inventory performance', 'According to the cards, we can tell that Cisco\'s inventory is selling faster than before and this company gains more sales in one period&nbsp;because of this improvement. Besides, Cisco have enlarged its market share, thus needs more inventory than before', '2014-10-22 05:56:05', '2014-10-22 05:56:05', 0, 1, '', 'According to the cards,Cisco\'s inventory is selling faster than before and this company gains more sales in one period&nbsp;because of this improvement.', 0, '', '', 125),
	(95, 'Inventory Time: with seasonality&sales', '<u>This story board consists of two cards regarding seasonally(quarterly)&nbsp;inventories and their connection between sales and PM.</u><u></u><br><br>In this story board, we can notice that:<br><br>Wal Mart (W) reached its peak on inventory in Q3, and then had the greatest sales in Q4, which yields its highest PM in Q4.<br>On the contrary, McDonalds (M) didn\'t have a extraordinary peak on inventory seasonally. But it had the greatest sales in Q3 as well as its PM.<br>The last thing is that M realized a higher PM with a relatively low inventory and sales.', '2014-10-22 14:42:36', '2014-10-22 15:52:01', 1, 2, 'http://162.144.108.196/idaciti/application//data/upload/117cavemen_inventory.png', 'The En', 0, '', '', 117),
	(96, 'Apple', 'This story board combines the sales, net income, revenue recognition, free cash flow,&nbsp;stock prices of Apple, reflecting the operating status os Apple.', '2014-10-22 14:55:24', '2014-10-22 15:08:05', 0, 1, '', 'The &nbsp;numbers show positive future of Apple. With new products releasing, Apple still have great competitiveness in the market.', 0, '', '', 118),
	(97, 'EPS of two companies', 'Comparing&nbsp;EPS is interesting because EPS is a ration, so&nbsp;the number alone can only tell a part of the story. If just looking&nbsp;at EPS without NI and common shares outstanding, you will find it&nbsp;misleading. The EPS of McD is much larger than that of Coco cola, and you may thing that it is a great company to invest in. However, McD did not make that much money as Coca cola in fact, because Coca cola has far more common share than McD, which makes its EPS appears to be lower. Also, EPS is a ratio easy to be manipulated. Although the companies did not make more money than previous years, they can still have higher EPS by decreasing the common shares outstanding--they buy back shares. I found out that although two companies make much less in 2013&nbsp;than the previous year, their EPS does not change much. And then I checked the treasury stocks, finding out that their treasury stock has been going up every year. So it appears to me that these two companies just bought back stocks when they did not do well to maintain a relatively stable EPS', '2014-10-22 18:57:45', '2014-10-22 18:58:02', 1, 1, '', 'Comparing&nbsp;EPS is interesting because the number alone can only tell a part of the story. If just looking&nbsp;at EPS without NI and shares outstanding, you will find it&nbsp;misleading.&nbsp;', 0, '', '', 124),
	(98, 'EPS Analysis of Franchises', 'Comparison of the earnings performance of three food&nbsp;franchises&nbsp;', '2014-10-22 22:46:21', '2014-10-22 22:46:35', 1, 1, '', 'We should research more information on the dividends payment of those three companies', 0, '', '', 120),
	(99, 'EPS analysis of whole Foods', 'The EPS analysis &nbsp;Whole Food include Net Income, Earnings per share, and Wighted AVG shares outstanding analysis.', '2014-10-23 04:32:43', '2014-10-23 04:44:10', 0, 1, '', 'End', 0, '', '', 175),
	(101, 'Comparison between Ebay and Walmart', 'I would like to compare the Ebay and Walmart to see which company is much better for making investment. To make investment decision, besides basic EPS, we also need to consider the total amount of investment the company used to generate these profits.<br><br>', '2014-10-23 21:30:27', '2014-10-23 21:39:03', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/121How-to-Invest-In-Gold.jpg', 'In conclusion, although walmart has a higher EPS, it use more assets to generate it. From this point, Ebay is much better to investment than Walmart.<br>', 0, '', '', 121),
	(103, 'EPS Analysis of NIKE', 'Changes of&nbsp;&nbsp;EPS and Diluted EPS', '2014-10-24 16:10:18', '2014-10-24 16:58:51', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/151nike-red-just-do-it-logo.jpg', 'Hain', 0, '', '', 151),
	(104, '21st Century Fox Stock Repurchase', 'Stock repurchases are a way for a company to artificially inflate their Earnings per Share. By reducing the number of shares outstanding, EPS will increase. An increase in EPS makes the company look profitable and attractive to investors.&nbsp;', '2014-10-24 22:57:40', '2014-10-24 22:59:55', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/93logo.gif', 'From 21st Century Fox we can understand how each component is important in determining EPS. In 2013, net income increased and the number of shares outstanding decreased which led to the increased EPS.', 0, '', '', 93),
	(105, 'Wally What? Earnings Per Share and CAPEX', '<b></b>This card, despite up-to-date data, shows that Wal Mart\'s EPS are a result of their increased spending. (To clarify, their current spending, which the lack of data doesn\'t show- see the 4th slide for a more detailed analysis).&nbsp;<br>I reckon that the decline in EPS is due to the war they are waging on the big online retailers (Amazon, Target etc) to gain their piece of cybershopping. Specifically, they are increasing their web presence in the past and current quarters, as well as going forward. This expenses could translate to a decline in EPS if their tactics of increasing their market share do not materialize.&nbsp;<br><br><br><br>', '2014-10-26 16:11:15', '2014-10-26 16:11:30', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/172wally world.jpg', '<a target="_blank" rel="nofollow" title="Link: null">“To succeed in this world, you have to change all the time.”<br>&nbsp; &nbsp; - Sam Walt</a>', 0, '', '', 172),
	(106, 'Whole Food & Wal Mart', '<div>Whole Food’s FCF is going up. After lookinginto the chart of Revenues, I found its net sales’growth corresponded with the increasing trend of FCF. To some extent, this gives us a positive signal about its management and performance.</div><div><br></div><div>In contrast, the Wal Mart was seemingly suffering some problems. From 2012 to 2013, though it still maintained growingnet sales, it was going down in the FCF. In the last year’s annual report, the management of Wal Mart attributed this decline of FCF to the timing of income tax payment, lower income from continuing operation and a slightly higher CAPEX.</div>', '2014-10-29 07:33:37', '2014-10-29 07:33:37', 0, 1, '', 'Pay attention to the asset turnover,account receivable turnover and the inventory turnover which can make more room for the enterprise to achieve a positive FCF. Make aging analysis of the accounts to make sure whether a large amount of bad debts exi', 0, '', '', 156),
	(107, 'Fcaebook revenue recognition model', 'Revenue recognition at Facebook<br>', '2014-10-29 15:46:13', '2014-10-29 15:47:40', 0, 1, '', 'Facebook recognizes its revenues after it competes the service. These cards above clearly explain that fact.<br>', 0, '', '', 88),
	(109, 'inventory analysis of high-tech firms', 'compare inventory of software companies&nbsp;and&nbsp;analyze corresponding&nbsp;performance', '2014-10-29 21:14:37', '2014-11-04 21:28:29', 0, 1, '', 'inventory analysis can be one indicator for business performance<br><br><br><br>', 0, '', '', 97),
	(111, 'Who wins the battle?', 'Ebay and Amazon two dominant electronic commerce companies with different strategies of way operating and expanding&nbsp;in current turbulent economy. "When it\'s on your mind, its on Ebay". Let\'s analyze whether this slogan inspired customers to switch from competitor&nbsp;Amazon to they marketplace', '2014-11-01 19:04:51', '2014-11-17 21:08:16', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/153images.jpg', 'Recently, Ebay announced separation&nbsp;from Pay Pal. Will Ebay be able to survive without its growth engine and remain competitive with Amazon. Any potential advantageous for the Amazon?', 0, '', '', 153),
	(112, 'Investment to choose: PG and JNJ', 'As a smart investor, dividend payout could&nbsp;be one of your standards&nbsp;to help you&nbsp;choose stocks.&nbsp;<br>Some analysts stated that stocks that pay higher dividends have historically outperformed stocks that pay lower dividends and&nbsp;<span>companies that pay more in dividends typically tend to experience higher earnings growth in the future.<br></span>Here is a comparison of PG and JNJ based on dividend payout and EPS<div id="main-menu" class="sidr left"></div><div id="haloword-lookup" class="ui-widget-content ui-draggable"><div id="haloword-title"><span id="haloword-word"></span><a herf="#" id="haloword-pron" class="haloword-button" title="发音"></a><audio id="haloword-audio"></audio><div id="haloword-control-container"><a herf="#" id="haloword-add" class="haloword-button" title="加入单词表"></a><a herf="#" id="haloword-remove" class="haloword-button" title="移出单词表"></a><a href="#" id="haloword-open" class="haloword-button" title="查看单词详细释义" target="_blank"></a><a herf="#" id="haloword-close" class="haloword-button" title="关闭查询窗"></a></div><br style="clear: both;"></div><div id="haloword-content"></div></div>', '2014-11-02 23:58:14', '2014-11-02 23:58:14', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/136dividend_dollar.jpg', 'In conclusion, both PG and JNJ are good choices for investors since they have promising&nbsp;EPS and dividend yield. At this point, JNJ is doing even better', 0, '', '', 136),
	(113, 'EPS Analysis of Walmart vs. Costco', 'This storyboard is about the EPS analysis of Walmart and Costco. Besides EPS, I analyze profitability, liquidity and solvency of these two companies so that better investment decisions could be made', '2014-11-03 22:30:29', '2014-11-03 22:55:56', 0, 1, '', 'Both companies have advantages and disadvantages. When making investment decisions, both return&nbsp;and&nbsp;risks should be evaluated carefully. I prefer Walmart because of the better profitability.&nbsp;<span id="_wysihtml5-undo" class="_wysihtml5', 0, '', '', 131),
	(114, 'Chapter 8 & 9, Inventory', '<b><i></i></b><i>Taking Coca Cola Co and Boeing Co for example, the storyboard illustrates some interesting findings in those two corporations\' inventory, inventory turnover, and cost of goods sold.</i>', '2014-11-04 01:51:12', '2014-11-04 01:51:12', 0, 1, '', '<b>Chapter 8 &amp; 9, Inventor</b><br>', 1, '', '', 152),
	(116, 'Wal-Mart\'s Inventory:Are they efficient?', 'Analyzing Wal-Mart\'s Inventory usage&nbsp;<br>2009-2013', '2014-11-04 23:02:13', '2014-11-04 23:02:13', 1, 1, '', '<span>"Wal-Mart getting better over time"<br><br><br></span>', 0, '', '', 95),
	(117, 'J&J vs Pfizer vs Merck Inventory', 'In 2011 J&amp;J inventory turnover peaked at 51.25 times, that is much higher than Pfizer and Merck,and drastically dropped to 8.46 in 2012. FDA investigated J&amp;J from 2011-2012 related to its promotions of certain drugs. This could have attributed to drastic fall in turnover in 2012 for J&amp;J. Pfizer inventory turnover is steady while Merck\'s is decreasing in 2013. <br><br><a href="http://www.drugwatch.com/manufacturer/johnson-and-johnson/" rel="nofollow" target="_blank">http://www.drugwatch.com/manufacturer/johnson-and-johnson/</a><br><br><br>', '2014-11-07 17:39:43', '2014-11-12 02:48:29', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/148Screen Shot 2014-11-07 at 12.35.28 PM.png', 'Looks like the pharmaceutical industry revenue is on the decline because all of the competitor\'s revenue is drastically falling in 2013. <br>', 0, '', '', 148),
	(118, 'Nike\'s Inventory', 'This storyboard shows Nike\'s inventory. &nbsp; Card # 2 shows that the Inventory Turnover Ratio is ~ 5/6 which is a high inventory ratio. A&nbsp; high inventory ratio either implies strong sales. &nbsp;Card # 3 shows that Nike\'s average inventory is not too high. &nbsp;The cards seem to tell the story that Nike is in a good position with its inventory.&nbsp;', '2014-11-07 20:44:32', '2014-11-07 20:56:04', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/107Nike just do it.jpg', 'The cards seem to tell the story that Nike is in a good position with its inventory.', 0, '', '', 107),
	(119, 'Earning Per Share of Technology Company', 'This storyboard describe the trend of&nbsp;earning per share of three major technology companies, and analysis the difference among them', '2014-11-08 02:22:08', '2014-11-08 02:24:48', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/150Google-vs-Apple-vs-Microsoft-Picture.jpg', '<span>In conclusion, investors can not use single ratio to analyze a company. What we should do is use multiple ways to analysis companies, in different period, and in same industry of course.</span>', 0, '', '', 150),
	(120, 'ABOUT TRAVEL COMPANIES', 'This tells stories about 3 travel companies (Tripadvisor, Priceline and Expedia) and the travel industry.&nbsp;', '2014-11-08 19:14:29', '2014-11-08 19:17:35', 1, 2, 'http://162.144.108.196/idaciti/application//data/upload/1261.png', '&nbsp;&nbsp;', 0, '', '', 126),
	(121, 'INVENTORY', 'This storyboard discusses inventory of Amazon, Costco and Whole Foods.', '2014-11-08 20:44:55', '2014-11-08 20:44:55', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/126inventory.jpg', '&nbsp;&nbsp;', 0, '', '', 126),
	(123, 'Apple Google Microsoft Comparison', 'Revenues<br>Net Income<br>Assets<br>Earnings per Share, diluted', '2014-11-10 00:14:04', '2014-11-10 00:14:04', 0, 1, '', 'Here it is', 0, '', '', 195),
	(124, 'Apple and Google', 'A comparison of two companie', '2014-11-10 00:40:21', '2014-11-10 00:40:21', 0, 3, '', 'Now you have it!', 0, '', '', 195),
	(125, 'Boeing PP&E', 'From 2011-2012 Boeing had a loss of $20 Million in PP&amp;E and \nfrom 2012 - 2013 had a gain from sales of PP&amp;E of $16 \nMillion.<br>', '2014-11-12 02:06:46', '2014-11-12 02:11:25', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/148Screen Shot 2014-11-11 at 9.10.40 PM.png', 'Let\'s look at 2011 financial statements of Boeing and look at depreciation of PP&amp;E.<br>', 0, '', '', 148),
	(126, 'EPS Analysis of Amazon.com and Walmart', 'EPS Comparision and analysis of Amazon.com and Walmart. A look at their Diluted EPS and Basic EPS', '2014-11-12 17:46:20', '2014-11-12 17:57:29', 0, 1, '', 'Although online retailing and e-commerce has grown greatly in the last decade, the top big box retail chains such as Walmart and Costco are still far more profitable than their online counterparts.', 0, '', '', 110),
	(127, 'Reducing Income Taxes (Legally)', 'There are many ways to decrease the amount of taxes that you need to pay in a certain year. <br><br>Income Taxes = (Revenues-Expenses-Depreciation)x(Tax Rate)<br><br>That\n being said, companies can either: Decrease their revenues (not a \ndesired option), Increase their Expenses and/or Increase their \nDepreciation expenses in order to achieve lower Income Taxes and \nessentially.<br><br>For these reasons, many companies Buy new assets (especially inventory) at the end of the fiscal year, Increasing expenses. <br><br>Companies\n may also aspire to acquire their leases (if any) as capital leases, in \norder to be able to disclose the expenses and depreciation of the asset.<br><br>Further, companies include pension plans and benefit plans for their employees. As they put money into the 401k of their employees, for example, the expense those benefits, reducing their income before taxes at the end of the year. The reasoning is, if the company rather pay its workers and build loyalty and a better work environment than loose their money to taxes which brings the company no direct benefit.<br><br><br>', '2014-11-12 20:33:02', '2014-11-12 20:47:55', 1, 1, '', 'Be smart: There are ways of decreasing income taxes without doing anything illegal.<br><span id="_wysihtml5-undo" class="_wysihtml5-temp"></span>', 0, '', '', 170),
	(128, 'Creating History ', 'Amazon\'s goal "to be Earth\'s most customer centric company" and Amazon\'s Prime Air drone is a key to achieve this goal. Amazon Air Drone is a delivery system in development that will use remote controlled robotic vehecles to transport goods from company\'s order fulfillment centers to the consumer within 10-mile radius within 30 minutes.&nbsp;Aircraft will deliver customer orders of five pounds or less which includes 86% of all Amazons order. Does it sound realistic? Let\'s take a look at the video.&nbsp;', '2014-11-13 05:05:43', '2014-11-13 15:51:35', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/153images-3.jpeg', '<span>If\nthe start-up stays on track, it will be the first drone parcel delivery service\nin the world. Amazon is always on move to&nbsp;surpass their competitors in challenging way.&nbsp;<br>I wonder whether investors optimistic and feel secured&nbsp', 0, '', '', 153),
	(129, 'INCOME TAX', 'On this storyboard, we will compare and analysis the income tax expense and deferred tax expense of two giant supermarket, Walmart and Costco.', '2014-11-14 01:01:45', '2014-11-14 01:01:59', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/150walmartvscostcoedited.jpg', 'In the end, we know a lot about deferred tax expense. Specially, companies want deferred tax asset, because they could pay less tax in the future.&nbsp;', 0, '', '', 150),
	(131, 'Walt Disney Co.', 'This storyborad shows some basic data about PP&amp;E of Walt Disney.<br>', '2014-11-15 15:58:13', '2014-11-15 15:58:13', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/92Walt-Disney-Logo.jpg', 'Based on data regarding with PP&amp;E, we can tell that the development of Walt Disney Co. is stable and health<br>', 0, '', '', 92),
	(132, 'Inventory Comparison of Amazon & Walmart', 'In this storyboard, I compare the inventory of Amazon and Walmart.&nbsp;<br>I find that Amazon had improved its inventory management and that may be one of the reasons that increased its revenue and its revenue growth rate.<br>Walmart have larger average inventory but less inventory turnover, so it has a better liquidity in inventory.That may also be one of the reasons that caused Walmarts\' larger revenue.', '2014-11-17 06:36:45', '2014-11-17 06:39:10', 0, 1, '', 'Thank you for reading my storyboard.<br>Yiran (Stella) L<br><br>', 0, '', '', 162),
	(133, 'Pensions Apple vs Microsoft', 'In order to improve employee sales performance, corporations can acquire pension plans to make their employees happier and hence increase their sales; pension payments increase liabilities; higher liabilities decrease liquidity ratios; lower liquidity ratios should decrease the market value of equity. This is the common belief of how a company\'s pension plan improves sales and affects a company. This storyboard shows that these beliefs are not the norm, but an unstudied misconception.<br><span id="_wysihtml5-undo" class="_wysihtml5-temp"></span>', '2014-11-17 22:19:06', '2014-11-17 22:19:40', 1, 1, '', 'Since sales performances dont seem to be dependent on pension payments (happy employees)...What would happen if we used pension plan funds to improve company\'s marketing strategies instead?<br>', 0, '', '', 170),
	(134, 'Why is Amazon investing in drones?', 'So what\'s driving Amazon\'s Prime Air initiative? Instant customer gratification is one thing, but Amazon\'s cost of transportation is another! Amazon’s total shipping costs in 2013 were $6.635 billion. They received \nshipping revenue of $3.097 billion and incurred overall losses of $3.538\n billion related to shipping costs. It is clear Amazon is losing money on their shipping costs. Maybe this is why they are investing into drone technology?<br>', '2014-11-17 22:28:09', '2014-11-17 22:45:19', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/148Screen Shot 2014-11-17 at 5.37.11 PM.png', 'Do you think Amazon\'s investment into drones will pay off in the long run?<br>', 0, 'http://robotenomics.com/2014/06/17/the-economics-of-amazons-delivery-drones/', 'Economics of Amazon\'s delivery drones', 148),
	(135, 'Inventory of three retailer companies', 'I listed three retailer stores: Wal Mart, Costco and Dollar Tree. I am going to compare inventory, inventory turnover and change in inventory of the three companies', '2014-11-17 22:32:09', '2014-11-18 03:28:02', 1, 1, '', 'Inventory reflects&nbsp;business mode of companies. Costco has&nbsp;low inventory and high inventory turnover. Its store&nbsp;is like a warehouse. This reduces&nbsp;inventory mgmt cost and thus reduce&nbsp;price.', 0, '', '', 86),
	(136, 'PP&E of Sandisk', 'I listed data about PP&amp;E of&nbsp;Sandisk. The PP&amp;E of Sandisk has beeng growing for these years.', '2014-11-18 05:03:55', '2014-11-18 05:07:05', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/86c26-B007WTAJTO-1-l.jpg', 'The en', 0, '', '', 86),
	(137, 'PP&E Analysis of MCD/KO/SBUX', 'I thought it would be interesting to review and analyze the historical PP&amp;E levels of 3 companies I am very familar with', '2014-11-18 13:57:06', '2014-11-18 13:57:06', 1, 1, '', '"PP&amp;E levels between comapnies range&nbsp;and fluctuate&nbsp;due to size of the businesses and individual&nbsp;company objectives"', 0, '', '', 95),
	(138, 'Tax Avoidance of Pharmaceutical Industry', 'In the pharmaceutical industry, multinational drug-makers&nbsp;such as Pfizer Inc., Merck &amp; Co. and Johnson &amp; Johnson have known for using tax havens to avoid taxes.', '2014-11-18 15:43:44', '2014-11-18 18:59:34', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/160下载.jpeg', 'Companies have profit motive. Tax avoidance is different from&nbsp;tax evasion. As long as there are tax loopholes, these multinationals will take advantages of them', 0, '', '', 160),
	(139, 'Fortune 500 Tax Issues', '"A society that fails to fight widespread tax evasion proclaims its own corruption" says Jacques Leslie in a June 2014 New York Times op-ed piece. While it has been suggested in the past that&nbsp;lowering the tax rate below 35% would encourage corporations to cease hiding profits offshore - an amount estimated at $90 billion in 2013 -&nbsp;the issue persists. Another suggestion has been to no longer allow&nbsp;tax deferral.&nbsp;This storyboard looks to a handful of Fortune 500 companies that engage in such behavior,including Boeing and General Electric, among others.', '2014-11-18 20:59:54', '2014-11-18 22:02:49', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/11515_occupied_tomer_hanuka.jpg', 'Deferred taxes don\'t pay the government\'s bills.&nbsp;', 0, '', '', 115),
	(140, 'A Tale of Two (similar) Blue Chips ', 'This storyboard looks at two of the largest companies in the world, General Electric and Exxon-Mobil.&nbsp;<br><br>Superficially, you might think that they have&nbsp;similar structures, especially when it comes to income taxes. They are both giants in their fields, and even somewhat related in a few aspects of what they do. They are both international. They are both major employers domestically. Etc, etc.&nbsp;<br><br>Upon further examination, it seems as though GE\'s accountants should be showered with gifts and stock options, and Exxon\'s should be replaced. From 2009-2013,&nbsp;Exxon\'s tax rate averaged 46%, while GE\'s was about 8.4%. The difference is actually more than the US\' corporate tax rate of 35%.<br><br>I have a bit more analysis in <b>bold </b>on the slides following.&nbsp;<br><br><br>', '2014-11-19 03:11:01', '2014-11-19 03:11:16', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/172want you.jpg', '<blockquote>The hardest thing in the world to understand is the income tax.<div>&nbsp; <br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp', 0, '', '', 172),
	(141, 'Home Depot PP&E', 'This storyboard takes a closer look at&nbsp;Home Depot\'s PP&amp;E. &nbsp;Slide #2 merely shows the relationship between Net and Gross PP&amp;E. &nbsp;Slide #3 shows that PP&amp;E makes up a majority of Home Depot\'s Non-current assets.', '2014-11-19 05:47:26', '2014-11-19 05:50:59', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/107Home Depot.png', '<b>Home Depot\'s business requires a high amount of PP&amp;E</b>', 0, '', '', 107),
	(142, 'Microsoft vs. Home Depot: PP&E', 'This storyboard looks at the PP&amp;E of Microsoft and Home Depot in order to get an idea of how PP&amp;E varies across the tech and home improvement retail industries. &nbsp;The first card shows that Home Depot has a significantly higher amount of PPE than Microsoft, which is expected when comparing the home improvement retail industry to the technology industry. &nbsp;The second card shows that a large majority of Home Depot\'s non-current assets is actually comprised of PP&amp;E. &nbsp;Unlike Home Depot, PP&amp;E does not make up a majority of Microsoft\'s non-current assets. In fact, intangible assets make up a higher percentage of Microsoft\'s non-current assets than its PP&amp;E. &nbsp;This is also expected from a technology company, as it has a lot of proprietary technology, which is considered Goodwill (which is classified as an intangible asset). &nbsp;Overall, we can conclude that PP&amp;E is much higher in home improvement retail companies than in technology companies.&nbsp;', '2014-11-19 06:22:22', '2014-11-19 06:22:22', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/107home-depot-windows.png', '<b>Overall, we can conclude that PP&amp;E is likely&nbsp;much higher for home improvement retail companies than for&nbsp;technology companies.&nbsp;</b>', 0, '', '', 107),
	(143, 'PPE in Walt Disney', 'The story board talks about PPE, depreciation of PPE, and net income about the company', '2014-11-19 17:12:40', '2014-11-19 17:12:40', 0, 1, '', 'PPE', 0, '', '', 125),
	(144, 'Coca Cola PP&E', 'Analysis of Coca Cola\'&nbsp;PP&amp;E', '2014-11-19 17:19:43', '2014-11-19 18:16:55', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/98imgres.jpg', 'TB', 0, '', '', 98),
	(145, 'AT&T vs. Verizon - Pensions', 'Examining two of the largest telecommunications companies in the world in terms of profit margins, free cash flow, and allocations of pensions with respect to past law and current amendments.&nbsp; <br><br>Will examine the notes of 10-Ks and 10Qs to account for differences in reporting and compliance with new FASB standards.<br><br>How much cash and/or allocated assets should companies be required to hold to properly account for these pensions?<br><br><br>', '2014-11-19 22:21:00', '2014-11-19 23:45:57', 1, 2, 'http://162.144.108.196/idaciti/application//data/upload/111att-vs-verizon.jpg', 'Examining the notes we can see slight variances in the methodology of reporting, however both firms have enough positive cash flow to cover the required minimum amounts. <br>', 0, '', '', 111),
	(146, 'Analysis of income tax in Microsoft', 'It is an analysis of current income tax in Microsoft. It tends to find the reasons of the changes in deferred tax assets or liabilities. It also compares tax situation between Microsoft and Apple. The changes in&nbsp;deferred tax assets or liabilities are different because they have different purposes', '2014-11-20 00:09:08', '2014-11-23 14:22:49', 1, 1, 'http://162.144.108.196/idaciti/application//data/upload/119Screen Shot 2014-11-19 at 18.56.57.png', 'Apple avoids large amounts of tax payment in US by shifting profits to foreign countries', 0, '', '', 119),
	(147, 'A story about Amazon.com Inc. ', '<h2>Business Summary</h2>Amazon.com serves consumers through its retail websites. Co. designs its websites to enable products to be sold by Co. and by third parties across several product categories. Customers access Co.\'s websites directly and through its mobile websites and apps. Co. provides programs that enable sellers to sell their products on its websites and their own branded websites and to fulfill orders through Co. Co. also manufactures and sells Kindle devices. In addition, Co. provides services, such as advertising services and co-branded credit card agreements. Co. has organized its operations into two principal segments: North America and International.<br><br>I will compare Amazon.com Inc. with&nbsp;other competitive&nbsp;companies such as Ebay Inc. Wal Mart Stores Inc.&nbsp;in the same industry about multiple factors such as&nbsp;profitability, liquidity ratios and so on.<span>&nbsp;</span><br><br><br>', '2014-11-21 02:25:29', '2014-11-21 04:01:33', 0, 1, 'http://162.144.108.196/idaciti/application//data/upload/229images.jpg', 'A story about&nbsp;Amazon.com Inc.', 1, 'http://www.mergentonline.com.eres.library.manoa.hawaii.edu//documents.php?pagetype=predefinedreport&', 'Amazon.com Inc. Report', 229);
