INSERT INTO `storyboard_slide` (`sb_id`, `type`, `content`, `title`, `description`, `template`, `order`) VALUES
	(4, 'card', '13', 'Predict Corporate Bankruptcy', 'The Altman Z-score is a combination of five weighted business ratios that is used to estimate the likelihood of financial distress.', 2, 0),
	(4, 'card', '14', 'Altman Z Score ', 'The Z Score is not intended to predict when a firm will actually file for legal bankruptcy. It is instead a measure of how closely a firm resembles other firms that have filed for bankruptcy.', 4, 1),
	(4, 'card', '17', 'Financial Strength vs. Profitability', 'Interestingly, even thought the telecom giants AT&amp;T and Verizon have lower Altman Z Score, investors still depend on them for&nbsp;for reliable cash flow and hefty dividends.&nbsp;As investors, it\'s critical to analyze the underlying business performance of a company, to make sure it\'s covering its payout with sufficient free cash flow.<br><br>Looking at the free cash flow payout rations for AT&amp;T, it stands at FY2013 as ~70% and Verizon at FY 2013 stands at ~27%.&nbsp;<span>Such a low payout ratio by Verizon&nbsp;not only means Verizon can easily afford its current payout, but it also means the company should have no trouble granting investors another solid dividend bump in 2014.</span><br><br>', 2, 2),
	(4, 'card', '16', 'Altman Z Score -- Dangerously Low Scores', 'Look at several large companies and the various components made up their dangerously low Altman Z Scores.', 2, 3),
	(4, 'card', '15', 'Balance Sheet Strength', 'These ratios measures of liquidity (the ability to convert assets to cash and meet short-term obligations of less than one year) and leverage (the amount of debt in a firm\'s capital structure and the ability to meet long-term obligations of more than one year).', 2, 4),
	(12, 'media', 'http://application.idaciti.com//data/upload/2Brand 1.png', 'Brand = Profit?', '', 2, 0),
	(1, 'media', 'http://youtu.be/pXMyDlCVk38', 'Dow Breaks 17,000', 'Strong earnings and economics have pushed&nbsp;Dow to new highs. Does this signal our economy has zoomed past the lingering aftereffects of \nthe Great Recession, or evidence of a bubble about to pop? or, we are putting too much emphasis on the Dow companies? I wonder.<br><br>To the average retail investor, the Dow means "the" market. But it’s \nonly 30 stocks. What’s more, the index is price-weighted, meaning more \nexpensive stocks have an outsized impact on the number. The 30 stocks that currently constitute the Dow Jones Industrial Average\n make up a pretty narrow slice of American economic output.<br><br>As an investor, I do feel better when I see Dow and S&amp;P getting new highs, it just, well, makes me feel good. But when I invest for the long term, I prefer to look at the financial strength and growth potential&nbsp;of the companies and invest base on reasons, not just emotions.<br><br><br><br><br><br><br>', 2, 0),
	(1, 'card', '3', 'Profitability Ratios', 'How good is a company at running its business? Does its performance seem\n to be getting better or worse? Is it making any money? How profitable \nis it compared with its competitors? All of these very important \nquestions can be answered by analyzing profitability ratios. These ratios, much like the operational performance ratios, give \ninvestors a good understanding of how well the company utilized its \nresources in generating profit and shareholder value.<br><br>Profits are the lifeblood of business. What would be considered "good" net profit margin really depends on the industry. For example, for telecomm, it might be 10-15%, but for retail, a much lower&nbsp;net profit margin (5-8%)&nbsp;is typical.<br><br><br><br>', 2, 1),
	(1, 'card', '6', 'Investment Valuation Ratios ', 'This group of the ratios looks at a wide array of ratios that can be used by investors to estimate the attractiveness of a potential or existing investment and get an idea of its valuation.<br><br>P/E ration has been called the "sexy" financial ratio, well, it\'s the most cited ration for sure. But P/E alone isn\'t enough for you to determine the valuation of a company. For example, Microsoft is being valued at 13 to 14 times expected \nearnings is not too high on the surface, but the <i>Impression</i> from Wall Street \nis that Microsoft\'s best days are behind it. <br>', 2, 2),
	(1, 'card', '5', 'Cash Flow Ratios', 'This group of the financial ratio looks at cash flow indicators, which focus on the cash being generated in terms of how much is being generated and the safety net that it provides to the company. These ratios can give investors another look at the financial health and performance of a company.', 2, 3),
	(1, 'card', '7', 'Most Profitable Dow Jones Companies', 'There\'s not a bad egg among the Dow Jones companies as of now, and all 30 members are profitable right now. But even among heroes, some are and will be stronger than others. These are the four most profitable businesses on the Dow Jones today.', 2, 4),
	(1, 'card', '8', 'Dow Winners', 'Dow breaks with 17,000 in the beginning of 2nd half of 2014. How does individual company stock perform?<br><br>Almost 1/2 of the Dow companies are winners.<br>', 2, 5),
	(1, 'card', '25', 'Dow Non-Winners', 'Some Dow companies are not as exciting as the other winners in the group.', 2, 6),
	(7, 'indicator', '8', 'Set the Scene', 'Sometimes you want to start your story with some big picture&nbsp;context. So if your data story is about living standards you might want to start with some macro data. This chart on US Savings &amp; Disposable Income from&nbsp;FRED helps to set the opening scene for your story world.<br><br>Make sure that you introduce your story context appropriately for example:<br><br>In the USA, disposable income is rising according to FRED. However so is the use of food banks. But are US food and beverage&nbsp;retailers suffering as a result or is the need for food banks disconnected from retail spending? Perhaps spending on material goods rather than food is consuming the lion\'s share of thisdisposable income?<br>', 2, 0),
	(7, 'media', 'http://application.idaciti.com//data/upload/18Food bank investigation by the Sunday Mirror.jpeg', 'A Reality Check', 'The data on the previous slide indicates rising disposable income but maybe your story can benefit from a reality check?<br>&nbsp;<br>An image is a good way to show rather than tell.<br><br>In this case the reality of food banks (OK this is from the UK not the US but you get the idea). Why if there is rising disposable income are food banks on the rise too?', 2, 1),
	(7, 'card', '26', 'A Focal Point', 'After our reality check now we can go back to the data and start to focus our story. <br><br>Here I have used Idaciti curated data to create a card that shows leading US retailer Walmart\'s revenues over the last few years. From the chart,&nbsp;we can see that&nbsp;Walmart revenues are increasing, apparently reflecting increasing disposable income and despite an uptick in&nbsp;food banks.<br><br>So are other retailers growing like Walmart?&nbsp;', 2, 2),
	(7, 'card', '32', 'Peer Group Evidence', 'Using peer group data is a useful way of challenging or confirming your story focus.<br><br>Here we use Idaciti curated data to compare Wal mart to their nearest US&nbsp;food and beverage competitor, Costco.&nbsp;<br><br>Costco is number 2 in&nbsp;the top 10 food and beverage retailers in the USA according to the Food Dive website.<br>(see <a target="_blank" rel="nofollow" href="http://www.fooddive.com/news/the-top-10-us-retailers-for-food-and-beverage-sales-right-now/169323/" title="Link: http://www.fooddive.com/news/the-top-10-us-retailers-for-food-and-beverage-sales-right-now/169323/">http://www.fooddive.com/news/the-top-10-us-retailers-for-food-and-beverage-sales-right-now/169323/</a>)&nbsp;<br><br>Now we can see that Costco\'s revenues are also rising.', 2, 3),
	(7, 'media', 'http://application.idaciti.com//data/upload/18feeding-america.png', 'Cautionary Note', 'Telling stories with data may end up being just that - a porky (pork pie = lie).<br><br>Be careful to ensure you are comparing&nbsp;like for like in your story - for example:<br><br>Do the revenues include international sales as well as&nbsp;US sales (yes)?<br><br>Do the revenues include sales of items other than those provided by food banks (yes)?<br><br>Are food banks on the rise in the US (yes they are) but our story points to food bank use increasing in the UK and anyway where is the data to support that shock/horror redtop newspaper&nbsp;claim?<br><br>Wouldn\'t a better source be thMap the Meal Gap at&nbsp;<a target="_blank" rel="nofollow" href="http://feedingamerica.org">http://feedingamerica.org</a>?<br><br>', 2, 4),
	(7, 'media', 'http://www.regionalfoodbank.org/assets/CountyInfo/FY14-P1.png', 'Add Your Value', 'Somewhere in your story you need to add some value of your own, whether it\'s just some analysis in the form of text or a link to a chart or infographic you have created specifically for your story.<br><br>Here I\'ve used an infographic from the The Regional Food Bank of Oklahoma (see&nbsp;<a target="_blank" rel="nofollow" href="http://www.regionalfoodbank.org/assets/CountyInfo/FY14-P1.png" title="Link: http://www.regionalfoodbank.org/assets/CountyInfo/FY14-P1.png">http://www.regionalfoodbank.org/assets/CountyInfo/FY14-P1.png</a>).<br><br>But it would be better to use something you have&nbsp;created yourself to enhance your storytelling credibility', 2, 5),
	(7, 'media', 'http://application.idaciti.com//data/upload/18hungry.png', 'End with a Bang', 'Your story should finish with a climax of some sort. For example&nbsp;with another provocative statement that reflects your story content&nbsp;or the answer to the question you posed at the start - for example:<br><br>Could the USA or UK&nbsp;join this list?<br><br>This image from the&nbsp;World Food Programme (<a target="_blank" rel="nofollow" href="http://www.wfp.org/hunger/who-are">http://www.wfp.org/hunger/who-are</a>)&nbsp;highlights areas of the world where today millions of&nbsp;people hungry. How long before some \'developed\' nations join this list?<br><br><b>And Finally...</b><br><br>The final card in your storyboard is the storyboard&nbsp;\'end\' card that features a simple call to action and a link so that your audience can pursue your story themselves or visit your blog/website to get more of your insights.<br><br><br><br><br><br><br><br><br><br>', 2, 6),
	(3, 'media', 'http://youtu.be/4NnPE8_MBYQ', 'Executive Compensation - The Debate', '', 2, 0),
	(3, 'card', '10', 'Financial and Operating performance', 'Earnings per share measures the profitability accruing to each common stock of the company. &nbsp;It is often considered by analysts, investors and the companies themselves&nbsp;as a measure of company performance.<br>Return on Equity is a similar concept and measures the total profits generated by the company as a percentage of the invested equity capital. Return on Assets measures how effectively the company has employed its assets&nbsp;in generating revenues.<br>Google has identified these companies as its main competitors in its proxy statement. &nbsp;Who are the best performing companies and are their employees appropriately compensated?&nbsp;<br>', 2, 1),
	(3, 'card', '12', 'Google\'s Top Competitors - Earnings Per Share and ', 'Apple and Google have the highest Earnings per Share and also pay their employees the most (as measured by share-based compensation). &nbsp;Interestingly, the increase in&nbsp;Google\'s share-based compensation over time mirrors the increase in Google\'s EPS over time. &nbsp;Apple exhibits a similar pattern, although Apple\'s Earnings per Share&nbsp;peaks in 2012 and drops off in 2013', 2, 2),
	(3, 'card', '11', 'Google\'s Top Competitors - Stock Price Performance', 'Both Apple\'s and Microsoft\'s stock price have been trending upwards in the past year, whereas Google\'s stock price has shown a relative plateau. &nbsp;Perhaps there is an association between&nbsp;Microsoft\'s apparently large compensation expense and positive trend in stock price? &nbsp;Employees are being rewarded for contributing to the stock price improvement of Microsoft? &nbsp;What do you think&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;', 2, 3),
	(13, 'card', '43', 'Market cap', 'Market cap of 4 high tech companies.', 2, 0),
	(9, 'media', 'http://application.idaciti.com//data/upload/2User Guide - Add Card.png', 'Create a Card', '<div>To create a new idaciti data card, you can either&nbsp;click <u>My Cards</u> in the sidebar and then click <u>Add Card</u>., or you can click the quick access button on top of the screen.<br><br>Creating a data card in idaciti&nbsp;involves simply selecting company and KPI data and decide how you want that data\nvisualized on the card.\n<br><br><b>Step 1: Choose a company or companies\n</b>\n						<br><br>(1) Enter part of a&nbsp;company name &nbsp;or stock symbol&nbsp;in the search box to find companies tracked by idaciti (for the preview release, we track Dow 30 and NASDAQ 100 companies)<br>(2) Or select a list of companies (lists are&nbsp;created by using&nbsp;the list builder, just click the icon nest to the list box) to populate your company list\n<br><br>Your selected company/companies display in the middle list box where you can use the (-) to\nremove a company from the list.\n<br><br><b>Step 2: Choose a KPI or KPI\'s<br></b><br>(3)&nbsp;Enter a partial or complete&nbsp;KPI name in the search box to find KPI\'s provided by idacit (for the preview release, we have over 400 KPI\'s)<br>\n(4) Or select a list of KPIs (lists are&nbsp;created by using&nbsp;the list builder, just click the icon nest to the list box)&nbsp;) to populate your KPI list\n<br>Your selected KPI/KPIs display in the middle list box where you can use the (-) to remove a KPI from\nthe list.\n<br><br>Click the <u>Refresh Data</u> button to update the data used by your card if you make changes.\n\n						<br><span><br><b>Step 3: Visualize your Data</b><br></span><br></div><div><span><span><span><div>\n						</div>\n					</span>\n				</span>\n				<span>\n					<span>\n						<div>\n							<div>\n								(5) You can visualize the data on the card by clicking the buttons to see the data rendered in\ndifferent ways (e.g. as charts or a map)\n\n								You may be able to select other rendering options such as by a specific KPI within your list of KPI\'s\nor by annual or quarterly time periods.\n\n								<br><b><br>Step 4: Describe and Save your Card\n<br></b><br>(6) Click the edit button to give your card a tile and a description and then click the <u>Save Story Card</u>\nbutton to save your Card.\n<br><br>Your Card is now accessible for viewing/editing from the My Cards option in the sidebar and available to add to any of your Storyboards.<br><br><br>\n							</div>\n						</div>\n					</span>\n				</span>\n			</span>\n		</div>', 2, 0),
	(9, 'card', '18', 'Sample Card 1', 'This card is designed to look&nbsp;at the insider trading data for selected Dow 30 companies.<br><br>When we setup this card, we select <i>Insider Stock Sales</i> and <i>Insider Stock Purchase</i>. As part of the storytelling, we can set a default KPI (In this case,&nbsp;Insider Stock Sales&nbsp;) and start our narrative around this KPI. However, keep in mind, all data cards are dynamic, so viewers do have the freedom to interact with the card and examine certain information closely if they want to.<br><br>For example, they can select the Insider Purchase. They can view either annual data or quarterly data. <br><br><b>Go ahead, you can try changing the KPI and Annual/Quarter trending data display.</b><br><br>Maybe a particular user is only interested in <i><b>Microsoft</b></i>, <i><b>Intel</b></i> and <i><b>IBM</b></i>,&nbsp;and there are&nbsp;too many companies included. The viewer can click "on/off" companies by clicking the company name&nbsp;on the legend - it\'s on the right side of the chart.<br><br><br><br><br><br>', 2, 1),
	(9, 'card', '7', 'Sample Card 2', 'Let\'s look at another sample card that uses a US map&nbsp;chart for visualization.<br><br>There\'s not a bad egg among the Dow Jones companies as of now, and all 30 members are profitable right now. But even among heroes, some are and will be stronger than others. These are the most profitable businesses on the Dow Jones today.<br><br>You can go ahead and play with the chart, try different KPI\'s and different fiscal reporting periods.<br><br>You can also click the "flip" icon on the top-right corner of the card to view the flip side of the card. The flip side contains the description entered by the author of the card, the data source(s) and the actual data used in the card.<br><br>', 2, 2),
	(9, 'media', 'http://application.idaciti.com//data/upload/2User Guide - Add Storyboard Top 1.png', 'Create a Storyboard (1)', 'To create a new idaciti storyboard, you can either&nbsp;click&nbsp;<u>My Storyboards</u>&nbsp;in the sidebar and then click&nbsp;<u>Add Storyboard</u>., or you can click the quick access button on top of the screen.<br><br><div>Creating a Storyboard in idaciti involves selecting existing <i>Data&nbsp;Cards </i>and/or creating new cards (image, video, economic indicators cards)&nbsp;to add to&nbsp;your storyboard in a specific sequence.<br><br></div><div>The picture&nbsp;shows the top half of the create storyboard screen.<br><br></div><div><b>Step 1: Select Cards to Display<br><br></b></div><div>(1) Here you can select which cards to include in the deck. You can include cards you created and cards shared with you.<br>(2) Optionally, you can filter the cards by title of the cards or if you are looking for cards created by a specific author, type in the author\'s name, partial name will work.<br><br></div><div><b>Step 2 &amp; 3: Choose How to Interact with the Deck of Cards<br><br></b></div><div>(2) The arrows are used to navigate back and forward through the deck of&nbsp;cards if your deck is displayed as a single closed stack.</div><div>(3) The open/close deck buttons are used to fan out/close in the cards in the deck (the cards are \'fanned out\' here).<br><br></div><div><b>Step 4: Add or View the Card<br><br></b></div><div>(4) Click the (+) on the card to add the card to your storyboard, or click the (i) to view the card content to decide whether to add the card.<br></div><br><div><span><span><span><div>\n						</div>\n					</span>\n				</span>\n			</span>\n		</div>', 2, 3),
	(9, 'media', 'http://application.idaciti.com//data/upload/2User Guide - Add Storyboard Bottom.png', 'Create a Storyboard (2)', '<div>\n			<div>\n				<div>\n					<div>\n						Below the card deck is the storyboard sequencer and the card editing panels. You can click the icon on the top-right corner of the&nbsp;card deck panel to shrink the panel while working on the descriptions of your storyboard.<br><br>When you create a new storyboard it will have 3 default cards:\n<br>\n						<span>(1) A <b>start</b> card<br>\n(2) A \'placeholder\' to add a new card\n<br>(3) An <b>end</b> card\n<br></span>\n						<br>Click on a card in the sequencer to view/edit the card metadata in the editing panel. This metadata is\nusually a title, a description and an image or URL link for example.\n<br>\n						<br>When you click on a start card you can also select a template for the card.\n\n						You need to complete the metadata for the start and end cards before you can save the storyboard.\n<br>\n						<br>To add a data card from the deck into the storyboard, click the (+) sign on the card (see prior slide).\n\n						To add an non-data card to the storyboard click the placeholder card with the (+) sign\non it and select either an indicator or an image /video card.\n<br><br>The indicator card let you select an FRED indicator to add to your storyboard.\n<br><br></div></div></div></div><div><span><span><span><div>\n						</div>\n					</span>\n				</span>\n				<span>\n					<span>\n						<div>\n							<div>\n								The image/video card let you upload an image to your card or link to an image/Youtube video to\ndisplay in the card.\n\n								Once you have added your cards you can click the <u>Save</u> button and your storyboard will be accessible to view/edit under My Storyboards in the sidebar.\n\n							<br><br></div>\n						</div>\n					</span>\n				</span>\n			</span>\n		</div>', 2, 4),
	(9, 'media', 'http://application.idaciti.com//data/upload/2User Guide - Storyboard Details.png', 'Edit Storyboard', 'When you add or edit a storyboard, there are a few tools you can use.<br><br>(1) When you hover over a particular slide, you will find a set of icons appeared<br><br><ul><li>Click on the "<b>gear</b>" icon to change layout of the card</li><li>Click on the "<b>remove</b>" icon to delete the card from the storyboard</li><li>Click on the "<b>left</b>"/"<b>right</b>" icon to move the slide to a different position in the storyboard</li><li>Click on the "<b>open</b>" icon to preview the slide&nbsp;</li></ul>(2) If you have more slides than the screen can show, the "<b>scroll to left</b>" or "<b>scroll to right</b>" icon will be visible, and you can click or it to bring other slides into view<br><br>(3) The description box has basic formatting capability to help you make the description more readable<br><br>(4) As you are writing your point of view, you can still interact with the data card&nbsp;in order to get a clear picture of what the data reveals<br><br><br><br><br>', 2, 5),
	(9, 'media', 'http://application.idaciti.com//data/upload/2User Guide - Share Storyboard.png', 'Share Storyboards', '<div>\n			<div>\n				<div>\n					<div>\n						From <u>My Storyboards </u>you can see the storyboards you have created and use the options in the title strip to manage the storyboard.\n<br>\n						<span><br>(1) These 2 icons are used to \'flip\' the card to view more about it and to delete [-] the storyboard.<br><br>(2) These 2 icons are used to set the storyboard to public/private sharing and to share the\nstoryboard with one or more&nbsp;of the circles you belong to so all members of that circle can view it.&nbsp;<br><br>You can do the same with the cards you created by going to <u>My Cards</u>, and use the icons describe above to manage the privacy/sharing of your cards.<br><br></span>\n					</div>\n				</div>\n			</div>\n		</div>', 2, 6),
	(9, 'media', 'http://application.idaciti.com//data/upload/2User Guide - Publish Storyboard.png', 'Publish Storyboards', '<div>\n			<div>\n				<div>\n					<div>\n						From <u>Browse Storyboards</u>&nbsp;or the <u>Dashboard</u>&nbsp;you can click a storyboard to view it and then spread the word or\ncomment on the storyboard.\n<br>\n						<span><br>(1) Click the button to tweet a link to this storyboard.<br><br>\n(2) Click the button to view the storyboard as a URL or <br>(3) Use the embed code displayed to embed the\nstory into your blog/website (via an iframe).<br><br>\n(3) Comment on the storyboard using the popular Disqus commenting system.</span></div>\n				</div>\n			</div>\n		</div>', 2, 7),
	(15, 'card', '9', 'All for Defense?', 'Look at revenues and net income with specific revenue from federal contracts.<br><br>', 2, 0),
	(14, 'media', 'http://vimeo.com/96711271', 'idaciti Explained', '<b>Why idaciti?</b><b>&nbsp;</b><br><br>Because we beleive a great way to get value from the world of big financial data is by&nbsp;using data to tell stories.<br><br><b>What\'s idaciti?</b><br><br><div>idaciti is a social BI platform with a quick and simple workflow that turns financial &nbsp;data into compelling stories. idaciti enables the community of data consumers -- including investors, analysts, corporations and academics -- to connect and collaborate around the global financial data.<br><br></div><div><br></div><div>Democratize the access to global financial information to drive changes is our mission. We aim to empower citizens of all countries to access the high value financial data -- from both public corporations and governments to gain insights and drive changes locally and globally.<br><br></div><br>', 2, 0),
	(14, 'media', 'http://application.idaciti.com//data/upload/2SocialBIPlatform2.png', 'Social BI Platform', 'idaciti is LinkedIn\nfor big data: A social BI platform for a community of investors and corporations to connect and collaborate around\ndata.&nbsp;\n\n<br>\n\n<span><br>As an idaciti “<i><b>explorer</b></i>”, users can identify\nissues, &nbsp;make company-specific data\ncomparable with peers and create a clean data store for the community.</span>\n\n<br>\n\n<span><br>As an idaciti ’<i><b>storyteller</b></i>\', users can autjro and share information insights to empower their community all do new stuff, but\nbetter, with data.&nbsp;</span>\n\n\n\nGrounded\nin XBRL -\nthe global language of finance - with the ability to link in relevant\ndata sets – idaciti help users make better investment decisions and improve\nbusiness performance in a social\nenvironment.', 2, 1),
	(14, 'media', 'http://application.idaciti.com//data/upload/2DatacardStory.png', 'Data, Story, Social', '<span><b>DATA</b><br><br>Idaciti provides &nbsp;users access to a set of <i>curated</i> business and financial data to use as the foundation for the stories.&nbsp;<br><br><br><b>STORY<br><br></b></span>idaciti cards allow users to visualize rich financial data in various formats without the need to have technical or deep understanding of the data sets.<br><br><span>An idaciti story is a combination of cards connected into a compelling narrative. Real-time and dynamic data provide the deep insights, images and videos provides the added colors and texture to the stories.<br><br><b>SOCIAL</b><br><br></span><span>Idaciti encourages users to socialize their cards and stories. That\'s the best way to improve the quality of the information and benefit from the wisdom of the crowd or the user\'s&nbsp;trusted circles.</span><span><br><br></span><span><br><br><br></span>', 2, 2),
	(18, 'card', '71', 'IBM', 'IBM i<span>ncreased its permanently reinvested overseas earnings by 18% to <b>$52.3 billion</b> last year. At the same time, the company increased its borrowing by $6.4 billion, or 19%, to <b>$39.7 billion</b> (<i>$6.86 billion in short term debt and $32.86 billion in long term debt</i>)&nbsp;. IBM is in the midst of a five-year plan to repurchase $50 billion of its own stock.<br><br></span>', 2, 0),
	(18, 'card', '72', 'Hoarding Cash?', 'It\'s true that American corporations are fabulously profitable today. <br><br>Despite earning record profits, and having the ability to borrow cash easily, companies seemed to refuse to spend, is this true?\n\n<br><br>About 60 percent of [non-financial corporate] cash piles are offshore and subject to as much as 35 percent tax if brought back to the U.S.', 2, 1),
	(16, 'card', '58', 'Free Cash Flow Analysis', 'Free Cash Flow represents the cash from operations minus capital expenditures.  In essence, it represents the \'excess cash\' the firm has left over after it has made the requisite investments during the period. &nbsp;Notice here that the net inflow from&nbsp;cash from operations peaked in 2011, and dropped off slightly in 2012 and 2013. &nbsp;However, the net cash outflow from investments increased in 2011, dropped off slightly in 2012, but increased significantly in 2013 (cash from investing activities is more negative in 2013, suggesting more cash outflow than inflow).. &nbsp;This graph suggests that Chevron\'s investing activities peaked in 2013. &nbsp;Free cash flow peaked in 2011 but trended downwards in the subsequent years', 2, 0),
	(16, 'card', '59', 'Capital expenditures', 'This graph really amplifies the relationship between capital expenditures and free cash flow. &nbsp; Free cash flow exhibited a&nbsp;sharp decline from 2011 onwards, whilst capital expenditures has increased significantly&nbsp;', 2, 1),
	(16, 'card', '61', 'Capital Expenditures - Chevron versus Exxon', 'Let\'s compare the capital expenditures of Chevron to one of its main competitors, Exxon Mobil. &nbsp;Exxon has been spending more than Chevron but it seems like Exxon\'s capital expenditures may be tapering off whereas Chevron\'s continue to increase, chasing growth. &nbsp;This article supports this thesis. &nbsp;<br>http://www.fool.com/investing/general/2014/07/14/why-chevron-is-more-successful-than-exxonmobil.aspx<br>', 2, 2),
	(16, 'card', '69', 'Exxon and Chevron - who is Goliath?', 'Exxon is the larger company, so it is not surprising that Exxon is spending more on capital expenditures in absolute dollar terms &nbsp;', 2, 3),
	(16, 'card', '68', 'Exxon\'s CapEx, FCF and Cash from Financing ', 'How was Exxon able to sustain their capital expenditures? Free cash flow increased and peaked in 2011, dropping off in 2012 and 2013, suggesting that they had some excess cash from operations to fund their investing activities. &nbsp;However, interestingly, net cash inflow from financing activities spiked in 2013, perhaps helping to fund the investing activities, when cash from operations dropped off slightly', 2, 4),
	(16, 'card', '70', 'Exxon and Chevron - EPS', 'Both companies have been struggling in the past year in 2013. &nbsp;However, on a per share basis, once we take into account the size of the company, Chevron seems to be more profitable on a per-share basis', 2, 5),
	(6, 'media', 'http://application.idaciti.com//data/upload/2CorporateTaxWorld.png', '#1 Corporate Tax Rate', '<b>We’re #1! U.S. officially has the top corporate tax rate.&nbsp;<br><br></b>I think very&nbsp;few of us rejoiced at the news that as of April 1st 2014, the United States had assumed the title of having the highest corporate tax rate in the world.&nbsp;<br><br>The pictures shows the selected corporate tax rate around the world. The data source is from <a target="_blank" rel="nofollow" href="http://www.kpmg.com/global/en/services/tax/tax-tools-and-resources/pages/corporate-tax-rates-table.aspx">KPMG</a>.<br><br>Notes from KPMG on the US Corporate Rate:<br><br>\n\n\n\n\n\n\n\n<i>The corporate income tax rate is approximately 40%. The marginal federal corporate income tax rate on the highest income bracket of corporations (currently above USD 18,333,333) is 35%. State and local governments may also impose income taxes ranging from 0% to 12%, the top marginal rates averaging approximately 7.5%. A corporation may deduct its state and local income tax expense when computing its federal taxable income, generally resulting in a net effective rate of approximately 40%. The effective rate may vary significantly depending on the locality in which a corporation conducts business. The United States also has a parallel alternative minimum tax (AMT) system, which is generally characterized by a lower tax rate (20%) but a broader tax base.<br></i><b><br><br><br><br></b>', 2, 0),
	(6, 'media', 'http://application.idaciti.com//data/upload/2ombbudget.png', 'Who Pays More Tax?', 'This chart is created using the data published by the White House (OMB), And,&nbsp;of course it does not reflect the fact that employers typically cover half of the payroll taxes collected by the government. Still, you can look at the trend of how much revenue was supported by corporate income taxes versus personal income taxes.&nbsp;<br><br><br>Data source:&nbsp;<a target="_blank" rel="nofollow" href="http://www.whitehouse.gov/omb/budget/Historicals">White House OMB Budget Table 2.1: Receipts by Source</a><br><br><br><br><br><br>', 2, 1),
	(6, 'card', '20', 'Corporate Tax - Dow 30', 'An analysis in 2013&nbsp;from the&nbsp;<a target="_blank" rel="nofollow" href="http://www.washingtonpost.com/business/economy/post-analysis-of-dow-30-firms-shows-declining-tax-burden-as-a-share-of-profits/2013/03/26/3dfe5132-7b9a-11e2-82e8-61a46c2cde3d_story.html">Washington Post</a>&nbsp;reveals that most of the 30 companies listed in the Dow industrial average have seen their U.S. tax burdens as a share of corporate profits&nbsp;<b><i>drop by half </i></b>since the 1960s and 1970s.&nbsp;<br><br>An interesting debate about <b><i>tax inversions</i></b> have drawn attention to the recent merger news. According to some,&nbsp;<span>U.S. companies are racing to ink cross-border deals that could help them gain access to lower corporate tax rates&nbsp;before an expected crackdown in Congress. And that has companies willing to pay big premiums.<br><br></span>An example is Pfizer.&nbsp;Pfizer first approached U.K. pharma firm AstraZeneca in early January 2014. As of Jan. 3, its stock closed at&nbsp;£35.86. After several offers,&nbsp;Pfizer’s most recent offer for AstraZeneca<span>&nbsp;came in at&nbsp;£55 in mid May. That represented a 55% premium to the target’s January stock price and a 48% premium to AstraZeneca’s stock price when news of a potential offer first leaked in April.<br><br>Even&nbsp;</span><span>President Obama has publicly&nbsp;demanded "<b><i>economic patriotism</i></b>" from U.S. corporations that use legal means to avoid U.S. taxes through overseas mergers.</span><br><br><br><br>', 2, 2),
	(6, 'card', '57', 'Inconsistent Income Tax?', 'You would expect the operating profit before tax and income tax expense/income taxes paid&nbsp;have a consistent correlation -- the higher the profit, the high the tax expense/paid. For these companies, the correlation doesn\'t seem always consistent. And there are many reasons.<br><br>For example AT&amp;T recorded an Income Tax "Benefit" for 2010, and it&nbsp;is due to an IRS settlement.<span>From the Income Taxes Footnote for AT&amp;T\'s 10-K:<br></span>In September 2010, we reached a settlement with the Internal Revenue Service (IRS) on tax basis calculations related to a 2008 restructuring of our wireless operations. The IRS settlement resolves the uncertainty regarding the amount and timing of amortization deductions related to certain of our wireless assets. The allowed amortization deductions on these settlement-related assets and the related cash flow impacts are expected to be recognized over a 15-year period, which began in 2008. Pursuant to the settlement, we paid $300 to the IRS during the fourth quarter of 2010 as a result of the disallowance of a portion of the amortization deductions taken on our 2008 and 2009 income tax returns. We recorded an $8,300, or $1.40 per diluted share, reduction to income tax expense in our consolidated statement of income during the third quarter of 2010 and corresponding decreases of $6,760 to our net noncurrent deferred income tax liabilities and $1,540 to other net tax liabilities to reflect the tax benefits of the settlement. The IRS settlement resulted in a reduction to our unrecognized tax benefits (UTBs) for tax positions related to prior years of $1,057, which also reduced the total amount of UTBs that, if recognized, would impact the effective tax rate.<br>', 2, 3),
	(6, 'card', '52', 'GE - Zero Tax?', 'Well, GE is paying taxes, some years,&nbsp;but how much exactly? In 2010, GE\'s tax rate was 7%, but it did jump up to 28% in 2011 before dropping again.<br><br>As the&nbsp;New York Times<span>&nbsp;(<a target="_blank" rel="nofollow" href="http://www.nytimes.com/2011/03/25/business/economy/25tax.html?ref=butnobodypaysthat&amp;_r=0" title="Link: http://www.nytimes.com/2011/03/25/business/economy/25tax.html?ref=butnobodypaysthat&amp;_r=0">GE\'s Tax Strategy</a>)&nbsp;and others have well documented, GE has employed a number of <b><i>aggressive</i></b> (and <b><i>legal</i></b>) strategies that have greatly reduced the company’s corporate tax burden.<br><br>As New York Times pointed out, "</span><span>Its extraordinary success is based on an aggressive strategy that mixes fierce lobbying for tax breaks and innovative accounting that enables it to concentrate its profits offshore. G.E.’s giant tax department, led by a bow-tied former Treasury official named John Samuels, is often referred to as the world’s best tax law firm. Indeed, the company’s slogan <b><i>“Imagination at Work”</i></b> fits this department well. The team includes former officials not just from the Treasury, but also from the I.R.S. and virtually all the tax-writing committees in Congress."</span><span><br><br><br>In 2009, even though GE\'s international business netted over $10B in profit, the company recorded over $400M loss in the company\'s US&nbsp;operation. End result? T</span><span>he company owed the U.S. government a whopping bill of $0, with the tax rate = -12%. &nbsp;<br><br>In comparison, if you switch and look at Exxon, similar profit margin as GE, and Exxon paid as high as 48% for taxes.<br><br><br></span><span><br><br></span><br><br><br>', 2, 4),
	(11, 'card', '34', 'Coffee and Organic Food', 'First item to look at closely is&nbsp;Net Income, we can see&nbsp;that from 2012 to 2013, the Net Income for Starbucks&nbsp;has&nbsp; dropped from $1.4 Billion to a mere $8.3 Million (and I can barely see the number for 2013, since the drop is so drastic). This drop must be the result from the Kraft lawsuit.<br><br>Looking at the 2013 10-K filing to the SEC, I did confirm there was a "Litigation Charge" of $2.78 Billion on the income statement. And the detailed Legal Proceedings is available in the Commitment &amp; Contingencies note. Since Starbucks does have "adequate liquidity" to pay the $2.8 billion, which was&nbsp; booked as a charge to 2013 operating expenses resulted in a $325 Million <i><b>loss</b></i> for Operating Expenses.<br><br>You can view the SEC reports here: <br><br><a target="_blank" rel="nofollow" href="http://www.sec.gov/Archives/edgar/data/829224/000082922413000044/R2.htm">Income Statement</a><br><a target="_blank" rel="nofollow" href="http://www.sec.gov/Archives/edgar/data/829224/000082922413000044/R23.htm" title="Link: http://www.sec.gov/Archives/edgar/data/829224/000082922413000044/R23.htm">Commitment &amp; Contingencies Note</a><br><br>So, Starbucks owed Kraft Foods big-time for prematurely terminating a deal with them. Other than this set back, Starbucks has consistent growth in Net Income and Net Sales.<br><br>Whole Foods is another brand that has also shown consistent growth, but definitely not as impressive as Starbucks.<br><br><br><br><br><br><br><br><br><br><br><br>', 2, 0),
	(11, 'card', '41', 'Building  A Brand', 'This card looks&nbsp;at how much Starbucks and Whole Foods actually spent on advertising. Is this how they built the well-loved brands, or, is there something else more interesting at play?<br><br>Starbucks spent $205 M in 2013 on advertising, that\'s <b><i>1.36%</i></b> of their same year Net Sales of close to $15 B.&nbsp;Whole Foods spent $56 M in 2013, and their Net Sales was $13 B, so that equates to less than <b><i>0.5%</i></b>. In contrast, Disney spent almost <b><i>6% </i></b>of the Net Sales amount on advertising.<br><br>I think both Starbucks and Whole Foods are <b>talkable</b> brands that do not rely on expensive traditional advertising to drive sales. Instead, they tap into the inexpensive conversational power of customers as their primary advertising vehicle. These brands enjoy the benefits of using word of mouth marketing to not only increase awareness, but also drive sales.<br><br>To build a brand is to be clear&nbsp;about what your brand stands for, and both&nbsp;Starbucks and Whole Foods are obvious in what they stand for. Starbucks stands for bolder, more flavorful coffee. Whole Foods stands for natural and organic groceries. By deliberately deciding to stand for something, these two companies are known for their unique point of view -- that\'s the important part of building a powerful brand!<br><br><br><br><br><br><br>', 2, 1),
	(11, 'media', 'http://application.idaciti.com//data/upload/2Brand-WholeFoods-Starbucks.png', 'Brand Power', 'So build a brand is more about<span>&nbsp;turning&nbsp;employees ADN&nbsp;customers into <i>marketers</i>. It negates the need to keep pumping out “new” whiz-bang products every 90 days to beef up sales.&nbsp;</span><span>Contrary to popular thought, the heart beat of a business enterprise is neither “making sales” nor “making money,” although this is why many of us continue to think that is why businesses exist.<br><br></span>Why is it that Whole Foods customers are always ready to tell others where they shop?&nbsp;<span>Why do so many customers drive past a half-dozen other coffee shops to get to a Starbucks and then queue up in a slow moving line, all-the-while talking to people they’ve never seen before as if they’re old friends?<br><br></span>I believe band is about&nbsp;<span>being consistent between customer expectation and customer experience. Starbucks and Whole Foods are both doing a great job in standing apart from the crowd, and the financial&nbsp;numbers show the results.</span><span><br><br></span>', 2, 2),
	(11, 'card', '38', 'Good Investment?', 'Before the lawsuit was settled in November 2013, the stock price for Starbucks was actually growing at a steady pace, and after November, the stock has lost more than 10% of its value for a while. Since April 2014, the stock price is climbing again. Before the lawsuit was settled, several analysts have thought any sizable settlement might lead to investment opportunity, and they were right.<br><br>Reported by Courthouse News Service (<a target="_blank" rel="nofollow" href="http://www.courthousenews.com/2014/01/22/64725.htm" title="Link: http://www.courthousenews.com/2014/01/22/64725.htm">http://www.courthousenews.com/2014/01/22/64725.htm</a>)&nbsp;Shareholders Sue Starbucks for $2.8 Billion. The lawsuit claimed that&nbsp;Starbucks mishandled a coffee distribution dispute with Kraft, costing \nthe company billions of dollars when an arbitrator dealt a "crushing \nblow" awarding Kraft $2.8 billion in damages, shareholders claims in a \nclass action.<br><br>The lead plaintiff is demanding almost $3 billion in damages for the shareholders. She also wants Starbucks to make changes to their bylaws so that stockholders have greater input. The attorney representing the lead plaintiff was contacted for a statement, but has yet to respond. The case is ongoing, so it may take some time for the result to become apparent.<br><br><br><br>', 2, 3),
	(11, 'card', '42', 'Rotting Away?', 'The Whole Food stock has taken a beating since late 2013.&nbsp;Interestingly, Whole Foods seems to be a victim of its own success. The trend started by Whole Foods to promote organic foods is catching on, and low-priced competitors have been bluntly stating that they want to&nbsp;<span>"drive down organic food prices."<br><br></span>Has the stock finally bottomed? You could argue that the big sell-off is overdone.&nbsp;During the company\'s conference call with analysts after announcing earnings earlier this year, J.P. Morgan analyst Kenneth Goldman had a very pointed question/comment.<span>"One of the questions I\'ve been getting lately is, \'<b><i>Does Whole Foods management appreciate that the world has changed and there\'s a lot more competition out there?\'</i></b> I\'ve got to be honest. I\'m not really hearing anything that\'s suggesting management is taking this situation as seriously as some investors want you to," he said.</span>', 2, 4),
	(22, 'media', 'http://application.idaciti.com//data/upload/2AmazonBuys.jpeg', 'Amazon’s Biggest Acquisitions', 'Amazon pulled the rug out from under Google on August 25th, 2014&nbsp;when the company acquired&nbsp;video game streaming site <a target="_blank" rel="nofollow" href="http://www.twitch.tv/">Twitch</a>&nbsp;&nbsp;for $970 million in cash.&nbsp;<br><br>While the Twitch acquisition is a huge move for Amazon, it’s only the second-largest single purchase from the retail giant, according to company data that was charted for us by Staista.&nbsp;Of all of Amazon’s purchases, however, the most important may have been the 2012 acquisition of Kiva Systems, which created Amazon’s incredibly efficient systems for picking, packing, and shipping items from its mammoth warehouses to consumers’ doorsteps.<br><br>Is one of the main reasons that Amazon is not seem as profitable because of all the large&nbsp;acquisitions<span>? Will these companies contribute to tremendous profits in the long run?<br><br><br><br></span><br><br><br><br>', 2, 0),
	(22, 'card', '75', 'Is Amazon profitable?', 'Amazon has long been seen as something of an anomaly in the business world. The company is all over the map when Wall Street attempts to <i>guestimate</i> its quarterly earnings, and when Amazon does manage to make money on razor thin margins, it reinvests all of it back into the business—a business that is nearly 20 years old and still laboring to stake its claim in the e-commerce land grab.&nbsp;<br><br><span>I<b>t\'s all about long-term growth.</b><br><br></span>Amazon isn\'t making profits because it <b>decided</b> to&nbsp;in investment mode. This may sound surprising, considering that 20-year-old Amazon is the world\'s largest online retailer, not a new start-up.<br><br><b>Can too profitable be a curse?</b><br><br>In contrast, if you switch the company in the chart to Apple you will see a different story. With over $64 billion in Gross Profit&nbsp;in FY 2013, do you think maybe Apple have an <i>addiction</i> to high margins? If&nbsp;the low end of the smartphone market is expected to grow faster than the high-end segment, Apple\'s market share might be&nbsp;in danger.<br><br><br><br><br>', 2, 1),
	(22, 'card', '77', 'Is Amazon Overpriced?', 'P/E contraction will happen, but for the long term investment, it\'s just not that important. If&nbsp;you rely on&nbsp;P/E too much&nbsp;as a measure you might be&nbsp;missing out on some of the greatest companies throughout history.&nbsp;<br><br>According to Market Watch, most analysts covering Amazon use metrics, such as&nbsp;<b>price-to-sales&nbsp;</b>or&nbsp;<b>estimated free cash flow</b>, to arrive at their price targets. But even those can be challenging.&nbsp;<br><br><span>Amazon has at least three fundamentally different businesses : first-party retail, third-party retail and AWS. If you count devices -- eBook Readers and Smartphones, then it would be 4 different businesses. All&nbsp;with distinct growth rates, margin structures and capital requirements that makes it&nbsp;increasingly hard to value Amazon by simply looking at a single multiple and metric, such as EBIT, EBITDA, earnings or FCF.</span><br><br><br>', 2, 2),
	(22, 'card', '79', 'Amazon Stock Chart', '<span>After a couple <i>correction</i> periods since Dec 2013, is this the right time to buy? According to&nbsp;<a target="_blank" rel="nofollow" href="http://finance.yahoo.com/q/ao?s=AMZN+Analyst+Opinion">analysts opinion</a>, it does seem buying Amazon\'s stocks&nbsp;is still worth considering.</span><br>', 2, 3),
	(22, 'media', 'http://youtu.be/98BIu9dpwHU', 'Amazon Prime Air', '<b></b>Amazon has asked the Federal Aviation Administration (FAA) for an exemption from rules prohibiting the use of drones for commercial purposes. &nbsp;With this request, the company&nbsp;has <b><i>signaled</i></b> that they are serious about transitioning the idea of <u>using drone to deliver products in 30 minutes&nbsp;</u><span>&nbsp;from concept to reality.<br></span><br>Is Amazon\'s technological approach aimed to delight consumers can also be profitable? According to Amazon,&nbsp;<span>they see drones as the future of commercial delivery. &nbsp;The technology is one way Amazon can shave down shipping expenses which cost the company nearly $4 billion per year.<br><br></span>In some ways, the Amazon Prime Air drone service seems like a half-baked idea. Similar to <u>Google Glass,</u>&nbsp;<span><u>&nbsp;</u>the service may be exciting, but it\'s probably&nbsp;years away from being public-ready. The current conditions, including the technology, the politics</span><span>&nbsp;and the risk factors do not favor Amazon Prime Air in the near future. But, still, I applaud Amazon\'s audacity in finding solutions to the delivery problem.</span><span><br><br></span>', 2, 4),
	(26, 'card', '83', 'Profitability Ratios for Hotel Chains', '<b>Return on Assets:</b>&nbsp;For the past three years (2011 - 2013) for which we have year end information, Wynn has performed better than Marriott&nbsp;in using their assets to generate income. Wynn had the following return on asset ratios for 2011, 2012, and 2013, respectively: 12%, 11%, and 13%.&nbsp;Marriott had the following return on asset ratios for 2011, 2012, and 2013, respectively: 4%, 11%, and 11%.&nbsp;<br><br><b>Earnings Per Share:</b>&nbsp;There is a&nbsp;large variance between the two companies\' earnings per share for the past three years for which we have year end information. This could be due to Marriott issuing many more shares than Wynn or it could be due to Wynn making more profit than Marriott.<br><br><b>Return on Equity:</b>&nbsp;What is shocking is that return on equity (ROE) for 2013&nbsp;is negative for both companies. That means that either that both companies suffered a loss or both companies have negative equity. As the return on assets are positive for both companies for 2013, stockholders\' equity must be negative.<br><br><br>', 2, 0),
	(26, 'card', '85', 'Follow Up Metrics on Hotels', '<b>Earnings per Share:</b>&nbsp;Marriott has 187.81 million more common shares outstanding when compared to Wynn at year end 2013. Marriott also earned $102.65 million less than Wynn during 2013. This accounts for the variance between the basic earnings per share of both companies.<br><br><b>Return on Equity:&nbsp;</b>Both companies have negative stockholders\' equity in 2013, which accounts for the negative return on equity even though both companies made a profit. Both companies have large amounts of treasury stock on their balance sheets, which reduces equity. In 2013, Wynn had $1.14 billion in treasury stock and Marriott had $7.93 billion in treasury stock. Looking at each company\'s 10-K for 2013, it is apparent that the treasury stock purchased by both companies is what drove equity to be negative for both companies.<br><br><br>', 2, 1),
	(27, 'card', '87', 'CFO and NI for Home Depot', 'Cash from operating Activities represents the cash inflows and outflows from Home Depot\'s core business activities (its operations). &nbsp;Notice how Cash from Operating Activities and Net Income are generally congruent and moving in a similar direction. What does this suggest? &nbsp;Why do you think there IS a difference between Cash From Operating Activities and Net Income for Home Depot&nbsp;&nbsp;&nbsp;', 2, 0),
	(27, 'card', '88', 'Changes in Working Capital and Depreciation for HD', 'This card provides details regarding Home Depot\'s changes in working capital and depreciation over time. &nbsp;What are some of the interesting trends you see here? &nbsp;How can these trends explain the trends in Cash from Operating Activities and net Income for Home Depot&nbsp;', 2, 1),
	(28, 'media', 'http://youtu.be/hMM0RhR3bYM', 'Apple Watch Unvelied', '<span>Apple finally took the wraps off its much-rumored Apple Watch on Tuesday 9.9.2014, showing off features and functions on the wrist-mounted device, which is poised to shake up the growing wearables industry.&nbsp;<br><br>With the active developer community, I am sure many creative, imaginative applications will surface soon enough to wow us. We already know that Apple Watch can make payments, find your BMW (if you drive one, that is), open the door to your hotel room, and send your heartbeat to another Apple Watch user - which seems freaky to me, unless you are 17 and desperately in love.<br><br>Nobody can say for sure how big the "wearable technology" market will be, but according to&nbsp;<a target="_blank" rel="nofollow" href="http://www.statista.com/statistics/259372/wearable-device-market-value/">statista</a>&nbsp;,&nbsp;the estimated&nbsp;</span>global wearable technology market will attain a value of $5 billion in 2014 and reach close to $14 billion in 2018. With the introduction of Apple Watch to the mix, will the number be even more impressive?&nbsp;&nbsp;can see in the future Apple could work with Gucci, Tiffany and other companies to create designer Apple Watch, sky is the limit if Apple decided to create wearable technology that\'s also fashionable.<br><br><br><span><br><br></span><br>', 2, 0),
	(28, 'media', 'http://youtu.be/x9xdh6BBlmY', 'Game Changer?', 'Tech evangelists have predicted for years a world in which people paid for retail goods with the wave of a smartphone, or the push of a smartphone button. For nearly as long, this so-called mobile wallet has yet to catch on.&nbsp;<span>Now, the biggest technology player of them all — Apple — thinks it has the formula for making it happen.<br><br></span>The product, Apple Pay, will almost certainly give Apple a leg up on mobile payments, which Forrester Research expects to reach <b>$100 </b>billion in the United States over the next five years.&nbsp;If Apple Pay can make more people use their smartphones to pay for things, it could push companies like Google, Amazon and Microsoft to reach similar deals and making mobile payments more widespread. T<span>he bigger question for Apple Pay is whether consumers find it handy enough to convert from credit and debit cards.</span><span><br><br>The fancy new devices caught out attention and imagination on 9.9.2014, but the true <b>game changer </b>might be the less glamorous payment service.<br><br></span><span><br><br></span>', 2, 1),
	(28, 'card', '23', 'Apple Stock is a Winner', 'According to a survey of analysts by Fortune after the stock split, over 60% of analysts predict Apple’s stock price will rise above $100. This is a significant increase from a year ago, when only 4 out of 45 analysts predicted that Apple’s stock price would rise above $700, the $100-equivalent of Apple’s stock price since its 7-for-1 stock split in June 2014.<br><br>On 9.10.2014 after the announcement of iPhone 6/iPhone 6 Extra, Apple Pay and Apple Watch, the stock closed at $101 (3 % over the close price on 9.9.2014).&nbsp;<span>Goldman Sachs upped their target price on shares of&nbsp;</span>Apple (NASDAQ:AAPL)<span>&nbsp;from $107.00 to $115.00 in a research note issued on Wednesday after the Apple unveiled the new products &amp; Apple Pay service.</span><br><br>', 2, 2),
	(28, 'card', '91', 'R&D Spend', '<span>According to Steve Jobs,&nbsp;Innovation has nothing to do with how much R&amp;D dollars a company actually spent.&nbsp;When Apple came up with the Mac, IBM was spending at least 100 times more on R&amp;D. It\'s not about money. It\'s about the people you have, how you\'re led, and how much you get it.&nbsp;<br><br>This is true, there is no direct relationship between R&amp;D spend and how innovative a company is. However, when we looked how a company increase or not increase R&amp;D spend, can we also get a sense if the company has continued or stopped <b><i>trying</i></b> to be innovative?&nbsp;<br><br>Apple continues to increase R&amp;D spend, increased from $1.3 billion in 2009 to almost $4.5 billion in 2013, a 250% increase over 5 years. In contrast, Microsoft and IBM has not increased R&amp;D spend, and Yahoo actually decreased R&amp;D spend. Google just like Apple, continue to increase R&amp;D.<br><br><br><br><br></span>', 2, 3),
	(28, 'card', '40', 'Cash Dividends', 'As an investor, I certainly quite like where Apple stands. Healthy free cash flow, consistent dividend payout and still reasonable P/E ratio.<br><br><span>As a long-term investor, I don’t pay too much attention to day-to-day headlines about the stock price. But I do pay attention to the&nbsp;product launches. On 9.9.2014 Apple as expected unveiled the bigger&nbsp;&nbsp;iPhone 6/iPhone 6 Extra&nbsp;in addition to a mobile-wallet solution and a new wearable device. Together, I think these moves stand a good chance of helping Apple cement growth for the next decade.</span><br><br>', 2, 4),
	(30, 'card', '272', 'Example Card Current Ratio', '', 2, 0),
	(30, 'card', '274', 'Net Income/Net Sales Example Card', '', 2, 1),
	(31, 'card', '289', 'Shareholders Equity of Home Depot Inc', 'We can see from the column changes that the shareholders equity was decreased by 5,255,000,000 during 2012 to 2013.', 2, 0),
	(31, 'card', '290', 'Common Stock of Home Depot Inc', 'We can obviously see from this line that the common stock of Home Depot Inc decreased a lot from the end of 2013 to beginning of 2014. (It\'s very weird that the line here shows that the common stock or Home Depot changed to be 0, may be the data is not that correct in this system.) We would like to figure out what influenced the common stock condition.', 2, 1),
	(31, 'card', '291', 'Treasury Stock of Home Depot Inc', 'It is reasonable to guess that the decrease in Home Depot Inc\'s Common stock was caused by the stock repurchase by the company, in which way the treasury stock of the company should increased. But from this line we are informed that the treasury stock decreased during 2013Q3 to 2014Q1. (it\'s also very weird that the treasury stock turned to be 0 in 2014Q1 here).', 2, 2),
	(32, 'card', '106', 'Cash Flow of Johnson & Johnson and Procter & Gambl', 'In 2010Q4, P&G had a high positive operating net cash, and J&J had a relatively low negative investing net cash in 2011Q2. In that quarter, the FCF of J&J was about double to that of P&G.\n\nIn 2012Q2, J&J had a very low negative financing net cash.\n\nIn the annual sheet, P&G deeply decreased it\'s operating net cash in 2012.', 2, 0),
	(32, 'card', '117', 'Cash Flow of J&J and P&G (side-by-side)', '', 2, 1),
	(32, 'card', '107', 'Income Statements of Johnson & Johnson and Procter', 'In 2012Q4 and 2013Q4, P&G had very high Revenue compare to any other quarters. In 2013 annual sheet, P&G had about twenty times revenue than J&J. In general, the COGS of P&G is usually twice more than J&J.', 2, 2),
	(32, 'card', '190', 'Liquidity for P&G and J&J', 'J&J: in the quarter sheet, the trends of quick ratio and current ratio are pretty much same. Its assets are more than its liabilities. P&G: the trends of quick ratio and current ratio are also same, but its assets is less than its liabilities. P&G has a working capital deficit.', 2, 3),
	(32, 'card', '191', 'Non-recurring Items for P&G and J&J', 'P&G: In 2011Q4, the income from continuous operation is much lower than the income before extraordinary items available for common. I think there might be a profit gained from an irregular item in this season.\n\nJ&J had the same pattern in the fourth quarter from 2010 to 2013.', 2, 4),
	(32, 'card', '235', 'Revenue for P&G and J&J', 'P&G has a very stable trend of revenue, but the revenue of J&J dropped in 2013. However, when I look through the annual report of J&J in 2013, the sales to customers is $71,312, which is different from what shows in idaciti. The sales to customers for 2012 and 2011 are $67,224 and $65,030, which are only slightly different from what show in idaciti.', 2, 5),
	(2, 'media', 'http://youtu.be/oorOZnBhFtg', 'Apple Watch', 'I will start the story with the official video for Apple Watch&nbsp;from Apple.&nbsp;There\'s a reason Apple invited fashion bloggers to the event on 9.9.2014. The Apple Watch is clearly more than just a wrist computer that does nifty high-tech things; it\'s meant to be pretty. A classic Apple thing. This&nbsp;<span>video of the Apple Watch showed a variety of shots that could have come from a fashion magazine.<br><br></span>In addition to giving you text notifications and updating your fitness achievements on your iPhone, the Watch will also perform other functions, thanks to Apple collaborations with other companies. It will show Facebook updates and baseball scores, as well as where you left your car (assuming that car is a BMW). Starwood Hotels has also worked with Apple to create an app that will allow the watch to unlock a hotel room door.<br><span><br><br></span>', 2, 0),
	(2, 'media', 'https://d28wbuch0jlv7v.cloudfront.net/images/infografik/normal/chartoftheday_1994_Apples_Gross_Profit_by_Product_n.jpg', 'iPhone', 'The iPhone 6 release date is finally conformed (9.19),&nbsp;which would fit in nicely with the rollout of the newly announced iOS 8.<u></u> Some analysts&nbsp;put out notes expressing their optimism regarding \nApple\'s short term outlook. Some believe Apple\'s plan to release a \n4.7-inch &amp; 5.4 - inch&nbsp;iPhone 6 this year that could come with an even higher price \ntag than the iPhone 5S.<br><br>Here is the breakdown of Net Sales by product reported by Apple in their last 10-K statement:<br><a target="_blank" rel="nofollow" href="http://www.sec.gov/Archives/edgar/data/320193/000119312513416534/R74.htm">Apple Net Sales by Product</a><br><br>We can easily see that the \niPhone is already Apple\'s biggest cash cow, the prospect of improved \nmargins on a top-selling new iPhone will bode well with Apple\'s \nshareholders who are keenly waiting for Apple to reignite its stuttering growth engine.<br><br><br><br><br><br>', 2, 1),
	(2, 'media', 'http://www.statista.com/graphic/1/268711/global-market-share-of-the-apple-ipad-since-2010.jpg', 'iPad', 'The statistic shows the market share of Apple of global tablet shipments from the first quarter of 2012 to the first quarter of 2014. In the fourth quarter of 2013 Apple\'s market share was at 33.2 percent. The market share of iPad is definitely dramatically lower than its 2012 Q2\'s 60%+ domination.&nbsp;Apple’s tablet revolutionized the PC industry. With that work done, the iPad is seemingly taking a breather.&nbsp;<br><br><i>iPad was the product that made me wondered how did I ever lived my life&nbsp;without one</i>? Nowadays, iPad seemed to have faded to the background. iPhone is the biggest revenue generator, and according to Forbes,&nbsp;the wearable device iWatch could add $50 billion to Apple\'s value.&nbsp;I would look for&nbsp;Apple to recalibrate. Gone are the days of magic and revolution – and the extraordinary sales that came with it – but the iPad might still have room to grow.<br><br><br>', 2, 2),
	(2, 'card', '22', 'Is Apple Still Growing?', 'Apple’s remarkable growth streak — now more than a decade old — is \nstarting to fade a little. So, Apple is no longer growing 50% + like it \nwas two years ago, but that\'s more a psychological issue than anything. I\n like the quote by&nbsp;Toni Sacconaghi, an analyst at Sanford C. Bernstein. \nHe said,&nbsp;“I<i>f Apple grew the next five years like it did the previous five years, it would be approaching the G.D.P. of Australia.</i>”<br><br>Apple,\n which had been #1 in the prior three years, fell 20% in brand value to \nan estimated $147.9 billion according to MillwardBrown,\n New York-based research firm. In 2014, Google was named the most \nvaluable brand,&nbsp;Google\'s brand value rose 40% vs. a year ago to $159 \nbillion. Basically,&nbsp;<span>Millward Brown finds that you are likely to be\n more loyal to Google than you are to Apple -- well,&nbsp;this year, anyway. &nbsp;<br><br></span><span><b>Looking at revenue growth from FY 2012 to 2013, Apple increased revenue by \n$15 Billion</b> (almost10% growth) and Google grew almost $10 Billion (almost\n 20% growth). And both Apple and Google have a healthy Net Profit Margin of 22% in FY 2013. I wonder if Apple truly "<i>lost</i>" to Google, or maybe Apple simply couldn\'t outperform itself year after year.&nbsp;After all, it\'s not easy to continuously&nbsp;</span>redefining technology for consumers. <br><br>', 2, 3),
	(2, 'card', '23', 'Apple Stock Chart', 'According to a recent survey of analysts by Fortune, now <i>over 60% of analysts predict Apple’s stock price will rise above $100.</i> This is a significant increase from a year ago, when only 4 out of 45 analysts predicted that Apple’s stock price would rise above $700, the $100-equivalent of Apple’s stock price since its 7-for-1 stock split in June 2014.<br><br>Although the stock split doesn’t have any economic impact whatsoever, but the split does put the shares within reach of more individual investors. According to WallStreetDaily, with the 7-1 split,Apple will now likely become a member of the prominent Dow Jones Industrial Average. <br><br>if Apple gets to be part of Dow, which company will be pushed aside to make room for Apple? The lowest priced <b>Intel</b> or <b>Cisco</b>? Both are also hardware companies; thus, either would be a like-for-like swap with Apple.&nbsp;<br><br><br><br>', 2, 4),
	(2, 'media', 'http://application.idaciti.com//data/upload/2AppleDividendHistory.png', 'Dividend History', 'Apple has been buying back shares for quite a while now. The share buy-backs put upward pressure on the stock price, as it reduces total share outstanding. In a standard supply and demand curve, less supply results in higher prices. Anticipation of higher prices, reduces the number of willing sellers, which puts added upside pressure on the stock price.&nbsp;<br><span><br>Following&nbsp;Apple’s&nbsp;&nbsp;dividend and buyback program, some investors are wondering whether other cash-rich companies will follow its lead.<br><br></span>When tech companies “initiate dividends, it’s not really seen as a positive, because the implication is that they can’t find other growth opportunities and technology tends to be a growth sector.”In the case of Apple, that perception wasn’t as much of a concern. The size of its cash flow means that it still has more than ample funds to spend on growth and acquisitions.<br><br><span>Besides the continued growth prospects of the company, a modest dividend coul drive the stock price up, as income-seeking investors become attracted to the stock for its dividend and growth potential.&nbsp;</span><br><br><div><br></div>', 2, 5),
	(2, 'card', '24', 'Advertising Spend', 'In the last 5 years, Apple has steadily increased their advertising spend from about $ 500 million&nbsp;to a little over $1.1 billion in 2013. Since Apple\'s net sales in 2013 is over $170 billion, this translates to <span>Apple spent <u>less than 1% of net sales</u> in 2013&nbsp;on advertising.<br></span><span><br>How does that compare to, say, Microsoft? Would it surprise you to learn that in 2013 Microsoft has spent $2.6 billion on advertising, and Microsoft\'s net sale for the period was $77 billion, this means Microsoft has spent <u>almost 3.5% of the net sales amount </u>on advertising.<br><br></span>As Forbes reported,&nbsp;<span>Apple’s past advertising campaigns have been, basically, <b><i>art</i></b>. The silhouettes of dancers rocking out to U2′s “Vertigo” (<a target="_blank" rel="nofollow" href="http://news.cnet.com/U2-pitches-for-Apple/2100-1041_3-5406646.html">http://news.cnet.com/U2-pitches-for-Apple/2100-1041_3-5406646.html</a>)&nbsp;not only sold millions of iPods, they helped make the aging band cool again. Apple’s hipster credibility was cemented by the amusing, passive aggressive commercials where the handsome young Mac ribbed a portly PC. But even if it screwed up on one campaign, its advertising strategy is still genius.</span><span><br><br><br><br></span><br><br><br>', 2, 6),
	(2, 'media', 'http://youtu.be/jiyIcz7wUH0', 'Apple AD -- Your Verse', 'Close to 2 million&nbsp;views on YouTube,&nbsp;&nbsp;this TV ad for iPad Air&nbsp;is how Apple spent some of the advertising dollars recently.<br><br>The "what will your verse be?" iPad poetic new&nbsp;ad campaign has focused on amazing story telling and has intended in not so subtle way to tug on heartstrings.&nbsp;<br><br>To go along with the TV ad, Apple has also posted a new webpage with the ad’s theme. This&nbsp;<a target="_blank" rel="nofollow" href="http://www.apple.com/your-verse/">new page</a><span>&nbsp;shares stories of the iPad being used in film-making, sports, and education.<br><br></span><b>This is classic Apple.</b><br><span><br><br></span><br><br><br><br><br>', 2, 7),
	(2, 'media', 'http://youtu.be/a0Pzx9hsE4A', 'All About Emotions!', 'OK, this Coldplay&nbsp;song by Alex Boye really have nothing to do with Apple, but when I listen to his mesmerizing voice, I felt compelled to share. <br><br>This may not be the kind of emotions that Apple is trying to create for their products, but&nbsp;I do believe there are many consumers just like me, have an emotional connection to the Apple products. <br><br>Tell you the truth,&nbsp;the solid &nbsp;(sometime <i>exciting</i>)&nbsp;financials is simply the tool to justify my admiration for Apple.<br><br>', 2, 8),
	(34, 'card', '122', 'AMGN/GILD Income Statement Analysis', 'Comparing two of the largest public biopharamaceutical companies from a time period of 2009-2013', 2, 0),
	(34, 'card', '123', 'AMGN/GILD Cash Flow Analysis', 'Comparing the Cash from Operations and the Cash from Financing amounts for the two of the largest public biopharmaceutical companies headquartered in the United States', 2, 1),
	(34, 'card', '201', 'PG vs. JNJ Debt Analysis', 'While PG and JNJ have similar levels of total debt at the end of 2013, JNJ\'s short-term debt only consists of 16.5% of its overall total debt. PG\'s short-term debt consists of 39.4% of its overall total debt.  It\'s likely that PG\'s higher short-term debt as a percentage of total debt and overall total number is higher because the company had a high number of short-term bank loans.  Maybe PG needed the liquidity to expand a product line or invest in property to expand its operations.', 2, 2),
	(34, 'card', '202', 'PG and JNJ non-recurring items check', 'Both PG and JNJ did not have any cash from discontinued operations in the time period 2009-2013. JNJ’s cash and cash equivalent levels during the time period remained significantly steadier than PG’s.  Its possible PG used cash during the time period for an acquisition.  This would explain PG’s more fluctuating cash and cash equivalent totals.', 2, 3),
	(34, 'card', '251', 'Internet Information Providers Revenue Comparison', 'Comparing Google and Yahoo Revenue Over a 5 year time period', 2, 4),
	(35, 'card', '168', 'Analysis of Net Income of Apple ', 'In 2013, there was a sudden drop of net income of Apple. Through analysis, I found that the slow down of the increase of net sales is one of the main reason, while the increase of cost of goods sold and expenses didn\'t accelerate.', 2, 0),
	(35, 'card', '169', 'Analysis of Cash Flow of Apple ', 'In 2013, there was a sudden drop of net income of Apple. Through analysis, I found that the reasons are the decrease of net sales which affects the net cash provided by operating activities and the increase of net cash used in financing activities.', 2, 1),
	(35, 'card', '158', 'Free cash flow of Microsoft and Apple', '', 2, 2),
	(35, 'card', '222', 'Apple vs Microsoft Current Ratio', 'Apple\'s and Microsoft\'s current ratio are almost mirrors of each other. Microsoft is more liquid with a higher current ratio. \n\nIn 2010 Apple launched iPad, and their current ratio dropped. \n\nCurrent ratio shows if a company\'s short-term assets can pay off its short-term liabilities. This can be misleading b/c the current ratio only looks at current liabilities and assets, BUT investors should look at the the company as a going concern. ', 2, 3),
	(35, 'card', '91', 'Apple & Others Advertising vs. R & D', 'How mush does Apple and other large companies spend on advertising vs. research & development?', 2, 4),
	(35, 'card', '148', 'Apple Inc. Income Statement', '', 2, 5),
	(35, 'card', '293', 'Apple v Microsoft | Stockholders\' Equity', 'Long Term Debt Ratio: The greater a company\'s leverage, the higher the ratio. Generally, companies with higher ratios are thought to be more risky because they have more liabilities and less equity.\n\nDebt to Equity: A high debt/equity ratio generally means that a company has been aggressive in financing its growth with debt.\n\nOperating Cash Flow to Debt: The higher the percentage ratio, the better the company\'s ability to carry its total debt. Apple clearly has a higher rate at almost double. \n\n', 2, 6),
	(35, 'card', '129', 'Comparison of ratios of Apple,Google and Microsoft', 'Net profit margin indicates the profitability of each company, current ratio represents the liquidity and long-term debt and equity reflects debt capitalization of three public companies', 2, 7),
	(35, 'card', '238', 'Comparison of equity in Apple,Google and Microsoft', 'Compare shareholders\' equity per share, dividend payout and retained earnings of three public companies', 2, 8),
	(35, 'card', '126', 'Microsoft vs Apple Liquidity Analysis', 'Just a quick look at Apple (AAPL) and Microsoft (MSFT) from an accounting standpoint. This comparison shows how Microsoft, although it is not the face of technology as it used to be, hold better financial rations (and liquidity) than Apple. This analysis suggests an upside in Microsoft\'s stock, when compared from a \\', 2, 9),
	(35, 'card', '130', 'Microsoft vs Apple Stockholder Equity Analysis', 'A quick look at Microsoft\'s and Apple\'s Stock Holder\'s Equity.', 2, 10),
	(35, 'card', '301', 'Apple vs Microsoft - EPS Analysis ', 'So I wanted to try to understand Apple\'s income, large sums of cash reserves, the amount of R&D they have (which should be taking up a lot of its cash), and the dividends per share that they give out (none). Then compare those numbers with Microsoft\'s numbers, and try to understand why Apple does not pay out any dividends.', 2, 11),
	(37, 'card', '111', 'statement of cash flow items', 'compare free cash flow and account payable between two firms', 2, 0),
	(37, 'card', '112', 'income statement items', 'compare revenue, COGS and GP between two firms', 2, 1),
	(37, 'card', '243', 'liquidity', 'compare the liquidity between two firms', 2, 2),
	(37, 'card', '244', 'non recurring item', 'see how the extraordinary items impact on the company', 2, 3),
	(37, 'card', '300', 'revenue for the energy industry', '', 2, 4),
	(61, 'card', '98', 'Compare AT&T Inc. with Verizon Inc. 2010 Q3', 'We all know that the net income of communication firms such as AT&amp;T Inc. and Verizon Inc. is mainly affected by their operating income (loss). However, we can see that the curve of AT&amp;T Inc. net income reached a summit in 2010 Q3, and its operating income (loss) was remained at same level compared to other three quarters of that year. I believe it is because that AT&amp;T Inc. was the first communication carrier which maked an agreement with Apple Inc. to obtain the exclusive right to sell contracted iPhone 4', 2, 0),
	(61, 'card', '109', 'Cash Flow Statement of AT&T Inc. and Verizon Inc.', '', 2, 1),
	(61, 'card', '193', 'Liquidity AT&T Inc. and Verizon Inc.', 'The chart show that Verizon has a better liquidity situation than AT&amp;T does', 2, 2),
	(61, 'card', '194', 'Extraodinary Items AT&T Inc. and Verizon Inc.', '', 2, 3),
	(61, 'card', '241', 'Accounts Receivable for AT&T and Verizon', 'The chart show that a decreasing trend on Allowance for Bad Debts Account for both AT&amp;T and Verizon. That means these two firms have controled their bad debts much better than before', 2, 4),
	(73, 'card', '150', 'Starbucks Cash flow items', 'The ROE and ROA of starbucks is keeping going up while the investment items remain relatively stable. This situation may caused by increasing sales. From 2011 to 2012 the net profit margin went down a bit, and this may be the result of market fluctuation.', 2, 0),
	(73, 'card', '304', 'Quick Ratio and Current Ratio of starbucks', 'The liquidity of Starbucks is not stable, it may result from company financing activities. From 2009 to 2012 Current Ratio was higher than Quick Ratio, however in 2013 Current Ratio is lower than Quick Ratio, thus the inventory account may have an negative impact on current assets in this year.', 2, 1),
	(73, 'card', '305', 'Net income, Revenue and Operating cash flows to sa', 'Revenue went up form 2009 to 2013, however, Net income in 2013 was quite small compared to that in other years, thus there may have a huge expense in 2013. At the same time Operating cash flows to sales went up, it shows that the company generated large amount of cash from operating activity, so that the huge expense may result from non-operating activities.', 2, 2),
	(73, 'card', '213', 'Non-recurring items\' influence on income of Starbu', 'From 2009 to 2012 the net income is higher than income before extraordinary items, because these years satrbucks earned little and even lost money, so they have a profit form tax. In 2013 the net income was below income before extraordinary items, it may caused by increasing from non-recurring items.', 2, 3),
	(74, 'card', '102', 'Income statements of Wal mart and Costco', 'This card involves several income statement items of Wal Mart and Costco.\nMaybe some analysis can be continued after learning these items.<br>In this card ,wal mart has larger amount in net sales,other revenue and net income.<br><br><br><br>', 2, 0),
	(74, 'card', '103', 'Cash flow items of Wal mart', 'This card shows the cash flow items of walmart and Costco.<br><br>Wal Mart Stores Inc has more net cash provided by operating but has less net cash by investing and financing than Costco.<br>Is that means that Costco is still extending?<br><br>Also Wal-mart\'s net cash provided by investing activities declined from 2010 to 2011 and increased from 2011 to 2012. In the same period, its&nbsp;net cash provided by financing activities had a opposite trend.<br>Is those trends related to each other?<br>Maybe I should research more<br>', 2, 1),
	(74, 'card', '199', 'non-recurring items of Wal-mart & Costo', 'From the graph, the income from continuing operating of Costco had a 17.1% increase from 2010 to 2011,but the income before extraordinary items had decreased 54.48% in that period.That means discontinued operations in this period increased in that period and caused a loss in income.', 2, 2),
	(74, 'card', '197', 'Liquidity of Ebay & Amazon', 'From the graph,I can see that the current ratio of Ebay suffered a 33.47% decline in the first quarter to the second quarter in 2011.In the same period,it suffered a 46.37% decline in quick ratio.Perhaps some assets included in current assets but not included in the numerator of quick ratio such as inventory decreased a lot.Also ,Ebay suffered a large increase in both the current ratio and quick ratio in the first to the second quarter of 2012.\n\nGenerally, the current ratio and the quick ratio o', 2, 3),
	(74, 'card', '248', 'Revenues of Ebay & Amazon', 'In the graph, I can easily see that Amazon largely increased in its revenue in the fourth quarter of each year. And its accounts receivable had the same trend. Ebay had a sudden increase in its revenue in the first and second quarter of 2013. Its  accounts receivable also had the same trend.', 2, 4),
	(72, 'card', '211', 'Quick ratio of Ebay and Amazon', 'Quick ratio of Ebay and Amazon both went down form 2009 to 2013, and that of Ebay went down more quickly than that of Amazon. Since quick ratio focus on the  quick assets, it tells us that this two companies may have increased their liabilities or have reduced their cash amounts. And I think it may not be a good news to the business.', 2, 0),
	(72, 'card', '212', 'Current ratio of Ebay and Amazon', 'From 2009 to 2013 current ratio of both Ebay and Amazon went down, however, Ebay maintains a bigger number of current ration than Amazon. From the operating respect, I think Ebay has done a better job than Amazon.', 2, 1),
	(72, 'card', '267', 'revenue for ebay and amazon', 'amazon\'s revenue remains higher than that of ebay from 2009 to 2013. it may results from that amazon has a bigger assets than ebay. And it is very obvious that both ebay\'s and amazon\'s revenue are going up, this situation reflects that the macro economic is warming.', 2, 2),
	(72, 'card', '284', 'revenue operating income and non-operating income ', 'although the revenue of amazon is always going up, the operating and non operating income are going down and both of them remain negative since 2012. it shows amazon didn\'t do well in cost control and may cannot pay off its debts on time.', 2, 3),
	(36, 'card', '246', 'Non-recurring items', 'In 2009, Apple and Google\'s income before extraordinary items are about the same, but Apple\'s is growing faster than Google\'s. In 2014, Apple\'s income before extraordinary is more than four times larger than Google\'s.', 2, 0),
	(36, 'card', '121', 'Income Statement item', 'This card listed net income and cost of goods sold of google and apple', 2, 1),
	(36, 'card', '247', 'Revenue for Apple and Google', 'The data shows that Apple\'s other non operating income and revenues has a negative relation. While Google\'s revenue is growing, its other non operating income does not change much.', 2, 2),
	(36, 'card', '119', 'Cash Flow items', 'This card compares four items in Statement of Cash Flow', 2, 3),
	(36, 'card', '210', 'Liquidity of Google and Apple', 'I chose current ratio,quick ratio and cash ratio to Analyze Google and Apple\'s liquidity. The trend of the three ratios are almost the same, and both of the companies has a decline in the ratios. Google\'s ratios are much bigger than Apples, which means Google has better liquidity. In 2009 Google\'s current ratio is 10.62, I think it is a little strange because Google does not have much inventories.', 2, 4),
	(75, 'card', '104', 'Income Statement Items', 'I just wanted to see the relationship between cost of goods sold, operating income and net income.  I don\'t think I made any relevant conclusions from this yet, because I think I need more items to see a direct correlation, I was more busy trying to play with this!', 2, 0),
	(75, 'card', '116', 'Cash Flow Items Assignment 1', 'In this card, I wanted to see how much of the cash from sales were being used in financial activities such as investments as well as being used to pay back loans and notes.  ', 2, 1),
	(75, 'card', '214', 'Restructuring data', 'It is very interesting to note that Pfizer had an incredibly large restructuring cost that it was able to add back after the period.  This restructure increased both its recorded \\', 2, 2),
	(75, 'card', '307', 'Revenue', 'The purpose of this card is to explore the relationship graphically between revenue and EBITDA over a period of time. ', 2, 3),
	(75, 'card', '208', 'Liquidity of IBM, Apple Inc and Microsoft Corp', 'I prepared a storyboard for my slides and saw an interesting slide on the liquidity of IBM, Apple, and Microsoft, and I liked the relationship between Liquidity and the revenue slide I just did. &nbsp;It was interesting to see Apple\'s high liquidity. &nbsp;Is it due to their high cash assets', 2, 4),
	(77, 'card', '314', 'Walt Disney Basic EPS', '', 2, 0),
	(77, 'card', '315', 'Disney Diluted EPS', '', 2, 1),
	(77, 'card', '316', 'Disney Net Income', 'As we can see, Net Income doubled during this period. Also, there was always positive growth each year, no less than seemingly 500M<br>', 2, 2),
	(77, 'card', '317', 'Disney Weighted AVG Shares Outstanding', '', 2, 3),
	(77, 'card', '318', 'Disney Common Shares Outstanding', '', 2, 4),
	(77, 'card', '319', 'Disney Treasury Stock', '', 2, 5),
	(78, 'card', '165', 'Income Statement', 'I wanted to see the relationship between COGS, SGA, Operating Income, Net Income and Revenues with Amazon and Ebay. I was mostly just picking regular Income Statement items and learning how to make cards at this point', 2, 0),
	(78, 'card', '166', 'Cash Flows of Apple, IBM, and Microsoft', 'In this card I just wanted to show that Apple has a significantly higher Free Cash Flow than both IBM and Microsoft. In 2009 Apple\'s FCF was below both other companies but since 2011, it has taken a significant jump to take the lead amongst the three.', 2, 1),
	(78, 'card', '226', 'Liquidity for Verizon and AT&T', 'In this card I just wanted to show that Verizon took a significant jump from 2013 to 2013 in its quick ratio while AT&amp;T\'s quick ratio has remained about the same from 2009 to 2013.', 2, 2),
	(78, 'card', '229', 'Non-Recurring Items for AT&T and Verizon', 'Verizon: I found it\ninterested how they had large spikes in their Income Before Extraordinary Items\nin 2010 Q4 and 2013 Q4 (Both over 20B) but the quarters before and after those\ndates seem normal. Also, they had zero in 2009 Q4, it would be interesting to\nfind out what happened there.\n\n&nbsp;\n\n<br><span>AT&amp;T: Also experienced\nlarge spikes in 2010 Q4 and 2013 Q4, maybe this was experienced across the\nentire industry?&nbsp;</span>', 2, 3),
	(78, 'card', '271', 'Revenue for AT&T and Verizon', 'AT&amp;T\'s revenue slowly grew from 2009-2013 but I\'m more interested in Verizon\'s Revenue growth beginning in 2011. Could it be due to Verizon beginning to carry the iPhone in 2011?', 2, 4),
	(80, 'card', '326', 'EPS changes of Home Depot Inc.', 'We can see from the line that the EPS of Home Depot Inc. is in a good trend annually from 2009 to 2013', 2, 0),
	(80, 'card', '325', 'Net income changes of Home Depot Inc.', 'We can see from the line that the changes of net income in Home Depot Inc. is consistent with the changes of EPS. It is proved that the stock performan of Home Depot Inc. is not diluted, which is in accordance with what is disclosed in financial report of Home Depot Inc.', 2, 1),
	(80, 'card', '327', 'PE changes of Home Depot Inc.', 'we can see from the PE line that the price to earnings ratio of Home Depot Inc.&nbsp;increased a lot during 2009 to 2012, then decreased during the end of 2012 to 2013. <br><br>Since we already know that both EPS and net income performances of Home Depot Inc. kept to be&nbsp;good in the past severa&nbsp;years, this is a good opportunity for investors to buy in the stocks of Home Depot Inc..', 2, 2),
	(82, 'card', '105', 'Sales expenses and cost of Microsoft Inc.', '<span>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Net sales in both companies is\ngrowing, and the growth rate of net sales in Google is larger than that in Microsoft.</span>\n\n<span>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S, G&amp;A in both companies is\ngrowing, and that in Google grows much sooner than Microsoft, which indicates\nGoogle experiences expending in the number of employees, the region and other\nareas.</span><br>&nbsp;<span>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The amount of cost of goods of\nGoogle is different from the number I found in 10-K in 2011. Sheets below is\nmade based on data in 10-K. Apparently the cost of goods sold increased faster\nin Google than that in Microsoft. I assume that it is because some products of\nGoogle sold are much more costly.<br>&nbsp;</span><span>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The net income increased\ncontinuously in Google while that in Microsoft fluctuated over time.</span>\n\n<span>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In conclusion, Microsoft is the\ngiant in Internet industry and it’s larger and more mature than Google. However,\nit has a low growth rate now and it needs a breakthrough.&nbsp; On the other hand, Google expends fast.&nbsp; </span>\n\n<span>\n <span><span>\n  <span>\n  <br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span>2009\n  \n  &nbsp; &nbsp;\n  2010\n  &nbsp;&nbsp;\n  \n  2011 &nbsp;&nbsp;\n  \n  \n  2012 &nbsp;&nbsp;&nbsp;\n  \n  <span>\n  &nbsp;  2013\n<br>  </span>\n </span>\n <span>\n  \n  Cost of goods sold\n&nbsp;  \n  \n  8844\n  &nbsp;&nbsp;\n  \n  10417&nbsp;\n  \n  \n  13188&nbsp;\n  \n  \n  20634\n  &nbsp;&nbsp;\n  \n  25858\n  \n </span>\n</span></span>\n\n<span>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n\n \n \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n \n \n \n\n \n \n</span>\n\n<br><br><br><br><br>', 2, 0),
	(82, 'card', '99', 'The Cash Flow of Google and Microsoft', '<span>According\nto the quarter sheet, both companies have an annual periodic change. Microsoft\nalways has the largest cash flow in Q1 and the smallest\nin Q4, while Google always has the largest cash\nflow in Q4 and the smallest in Q1. Perhaps that’s because Microsoft\nusually receive the annual payment from their customers in Q1 and it pays the\ninterest to other companies or banks in Q4. The similar things happen to Google\nbut in different time of the year. </span><br><br><br><br>', 2, 1),
	(82, 'card', '203', 'Account receivable of Microsoft and Google', '<span>According\nto the quarter sheet of Account receivable gross, Microsoft has smaller number\nof receivable account in Q1 and Q3 and the larger number in Q2 and Q4. If we\ntake a close look at the change of the receivable account in Q1 and Q4 yearly,\nwe could see the amount in Q4 increases every year while that in Q1 is stable,\nwhich indicates larger sales if the rate of receivable account for sales\ndoesn’t change and the good ability of collecting cash.&nbsp; Annually speaking, the amount of receivable\naccount in Google rises every quarter. It is of the smallest number in Q1 and\nthe largest number in Q4. Both of the amount in Q1 and Q4 increase largely\nthese years. I think that is because Google has an expanding sales and it\ndoesn’t control the amount of receivable account tightly, which might be common when a company is growing fas. But there is a\nwarning flag that the difference between the amount in Q1 and Q4 is smaller\nnow, which means some of the increasing sales is debt. It will bring a larger\nrisk to take control of their debt. </span><br><br><br><br>', 2, 2),
	(82, 'card', '205', 'allowance for bad debt of Microsoft and Google', 'The card shows that the allowance of bad debt of Microsoft is quite stable while that of Google increased sharply during 2012 and stayed in a high level. The change of the account, allowance of bad debt, in Google should have close connection with the increasing number of its account receivable. I assume that it’s because the growing account receivable made Google exposure larger risk of bad debt that Google changed its accounting policy about the account, allowance for bad debt. <br>', 2, 3),
	(82, 'card', '206', 'The acount receivable and allowance for bad debt o', '<span>Another interesting thing is that Google has larger amount\nof allowance for bad debt than Microsoft since 2012. Generally speaking,\nMicrosoft has more account receivable than Google so its allowance for bad debt\nshould be larger than Google. What’s happening here? As the sheet indicates\nMicrosoft has a stable financial performance, I would like to ascribe it to the\nrapid growing of Google’s account receivable. It should be the expansive sale\nof Google that leaves itself in a position with higher risk of bad debt.&nbsp; </span>\n\n<br><br><br><br>', 2, 4),
	(82, 'card', '200', 'current ratio of Mirosoft and Google', 'The current ratio of Google has decreased largely in 2010.\nThat’s because of the increasing of current liabilities. According to the past\nannual report of Google, we could know the current ratio was about 10 from 2006\nto 2009 and it declined sharply mainly for the raise of current liabilities\nwhich helps it take its liability leverage. In addition, its current ratio is higher\nMicrosoft which guarantees its operation ability. So though it expends fast, it\nis not of a high risk of lacking money.\n\n<br><br><br><br><br>', 2, 5),
	(81, 'card', '330', 'AT&T and Verizon: Basic EPS', '', 2, 0),
	(81, 'card', '336', 'AT&T and Verizon: Diluted EPS', 'analysis', 2, 1),
	(87, 'card', '262', 'American Express Stockholders Equity', 'This chart shows the value of the common stock issued and the total stockholders equity. What is interesting to see here that the amount of stockholders equity is on an incline whereas the value of issued common stock is in a decline.', 2, 0),
	(87, 'card', '260', 'Visa. Vs. American Express', 'Earnings per share is relatively high for American Express because the card business is not extremely capital intensive in operations. I noticed that American express repurchased over 3 million shares of common stock in 2013. This was a progressive increase in the past 3 years. This repurchase of common stock as treasury shares will immediately increase the eps ratio. \n\n', 2, 1),
	(87, 'media', 'http://application.idaciti.com//data/upload/114Pic.JPG', 'Explanation', 'As we can see from the first card, American Express has a rise in stockholders equity but the common stock being issued is in an decline. I suspect that here the company is buying back their own stock or redistributing it among their company members. Either way this makes earning per share go up. In fact, as the second card suggest, the company is repurchasing common stock as treasury stock and this increases earnings per share.', 2, 2),
	(88, 'card', '310', 'McDonalds\' cash flow from operating，investing and ', 'From the chart we can see that McDonalds\' FCF is increase sharply from 2009 to 2010 and hold steady from 2010 to 2013. While the net cash provided by operating is just showing the same tendency. However, we know that FCF is increased by cash flow from operating and decreased by capital Expenditures. McDonalds keep stable in the financial activities and increase their investment activities. That means McDonalds enlarge it operation and investment.', 2, 0),
	(88, 'card', '313', 'McDonalds\' ROE & ROA ', 'McDonalds\' ROE & ROA increase gradually. Especially the ROA reflect flat from 2011 to 2013. That means McDonalds\' asset contribute to its net income effectually and reasonably. Because McDonalds can copy their restaurant accurately in the same market or country, They can offer the  same service and food to keep this even.', 2, 1),
	(88, 'card', '176', 'The quarterly NT CE&GF of McDonalds ', 'We can see from this cards that the cost and expenses and gross profit in Q3 is higher than the other three quarters. Because the gross profit equals revenues subtracts cost of good sold, I think probably that McDonalds can sells more ice drinks during summer, from July to September. So the kind of ice drinks and ice cream really bring big profit to McDonalds. What\'s more, the net income shows the same quarter changes from 2010 to 2014, however, in the 2009 Q3, the net income just same as other ', 2, 2),
	(88, 'card', '227', 'McDonalds\' Current Asset vs Non Current Asset', 'It is really surprise me that McDonald\'s Non Current Asset is around seven times larger than its current assets, and they increase smoothly every year. What I found is that the strategy of McDonald\'s of PP&E is purchasing property as their restaurants rather than renting property. Some of the restaurants are operated directly by McDonald\'s. The other restaurants can be rented to people who want to operate a McDonald restaurant but have no property.', 2, 3),
	(89, 'card', '338', 'Google & Yahoo', 'Although no longer directly competitive in terms of their core businesses, Google and Yahoo! continue to launch individual products that go head to head—most notably, webmail services.<br><br>Over time, Yahoo\'s shares show only slight dilution, compared with Google\'s consistently more diluted earnings. The large spike in 2012 Q3 earnings marked the conclusion of the company\'s first full quarter under the direction of CEO Marissa Mayer.<br><br>Google\'s earnings were anti dilutive on a quarterly basis&nbsp;during 2009, possibly due to the issue of stock-based compensation during a period of rapid growth.', 2, 0),
	(89, 'card', '339', 'AT&T, Verizon, and Comcast', 'Across the board, these telecommunications providers show very little dilution in earnings per share on an annual basis.<br><br>An interesting exception can be found during the second half of 2009, when Verizon (according to its own reports) saw pre-tax costs related to workforce reductions that caused a 23-cent decline in diluted EPS.', 2, 1),
	(89, 'card', '340', 'Costco & Walmart', 'Costco and Walmart show consistently undiluted EPS, with Costco showing more steady growth in earnings over the last 5 years. Although both retailers provide deep discounts on staples, Walmart has a much larger international presence, operating in 26 countries.<br><br>Costco, on the other hand, depends on memberships for its growth and a portion of its revenues, which may support its ability to grow in restrictive economic climates. By providing a discount conditional upon an annual fee, Costco encourages shopper loyalty and may lure customers away from other chains like Walmart.', 2, 2),
	(86, 'card', '360', 'Comparison of net income', 'Pfizer\'s net income has been increasing since 2010. Johnson &amp; Johnson\'s net income fluctuated in last five years and has a upward trend since 2011. Merck\'s income dropped 93%&nbsp;in 2010 and faced a downward trend since 2011. The income&nbsp;plunge was due to the $41 billion&nbsp;merge deal&nbsp;with Schering-Plough that completed in November, 2009.', 2, 0),
	(86, 'card', '303', 'Comparison of dividend policy ', 'Among the three pharmaceutical companies, Pfizer is the most liquid company and has the highest dividend coverage ratio of 2.70. It indicates that Pfizer has sufficient earnings to pay dividends amounting 2.7 times of the present dividend payout during the year of 2013. Pfizer also has the lowest dividend payout ratio of 0.32 among the three companies. High dividend coverage ratio and low dividend payout ratio indicate that Pfizer is retaining a higher portion of its earnings to meet its financing requirement. Pfizer has done numerous acquisitions and will continue to expand, which could be the reason why it has high liquidity and low dividend compared with other two companies. However, Pfizer is still a good dividend stock since it has a regular dividend policy and has paid uninterrupted dividends since initiating payment in 1982.', 2, 1),
	(86, 'card', '364', 'Comparison of common shares outstanding', 'In past five years, Pfizer has been cutting its shares outstanding from 8 billion to 6.4 billion. Pfizer uses stock repurchase program to return capital to shareholders than dividends that are taxed. The stock repurchase could also explain why&nbsp;Pfizer has&nbsp;high dividend coverage ratio and low dividend payout ratio. The other two companies keep common shares outstanding on a&nbsp;certain&nbsp;level.', 2, 2),
	(86, 'card', '363', 'Comparison of total asset', 'Pfizer sold its total assets over 40 billion in the past five years. While Johnson &amp; Johnson increased its total asset over 30 billion in the past five years', 2, 3),
	(86, 'card', '358', 'Comparison of Stock Price', 'All three companies have a increase in stock price. From 2012 to 2013, Johnson &amp; Johnson has a price increase over 30%. In this period,&nbsp;Johnson &amp; Johnson\' total asset and shares&nbsp;outstanding&nbsp;increased. The company was in an expansion', 2, 4),
	(86, 'card', '356', 'Comparison of EPS', 'Among the three companies, Johnson &amp; Johnson has the best basic(4.92)and diluted&nbsp;EPS(4.81) in 2013, which means for single share&nbsp;it generate more profits than the other two companies. In 2013,&nbsp;Pfizer has a basic(3.23)and diluted&nbsp;EPS(3.19)&nbsp;', 2, 5),
	(86, 'card', '359', 'Comparison of P/E Ratio', 'The&nbsp;abnormally high PE ratio of Merck in 2010 was due to its low EPS of 0.28. The low EPS was the result of low net income due to merger deal&nbsp;with Schering-Plough. Investors expect Merck to grow&nbsp;rapidly&nbsp;after the merger.&nbsp;In 2013, Merck also has the highest P/E ratio of 33.59. Investors are optimistic concerning Merck\'s growth prospective. In 2014, Merck\'s stock has outperformed Pfizer, which has the lowest P/E ratio of 9.48 in 2013', 2, 6),
	(91, 'media', 'http://www.youtube.com/watch?v=xYMViPliCfw', 'So what is Viacom?', 'So what is viacom?<br><br>This video highlights the major channels/brands that viacom owns. Their business strategy is to understand their audience segments and continue to deliver engaging and dynamic content. <br><br><b>Strategic Takeaways:</b><br>From an overall business perspective, Viacom is always looking to reach their audience across platforms in new and exciting ways. Recently viacom reached an agreement with sony to offer more programing on their web based t.v. channel. This demonstrates constant changes in the industry and how that impacts their operations, revenue, and growth of the company. <br><br><a title="Link: null" rel="nofollow" target="_blank">(http://north.viacom.com/company/research/</a>)<br><a title="Link: http://www.wsj.com/video/sony-viacom-strike-web-tv-deal/F43E9BDB-EA82-47B8-8104-B071A55865ED.html" href=")http://www.wsj.com/video/sony-viacom-strike-web-tv-deal/F43E9BDB-EA82-47B8-8104-B071A55865ED.html">)http://www.wsj.com/video/sony-viacom-strike-web-tv-deal/F43E9BDB-EA82-47B8-8104-B071A55865ED.html</a>)<br><br><br><br>', 2, 0),
	(91, 'card', '120', 'Liquidity of Broadcasting and Cable Providers', 'Thank you Marie Miller for sharing this card! I\'ve added to your analysis for the purposes of this story board below!<br><br><br>After analyzing the overall liquidity and net cash from operating for Viacom, it is important to note that this corporation has a 12 - month end on Sept 30th.&nbsp; The basis for their operations and annual reports are on this calendar. <br><br>Overall, I can evaluate that Viacom is in a healthy, mature financial state due to the fact that they are able to provide a positive cash flow from operations, that is sufficient enough to handle their cash outflow for financing. This indicates that the corporation is continue to grow and align with their business strategy. Also, the large cash outflow from financing in 2012 includes a debt repayment of 892 million. This indicates&nbsp; a healthy state. It is important to note that in 2013, debt was not repaid and treasury shares were repurchased during both years.&nbsp; This will affect the further analysis made based on eps in this storyboard. <br><br>', 2, 1),
	(91, 'card', '369', 'EPS and purchase of treasury stock', 'Not sure what happened in 2010 - I think this may be some sort of systems error. \nWhen looking at Viacom\'s overall increase in the EPS ratio over the past 3 years, it is important to compare to the C/F from financing.  A large increase in the outflow from financing in 2013 can be explained by the 4,800 treasury share purchase made. This is almost double previous years. This direct decrease in the common shares outstanding can explain the increased eps ratio of  4.93 in 2013. \nThe reasoning behin', 2, 2),
	(91, 'card', '370', 'Impact on Diluted EPS', 'As described above, because of the redeemable controlled interest in the temporary equity section of the balance sheet, the is a diluted eps of 4.83 in 2013.  These results are not anti-dilutive because they decrease the earnings per share if this was to be converted or redeemed in the beginning of the period. The impact of the diluted portion of the ratio seems to be pretty consistent throughout the past few years which indicates a pretty steady makeup of the temporary equity section of the bal', 2, 3),
	(94, 'card', '378', 'INVT and Net sales of Cisco', 'From 2009 to 2013 the INVT keeps going up, which means the inventory is selling  faster form year to year, and at the same time net sales are increasing as well. This may show a cause and effect relationship between these two numbers.', 2, 0),
	(94, 'card', '379', 'Days average inventory conversion and average inve', 'Form 2009 to 2013 days average inventory conversion is getting shorter which means the inventory is getting salable and preferably. However the average inventory is going up form 2009 to 2011 and remain stable in 2012 and 2013. This  is because Cisco is enlarging its market share and need more products.', 2, 1),
	(92, 'card', '375', 'Apple Shareholder\'s equity', 'From\nthe chart, it is clear that the value of common stock is increasing steadily\nfrom 2009 to 2013. <br>Shareholders Equity also increases largely in the last 5\nyears, suggesting Apple operated very well and made a lot of profits.&nbsp;', 2, 0),
	(92, 'card', '377', 'Apple common shares outstanding', '<span>What\nis really interesting is that common shares outstanding fall dramatically from\n2012 to 2013 to almost the same level in 2009. It indicates that Apple\nrepurchased huge amounts of stock in the last year. In its year-ago Q4 (ending\nSeptember 2013), Apple "only" spent $5 billion on share buybacks,\nleading into the company\'s blockbuster holiday quarter. The top management in\nApple strongly believes the value of stock is incredibly undervalued by investors.</span>', 2, 1),
	(92, 'card', '374', 'Apple VS. Microsoft', 'Apple’s earnings per share is much higher than that in Microsoft, indicating Apple is more profitable and has much more profits to distribute to its shareholders than Microsoft. And a higher EPS would make the stock price of Apple rise, so Apple is more attractive to investors. But EPS is affected and manipulated by a lot of factors. Apple’s surprisingly huge stock buyback will definitely stimulate EPS to a much higher level.', 2, 2),
	(92, 'card', '376', 'Stock price', 'Regarding\nthe stock price of two companies, the price of Apple is much higher than Microsoft. Especially in 2012, Apple reached a peak in the five-year period,\nrevealing large expansion and high profitability of thecompany. It seems the\nstock price of Microsoft remains stable, a little increase but no big change.\n\n&nbsp;\n\n<br><span><br>Apple\nstock performance is better than Microsoft. Apple’s dividend raise is about\nfour times more than the total Microsoft dividend. It’s wise to invest Apple since\nApple’s larger dividends work harder than Microsoft’s each subsequent year.</span>', 2, 3),
	(76, 'card', '125', 'High Tech Corporations Cash Status', 'In this card I put 7 high tech companies together to compare their cash status from operating, nonoperating aspects. It is interesting to find that Apple stands from the crowd since 2010.', 2, 0),
	(76, 'card', '128', 'ROA, ROE, Sales of retail companies', 'This chart shows the difference between online retail companies (such as Amazon, ebay, etc.) and offline retail companies (such as Walmart). It is interesting to find that the 4th quarter would always be in high net sales.', 2, 1),
	(76, 'card', '285', 'Liquidity of Apple', 'This cart measures the liquidity of Apple through its Cash and cash equivalent, accounts receivable, accounts payable, accrued liabilities, etc.', 2, 2),
	(76, 'card', '286', 'IT industry revenues', 'This graph compares the operating revenues after tax, interest revenue and total revenue among the Intel, apple, google, IBM.', 2, 3),
	(76, 'card', '309', 'J&J vs P&G on revenue', 'why did J&J\'s revenue decline dramatically in 2013?', 2, 4),
	(96, 'card', '388', 'Sales and Income of Apple', '', 2, 0),
	(96, 'card', '387', 'Accounts receivable and bad debt', 'As Apple\'s financing plans work well among the customers, accounts receivable grows massively in recent three years. It also predicts abundant cash flow in the future. Allowance for bad debt is comparatively low, showing Apple\'s confidence in getting back the money', 2, 1),
	(96, 'card', '158', 'Free cash flow of Microsoft and Apple', '', 2, 2),
	(96, 'card', '389', 'Apple\'s stock', 'With sales and income growing, Apple also enjoys a relatively stable and gradually growing stock price. But seems Apple never declared any dividend', 2, 3),
	(95, 'media', 'http://162.144.108.196/idaciti/application//data/upload/117Inventory.jpg', 'Brief Introduction to This Story Board', 'Wal Mart (W) reached its peak on inventory in Q3, and then had the greatest sales in Q4, which yields its highest PM in Q4.<br>On the contrary, McDonalds (M) didn\'t have a extraordinary peak on inventory seasonally. But it had the greatest sales in Q3 as well as its PM.<br>The last thing is that M realized a higher PM with a relatively low inventory and sales.', 2, 0),
	(95, 'card', '390', 'Seasonality on net Inventories between Walmart&Mcd', 'It\'s very interesting to notice that the inventory of Wal Mart (W) is much more fluctuant than that of McDonalds (M). The inventory of W always reach a peak in Q3 which I guess it is because they need to prepare more inventories for sale in Q4. However, M has a rather flat and relative low inventory.', 2, 1),
	(95, 'card', '391', 'seasonality on net Sale&Profit between Walmart&Mcd', 'This is the second part of the comparison between W&M.\nIn the last card, I found that inventory of W always has a peak in Q3 but that of M is rather flat. In these card, I want to further explore the connection between inventory and sales as well as its profit margin seasonally.', 2, 2),
	(97, 'card', '395', 'EPS of two food companies', 'The McD has far lager number than Coca cola in terms of EPS both basic and diluted, it it necessary to dig into NI and Shares outstanding to find out why. ', 2, 0),
	(97, 'card', '396', 'impact factors on EPS (basic)', 'I dig into NI and Common stock outstanding to find out why McD\'s EPS is far larger than that of Coca cola. It turns out that although Coca cola has more Net income, McD has far less Common share than Cola. ', 2, 1),
	(97, 'card', '234', 'Related indicators from Shareholder\'s equity ', '', 2, 2),
	(98, 'card', '399', 'Coca Cola\'s EPS Analysis', 'Coca Cola\'s earnings per share decreased dramatically from 2010, which is consistent with its reduced earnings since 2010. A high EPS figure is an indicator of steady source of income. It may not be a good time to invest on Coca Cola right now, especially when the news report stated that Coca Cola failed its cost cuts and its profits kept falling.', 2, 0),
	(98, 'card', '354', 'EPS of Walmart vs. Costco', 'EPS serves as an indicator of a company\'s profitability. Although the EPS of Warlmart is a little bit higher than that of Costco, Walmart\'s stockholder\'s equity is 7 times as much as Costco\'s. Walmart uses much more equity (investment) to general income. As far as I\'m concerned, Costco would be more efficient at using its capital to generate income and would be a better company. ', 2, 1),
	(99, 'card', '402', 'net income', '', 2, 0),
	(99, 'card', '403', 'Weighted Shares Outstanding', '', 2, 1),
	(99, 'card', '401', 'Earnings per share, basic', 'W', 2, 2),
	(101, 'card', '405', 'EPS comparison between Ebay and Walmart', 'The basic EPS indicates the profitability of a company. It represents the portion of a company\'s profit that is allocated to one share of stock. As we can see from this chart, Walmart\'s basic EPS is around twice as much as ebay\'s EPS. Therefore, this indicates that Walmart is much more profitable than Ebay.', 2, 0),
	(101, 'card', '407', 'stockholder\'s equity comparison', 'Stockholders\' equity is important to investors. It shows how many assets the company possesses from investors. Walmart\'s stockholder\'s equity is 2 to 3 times more than Ebay\'s stockholder\'s equity. This demonstrates that walmart gaines more assets from investors than Ebay does.', 2, 1),
	(103, 'card', '410', 'NIKE Basic EPS', 'The general trend of basic EPS for NIKE is upward. Obviously, 2012 is an extraordinary year which we may discussed later. If we reconcile the number of&nbsp;outstanding common stock by&nbsp;excluding the impact of what happened in 2012, NIKE still had a increased basic EPS rate.&nbsp;', 2, 0),
	(103, 'card', '411', 'Weighted Average Outstanding Stock Basic', 'On Nov. 15, 2012, NIKE approved a 2 for 1 stock split, which is the main driver of reducing its basic EPS', 2, 1),
	(103, 'card', '412', 'Diluted EPS NIKE', '', 2, 2),
	(103, 'card', '413', 'Weighted Average Number of Outstanding Diluted ', '', 2, 3),
	(104, 'card', '414', 'EPS for 21st Century Fox', 'In 2011&nbsp;the Board implemented a stock repurchase program for $6B. Repurchasing stock will increase Earnings per Share. However, we see a decline in EPS from year 2011 to 2012. In 2012, more than $4B shares were repurchased and another $2B in 2013. What explains the $.57 decrease in EPS in 2011.', 2, 0),
	(104, 'card', '252', 'SH/E of Walt Disney and 21st Century Fox', 'Looking at Net Income we see a significant decrease in 2012. This explains why 21st Century Fox was repurchasing stock and was not able to increase EPS. A decrease in Net Income will also cause a decrease in EPS. From the 10-K, the company tells the public that EPS actually increased $.03 in 2012 from the repurchase of stock. (Net income had a much larger impact unfortunately)', 2, 1),
	(105, 'card', '416', 'EPS at Wally World', 'Shows earnings per share at WalMart, as well as the number of shares outstanding and Treasury Shares (Note: according to these data, treasury shares are 0). ', 2, 0),
	(105, 'card', '415', 'CAPEX at Wally World', 'Shows the capital expenditures and dividends at Wal Mart. Although these data are not current, I am assuming that the CAPEX for this year will be higher due to the enhancement of eCommerce upgrades they are currently undertaking.  ', 2, 1),
	(105, 'card', '287', 'Retail Giants Shareholder\'s Equity', 'The data shows that Walmart Inc is not only a far larger company in terms of it\'s operations and revenue when compared to Amazon Inc, it is also far more profitable and rewarding for investors since it has higher diluted earnings per share as well as return on equity.', 2, 2),
	(105, 'card', '273', 'Equity of Walmart vs. Costco', 'For both of companies, the amount of shareholder equity, retained earnings, and common stock remain stable from 2009 to 2013. While ROE of Costco increases year by year, suggesting that Costco is increasing its ability to generate profit without needing as much capital. ', 2, 3),
	(105, 'card', '354', 'EPS of Walmart vs. Costco', 'EPS serves as an indicator of a company\'s profitability. Although the EPS of Warlmart is a little bit higher than that of Costco, Walmart\'s stockholder\'s equity is 7 times as much as Costco\'s. Walmart uses much more equity (investment) to general income. As far as I\'m concerned, Costco would be more efficient at using its capital to generate income and would be a better company. ', 2, 4),
	(106, 'card', '365', 'Cash flow of Wholefood, Costco and Wal Mart', '', 2, 0),
	(106, 'card', '384', 'Revenues of Wal Mart & Whole Food', '', 2, 1),
	(106, 'card', '383', 'Nonrecurring items of Wal mart & Whole Food', '', 2, 2),
	(106, 'card', '382', 'Liquidity of Wal Mart & Whole Food', '', 2, 3),
	(106, 'card', '380', 'Income statement of Wal Mart & Whole Food', '', 2, 4),
	(107, 'card', '138', 'E-commerce profitability', 'Performance of e-commerce companies', 2, 0),
	(107, 'card', '147', 'Income Statement of Facebook', '', 2, 1),
	(107, 'card', '159', 'Facebook Income statement - 2', '', 2, 2),
	(107, 'card', '209', 'Facebook is the bestseller ', 'Social media companies are valued highly in the market today. Facebook is the bestseller. Facebook is highly valuated and it\'s equities 52-week price constantly growing mostly affected by innovations. If Facebook\'s liquidity ratio is for several times higher compare to all top traded companies, what could be the reasons for not BUY?.', 2, 3),
	(107, 'card', '298', 'Facebook Inc. ', 'Facebook', 2, 4),
	(107, 'card', '299', 'Facebook Inc. Revenue recognition', 'According to this graph Deferred Revenue is equal to zero. Thus, Facebook Inc. recognizes revenue only after service or product is delivered to the customer and return privileges have expired.', 2, 5),
	(112, 'card', '421', 'PG and JNJ: Net income and EPS', 'EPS represents the portion of a company\'s profit allocated to each outstanding share of common stock.<span><br>As we can see, the trends of EPS of both companies are accordant with their net income.&nbsp;</span>Changes in Revenue and EPS are the most important factors in the long-term price of a company\'s stock and those data help us to understand the companies\' worth.<br>Especially of the surge of JNJ in 2013, the company&nbsp;<span>delivered strong results in 2013 led by the outstanding performance in our Pharmaceutical business, the strength of key brands in our US OTC and other Consumer businesses and continued progress in integrating Synthes into Medical Devices and Diagnostics business.&nbsp; We also advanced our longer term growth drivers, bringing innovative solutions to the global healthcare market and executing with excellence</span><span><br><br></span><br>', 2, 0),
	(112, 'card', '424', 'PG and JNJ: PE', 'The Price/Earnings Ratio is given by dividing the Last Sale Price by the Average EPS (Earnings Per Share) Estimate for the specified fiscal time period. P/E ratios give us <span>how much an investor in common stock pays per dollar of current earnings.<br></span><span>Luckily, the PE is overall increasing for both companies, which suggested investors are willing to pay higher as the earnings growth in recent years<br><br><br></span>', 2, 1),
	(112, 'card', '420', 'PG and JNJ: dividend yield and dividend payout', '<span>The dividend yield is a ratio that shows how much a company pays out in dividends relative to its share price. It\'s calculated by dividing the annual dividends paid per share by the price per share.<br>JNJ has a higher dividend yield and dividend payout than PG. Actually both companies are considered dividend stocks which paid out dividend generously to investors</span>', 2, 2),
	(112, 'card', '422', 'PG and JNJ: stock', 'Updated stock price, PE ratios and EPS could be seen on this page', 2, 3),
	(113, 'card', '354', 'EPS of Walmart vs. Costco', 'EPS serves as an indicator of a company\'s profitability. Although the EPS of Warlmart is a little bit higher than that of Costco, Walmart\'s stockholder\'s equity is 7 times as much as Costco\'s. Walmart uses much more equity (investment) to general income. As far as I\'m concerned, Costco would be more efficient at using its capital to generate income and would be a better company. ', 2, 0),
	(113, 'card', '273', 'Equity of Walmart vs. Costco', 'For both of companies, the amount of shareholder equity, retained earnings, and common stock remain stable from 2009 to 2013. While ROE of Costco increases year by year, suggesting that Costco is increasing its ability to generate profit without needing as much capital. ', 2, 1),
	(113, 'card', '428', 'Profitability of Walmart vs. Costco', 'The EBIT of Walmart is much higher than that of Costco. However, the absolute level of profit may only provide an indication of the size of the business, but it says very little about company performance. In order to evaluate the level of profit, I compare Operating Profit Margin and ROA of these two companies. Compared to Costco, Walmart has a higher Profit Margin and ROA, which indicate that it has better ability to create profit.', 2, 2),
	(113, 'card', '132', 'Liquidity of Walmart vs. Costco', 'Current ratio and quick ratio measure a company\'s ability to pay back its short-term liabilities with its short-term assets. Both the current ratio and quick ratio of Costco are higher than those of Walmart, so Costco is more capable of paying its obligations. In addition, a current ratio under 1 indicates that Walmart would not be able to pay off its obligations if they came due at that point. Although it does not necessarily mean that it will go bankrupt, it is not a good sign.', 2, 3),
	(113, 'card', '427', 'Long-term solvency of Walmart vs. Costco', 'The most interesting part of this chart is that the Interest Coverage Ratio of Walmart is negative. When I checked the EBIT and Interest Expense of Walmart, I found that its Interest Expense was negative. Negative Interest Expense means that Walmart paid less interest on the loans than it received in interest on its investments. From this perspective, Walmart has high ability to pay its debt.', 2, 4),
	(114, 'card', '431', 'Inventory II', 'Manufacturing Corporation, Coca Cola Co<br>Coca Cola Co has a much higher Cost of Goods Sold than Inventory account which means products that made by Coca Cola Co were immediately sold rather than remain in the warehouse.<br>In the meanwhile, Coca Cola Co\'s Inventory Turnover has increased since 2009, that means the number of&nbsp;times on average Coca Cola Co sells its products has increased', 2, 0),
	(114, 'card', '430', 'Inventory IV', 'Manufacturing Corporation, Boeing Co<br>Comparing with Coca Cola Co, which produces drinks, Boeing Co manufactures aircrafts. It approximately manufactures 700 aircrafts a year and the demand of those aircrafts is stable. As a result, Boeing Co does not have a high Inventory Turnover.<br>But, I can not figure out why its Inventory is nearly the same amount with its Cost of Goods Sold. Will the huge Inventory makes expensive storage costs for Boeing Co?', 2, 1),
	(109, 'card', '417', 'inventory analysis', 'in the inventory turnover, Apple grows every year and reaches to a huge level among the competitors. Microsoft also increases every year, but at a rather low rate. While IBM does not have a clear trend in this area, which can be result from the large average inventory in warehouse. As a consequence, I think the executive has taken some measures to deal with the problem and&nbsp;the inventory level falls down, since large stock in warehouse may incur some overhead cost for the company.<br><br><br><br><br>', 2, 0),
	(109, 'card', '432', 'continue for inventory analysis', 'revenue for IBM declined from 2011, so managers may try to reduce the inventory level to cover costs. But Apple\'s revenue goes up significantly, suggesting that it has to produce more products in order to meet customers in the market and as a result, they could own much inventory for the daily operation.', 2, 1),
	(115, 'card', '433', 'Wal Mart Inventory Historical Data', '', 2, 0),
	(115, 'card', '435', 'Wal Mart Inventory Conversion', '', 2, 1),
	(115, 'card', '434', 'Wal Mart Inventory Turnover', '', 2, 2),
