	(116, 'card', '433', 'Wal Mart Inventory Historical Data', '', 2, 0),
	(116, 'card', '435', 'Wal Mart Inventory Conversion', '', 2, 1),
	(116, 'card', '434', 'Wal Mart Inventory Turnover', '', 2, 2),
	(116, 'card', '436', 'Wal Mart Liquidity Measurement Ratios ', '', 2, 3),
	(90, 'card', '288', 'Johnson & Johnson 2012 Buyback', 'Among 60 S&amp;P companies engaging in buybacks in 2012, Johnson &amp; Johnson accounted for the largest amount, repurchasing $12.9 billion worth of stock. Buybacks are usually used for several purposes, but the 2012 buyback was a well crafted move used to avoid a large tax hit on its acquisition of Synthes, a Swiss medical company. <br><br>Evidence of this activity can be seen quarterly during 2012.&nbsp;', 2, 0),
	(90, 'card', '346', 'Basic EPS vs Diluted EPS', 'This shows that J&amp;J has generally avoided\ndilution. A substantial difference in a company\'s EPS and diluted EPS may\nindicate high potential dilution for the company\'s shares, basically a bad sign\nfor shareholders. During the 2012 buyback, “instead of a dilutive stock\nissuance followed by a share buyback program, the company has borrowed stock\nthrough an accelerated share repurchase agreement, which transforms the\ntransaction into an accretive deal” (Forbes). <br>So, with the help of Goldman\nSachs and JP Morgan in swapping shares with Irish subsidiary Janssen, J&amp;J\nwas able to acquire Swiss Synthes, which, funny enough, is headquartered in\nPennsylvania.&nbsp; &nbsp;&nbsp;<br>', 2, 1),
	(90, 'card', '349', 'Tax Effect on Acquisition of Synthes', 'The\nloophole J&amp;J discovered in 2012 was apparently an impressive work in an\nongoing battle of tax avoidance through overseas earnings. Google, IBM, Pfizer,\nand numerous corporations have accumulated $1.95 trillion outside the US as of\nMarch 2014 (Bloomberg). Although viewed as an untapped pot of money, Congress\nhas remained in a stagnant struggle. \n\n<span>&nbsp;<br><br>This may be a far reach, but the steady income tax expense and payments to acquire productive assets compared to the boom in goodwill may be evidence of the acquisition of Synthes with no effect on taxes and no evidence of a substantial purchase.&nbsp;</span>', 2, 2),
	(90, 'card', '441', 'J&J Stock ', '', 2, 3),
	(8, 'media', 'http://application.idaciti.com//data/upload/23Image for repurchase.jpg', 'Washington Post article on Buybacks', 'Stock buybacks are controversial. &nbsp;Do these transactions reward shareholders or are&nbsp;they simply a way to boost to artificially boost Earnings per Share, a measure that investors and corporate boards fixate upon in measuring firm performance and determining executive compensation, respectively.<br><a target="_blank" rel="nofollow" href="http://www.washingtonpost.com/business/economy/companies-turning-again-to-stock-buybacks-to-reward-shareholders/2013/12/15/58a2e99c-4aef-11e3-9890-a1e0997fb0c0_story.html">http://www.washingtonpost.com/business/economy/companies-turning-again-to-stock-buybacks-to-reward-s...</a><br><a href="http://online.wsj.com/news/articles/SB10001424127887324582004578456623771366426">http://online.wsj.com/news/articles/SB10001424127887324582004578456623771366426</a><br><br><br>', 2, 0),
	(8, 'card', '28', 'Stock buybacks of the Top EPS companies', 'A striking trend is that both Cisco and Intel increase their stock repurchases in the years leading up to 2011, followed by a decline in repurchases post-2011. &nbsp;We see a similar pattern with Microsoft, however, their stock repurchases peak in 2010 and then decline. &nbsp; &nbsp;', 2, 1),
	(8, 'card', '27', 'EPS and FCF', 'The pattern of Intel\'s EPS follows that of its repurchase activities, with EPS&nbsp; increasing in the years leading up to 2011 (peaking at 2011), and then declining, suggesting that the increase (decrease) in EPS may be&nbsp;associated with the increase (decrease) in stock repurchases. &nbsp;However, for Cisco, we see EPS peaking in 2013, with EPS showing some volatility in the years leading up to its peak in 2013. Similarly, Microsoft shows some volatility in its EPS&nbsp;with EPS increasing until 2011, dropping off and then&nbsp;bouncing back again.&nbsp;&nbsp;Overall, there appears to be no evidence that there is an association between free cash flow and stock repurchase activity, and free cash flow and EPS for these firms<br><br>', 2, 2),
	(8, 'card', '33', 'Debt Issuances', 'This graph shows that Intel and Cisco, in particular, issued significant amounts of&nbsp;debt in the years leading up to 2011, with debt issuances peaking in 2011 for both firms, and then declining subsequently. &nbsp;This suggests that there is some association between debt issuances and stock repurchases for these two high EPS&nbsp;companies. &nbsp;Are these two companies issuing debt and using the proceeds to repurchase stock? &nbsp;Further investigation is necessary. &nbsp;What do you think? &nbsp; &nbsp;', 2, 3),
	(93, 'card', '151', 'Yahoo Inc. Statement of Cash Flows ', 'This graph shows all the KPIs that make up Yahoo Inc.’s Net Cash Flow: Cash from Operating Activities, Cash from Investing Activities, and Cash from Financing Activities. \n\nYahoo’s Net Cash from Operating Activities (which is cash coming in / flowing out of the company from core business activities) is positive across the 5-year period from 2009 – 2013.  It is steady around $2 - $3 billion in 2009, 2010 & 2011.  In 2012 it jumps dramatically to ~$10 billion, and in 2013 it returns to ~$3 billion', 2, 0),
	(93, 'card', '306', 'Yahoo vs. Google: Revenues & Income St. KPIs', 'While Google’s Net Income increased steadily from 2009 – 2013, Yahoo’s Net Income was less stable, increasing and decreasing every other year.  The difference in dollar amount between Google and Yahoo’s Net Income was significant.  Yahoo’s Net Income ranged from $597,992,000 to $3,945,479,000 between 2009 and 2013, while Google’s Net Income ranged from $6,520, 448,000 to $12,920,000,000 over the same period. \n\nFrom 2009 – 2013, Google’s Revenue increased quite quickly year over year, starting at', 2, 1),
	(93, 'card', '341', 'Yahoo Income Statement Items ', 'From 2009 to 2012, Yahoo’s revenue decreases from approximately $6.5 Billion to approximately $4.7 billion.  Its COGS also decreases over the 5-year period from approximately $2.9 billion to approximately $1 billion.  The fact that the COGS decreases as the revenue decreases helps to keep Yahoo’s net income positive despite the loss in revenue.  This is especially evident in 2012 when Yahoo’s revenue stays about the same, yet its COGS descreases from approx. $1.5 B to $1.1 billion, which helped ', 2, 2),
	(93, 'card', '342', 'Google Inc. Income Statement Items ', 'This graph shows the items that make up Google’s income statement. \nFrom 2009 – 2013, Google’s revenue Inc. increased year over year.  It was ~ $24 billion in 2009, ~ $29 billion in 2010, ~ $38 billion in 2011, ~$50 billion in 2012, and ~60 billion in 2013.  This is shows strong and steady revenue growth for Google over the 5 –year period. \n\nGoogle’s COGS also increased steadily for 2009 & 2010, but in 2011 it jumped from ~10 billion to ~ $60 billion.  I have not been able to find what this huge', 2, 3),
	(93, 'card', '343', 'Google vs. Yahoo: Return on Equity', '', 2, 4),
	(93, 'card', '344', 'Google Inc. Net Cash Flow ', 'This graph shows all the KPIs that make up Google Inc.’s Net Cash Flow: Cash from Operating Activities, Cash from Investing Activities, and Cash from Financing Activities. \n\nGoogle has a positive cash flow from operating activities for 2009 – 2011, and also for 2013.  Cash from operating activities is only listed as negative in 2012 (- $51M).  This means that over the 5 year period, aside from 2012, Google had more cash coming into the company from its core business activities than it had going ', 2, 5),
	(93, 'card', '345', 'Google vs. Yahoo Liquidity ', 'Liquidity refers to the ability to convert an asset to cash quickly, which is also known as marketability. From an investor’s perspective, it is better to invest in liquid assets than illiquid ones because it is easier to get your money back.  \n\nLiquidity is often calculated using liquidity ratios, such as the Quick Ratio and Current Ratio.  These liquidity ratios measure a firm’s ability to meet maturing short-term obligations.  The higher the liquidity ratio, the better equipped it is to meet ', 2, 6),
	(93, 'card', '373', 'Google Vs. Yahoo: Free Cash Flow ', 'Google’s Free Cash Flow is positive across the entire 5-year period, ranging from approximately $7B on the low end to approximately $13B on the high end.  \n\nYahoo’s Free Cash Flow, in comparison, is not very high over the 5-year period, and is even turns negative in 2012.  From 2009 – 2013, Yahoo’s Free Cash Flow ranges from approximately $877 M on the high end, to approximately -$787M on the low end.  \n\nFree Cash flow establishes how much cash a company has after paying its bills for ongoing ac', 2, 7),
	(118, 'card', '449', 'Nike Inventory Turnover Ratio', 'Inventory Turnover Ratio = COGS / Average Inventory.   The inventory ratio is an efficiency ratio that shows how effectively inventory is managed by comparing cost of goods sold with average inventory for a period.  According to Nike\'s Inventory Turnover Ratio, its COGS for 2009/2010 should be around $10 billion, and in 2011/2012 should be between $18 billion and & $21 billion. ', 2, 0),
	(118, 'card', '450', 'Nike\'s Cost of Goods Sold', 'From looking at the Inventory Turnover Ratio, I calculated that the the COGS in 2009 / 2010 was around $10 billion.  This COGS chart shows that this is true.  However I overestimated the COGS for 2011 / 2012 -- I calculated the COGS to be between $18 billion and $21 billion, when it was actually around $13 - $14 billion.   I\'m not sure why this overestimation happened -- perhaps it was a rounding error.  ', 2, 1),
	(118, 'card', '452', 'Nike: Is average inventory too high?', 'A good rule of thumb is that if inventory turnover ratio multiplied by gross profit margin is 100 percent or higher, then the average inventory is not too high.  As you see from 2009 - 2013, Nike\'s inventory turnover ration multiplied by gross profit margin equals + 200% throughout the years.  Therefore, Nike\'s average inventory is not too high.', 2, 2),
	(118, 'card', '454', 'Nike Inventory Adjustment', 'From the chart of Nike\'s inventory adjustment -- in 2012 it looks like certain changes were made in the current period to the value and amount of inventory reported. ', 2, 3),
	(119, 'card', '458', 'per share', 'Firstly, per share data shows huge difference between these three companies. Microsoft Corp has the largest number of shares of common stock outstanding. Then lets move to the profitability of these common stocks. The average market P/E ratio is 20-25 times earnings. Generally a high P/E ratio means that investors are anticipating higher growth in the future. The whole picture indicates that market has a more optimism prediction for Google, then Apple, lastly Microsoft. Specifically, Apple was growing fast at first, and its P/E ratio was also increasing. Today, Apple is one of the largest company in the world, so its revenue and earnings can not keep the same growth as before. As a result, its P/E had dropped to 12 by This reduction in the P/E ratio is a common occurrence as high growth startups solidify their reputations and turn into blue chips.&nbsp;', 2, 0),
	(119, 'card', '460', 'dividend', '', 2, 1),
	(119, 'card', '459', 'price to earning', 'In this chart, we can see clearly that the price to earning of &nbsp;Google Inc. is the highest, then Microsoft Corp. following. Apple Inc. has the lowest price to earnin', 2, 2),
	(120, 'card', '163', 'cash flow items ', '<ul><li>Princeline\'s free cash flow increased sharply during 2009 - 2013&nbsp;from 500M to around 2200M.</li><li>Expedia\'s free cash flow decreased from 2012 - 2013 from 1000M to below 500 M after increasing since 2009.</li><li>TripAdvisor\'s free cash flow increased gradually to around 300M by 2013.&nbsp;</li><li>Overall, Priceline remained the largest size of free cash flow among three companies, mostly from its operating activities.&nbsp;</li></ul>', 2, 0),
	(120, 'card', '164', 'income statement ', '<ul><li>Net income: Priceline had best performance at this point (growing drastically from 500m to nearly 2000m during 2009 - 2013) while TripAdvisor increased steadly to over 200m by 2013. Expedia\'s fluctuated, and specifically, its increased gradually from around 250m to 500m over 2009 - 2011 before decreasing by about 250m by 2013.</li><li>Sales and expenses: It should be noticed that the exceedingly increasing cost aexpenses of Expedia partly lead to its dropping net income, despite its continuing increasing sales.&nbsp;</li></ul>', 2, 1),
	(120, 'card', '264', 'liquidity ', 'Except Expedia\'s current ratio remained steady (close to 1), the other two companies\' current ratio fluctuated (but above 1 at most time)<br>Comparing to the other two companies in the travel industry, Expedia\'s current ratio was below 1 which could mean this company had trouble with paying its short-term debt.&nbsp;<br>And Priceline\'s current ratio reached over 5 in 2013. This indicate Priceline was able to meet its short-term obligation while possibly it did not perform efficient in utilizing its current-assets.', 2, 2),
	(120, 'card', '266', 'revenues of the travel industry ', 'Generally, it could be seen from these three typical companies within in this industry&nbsp;that the travel industry was experiencing upward trends in these years. Possible reasons were expanding markets, emerging business forms or growing family income.&nbsp;<br>Among three, Priceline stayed the highest level of revenues (reaching 6.8b in 2013)except in the middle of 2010. Then Expedia amounted 4.7b and TripAdvisor 0.9b.&nbsp;<br>During 2011 - 2013, Priceline enjoyed about 56% increases in revenues while Expedia 37% and TripAdvisor 48%.&nbsp;<br><br>', 2, 3),
	(121, 'card', '461', 'inventory', 'Costco had the largest inventory in 2013 amounting to 7.89b. Then was the Amazon with 7.41b inventory. Whole Foods was a relatively smaller suppermarket chain store and held inventory with value of 414m in 2013.<br>It can be observed that Whole Foods\' revenues exceeded its inventory to the largest degree.<br>Costco made more revenues than Amazon with comparable size of inventory.&nbsp;', 2, 0),
	(121, 'card', '462', 'inven turnover&days inven conversion', 'Whole Foods\' inventory turnover was 32.77 in 2013, which meant its sales were 32.77 times its average inventory. This was the highest among three, indicating strong sales. Or it was possible that Whole Foods experienced inventory shortage which cmight bring losses to businesses.&nbsp;<br>Costco Wholesale had higher inventory turnover, and correspondingly fewer days inventory conversion comparing with Amazon. So basically Costco was more efficient in putting its inventory into sales than Amazon.&nbsp;', 2, 1),
	(123, 'card', '464', 'Apple Google Microsoft Comparison', 'Comparison of companies', 2, 0),
	(124, 'card', '465', 'Apple and Google Revenues', '', 2, 0),
	(124, 'card', '466', 'Apple and Google Net Income', 'A comparison', 2, 1),
	(124, 'card', '467', 'Apple and Google Assets', 'a comparison', 2, 2),
	(124, 'card', '468', 'Apple and Google EPS', 'Diluted', 2, 3),
	(125, 'card', '473', 'Boeing PP&E', 'Beoing experienced a gain from the sale of PP&amp;E from 2009 until 2011. From 2011-2012 Boeing had a loss of $20 Million in PP&amp;E and from 2012 - 2013 once again had a gain from sales of PP&amp;E of $16 Million.', 2, 0),
	(125, 'card', '474', 'Boeing Depreciaton & Net Income', 'Operating Income after depreciation is much higher than net income. Looks like Boeing accelerated depreciation in 2011 in order to increase net income. After 2011 Boeing stopped using depreciation for tax purposes. ', 2, 1),
	(117, 'card', '476', 'J&J, Pfizer, Merck Days Inventory Conversion', 'Pfizer holds hold on to its inventory much longer than Merck and J&J. This decreases liquidity for Pfizer while J&J is likely more liquid due to shortest conversion rate of inventor.', 2, 0),
	(117, 'card', '445', 'J&J vs Pfizer vs Merck Inventory Turnover', 'In 2011 J&amp;J inventory turnover peaked at 51.25 times, that is much higher than Pfizer and Merck. In 2011-2012 FDA launched investigations against J&amp;J which may have caused its turnover to drop to 8.46 in 2012', 2, 1),
	(117, 'card', '446', 'J&J vs Pfizer vs Merck Revenue', 'J&J\'s net sales correspond with its inventory turnover in 2011. J&J cost of goods increases from 2010, but its revenues dramatically drop in 2012 and at the same time its current ratio is increasing, how could that be?', 2, 2),
	(117, 'card', '447', 'J&J vs Pfizer vs Merck R&D', 'Revenue of all 3 competitors is dropping in 2013, but J&amp;J is the only one who increased R&amp;D spending and its revenues are also falling.', 2, 3),
	(126, 'card', '287', 'Retail Giants Shareholder\'s Equity', 'The data shows that Walmart Inc is not only a far larger company in terms of it\'s operations and revenue when compared to Amazon Inc, it is also far more profitable and rewarding for investors since it has higher diluted earnings per share as well as return on equity.<br>In addition, there does not appear to be much difference between the Basic EPS of these two companies and their Diluted EPS. This must mean that neither company have many dilutive elements such as stock options, warrants, or convertible preferred shares.<br>', 2, 0),
	(126, 'card', '354', 'EPS of Walmart vs. Costco', '&nbsp;Although the EPS of Warlmart is a little bit higher than that of Costco, Walmart\'s stockholder\'s equity is 7 times as much as Costco\'s. Walmart uses much more equity (investment) to general income. As far as I\'m concerned, Costco would be more efficient at using its capital to generate income and would be a better company.<br>Costco\'s profitability and EPS are much closer to Walmart\'s level than Amazon.com.&nbsp;<br>', 2, 1),
	(126, 'card', '352', 'EPS comparison', 'Walmart\'s basic EPS is around twice as much as ebay\'s EPS. However, walmart\'s stockholder\'s equity is 2 to 3 times more than Ebay\'s. Therefore, although walmart has a higher EPS, it use more assets to generate it. From this point, Ebay is much better to investment than Walmart.<br><b></b>Ebay, another online retailer like Amazon has roughly half the EPS of Walmart. It seems that as of now, online retailers are still greatly outperformed by their physical chain&nbsp;counterparts. I do believe the gap will shrink in the future (unless Walmart is successful in beating Amazon in the online retail market) as the U.S. becomes more computer literate&nbsp;<br><br>', 2, 2),
	(127, 'card', '471', 'Apple vs Microsoft - Income Taxes', 'There are many ways to decrease the amount of taxes that you need to pay in a certain year. <br><br>Income Taxes = (Revenues-Expenses-Depreciation)x(Tax Rate)<br><br>That being said, companies can either: Decrease their revenues (not a desired option), Increase their Expenses and/or Increase their Depreciation expenses in order to achieve lower Income Taxes and essentially.<br><br>For these reasons, many companies Buy new assets (especially inventory) at the end of the fiscal year, Increasing expenses. <br><br>Companies may also aspire to acquire their leases (if any) as capital leases, in order to be able to disclose the expenses and depreciation of the asset.<br>', 2, 0),
	(127, 'card', '371', 'Leases - Appple vs Microsoft', 'By measuring profitability and liquidity through ROA and Debt/equity ratio, management is encouraged to utilize Operating Leases.', 2, 1),
	(127, 'card', '301', 'Apple vs Microsoft - EPS Analysis ', 'So I wanted to try to understand Apple\'s income, large sums of cash reserves, the amount of R&amp;D they have (which should be taking up a lot of its cash), and the dividends per share that they give out (none). Then compare those numbers with Microsoft\'s numbers, and try to understand why Apple does not pay out any dividends.', 2, 2),
	(127, 'card', '126', 'Microsoft vs Apple Liquidity Analysis', 'Just a quick look at Apple (AAPL) and Microsoft (MSFT) from an accounting standpoint. This comparison shows how Microsoft, although it is not the face of technology as it used to be, hold better financial rations (and liquidity) than Apple. This analysis suggests an upside in Microsoft\'s stock, when compared from a \\', 2, 3),
	(128, 'media', 'https://www.youtube.com/watch?v=Le46ERPMlWU', 'Impressive?', 'This innovation call for significant&nbsp;investment.&nbsp;<br>How companies record cost associated with R&amp;D? Do they expense or capitalize it?<br>Accounting rules define an asset as something with future economic benefits, so it\'s natural to ask why research and development costs can\'t be capitalized and treated as an asset rather than an expense, which is what the rules require. After all, the whole purpose of "R&amp;D" is to realize future economic benefit.The main reason companies aren\'t allowed to capitalize their research and development costs is that there\'s no way to reliably measure the future economic benefits of those costs.it\'s not possible to directly match R&amp;D expenses with revenue,(matching principle)&nbsp;then the asset can\'t be amortized. For these reasons, accounting rules require that all R&amp;D costs be treated as expenses when they are incurred. Finally, by capitalizing the R&amp;D cost&nbsp;company will show more assets, which would increase the value of the company by increasing their net income<br>', 2, 0),
	(128, 'indicator', '6', 'Amazon Research and Development Expense', '(don\'t pay attention to graph, isn\'t related to storyboard. The numbers provided below is taken from another source and they are relevant)&nbsp;<br>Amazon Research and Development Expen<br>2002 - 58.16M<br>2008-258.00M<br>2012 - 345.00M<br>March 31, 2014 - 1.991B<br>September 30, 2014 - 2.423B<br>R&amp;D expense is essentially the amount of money that a company spends to develop new products and services. Drastic increase from March to December was when Amazon start expanding its R&amp;D operations in Cambridge, UK., with a plan to staff out a large research lab. Thus, based on those numbers we can conclude their bottom line on their&nbsp;income statement will substantially decrease.&nbsp;', 2, 1),
	(129, 'card', '500', 'income tax', 'From the chart, we can see that the current income tax expense of Walmart is heavy bigger than that of Costco, so do deferred tax assets and deferred tax liability, because the size of Walmart is larger a lot than Costco. Let’s go to the Walmart, which use the deferred tax expense well.', 2, 0),
	(129, 'card', '501', 'deferred tax asset', '<span>Walmart\'s deferred tax asset is larger than current income tax expense(state and local).&nbsp;This asset helps in reducing the company’s future tax liability. Deferred tax assets increased from 2009 to 2010 and 2012 to 2013, decreasing from 2010 to 2012. There three reasons of the increase. Firstly, expenses&nbsp;are recognized in the income statement before they are required to be recognized by the taxing authority. Secondly, revenue is subject to taxes before it is taxable in the income statement. Lastly, the tax base or tax rules for assets and/or liabilities&nbsp;are different. And we can also see the similar phenomenon in the chart of Costco.&nbsp;</span>', 2, 1),
	(129, 'card', '503', 'deferred tax liability', 'The deferred tax liability of Walmart is much larger than that of Costco. Both deferred tax liability of Walmart and Costco are increasing by time.&nbsp;<span>A deferred tax liability arises when a company\'s real-world tax bill is lower than what its financial statements suggest it should be due to differences between tax accounting rules and standard accounting practices.&nbsp;</span>This liability records the fact that the company will, in the future, paying more income tax because of a transaction that took place during the current period, such as an installment sales receivable.', 2, 2),
	(131, 'card', '506', 'Walt Disney Co.-PP&E Gross & Net', 'From the graph, we can see that PP&E of Walt Disney Co. is increasing steadily.', 2, 0),
	(131, 'card', '507', 'Walt Disney Co.--Impairment', 'It\'s worth noting that, in 2012Q4, asset impairment charges are negative.<br>', 2, 1),
	(131, 'card', '508', 'Walt Disney Co.--OI & Depreciation', 'All data of depreciation are very stable while the operating income after depreciation are slowly increasing.', 2, 2),
	(23, 'media', 'http://162.144.108.196/idaciti/application//data/upload/2idacitipreviewstats-2.png', 'idaciti Preview -- Where Are We?', 'We started the idaciti preview program in Fall 2014, the program will conclude in December 2014.<br><br>We have about 250 registered users, these users belonged to<b> 13</b> different circles, and almost <b>500</b> cards, <b>100</b> storyboards were created as of mid November in 2014.<br><br>The total number of times cards and storyboards were viewed by peer has exceeded <b>13,000</b> times! And over <b>320</b> comments were posted mostly by students to exchange ideas, offer suggestions, dare I say this is the beginning of <b><u>peer-to-peer learning.</u></b><br><br>In early 2015, we will expand on the preview program and add more data, more features and more users to the idaciti platform. This storyboard will introduce you to how idaciti can benefit professors &amp; students in accounting/finance classes.<br><br><br><br><br><br><br>', 2, 0),
	(23, 'media', 'http://application.idaciti.com//data/upload/2accounting.jpg', 'Career Challenge', 'Today\'s students face a challenging and ever-changing job market when they graduate. Even highly qualified students in accounting and finance need to offer the <i>\'<b>in-demand</b>\' </i>skills that make a difference. Skills that will ensure that employers select your students over others and skills that will help your students to get on, and stay on, the fast track in their careers.&nbsp;<br><br>We have built idaciti to support the idea that <i><b>data analysis/visualizatio, story-discovery</b></i> and&nbsp;<i><b>storytelling</b></i> are the skills that finance and&nbsp;accounting students should be proficient at to help them stand apart from their peers. The <b><i>story-discovery</i></b> skill focus on ability to research and look at a problem from various angles and <b><i>storytelling</i></b> focus on packaging the discovery into an effective and interesting narratives. <br><br>We have seen evidence of how attractive the skill set to analyze real-world financial data can be. One of the early users of idaciti secured internships from two of the Big 4 accounting firms by impressing the recruiter of her ability to use idaciti to better understand the accounting concepts she learned and able to create interesting stories.<br><br><br><br><br><br><br><br>', 2, 1),
	(23, 'media', 'http://application.idaciti.com//data/upload/2CorporateTaxAnalysis.png', 'Story Discovery', 'idaciti has provided a <b>simple workflow</b> for you and students to create data cards, and the the process of creating a card can lead to discovery of stories.<br><br>We are collecting massive amounts of financial data on an ongoing basis. As the amount of data on a topic increases (for example, corporate taxes), visualizations of that data become more interesting–and the probability that you’ll see something cool in those visualizations increases.<br><br>When trying to design useful visualizations of a data set, it’s best to start small. Take a slice of the data, try out a few visualizations, and look for stories. When a story emerges from a particular visualization, add other companies, concepts to see if the story still holds true.<br><br>In order for&nbsp;others to explore your data story, show them the data using an appropriate visualization and let them “<b>play</b>” with the data. They’ll start to ask questions about the data that they wouldn’t be able to ask without this “<b>play</b>” time. This is why all the data cards are interactive. We encourage viewers to play with the data, and comment on the data card and storyboards.<br>', 2, 2),
	(23, 'card', '20', 'Sample Card: Corporate Taxes ', 'A recent analysis from the Washington Post reveals that most of the 30 companies listed in the Dow industrial average have seen their U.S. tax burdens as a share of corporate profits drop by half since the 1960s and 1970s.\nThe cumulative losses attributable to tax haven abuse by corporations and individuals are about $150 billion each year, according to tax experts. <br><br>Here is an example of a data card that include data relevant to corporate taxes for the Dow companies. This card also included data from USASpending.gov to show how much revenue each company gained from federal contracts.<br><br>You can click on the "bar" icon next to the column headings and turn the numbers into bars for visual comparison. This is just one example that you or your students can create with live data to take a close look at the corporate taxes in US.<br><br>Every data card has the <b><u>front</u></b> side&nbsp;that shows data visualization and a back side that shows the supporting data.&nbsp;Flip over the card by clicking the flip icon on the top-right corner, you can see the source of the data and search/filter data points.&nbsp;<br><br><br><br><br>', 2, 3),
	(23, 'card', '52', 'Sample Card: GE - Zero Tax?', '<span>Well, GE is paying taxes, some years,&nbsp;but how much exactly? In 2010, GE\'s tax rate was 7%, but it did jump up to 28% in 2011 before dropping again.<br><br></span>In 2009, even though GE\'s international business netted over $10B in profit, the company recorded over $400M loss in the company\'s US&nbsp;operation. End result? T<span>he company owed the U.S. government a whopping bill of $0, with the tax rate = -12%. &nbsp;<br><br></span>In comparison, if you switch and look at Exxon, similar profit margin as GE, and Exxon paid as high as 48% for taxes. <br><br>Your Students can find other multinational corporations and discuss the interesting \'inversion" of US corporations to creatively trying to reduce the tax <i>burdens</i>. idaciti is the platform for them to learn, to discuss and to share.<br><br><br>', 2, 4),
	(23, 'media', 'http://application.idaciti.com//data/upload/2CorporateTaxWorld.png', 'Add Colors to Story', 'The pictures shows the selected corporate tax rate around the world. The data source is from&nbsp;<a href="http://www.kpmg.com/global/en/services/tax/tax-tools-and-resources/pages/corporate-tax-rates-table.aspx" rel="nofollow" target="_blank">KPMG</a>.<br><br>Instead of showing just the data, a Word Cloud can be created to visualize the corporate tax rates around the world. Students can be creative in how they want to tell the story.<br><br><br>', 2, 5),
	(23, 'media', 'http://youtu.be/VcZF_DxQ5cU', 'Enrich Story with Videos', 'Adding videos to the storyboard is simple and can add&nbsp;a global perspective to the financial story.&nbsp;', 2, 6),
	(23, 'media', 'http://162.144.108.196/idaciti/application//data/upload/2WhatEngagesStudents.png', 'Engage, Challenge, Inspire!', '<span>Data storytelling is not just a different way to write an essay. Crafting compelling stories requires <b>collaborative</b> effort involving peer review to drive continuous improvement of the narrative - something that is ideally suited to the world of education with a class of students and a professor acting in a mentoring role. And by definition, engagement with the story requires engagement with a number of story perspectives: the data that is used, the way that data is visualized for effective communication and how the visualized data is organized into a meaningful narrative.<br><br></span>\n\n\n\n\n\n\n\n<span>Adding data storytelling to the program, even disengaged students may find themselves attracted to the story paradigm once it becomes clear how the story can be developed and improved by peer-group sharing and making the evidence of the data tell its own story. &nbsp;Setting data storytelling challenges could be the new dimension your classes need to raise the level of student engagement with what maybe dry or complex financial data. &nbsp; <br><br>You are invited to join us in Spring 2015 to engage your students in a new way of learning and having fun with accounting.<br><br>&nbsp;</span><br><br>', 2, 7),
	(132, 'card', '509', 'inventory comparison of Amazon and Walmart', 'From the graph, you can easily see that both two companies had an increase in average inventory in the past 5 years. And Walmart had a larger inventory than Amazon. The larger average inventory may because Walmart has a  larger enterprise scale and it combines physical stores and internet commerce.', 2, 0),
	(132, 'card', '510', 'inventory comparison of Amazon and Walmart(2)', 'From the graph, we can see that Amazon had increase largely in its cost of goods sold, while Walmart had a more stable cost of goods sold. But Walmart\'s amount are much larger than amazon. That may also caused by its larger enterprise scale.', 2, 1),
	(132, 'card', '512', 'inventory comparison of Amazon and Walmart(3)', 'From the graph, both the two companies had an increase in inventory turnover. Although Walmart had a larger amount in inventory turnover, amazon had a more obvious increase.\nThese means that the liquidity of the inventory had been both improved. And it would took fewer days for Walmart to transfer its inventories into cash , account receivables or other revenues. Amazon is trying to make a better control of its inventory.', 2, 2),
	(132, 'card', '514', 'inventory comparison of Amazon and Walmart(4)', 'From the graph, we can see that Amazon had largely decrease the days it took to converse its inventory.And the days it took to converse inventory is just a little larger than Walmart in 2013.That means that Amazon had improved a lot in its inventory management.Thus the liquidity of its inventory,its ability to pay debt and its earning capacity are also to some extent improved.Walmart also decreases its inventory conversion days.But it did not decrease too much.', 2, 3),
	(132, 'card', '515', 'inventory comparison of Amazon and Walmart(5)', 'From the graph, we can see that both two companies had an increase in its revenue. Although the revenue of Walmart is still much larger than Amazon, the growth rate of Amazon in revenue is larger than Walmart. And one reason  that caused this larger growth rate in revenue may be the improved inventory management. ', 2, 4),
	(111, 'card', '268', 'Revenue amazon vs ebay', 'Based on the data, we can conclude that Amazon\'s revenue from 2009 to 2013 grew drastically from 24.5B to 74.5B. I believe that its kindle e-reader was the retailer best selling product and creation of amazon prime (loyalty program).  Ebay managed to keep their revenue in steady process with no drastic changes from 2009 to 2013. 43% of their revenue have resulted from Pay Pal account, which isn\'t the core activity of the company.', 2, 0),
	(111, 'card', '366', 'Ability of management effectively use resources to', 'Based on management effectiveness data, we can conclude that Ebay demonstrates highly well finical performance then its competitor. In 2011, profit margin of Amazon has been declined substantially while Ebay\'s fluctuate and indicated that Ebay is successful on generating profit. In 2011, ebay must be considered as a good investment, which created a good opportunity to trade their shares at higher market price. ROE Amazon has lower due to its total shareholders equity increase. Overall, Company s', 2, 1),
	(111, 'card', '101', 'Treasury Stock', 'First of all, Let\'s define what treasury stock is. Treasury stock is a cash paid for the repurchase of a firm\'s own stock. Stock repurchases are an efficient way to put cash into shareholder\'s hand, rather then paying dividends. As probably most of you notice company must have a cash on their hands in order to repurchase stock. In comparison with an Amazon, an Ebay concludes that for their company investing cash into treasury stock as an productive way of investing companies money. The benefitFi', 2, 2),
	(111, 'card', '198', 'EPS', 'Ebay is capable of generating a significant dividend for investors, than an Amazon, 2.2 vs 0.6. Although, Amazon have substantially lower EPS due its high number of shares. Al', 2, 3),
	(111, 'card', '218', 'Comparing Liquidity of Ebay and Amazon', 'Based on working capital position of both companies, we can conclude that Ebay and Amazon are able to pay off its liabilities. Moreover, the operating cycle reveals that Amazon is comparatively better in terms of receiving cash that it was invested in in the inventory and the receivables. The cash ratio significantly indicated that both companies has cash and csh equivalents on hand but Ebay\'s position is substantially stronger by comparison with previous years. ', 2, 4),
	(111, 'card', '232', 'Other Non Operating Income', 'The data shows that income derived from a source other than a firms regular activities has a positive income for Ebay, but not for the Amazon.', 2, 5),
	(111, 'card', '367', 'Net Income', 'The bottom line for Amazon abruptly declined from 2010 to 2012.Despite the new Kindle Fire tablet’s selling so well that it was already increasing production. The key moment not only boost it\'s revenue but also ability to stabilize the operating expenses. While Ebay drastically improved and walked away in 2011 with 3.23B with after it has considered all costs. ', 2, 6),
	(111, 'media', 'https://www.youtube.com/watch?v=8Lpvo4rv2jc', 'Pressure is on', 'Will the split form Pay Pal take away investor\'s confidence in the Ebay?\n<br>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<span>Acquired by eBay in 2002 for $1.3 billion,\nPayPal became eBay\'s fastest-growing segment. It lets customers use their bank\naccounts to make payments and money transfers without using credit or debit\ncards or checks. It makes money by charging a fee for many transactions. &nbsp;eBay’s\n2013 net revenue and it processed $203 billion in payment volume and in the\nmost recent quarter, PayPal gained 4 million new, active registered accounts,\nup 15%, to 152 million. Payments revenue rose 20% to $1.95 billion, about 45%\nof eBay\'s total revenue.</span>\n\n<span><span>Without PayPal, eBay is a company that will\ngrow more slowly. &nbsp;</span>PayPal has been expanding beyond online and mobile payments and offering\nother financial services. It began lending money to small business customers\nlate last year.</span>&nbsp;It probably has more upcoming advantages that company is working on but very little advandageous has been announced about Ebay.<span>eBay will need to demonstrate it can continue to dominate in e-commerce, which is also going through changes because of the explosion of mobile shopping and the rise of online marketplaces like Amazon, which is working on Prime Air projects and&nbsp;increased by 25% on&nbsp;Prime&nbsp;</span>membership. Do you think&nbsp;whether shareholders will be more likely interested&nbsp;to invest their money to competitive companies like Amazon?&nbsp;', 2, 7),
	(133, 'card', '517', 'Pensions', 'There is a cultural (management) idea that if management takes care of its employees and offer pension plans, and stock dividends, etc., that employees will theoretically perform better and as a result the firm will increase its sales and perform better throughout.\n\nIn this card I compare Apple and Microsoft and prove that this is not always the case. Microsoft has been paying higher pensions than Apple (even with apple having large amounts of cash), however Apple\'s sales have grown relatively fast (proving that pensions do help employee loyalty and better practices) however, the same has not happened for Microsoft<br>', 2, 0),
	(133, 'card', '518', 'Liquidity Ratios vs Pensions', 'The greater the pension plant (liability), the bigger effect it will have  on the liquidity ratios of the company. Theoretically, if pensions increase, holding everything else constant, liquidity ratios should decrease. Keep in mind that liquidity ratios can decrease if other liabilities are acquired or assets decrease - regardless of pensions, however, the higher the pensions (liability) the more probable liquidity ratios will decrease.\n\nThis being said, comparing Apple and Microsoft, Microsoft has higher pensions, but have still been able to keep growing their liquidity ratios, while Apple has not been able to do so in times when they increase their pension payments.<br>', 2, 1),
	(133, 'card', '519', 'Microsoft vs Apple Market Value', 'Just a comparison of Market Value of both companies. Following that Microsoft has had higher pensions and better liquidity ratios, we can assume that market value of equity is moved by sales movements of the company. Market value for Apple has increased more rapidly (look at steepness of curve), even though Microsoft has been a better overall company (paying higher pension amounts) and have had better liquidity ratios.', 2, 2),
	(134, 'card', '520', 'Amazon Operating Expenses', 'What is driving Amazon\'s prime air initiative? Why is Amazon testing and investing into drone technology? I think it is because Amazon\'s operational expenses, specifically SHIPPING COSTS are increasing year over year as is seen in this chart.', 2, 0),
	(134, 'media', 'http://162.144.108.196/idaciti/application//data/upload/148Screen Shot 2014-11-17 at 5.15.57 PM.png', 'Outbound Shipping Results', 'Here we see that Amazon\'s shipping costs are increasing year over year and are much higher than shipping revenue! They also believe that their net cost of shipping will continue to rise. One way they can lower their shipping costs is through economies of scale and better operating efficiencies which is still to be seen. The image in this card has shipping costs and revenues from 2011-2013 and a nice description. <br><br>Please read this article because it talks about why drones could pay off in the long run and give us more clues for our drone analysis. This is cool accounting! :))<br><a href="http://robotenomics.com/2014/06/17/the-economics-of-amazons-delivery-drones/" rel="nofollow" target="_blank">http://robotenomics.com/2014/06/17/the-economics-of-amazons-delivery-drones/</a><br><br>', 2, 1),
	(135, 'card', '483', 'Inventory of three retailer corporations', 'The inventory of Wal Mart more than 4 times higher than Costco and Dollar Tree. Wal Mart\'s large inventory may require high cost in inventory management and warehouse.', 2, 0),
	(135, 'card', '485', 'Inventory turnover of three retail corporations', 'Although Wal Mart has higher inventory, its inventory turnover is also high. That means Walmart has higher sales revenue than other two. Costco has low inventory and high turnover, which means it does not spend a lot on inventory management and does not have many obsolete goods. In 2012, Costco\'s inventory turnover exceeded Wal Mart\'s.', 2, 1),
	(135, 'card', '486', 'Change in inventories', 'Costco and Dollar Tree\'s inventory is stable over years, but Wal Mart\'s inventory changed a lot. It has a dramatic increase in 2009 and 2010 and a decrease in 2011 and 2012. In 2009 the change in inventory is negative, which means inventory is higher in 2008 than in 2009.', 2, 2),
	(136, 'card', '521', 'PP&E of Sandisk Corp', 'The Gross PP&E of Sandisk keeps growing from 2009 to 2013, but when Gross PP&E increased in 2010, the Net PP&E decreased. The change in Net PP&E is much smaller than the change in Gross PP&E.', 2, 0),
	(136, 'card', '522', 'Depreciation of Sandisk Corp.', 'The accumulated depreciation grow steadily over five years. The depreciation expense had a dramatic decrease in 2011. Maybe there is a change in the depreciation method.', 2, 1),
	(137, 'card', '497', 'Coca-Cola', 'Coca-Cola\'s PP&amp;E net stayed very consistent over the prior 4 year period at roughly 15 billion. &nbsp;There was gains on the sale of PP&amp;E in both 2011 and 2012 of over 200 million and roughly100 million, respectively.', 2, 0),
	(137, 'card', '496', 'McDonalds', 'McDonald\'s PP&amp;Enet &nbsp;levels grew consistently over the 5 year period from roughly 21 to 26 billion. &nbsp; McDonald\'s did not take a gain or loss on the sale of PP&amp;E during this time period', 2, 1),
	(137, 'card', '498', 'Starbucks', 'Starbuck\'s PP&amp;E net levels decreased from 2009 to 2011 but increased from the 2011 to 2013. The PP&amp;E levels ranged from just under 2.4 billion to 3.2 billion during the time period. &nbsp;Like McDonalds, Starbucks did not take a gain or loss on the sale of PP&amp;E during the 5 year time period.', 2, 2),
	(138, 'card', '524', 'Income Tax Expense', 'In 2013, Pfizer has around 4.3 billion income tax expense and it is much&nbsp;higher than the 2.44 billion income tax expense in 2012. Merck and Johnson &amp; Johnson also have volatile income tax expense. These companies all have huge amount of offshore profits and they don\'t repatriate these income back to the&nbsp;U.S. They repatriate them &nbsp; when they need to fund an acquisition. In 2009, Pfizer&nbsp;repatriated more than $30 billion to help fund for its $64 billion purchase of Wyeth', 2, 0),
	(138, 'card', '523', 'Deferred Tax Liabilities', 'In 2009, Pfizer has negative net deferred tax liabilities because the DTL is 30 billion more&nbsp;than the DTA. The big amount of DTL was due to the big acquisition. The offshore profit was includible for book purposes but not for taxable income until a future period.', 2, 1),
	(138, 'card', '525', 'Deferred Tax Assets', 'All three firms have considerable amount of deferred tax assets, which can help in reducing their future tax liability. All of them have huge amount of earnings overseas that are intended to reinvest indefinitely. For example, in 2013 Pfizer has $69 billion revenue overseas and the company does not make a U.S tax provisions of it&nbsp;because the&nbsp;hypothetical unrecognized deferred tax liability is not practical to determine.', 2, 2),
	(139, 'card', '526', 'Tax Rates', 'According to a study conducted by the Citizens for Tax Justice, in 2013 Apple, GE, Microsoft, Pfizer and Merck held the top 5 highest&nbsp;amounts of profit stored offshore in foreign subsidiaries in countries with corporate\ntax rates lower than those in the United States. The top 30 companies holding the most money offshore&nbsp;collectively\noperate 1,357 tax haven subsidiaries.&nbsp; &nbsp;<span><br><br>Tax rates of these five companies have all been well below 35% in the past.&nbsp;</span>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nGE\npaid an average tax rate of 1.8% between 2002 and 2011, according to the study.&nbsp;<br><span><br>To read more, visit:</span><a href="http://ctj.org/ctjreports/2014/06/offshore_shell_games_2014.php" title="Link: http://ctj.org/ctjreports/2014/06/offshore_shell_games_2014.php">http://ctj.org/ctjreports/2014/06/offshore_shell_games_2014.php</a><span><br>&nbsp;</span>', 2, 0),
	(139, 'card', '527', 'Taxes Paid', 'GE is not the only firm receiving profits while paying far less than 35 percent to the government. An additional study by the Citizens for Tax Justice showed that 29&nbsp;other major corporations joined GE in paying no taxes between 2008 and 2010; shown here are Dupont, Boeing, Verizon and GE. Although amounts are shown&nbsp;in income taxes paid, this reflects&nbsp;when deferred taxes are eventually paid, not the actual taxes due for that year. Deferred taxes will&nbsp;show up in the current\ntaxes line and will raise the effective tax rate in that year.&nbsp; &nbsp;&nbsp;<br><br>These companies&nbsp;were part of a larger group of 280 corporations that reportedly paid an average tax rate of just 18.5 percent during that time, the report said.', 2, 1),
	(139, 'card', '528', 'Boeing Deferral ', 'Boeing was among seven Fortune 500 companies&nbsp;accused of paying more to its CEO than in taxes in 2013. In response,&nbsp;Boeing claimed its 2013 global tax bill was $1.6 billion, though all but $5 million was <b>deferred</b> due to development and production investments, shown here. The base salary of Boeing CEO is 1.9 million, however, with stock options, awards&nbsp;and bonuses, was paid about 23 million in 2013.&nbsp;<br><br>Unfortunately, deferred taxes do not pay the government\'s bills.&nbsp;<br><br><br>', 2, 2),
	(140, 'card', '530', 'GE: Income and...taxes?', 'Illustrating that one of the world\'s largest companies has, what appears to be, an incredibly small tax bill. <br><br><b>GE\'s tax bill is so low due to the amount of money they have indefinitely reinvested (or \'parked\')&nbsp;overseas. In 2009, we see that they had a&nbsp;-0.12 tax rate. This significantly skewed the mean five-year&nbsp;tax rate to the downside, and is most likely due to the amount they lost in 2008. Any more ideas?&nbsp;</b><br><br><b><br></b><br><br>', 2, 0),
	(140, 'card', '531', 'Exxon..Income and taxes', 'Illustrates the world\'s largest oil major\'s income and taxes.<br><b>Exxon, by the nature of&nbsp;their&nbsp;business, operates in countries that&nbsp;levy an incredibly high tax rate on oil related income. They have 20+ subsidiaries in tax havens in an attempt to shield their tax liability, and, like other US&nbsp;internationals, they can&nbsp;offsetting credits to their American tax bill. &nbsp;This is surely not an extensive or exhaustive list. Anyone else have any input as to why Exxon pay such a high tax rate?</b><br><br>', 2, 1),
	(141, 'card', '534', 'Home Depot - Net vs. Gross PP&E', 'Chart compares Home Depot\'s Gross & Net PP&E.  Gross PP&E is the amount that Home Depot paid for any property,  buildings or other assets that it owns.  It then needs to depreciate these assets each year.  What is left is the Net PP&E value, which is the cost for equipment less its accumulated depreciation.  You see in each year that Home Depot\'s Gross PP&E - Accumulated Depreciation = Net PP&E', 2, 0),
	(141, 'card', '535', 'Home Depot- PP&E / Non-Current Assets ', 'Card shows Home Depot\'s PP&E in relation to its Non-current assets.  You can see from the chart that PP&E makes up a majority of Home Depots non-current assets. ', 2, 1),
	(142, 'card', '533', 'Microsoft vs. Home Depot - PP&E', 'This card compares the PP&E of Microsoft vs. Home Depot.  As expected, Home Depot\'s PP&E is significantly higher than Microsoft\'s PP&E across the 5 years.  Home Depot has many physical stores that sell inventory of all different sizes (fixtures, furniture, etc), therefore it requires high amounts of PP&E to conduct its normal business operations. Microsoft, on the other hand, as a technology company does not require as much PP&E as Home Depot. \n. ', 2, 0),
	(142, 'card', '535', 'Home Depot- PP&E / Non-Current Assets ', 'Card shows Home Depot\'s PP&E in relation to its Non-current assets.  You can see from the chart that PP&E makes up a majority of Home Depots non-current assets. ', 2, 1),
	(142, 'card', '536', 'Microsoft - PP&E / Non-Current Assets / Intangible', 'Card shows Microsoft\'s PP&E, Noncurrent Assets, & Intangible Assets.  Across the 5 years, Microsoft\'s intangible assets are greater than its property plant and equipment. This is the trend I would have suspected being that Microsoft is a technology company; it requires less PP&E than other industries, and it also has a lot of proprietary technology, which is considered Goodwill (i.e. an intangible asset). ', 2, 2),
	(143, 'card', '541', 'PPE in walt Disney Company', 'amount of PPE grows up form 2009 to 2013, and the percentage of PPE to total assets goes up as well. This may because many new Disney Land is opening and shows a increase in its business.', 2, 0),
	(143, 'card', '542', 'PPE and debt in walt Disney Comapny', 'Form 2009 to 2013 Disney\'s net income went up quickly, it may because it opened more theme park to attract people. at the same time its PPE went up, which may support the former guess. Form the debt to equity we can tell, the rate is stable, but since the equity went up, the debt should go up as well.', 2, 1),
	(143, 'card', '544', 'PPE and its depreciation in walt Disney Comapny', 'From 2009 to 2013 Walt Disney obtains an normal rate of depreciation, and because the company was buying PPE quicker than selling or deprecating, the net PPE amount went up. and the net income went up.', 2, 2),
	(144, 'card', '543', 'Coca Cola PP&E vs. Total Assets', 'Coca Cola\'s gross PP&amp;E has remained relatively steady from 2010 to 2013, while the value of total assets has increased markedly.', 2, 0),
	(144, 'card', '546', 'PP&E and Accumulated Depreciation', 'The trajectory of&nbsp;Coca Cola\'s accumulated depreciation over the period of time from 2009 to 2013 has not mirrored the changes in Coca Cola\'s PP&amp;E<br><br>', 2, 1),
	(144, 'card', '545', 'Coca Cola Fixed Asset Turnover', 'Coca Cola\'s&nbsp;<span>ability to generate net sales from PP&amp;E has changed dramatically over the time period from 2009 to 2010. Higher fixed asset turnover rate shows that the company has been more effective in using investment in fixed assets to generate revenue.&nbsp;<br><br>This begs the question of what happened in 2010 to decrease Coca Cola\'s fixed asset turnover so dramatically<br><br></span>', 2, 2),
	(144, 'card', '547', 'Net Sales vs. Net PP&E ', 'Fixed asset turnover = net sales/net PP&amp;E<br><br>', 2, 3),
	(145, 'card', '550', 'Operating Cash flow', '<div>From SEC EDGAR AT&amp;T notes Type: 10-Q/A: "Our combined net pension and postretirement cost decreased $163 in the third quarter and $489 for the first nine months of 2014. The decrease reflects higher amortization of prior service credits due to plan changes, including changes to future costs for continued retiree healthcare coverage. The decrease also reflects increasing corporate bond rates, which contributed to lower service cost and higher interest costs."</div><div><br></div><div>From SEC EDGAR Verizon notes Type: 10-Q</div><div>1. Pension Remeasurement</div><div>2. Severance Payments</div><div>3. Employer Contributions<br><a target="_blank" rel="nofollow" href="http://www.sec.gov/cgi-bin/viewer?action=view&amp;cik=732712&amp;accession_number=0001193125-14-384533&amp;xbrl_type=v">http://www.sec.gov/cgi-bin/viewer?action=view&amp;cik=732712&amp;accession_number=0001193125-14-384533&amp;xbrl_...</a>#<br><br></div>', 2, 0),
	(145, 'card', '552', 'Net Profit Margin and importance of disclosure', 'From the FASB Accounting Standards Codification: 10/14/14: FASB issues Proposed Accounting Standards Update 2014-260—Compensation—Retirement Benefits. <br><a target="_blank" rel="nofollow" href="https://asc.fasb.org/imageRoot/03/56988603.pdf">https://asc.fasb.org/imageRoot/03/56988603.pdf</a>\n\nIn brief, three main Amendments to Subtopic 715-20, 715-30, and 715-60.\n<br><br><div>Compensation—Retirement Benefits—Defined Benefit</div><div>Plans—General</div><div><br></div><br><div>In brief, three main Amendments to Subtopic 715-20, 715-30, and 715-60.<br></div><div><br></div><div>Subtopic 715-20 is related to "Disclosures" and specifically for us public entities. Amounts related to the employer’s results of operations shall be disclosed for each period for which a statement of income is presented. Amounts related to the employer’s statement of financial position shall be disclosed as of the date of each statement of financial position presented.<br><br>Subtopic 715-30 Timing of Measurement<br></div><div>715-30-35-62 The measurements of plan assets and benefit obligations required by this Subtopic shall be as of the date of the employer’s fiscal year-end statement of financial position except in both of the following cases...<br><br><br>Subtopic 715-60 Subsequent Measurement<br></div><div>&gt; Timing of Measurement</div><div>715-60-35-121 The measurements of plan assets and benefit obligations required by this Subtopic shall be as of the date of the employer’s fiscal year-end statement of financial position, unless either of the following conditions applies:</div>', 2, 1),
	(145, 'card', '549', 'Cash flow - ERISA', 'Taking a looking at free cash flow of AT&amp;T and Verizon. The amount of cash on hand is very important because of the "Pension Reform Act of 1974, ERISA" which attempts to safeguard employees\' pension rights by mandating pension plan requirements, including minimum funding.<br><br>These requirements can influence the employers\' cash flows significantly. &nbsp; <br>', 2, 2),
	(145, 'media', 'http://forward-now.com/wp-content/uploads/2014/02/PensionFund-savings-jar.jpg', 'Save up', '', 2, 3),
	(29, 'card', '189', 'The Liquidity of Google vs. Cisco', 'In generally, we use liquidity to embody certain company\'s operating ability. Here, I use cash flow and current ratio, cash and cash equivalents to represent it. Compared with the dividend payout, there is some blind links between them.', 2, 0),
	(29, 'card', '562', 'Liquidty Analysis of Google and Cisco', '', 2, 1),
	(29, 'card', '561', 'Google & Cisco / Non-current Assets / Intangible', 'Card shows Google and Cisco\'s Non-current Assets, & Intangible Assets. Across the 5 years, Google\'s intangible assets are greater than its property plant and equipment. This is the trend I would have suspected being that Google is a technology company; it requires less PP&E than other industries, and it also has a lot of proprietary technology, which is considered Goodwill (i.e. an intangible asset).', 2, 2),
	(29, 'card', '94', 'The Stockholders\' Equity of Google VS  Cisco', 'Compared with the First card I created, we, as investors, outsiders and clients, wonder that whether current have huge impact on earnings per share, the coupons decides the future investment and capital improvement.\n', 2, 3),
	(29, 'card', '361', 'The EPS of Google & Cisco', 'Google\'s EPS fluctuates fiercely  between the third quarter of 2012 and final quarter of 2013. Company\'s market performance, especially in high technology field, I guess, is influenced a lot by media coverage. Because, during this period, Google suffered financial crisis, and  the board election. To some degree, all of these events discourage investments and at the same time force them to accept Google\'s products again. ', 2, 4),
	(29, 'card', '469', 'The Lease of Google V.S Cisco', 'In high-tech sector, most of companies choose not to capital lease, because they  don\'t need too many machines and have less fixed assets compared with manufactory field. From the perspective of corporation maturity, Google has no data in operating lease payments, but when it comes to Cisco, it shows different story, I guess the operating lease is related to Cisco\'s expanse and limited capitalization. Especially after 2009, the trend of operating lease profit of Cisco climbed sharply, it indicat', 2, 5),
	(29, 'card', '499', 'The income tax of Google & Cisco', 'It is interesting to find that Google and Cisco have adopted two different avoided tax policies. Under the sustainable business mode, Google, as the head in high-technology sector, tends to use deferred tax liabilities policy. In general, firms with NDTL are more likely to issue debt and tend to have higher leverage after a refinancing. On the other hand, Cisco, as a growing middle-sized company, the NDTA helps alleviate the problem of identifying individual non-debt tax shields because it bundl', 2, 6),
	(29, 'card', '560', 'The Pensions and Postretirement Benefits of Google', 'A retirement plan is a financial arrangement designed to replace employment income upon retirement. These plans may be set up by employers, insurance companies, trade unions, the government, or other institutions. Congress has expressed a desire to encourage responsible retirement planning by granting favorable tax treatment to a wide variety of plans.  \n\n Defined contribution plans have become more widespread over recent years and are now the dominant form of plan in the private sector. The num', 2, 7),
	(147, 'card', '563', 'Profitablitiy Indicator Ratios', 'These ratiosgive investors a good understanding of\nhow well the company utilized its resources in generating profit and\nshareholder value.\n\nThree ratios\nindicate different profitability of three companies.\n\n<br><br>Net profit margin\nindicates the profitability of each company,&nbsp;<span>calculated as net income\ndivided by revenue.</span><br><br>ROA: A profitability ratio calculated as net\nincome divided by total assets. <br><span><br>ROE: A profitability ratio calculated as net\nincome divided by shareholders\' equity.</span>', 2, 0),
	(147, 'card', '564', 'Liquidity Measurement Ratios', 'Liquidity ratios analyze the ability of a company to pay off both its current liabilities as they become due as well as their long-term liabilities as they become current. In other words, these ratios show the cash levels of a company and the ability to turn other assets into cash to pay off liabilities and other current obligations.<br><br>Current ratio: A liquidity and efficiency ratio&nbsp;that measures a firm\'s ability to pay off its short-term liabilities with its current assets. The current ratio is an important measure of liquidity because short-term liabilities are due within the next year.<br><br>Quick ratio: A liquidity ratio&nbsp;<span>that measures the ability of a company to pay its current liabilities when they come due with only quick assets. Quick assets are current assets that can be converted to cash within 90 days or in the short-term.&nbsp;</span><br><br>Cash ratio is a liquidity ratio that measures a firm\'s ability to pay off its current liabilities with only cash and cash equivalents.<br><br>The cash conversion cycle is a cash flow calculation that attempts to measure the time it takes a company to convert its investment in inventory and other resource inputs into cash. In other words, the cash conversion cycle calculation measures how long cash is tied up in inventory before the inventory is sold and cash is collected from customers.<br><br><br>', 2, 1),
	(147, 'card', '565', 'Debt Ratios', '<span>Solvency ratios, also called leverage ratios, measure a company\'s ability to sustain operations indefinitely by comparing debt levels with equity, assets, and earnings. In other words, solvency ratios identify going concern issues and a firm\'s ability to pay its bills in the long term.&nbsp;<br></span><br>These ratios give investors a general idea of the company\'s overall debt load as well as its mix of equity and debt. Debt ratios can be used to determine the overall level of financial risk a company and its shareholders face. In general, the greater the amount of debt held by a company the greater the financial risk of bankruptcy.&nbsp;&nbsp;<br><br>Long Term Debt\nRatio: The greater a company\'s leverage, the higher the ratio. Generally,\ncompanies with higher ratios are thought to be more risky because they have\nmore liabilities and less equity. <br><br>Debt to Equity: A high debt/equity ratio\ngenerally means that a company has been aggressive in financing its growth with\ndebt.<br><br><br>', 2, 2),
	(147, 'card', '566', 'Investment Valuation Ratios', '<span>This group of the\nratios looks at a wide array of ratios that can be used by investors to\nestimate the attractiveness of a potential or existing investment and get an\nidea of its valuation.<br><br></span>Earning per share, also called net income per share&nbsp;<span>that measures the amount of net income earned per share of stock outstanding. In other words, this is the amount of money each share of stock would receive if all of the profits were distributed to the outstanding shares at the end of the year.</span><br><span><br>The dividend yield is a financial ratio that measures the amount of cash dividends distributed to common shareholders relative to the market value per share. The dividend yield is used by investors to show how their investment in stock is generating either cash flows in the form of dividends or increases in asset value by stock appreciation.</span><br>', 2, 3),
	(147, 'card', '567', 'Predict Bankruptcy', 'The working capital ratio<span>&nbsp;that measures a firm\'s ability to pay off its current liabilities with current assets. The working capital ratio is important to creditors because it shows the liquidity of the company.<br><br></span><span>Year over year, Amazon.com\nInc. has been able to grow revenues from $61.1B&nbsp;USD&nbsp;to $74.5B&nbsp;USD.\nMost impressively, the company has been able to reduce the percentage of sales\ndevoted to cost of goods sold from 75.25% to 72.77%. This was a driver that led\nto a bottom line growth from a loss of $39.0M&nbsp;USD&nbsp;to a gain of $274.0M&nbsp;USD.<br></span><br><span>Although debt as a percent\nof total capital increased at Amazon.com Inc. over the last fiscal year to\n38.63%, it is still in-line with the Internet and Catalog Retail industry\'s\nnorm. <br><br>Additionally, even though there are not enough liquid assets to satisfy current\nobligations, Operating Profits are more than adequate to service the debt.\nAccounts Receivable are typical for the industry, with 21.04 days worth of\nsales outstanding. <br>Last, inventories seem to be well managed as the Inventory\nProcessing Period is typical for the industry, at 45.28 days.</span>', 2, 4),
	(79, 'card', '311', 'Apple & Microsoft Cash Flow', 'Apple\'s free cash per share is increasing and CAPEX decreasing - healthy sign. Microsoft free cash per share decreased in 2013, this could be caused by increase in investing activities. Apple\'s cash from investing activities is leveling off from 2012-2013 and cash from operating activities is decreasing in 2013 - could be red flag.', 2, 0),
	(79, 'card', '320', 'Apple & Microsoft Income Statement', 'In 2010 Microsoft launched windows 7, this could attribute to substantial increase in operating expenses. If you zoom in to Q4, 2012 net income was dropped to negative but revenues only slightly decreased. For apple, net income and revenues decreased in Q2, 2014 while operating expenses remained stable - could be a red flag again. ', 2, 1),
	(79, 'card', '321', 'Apple & Microsoft Liquidity', 'Liquidity card shows us a completely different story of apple and microsoft. It is clear that Microsoft looks a lot healthier short term because its cash, current and quick ratios are much higher then apple\'s. Apple\'s liquidity is on the decline from 2009 maybe because they are investing more in R&D and their operating expense in increasing while microsofts\'s operating expense is decreasing. ', 2, 2),
	(79, 'card', '323', 'Apple & Microsoft Non-recurring items', 'Wow! Zoom into 2013 Q4, and you will see that there is a huge different between net income and income before extraordinary items adjusted from common stock equivalents for both apple and microsoft. Also, cash and cash equivalents including discontinued operations keep of fluctuating and a trend going up towards Q2, 2014. ', 2, 3),
	(79, 'card', '324', 'Apple & Microsoft StoryBoard', 'Update No. 2009-14 - software (Topic 985) was added to be effective in June 2010. This means that revenue for smart phones could  be accounted for at the time sale versus spreading the revenue over 2 years due to software updates. This could be why starting in 2010 revenue significantly increased for the industry that cells hardware and software together.', 2, 4),
	(79, 'card', '372', 'Apple & Microsoft R&D & SG&A', 'Microsoft\'s R&D expense is much higher than Apple\'s. I also added SG&A expenses and was surprised to see that Apple\'s SG&A expense sky rocketed from 2010 while Microsoft\'s SG&A grew at a much slower rate. ', 2, 5),
	(79, 'card', '574', 'Apple & Microsoft Advertising & Cash', 'The spike in SG&amp;A for apple in 2010 was caused by Advertising, Marketing and Retail expansion. We can see that for Apple in 2009 Advertising expense was $501 million and by 2013 reached $1 billion in ads spent! Also I added cash to this card and looks like Apple has A LOT more cash on hand versus Microsoft and this paints a completely different picture of financial health of both companies.<br><br>I found this article that talks about Apples Advertising, Marketing and Retail expansion costs that made SG&amp;A spike from 2010-2013.<br><br><a href="http://www.cbsnews.com/news/apples-ad-budget-hits-1-billion/">http://www.cbsnews.com/news/apples-ad-budget-hits-1-billion/</a><br>', 2, 6),
	(146, 'card', '553', 'Current income tax expense', 'Generally speaking, current income tax expenses increased from 2009 to 2013, but fluctuated in the process', 2, 0),
	(146, 'card', '554', 'DTA and DTL in Microsoft', 'In this chart, it is clear that deferred tax assets increased slightly\nfrom 2010 to 2011 and then dropped dramatically from 2011 to 2013. As a result,\nnet deferred tax&nbsp;\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nliabilities&nbsp; skyrocketed from 2011 to 2012. A deferred&nbsp;tax asset\nmay arise from a net operating loss. When Microsoft loses money\non its operations, that loss becomes a net operating loss, which Microsoft can\nhold on its books as a deferred tax asset to reduce taxable income in the\nfuture. So one of the reasons may be larger operating losses cause an increase\nin deferred tax assets.&nbsp;', 2, 1),
	(146, 'card', '556', 'Operating income', 'Operating income experienced\nups and downs: first increased highly, then fell and then went up quickly again.\nHowever, there were no operating losses from 2009 to 2013 in Microsoft. We can\nrule out this reason.\n\n<br>Another possibility is asset write-downs or debt write-offs. A deferred tax asset may also arise from asset write-downs or debt write-offs, which do not impact operating\nincome but do adversely impact the company\'s overall net income.', 2, 2),
	(146, 'card', '558', 'Comparison with Apple', '<span>Different from\nMicrosoft, deferred tax<br>assets increased in the current years. Net deferred tax\nliabilities also went up. So deferred tax liabilities are much larger than deferred\ntax assets. <br><br>Why does Apple have so large amount of deferred tax liabilities? The\npoint is that Apple shifts\nsubstantial amounts of its economic profits from the United States to&nbsp;</span>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nIreland,&nbsp;where they are taxed at a rate close to zero. Those profits are then sheltered\nin Ireland and untaxed unless Apple decides to bring the cash back to the\nUnited States. These overseas profits create deferred tax liabilities that will\nnot be taxed until the cash is repatriated.', 2, 3);
